(72784, 'esES', 'La lucha por la Galería Cobalto', 'Habla con Venthi en la Galería Cobalto.', '$n, llegas justo a tiempo.\n\n¿Has oído hablar de la Galería Cobalto? Antaño fue un lugar maravilloso donde vivían la mayoría de mis hermanos.\n\nLa Llama Hendida nos expulsó del lugar y se apropiaron de él.\n\nTeníamos la esperanza de recuperarlo, pero las últimas noticias apuntan a que estamos librando una batalla perdida.\n\n¿Nos prestas tu apoyo? Reúnete con Venthi en la Galería Cobalto cuando puedas.', '', '', '', '', '', 'Habla con Venthi en la Galería Cobalto.', 47187),
(72783, 'esES', 'Pedidos de fabricación', 'Habla con la funcionaria jefa Mimzy Sprazzlerock para informarte sobre los pedidos de fabricación.', 'Qué cosa más chula has conseguido en el dispositivo titánico. ¡Ahora dámela!\n\n¡Es broma! No tengo ni idea de cómo usar eso. ¿Y tú?\n\nVe a hablar con Mimzy Sprazzlerock. Ha montado todo un tinglado para encontrar gente con la que llevar a cabo algo llamado \"pedidos de fabricación\".\n\nAportas los materiales y otra persona te fabrica cosas con ellos.\n\nSencillo, ¿eh? ¡Habla con Mimzy y lo verás! Ah, y no le digas que te envío yo.', '', '', '', '', '', '', 47187),
(72773, 'esES', 'Aprendizaje de inventiva', 'Reúnete con Greyzik Dedoguijarro en Valdrakken.', 'Hay algunos goblins en Valdrakken que están investigando un dispositivo titánico abandonado.\n\nY la verdad es que están armando un gran revuelo. A algunos les preocupa que la investigación provoque más mal que bien.\n\nLos habitantes de Valdrakken agradecerían que fueras a reunirte con los goblins para ver si puedes encontrar una solución a su investigación.\n\nSin destruir parte de nuestra ciudad.', '', '', '', '', '', 'Reúnete con Greyzik Dedoguijarro en Valdrakken.', 47187),
