(72729, 'esES', 'El gran Corno', 'Lleva la moneda oxidada de las islas al gran Corno, que está en las Llanuras de Ohn\'ahra.', 'Una moneda peculiar, pescada en las Islas Dragón.\n\nHas oído rumores de otros pescadores que mencionaban a una criatura en las Llanuras de Ohn\'ahra que las colecciona.', '', '', '', '', '', '', 47187),
(72728, 'esES', 'El mundo aguarda', 'Completa 10 misiones del mundo en las Islas Dragón.', '¿Sabes lo que es una auténtica muestra de fuerza? ¡Que ayudes a la comunidad de las Islas Dragón!\n\nHay muchos problemas que resolver por aquí. ¡Muéstrame lo fuerte que eres y echa una mano!', '', '', '', '', '', '', 47187),
(72709, 'esES', 'Financiación para una caza del tesoro', 'Compra las notas sobre artefactos arqueológicos a la catalogadora Jakes.', '<La catalogadora Jakes rebusca con rapidez en su bolsa de suministros y saca un mapa recién dibujado>.\n\nUno de nuestros arqueólogos acaba de informarnos sobre ciertos hallazgos relacionados con un artefacto perdido que se cree que está en esta zona.\n\nSi donas esos suministros para financiar la siguiente expedición del arqueólogo, te entregaré este mapa que indica la ubicación de un tesoro cercano.', '', '', '', '', '', '', 47187),
(72708, 'esES', 'Suministros de las Islas Dragón', 'Entrega la bolsa de suministros de las Islas Dragón a la catalogadora Jakes en la Embajada Reposo Alado.', '<Ese protodragón debe de haberle robado la bolsa de suministros a un desafortunado miembro de la Expedición Dragontina.\n\nLa catalogadora Jakes sabrá qué hacer con ella en la Embajada Reposo Alado>.', '', '', '', '', '', 'Entrega la bolsa de suministros de las Islas Dragón a la catalogadora Jakes en la Embajada Reposo Alado.', 47187),
