(72686, 'esES', 'Oleada tormentosa', 'Derrota criaturas imbuidas de elementos para recoger desbordamiento elemental mientras estás en una tormenta elemental.', 'Los Primalistas se las han apañado para invocar feroces tormentas elementales por todas las Islas Dragón, $n.\n\nCuando una tormenta esté activa, dirígete a ella y mata a las criaturas imbuidas que veas en la zona.\n\nLuego recoge el desbordamiento elemental de los enemigos derrotados. Ten en cuenta que, cuanto más poderoso sea el enemigo, más desbordamiento elemental obtendrás.\n\nNo debemos permitir que la corrupción elemental de los Primalistas vaya a más.', '', '', '', '', '', '', 47187),
