(72648, 'esES', 'Chispas de vida: Tierras Azures', 'Recoge $1oa chispas de vida en las Tierras Azures con el modo guerra activado.', 'Las mareas han subido y nos han traído el regalo de la vida a las Tierras Azures.\n\nEs un buen momento para disfrutar de los amigos, la familia y la buena comida, así como para forjar nuevas historias.', '', '', '', '', '', 'Habla con el maestro de campo Emberath en Valdrakken.', 47187),
