(72585, 'esES', 'Orientación abierta', 'Completa las misiones de orientación en centro de cada facción: el Campamento Base Dragontina, Maruukai, Iskaara y Valdrakken.', 'Has hecho mucho por las Islas Dragón, $ghéroe:heroína;.\n\nMucha gente agradece tus contribuciones y quiere darte la bienvenida a sus comunidades. Ve a verlos y conoce a cada grupo y sus especialidades.\n\nCreo que descubrirás que, al igual que tú, ¡las islas Dragón también tienen mucho que ofrecer!', '', '', '', '', '', '', 47187),
(72584, 'esES', 'Colocar tu propia red', 'Coloca una red de pesca en el agujero de pesca de la boca del río.', '¿Quieres probar tu red? Ve a la boca del río, al sur de las Orillas del Despertar, y busca un sitio donde abunden los peces. Debería haber un buen lugar para montar tu red.', '', '', '', '', '', '', 47187),
