(72525, 'esES', 'Equipamiento de catalogación básico', 'Usa el kit de suministros de expedición para investigar el equipamiento de catalogación.', '¡Todos los catalogadores de la expedición se merecen su propia cámara!\n\nNo tienes por qué darle un nombre especial a la tuya, pero te animo a que lo hagas. Así es mucho más divertido.\n\nSea como sea, el abrecaminos Jeb debería poder proporcionarte todo lo que necesitas.\n\nAún no he dado con una sola cosa que no haya podido conseguir. Es increíble.', '', '', '', '', '', '', 47187),
(72524, 'esES', 'Equipamiento de escalada básico', 'Usa el kit de suministros de expedición para investigar el equipamiento de escalada.', '<El abrecaminos Jeb señala los suministros que tiene a su lado>.\n\nVas a necesitar suministros si quieres sobrevivir ahí fuera.\n\nTengo aquí todo lo que te hace falta para empezar a escalar.', '', '', '', '', '', '', 47187),
(72519, 'esES', 'Puesta a punto temporal', 'Utiliza el cronocristal con Eternus y Cromi en Azmerloth para evitar que caigan a través del tiempo.', 'Ya veo... Están cayendo a través de todas las posibilidades y del propio tiempo.\n\nRápido, he localizado otro punto en la línea temporal donde podríamos alcanzarlas. Es... inusual, pero no dejes que la extrañeza de este mundo te frene. El destino de Chronormu está en tus manos.', '', '', '', '', '', 'Vuelve con Nozdormu al presente.', 47187),
(72512, 'esES', 'Una brisa susurrante', 'Acércate a Ohn\'ahra en el Nidal de Ohn\'ahra.', '<Godoloto ladea la cabeza con curiosidad, asiente y finalmente te sostiene la mirada. Tras un largo momento, alza la vista al cielo... y hacia la montaña que está junto a Maruukai. Percibes que quiere que te dirijas al Nidal de Ohn\'ahra.>', '', '', '', '', '', 'Acércate a Ohn\'ahra en el Nidal de Ohn\'ahra.', 47187),
(72488, 'esES', 'El recorrido avanzado de Thaldraszus', 'Participa en cada uno de los circuitos avanzados de Thaldraszus.', 'Una vez más, ¡toca viajar a Thaldraszus! Un lugar lleno de picos, valles... ¡y circuitos listos para que los recorras!\n\nBusca a mis colegas bronce para demostrar tu habilidad en los circuitos avanzados y terminar así tu recorrido por las Islas Dragón.', '', '', '', '', '', '', 47187),
(72487, 'esES', 'El recorrido de Thaldraszus', 'Participa en cada una de las carreras de Thaldraszus.', 'Thaldraszus, hogar del Trono de los Aspectos y de gran parte de la historia de los dragónicos.\n\n¡Allí verás picos elevados y barrancos escarpados y profundos que parece que piden que los sobrevueles!\n\nComo siempre, mis colegas bronce han preparado unas cuantas carreras en Thaldraszus en las que puedes competir mientras exploras la zona.\n\n¿Por qué no las pruebas y así completas todos los circuitos de las Islas Dragón?', '', '', '', '', '', '', 47187),
(72486, 'esES', 'El recorrido avanzado de las Tierras Azures', 'Participa en cada uno de los circuitos avanzados de las Tierras Azures.', '¡Los circuitos avanzados de las Tierras Azures están diseñados para llevar tus habilidades como jinete de dragones a nuevas cotas!\n\nTú procura... no caerte.\n\n¡Busca a mis colegas bronce cuando quieras probar estos circuitos!', '', '', '', '', '', '', 47187),
(72485, 'esES', 'El recorrido de las Tierras Azures', 'Participa en cada una de las carreras de las Tierras Azures.', 'Los circuitos de las Tierras Azures son una experiencia única. Los picos altos, el terreno nevado y los densos bosques suponen muchos obstáculos interesantes y desafíos.\n\nMientras estés allí, ¡busca a mis colegas bronce y prueba sus circuitos!', '', '', '', '', '', '', 47187),
(72484, 'esES', 'El recorrido avanzado de las Llanuras de Ohn\'ahra', 'Participa en cada uno de los circuitos avanzados de las Llanuras de Ohn\'ahra.', 'Los circuitos avanzados deberían suponer un mayor desafío, ¡pero tengo la certeza de que no hay nada que no puedas superar!\n\nMis colegas bronce han preparado circuitos avanzados en las Llanuras de Ohn\'ahra con algunos obstáculos y otras sorpresas. También puedes intentar batir tus propios récords.\n\n¡Buena suerte!', '', '', '', '', '', '', 47187),
(72483, 'esES', 'El recorrido de las Llanuras de Ohn\'ahra', 'Participa en cada una de las carreras de las Llanuras de Ohn\'ahra.', 'Ah, las Llanuras de Ohn\'ahra. Grandes espacios abiertos, fuertes vendavales, paisajes interminables... ¡y nuevas carreras!\n\nAl igual que en las Orillas del Despertar, si te cruzas con alguno de mis colegas bronce, pregúntales sobre los circuitos.', '', '', '', '', '', '', 47187),
(72482, 'esES', 'El recorrido avanzado de las Orillas del Despertar', 'Participa en cada uno de los circuitos avanzados de las Orillas del Despertar.', 'Ahora que has volado por todos los circuitos básicos de las Islas Dragón y has demostrado tu habilidad, ¿qué te parece enfrentarte a un nuevo reto?\n\nLas carreras avanzadas son similares a las que has hecho hasta ahora, pero muchas tienen rutas de vuelo más complicadas u otros obstáculos que llevarán tus facultades al límite.\n\n¡Empecemos por los circuitos de las Orillas del Despertar!', '', '', '', '', '', '', 47187),
(72481, 'esES', 'El recorrido de las Orillas del Despertar', 'Participa en cada una de las carreras de las Orillas del Despertar.', '¿Sabes qué es lo más divertido de ser jinete de dragones? ¡Las carreras!\n\nMis colegas bronce han organizado circuitos para carreras a lo largo de las Islas Dragón. Es un paisaje tan variado y dinámico que parece hecho para la exploración a toda velocidad.\n\nSi te encuentras con uno de nuestros circuitos de carreras en las Orillas del Despertar, anímate y participa.', '', '', '', '', '', '', 47187),
(72456, 'esES', 'Escritos de confianza', 'Recupera varios volúmenes de la genealogía obsidiana, y entrégaselos a los intendentes de Wrathion y Sabellian.', 'A pesar de haber asegurado las murallas superiores de la Ciudadela Obsidiana, las fuerzas de los Djaradin continúan saqueando el patio. ¡Esa zona está repleta de registros históricos de valor incalculable! Debemos actuar con rapidez para poner a salvo todo lo que documente el linaje del Vuelo Negro.\n\nTanto Wrathion como Sabellian desean hacerse con esta información, así que puedes conseguir un escrito para cada uno.\n\nVe a la torre derrumbada de la ciudadela. Allí deberías encontrar algo que merezca la pena.', '', '', '', '', '', '', 47187),
(72448, 'esES', 'Asegurar nuestro legado', 'Elimina a dos enemigos poco comunes en la Ciudadela Obsidiana o en Cienoescoria.', '¡No he trabajado tan duro ni he llegado tan lejos para perder ahora la Ciudadela!\n\nPor desgracia, han surgido nuevas amenazas. ¿Puedo contar contigo para hacerles frente?\n\nAyúdanos a asegurar el área. Busca y elimina a dos de nuestros enemigos más poderosos.', '', '', '', '', '', '', 47187),
(72447, 'esES', 'Las mayores amenazas', 'Elimina a dos enemigos poco comunes en la Ciudadela Obsidiana o en Cienoescoria.', 'Unos poderosos djaradin y otras criaturas amenazan tanto la Ciudadela Obsidiana como la seguridad de mi Vuelo.\n\nEsto no puede seguir así.\n\nAyúdanos a asegurar el área. Busca y elimina a dos de nuestros enemigos más poderosos.', '', '', '', '', '', '', 47187),
(72435, 'esES', 'Orientación: Iskaara', 'Conoce a algunos vendedores de mercancías valiosas.', 'Te doy la bienvenida a Iskaara, $gamigo:amiga;.\n\nLas historias sobre tus hazañas con los Frondacuero ya se han extendido entre nuestra gente. Ya conoces a muchos de los nuestros, pero hay aún más compañeros que quieren intercambiar conocimientos y mercancías contigo.\n\nPor favor, tómate un momento para familiarizarte con algunos de los habitantes de Iskaara. Somos una comunidad que se apoya mutuamente, así que al igual que tú tienes mucho que ofrecernos, muchos de los nuestros también lo tienen para ti.', '', '', '', '', '', '', 47187),
(72434, 'esES', 'El circuito del Vitasagrario Rubí', 'Completa el circuito del Vitasagrario Rubí.', 'Dicen que aún no soy lo bastante mayor para volar en los circuitos.\n\nPero puedo ver cómo lo hacen otros. ¡Deberías participar! Y así yo puedo verte correr.', '', '', '', '', '', 'Completa el circuito del Vitasagrario Rubí.', 47187),
(72429, 'esES', 'Orientación: Maruukai', 'Reúnete con la guardiana del renombre y la intendente de renombre en Maruukai.', '<Okir pone voz a las señales de la khan Sansok>.\n\nLos Maruuk no estamos en contra de los forasteros, pero necesitamos que cualquier aliado potencial demuestre su valía. A medida que conozcas a los clanes y les ayudes, se irá corriendo la voz sobre tu apoyo.\n\nEn el piso inferior del krutal, en la colina, podrás encontrar a una de las hijas de la khanam Matra; ella te informará sobre la situación de nuestra gente. Ve y preséntate.', '', '', '', '', '', '', 47187),
(72428, 'esES', 'Cornisapos acaparadores', 'Recolecta 20 gemas acres de los cornisapos de las Islas Dragón para Gnoklin Bobinavagante de la Expedición Dragontina.', 'No es ningún secreto que a los cornisapos de estas tierras les encantan las gemas, las joyas y cualquier cosa brillante. ¡El otro día, hasta encontré una joya extraordinaria entre los excrementos de uno de ellos!\n\nPuede que no sea la más pulcra de las tareas, pero parece que a los cornisapos no solo les gusta coleccionar, sino también zamparse objetos de valor.', '', '', '', '', '', '', 47187),
(72427, 'esES', 'Infusión animada', 'Recolecta 13 hojas con pinchos de los azotadores de las Islas Dragón para Dhurrel de los Centauros Maruuk.', 'Hoy vengo con una petición bastante simple.\n\nLos alquimistas andan escasos de un ingrediente necesario para un brebaje particularmente difícil, aunque es una hierba bastante fácil de recolectar. Solo necesitas encontrar algunas plantas agresivas y extraerles muestras. ¿Crees que podrás?', '', '', '', '', '', '', 47187),
(72423, 'esES', 'Hacer frente a la tormenta', 'Hazte con 12 armamentos de la tempestad de los centauros Nokhud de las Islas Dragón para Temnaayu de los Colmillarr de Iskaara.', '¡Ah, has llegado justo a tiempo! Hemos oído que los centauros Nokhud tienen poderosas armas imbuidas del poder de la tormenta. Me gustaría hacerme con algunas de ellas para aprender a defendernos mejor de su amenaza.\n\nLo mínimo que podemos hacer es arrebatarles algunas para darles un mejor uso.', '', '', '', '', '', '', 47187),
(72410, 'esES', 'Pinzas y agujas', 'Reúne 10 pinzas puntiagudas de los guadáñidos de las Islas Dragón para Gnoklin Bobinavagante de la Expedición Dragontina.', 'Últimamente andamos escasos de agujas, ¡no dejan de partirse en dos!\n\nCreo que las púas de los guadáñidos podrían servirnos para sustituirlas.', '', '', '', '', '', '', 47187),
(72406, 'esES', 'Orientación: Valdrakken', 'Conoce a los proveedores importantes de Valdrakken.', 'Te doy la bienvenida a Valdrakken, $p. Soy Unatos, guardián del renombre del Acuerdo de Valdrakken.\n\nComo reconocimiento a la ayuda que has prestado a los Vuelos, se ha autorizado a ciertos proveedores de la ciudad a ofrecerte nuestros mejores productos.\n\n¿Porque no te tomas un rato para ver dónde están y qué productos ofrecen?', '', '', '', '', '', '', 47187),
(72399, 'esES', 'El jardín del ermitaño', 'Habla con Szareth en el Saliente de las Sombras.', 'Nuestros padres siempre dicen que no deberíamos visitar los jardines que hay sobre Gelikyr. Creen que el jardinero es malo y peligroso.\n\n¡Pero no es verdad! Es un poco gruñón pero muy simpático.\n\nAunque no hemos vuelto desde que aparecieron los Primalistas. Ahora es demasiado peligroso. Espero que el jardinero siga bien. ¿Podrías ir a comprobar cómo está?', '', '', '', '', '', '', 47187),
(72397, 'esES', 'Orientación: Campamento Base Dragontina', 'Conoce a los proveedores importantes en el Campamento Base Dragontina.', 'Te doy la bienvenida al campamento base,$p.\n\nNos llevó un buen rato elegir el lugar perfecto, pero no podría estar más contenta con nuestra elección.\n\nCuenta con un fácil acceso a las ruinas, a los criaderos de protodragones, y claro está, a los Vuelos.\n\n¿Por qué no te tomas unos minutos para explorar el campamento y conocer a algunos de los proveedores que ayudan a la expedición?', '', '', '', '', '', 'Reúnete con Toddy Bigotis en el Campamento Base Dragontina.', 47187),
