(72382, 'esES', 'Colmillarr de Iskaara', 'Completa 3 misiones del mundo de los tortolianos.', 'Completa 3 misiones del mundo para ayudar a los tortolianos.', '', '', '', '', '', 'Vuelve con el recolector Kajo.', 47187),
(72381, 'esES', 'Expedición Dragontina', 'Completa 3 misiones del mundo de los tortolianos.', 'Completa 3 misiones del mundo para ayudar a los tortolianos.', '', '', '', '', '', 'Vuelve con el recolector Kajo.', 47187),
(72380, 'esES', 'Juntos somos imparables', 'Vuelve al Trono de los Aspectos e informa a Alexstrasza de lo que ha ocurrido tras la derrota de Raszageth en la Cámara de las Encarnaciones.', '$n, debes informar a Alexstrasza y a Nozdormu de lo que ha ocurrido.\n\nKhadgar y yo nos reuniremos contigo en el Trono de los Aspectos enseguida.', '', '', '', '', '', 'Vuelve con Alexstrasza la Protectora en el Trono de los Aspectos, que está en Valdrakken.', 47187),
(72374, 'esES', 'Ayudar al Acuerdo de Valdrakken: La Fortaleza de Ruinadragón', 'Ve a las Orillas del Despertar y asedia la Fortaleza de Ruinadragón. Sigue trabajando para ayudar al Acuerdo de Valdrakken y a sus aliados en las Islas Dragón.', 'Nuestros aliados en las islas necesitan tu ayuda una vez más. En Valdrakken se respira con más tranquilidad sabiendo que tus esfuerzos han ayudado a forjar nuestro futuro.\n\nPero, bueno, al grano.\n\nLa amenaza de los Djaradin brota desde las profundidades de la Fortaleza de Ruinadragón para cernirse sobre las Orillas del Despertar. Debemos ser rápidos e interrumpir sus avances.\n\nEsperamos tu regreso, $n.', '', '', '', '', '', '', 47187),
(72373, 'esES', 'Ayudar al Acuerdo de Valdrakken: Se abre la veda', 'Ayuda a los Maruuk en una cacería en las Islas Dragón. Sigue trabajando para ayudar al Acuerdo de Valdrakken y a sus aliados en las Islas Dragón.', 'Nuestros aliados de las Llanuras de Ohn\'ahra han solicitado que cualquier cazador que haya en estas tierras preste ayuda a su causa.\n\nMientras continúas con tus esfuerzos por las islas, ¿por qué no visitas a nuestros aliados en uno de sus campamentos y les echas una mano?\n\nHay mucho que hacer. No te demores.', '', '', '', '', '', '', 47187),
(72372, 'esES', 'Domesticar a los dragon... antes', '', '', '', '', '', '', '', '', 47187),
