(72354, 'esES', 'La gran cámara', 'Consigue una pieza de botín de la gran cámara.', 'A lo largo de los años, los Aspectos y su pueblo adquirieron muchos artefactos y mucho armamento. Los Aspectos encargaron la construcción de una gran cámara encantada en la que pudieran almacenarlos hasta el momento en que un alma digna viniera en busca de los tesoros que custodiaba.\n\nSe encuentra en el interior del banco. Tal vez, si demuestras tu valía, puedas reclamar una parte del antiguo tesoro de los Aspectos.', '', '', '', '', '', '', 47187),
(72338, 'esES', 'Llave obsidiana superior', 'Consigue $1oa llave reconstruida.', 'Tráeme una llave reconstruida.', '', '', '', '', '', 'Entrega la llave reconstruida a cualquier facción que haya en la Ciudadela del Dragón Negro.', 47187),
