(72293, 'esES', 'Aventuras en las Islas Dragón', 'Revisa el mapa de exploración para elegir una zona de las Islas Dragón a la que apoyar.', '¡Ah, ya sé qué puedes hacer!\n\nLa Expedición Dragontina ha colgado un espléndido mapa de las Islas Dragón por aquí cerca.\n\nSus dibujos son muy precisos y detallados, si se me permite decirlo, aunque tampoco es que estés aquí para criticar obras de arte.\n\n¡Deberías echarle un vistazo para ver qué zonas de las Islas Dragón necesitan tu ayuda!', '', '', '', '', '', '', 47187),
(72292, 'esES', 'La historia de una victoria espectacular', 'Cuéntale la historia de tu victoria a la anciana Poa en Iskaara.', '¡Ha sido una batalla majestuosa!\n\nLa anciana Poa de Iskaara querrá escuchar la impresionante historia de tal victoria.', '', '', '', '', '', '', 47187),
(72291, 'esES', 'Historia de una victoria memorable', 'Cuéntale la historia de tu victoria a la anciana Poa en Iskaara.', '¡Ha sido una buena pelea!\n\nA la anciana Poa de Iskaara le interesará oír la historia de esta victoria.', '', '', '', '', '', '', 47187),
(72283, 'esES', 'Suministros de renombre', '', '', '', '', '', '', '', '', 47187),
(72282, 'esES', 'Suministros de renombre', '', '', '', '', '', '', '', '', 47187),
(72280, 'esES', 'Suministros de las Islas Dragón', '', '', '', '', '', '', '', '', 47187),
(72279, 'esES', 'Suministros de las Islas Dragón', '', '', '', '', '', '', '', '', 47187),
(72269, 'esES', 'Thaldraszus', 'Viaja a Valdrakken y reúnete con Alexstrasza la Protectora.', 'Alexstrasza la Protectora está organizando una reunión en el Trono de los Aspectos para hablar sobre la amenaza de los Primalistas.\n\nHa convocado a cualquier aventurero que esté dispuesto a ayudar.', '', '', '', '', '', 'Viaja a Valdrakken y reúnete con Alexstrasza la Protectora.', 47187),
(72268, 'esES', 'Las Tierras Azures', 'Habla con Masud el Sagaz en las Llanuras de Ohn\'ahra.', 'El Kirin Tor necesita toda la ayuda posible para localizar la piedra de juramento del dragón azul.\n\nHan visto a algunos de sus magos en las Llanuras de Ohn\'ahra buscando ayuda.', '', '', '', '', '', '', 47187),
(72267, 'esES', 'Las Llanuras de Ohn\'ahra', 'Reúnete con la embajadora Taurasza en la Avanzada Escama Rubí.', 'El Vuelo Verde necesita la ayuda de aventureros. Para ello, debes aliarte con los centauros de las llanuras.\n\nLa embajadora Taurasza puede ayudarte.', '', '', '', '', '', '', 47187),
(72266, 'esES', 'Las Orillas del Despertar', 'Reúnete con Sendrax en las Orillas del Despertar.', 'La dracónida Sendrax necesita que le echen una mano para ayudar a los recién llegados en las Orillas del Despertar.', '', '', '', '', '', '', 47187),
(72263, 'esES', 'La caballería tiene su lugar', 'Aprende a montar tu vorquin personal.', '¡$gEvocador:Evocadora;! ¡Aún quedan manadas de vorquin por aquí!\n\nMe las he apañado para reunir algunos que podrás usar como montura cuando se te cansen las alas. ¿Te acuerdas de cómo montar?\n\nMe ordenaron que te entregara este ejemplar ahora que los escamandantes están organizándolo todo. Cuídalo bien.', '', '', '', '', '', '', 47187),
(72261, 'esES', '¿Más que una prisión?', 'Lleva el artefacto antiguo de la Cámara a Lillian Brillaluna.', '<El artefacto antiguo parece de naturaleza elemental. Lillian Brillaluna, que está en Valdrakken, podría saber más>.', '', '', '', '', '', '', 47187),
(72260, 'esES', 'Artefactos de la Cámara', '', '', '', '', '', '', '', '', 47187),
(72259, 'esES', 'Artefactos de la Cámara', '', '', '', '', '', '', '', '', 47187),
(72256, 'esES', 'Las Garfas Oscuras', 'Entrega las órdenes de la escamandante a Kodethi y las Garfas Oscuras.', 'Naleidea tiene entusiasmo, pero es historiadora, no soldado. Desconoce los peligros a los que nos enfrentaremos en las Islas Dragón.\n\nPero no hay nada de qué preocuparse. Al fin y al cabo, las Garfas Oscuras protegerán la expedición.\n\nHablaré con Ebyssian y los líderes de tu Horda sobre la logística de la misión.\n\nMi lugarteniente, Kodethi, está explorando la ciudad con el resto de los dracthyr. Dile que nos reuniremos en la torre de zepelines. Le transmitirá mis órdenes al resto.', '', '', '', '', '', 'Reúnete con Naleidea en la torre de zepelines a las afueras de Orgrimmar.', 47187),
(72254, 'esES', 'El fantasma del pescador Tinnak', '', '', '', '', '', '', '', '', 47187),
(72253, 'esES', 'Pesca de las Islas Dragón', '', '', '', '', '', '', '', '', 47187),
(72252, 'esES', 'Pesca de las Islas Dragón', '', '', '', '', '', '', '', '', 47187),
(72251, 'esES', 'Cocina de las Islas Dragón', '', '', '', '', '', '', '', '', 47187),
(72250, 'esES', 'Cocina de las Islas Dragón', '', '', '', '', '', '', '', '', 47187),
(72249, 'esES', 'Sastrería de las Islas Dragón', '', '', '', '', '', '', '', '', 47187),
(72247, 'esES', 'Joyería de las Islas Dragón', '', '', '', '', '', '', '', '', 47187),
(72246, 'esES', 'Sueños serenos', 'Habla con el gerente de la sauna.', '¡Te doy la bienvenida a la Sauna de Sueños Serenos!\n\nLo siento, pero ahora mismo no podemos admitir nuevas visitas por circunstancias ajenas a nuestro control.\n\nDeja que te remita al gerente de la sauna, Xijan Zarpa Espinosa. Él podrá responder a todas tus preguntas.', '', '', '', '', '', '', 47187),
(72245, 'esES', 'Alquimia de las Islas Dragón', '', '', '', '', '', '', '', '', 47187),
(72244, 'esES', 'Inscripción de las Islas Dragón', '', '', '', '', '', '', '', 'Habla con Jessamine Babaz en la Embajada Reposo Alado.', 47187),
(72243, 'esES', 'Herboristería de las Islas Dragón', '', '', '', '', '', '', '', '', 47187),
(72242, 'esES', 'Ingeniería de las Islas Dragón', '', '', '', '', '', '', '', '', 47187),
(72241, 'esES', 'Lecciones de nuestro pasado', 'Habla con las escamandante Pavethal.', 'Soy Pavethal, escamandante de los dracthyr. Wrathion nos ayudó cuando despertamos de la larga estasis y ahora me toca a mí ayudarlo.\n\nSeguro que tienes preguntas sobre los míos y nuestra historia. Hasta hace poco, yo también las tenía.\n\nPero Nozdormu el Atemporal nos ha revelado verdades perdidas sobre los dracthyr. Me ha concedido una visión sobre nuestros orígenes... y el motivo por el que estábamos encerrados.\n\nDeja que te cuente las cosas que he visto.', '', '', '', '', '', '', 47187),
(72240, 'esES', 'Las Depositarias Obsidiana', 'Entrega las órdenes del escamandante a Derviche y a las Depositarias Obsidiana.', 'El entusiasmo de Toddy es admirable. Espero que eso no la ciegue ante los peligros que nos aguardan en las Islas Dragón.\n\nAl margen de eso, las Depositarias Obsidiana tenemos el deber de proteger la expedición.\n\nDebo hablar con Wrathion y el lord comandante sobre la próxima misión.\n\nLos demás dracthyr están explorando la ciudad. Busca a Derviche, mi leal lugarteniente, e infórmale de que nos reuniremos en los muelles. Le transmitirá mis órdenes al resto.', '', '', '', '', '', 'Comunica tu éxito a Toddy Bigotis en el Puerto de Ventormenta.', 47187),
(72193, 'esES', 'La Academia Algeth\'ar', 'Visita el recinto de la Academia Algeth\'ar.', 'Tengo entendido que la Academia Algeth\'ar vuelve a estar abierta al mundo.\n\nHace mucho tiempo, sus salas sagradas solo lo estaban para los dragones, pero, en los años que han pasado, la directora ha considerado sabio dar la bienvenida a cualquiera que quiera aprender. Me ha pedido que le recomiende estudiantes prometedores.\n\nComo gran $galiado:aliada; de los dragónicos, sería un honor que asistieras a nuestra gran academia. Tú decides si quieres apuntarte, pero seguro que a Doragosa le encantará, como mínimo, enseñarte la academia.', '', '', '', '', '', '', 47187),
(72192, 'esES', 'Salas de Infusión: Entropía al orden', 'Entra en las Salas de Infusión y derrota al tsunami primigenio.', 'Los Primalistas pretenden desatar de nuevo el caos elemental en este mundo y no se detendrán ante nada hasta cumplir su objetivo.\n\nHe recibido noticias inquietantes que aseguran que se han infiltrado en las Salas de Infusión, dentro de Tyrhold. Pretenden desbaratar la obra del guardián Tyr para sus fines nefastos.\n\nPor favor, debes acabar con cualquier amenaza primalista dentro de esas salas sagradas, $n.', '', '', '', '', '', '', 47187),
(72191, 'esES', 'Recompensa de escasez de suministros', '', '', '', '', '', '', '', '', 47187),
(72190, 'esES', 'Reservas sobre la reserva', 'Encuentra a Zuttiki.', '¡$C! Conozco a alguien que necesita desesperadamente tus habilidades.\n\nLos Primalistas han atacado la Reserva de Tyrhold. Yo tuve suerte de escapar, pero temo que los demás no hayan tenido tanta.\n\nSe encuentra al norte de aquí. Busca a Zuttiki. Ella podrá contarte todos los detalles.\n\nSi sigue viva, claro.', '', '', '', '', '', '', 47187),
(72189, 'esES', 'Variedad de jardines', 'Habla con Gryrmpech.', '¿Estás disfrutando del jardín de mariposas?\n\n¿Sabes qué? Hay un jardín mucho más grande al sur de aquí. Lo cuida un viejo dracónido llamado Gryrmpech.\n\nSiempre le vienen bien un par de manos extra. Tiene un \"ayudante\", pero yo nunca lo he visto. No creo que lo ayude mucho.\n\nSi te pasas por allí, asegúrate de decirle que te envía Xina.', '', '', '', '', '', '', 47187),
(72188, 'esES', 'LFGDungeons - DF - Heroic Random - Nth', '', '', '', '', '', '', '', '', 47187),
(72187, 'esES', 'LFGDungeons - DF - Heroic Random - 1st', '', '', '', '', '', '', '', '', 47187),
(72185, 'esES', 'LFGDungeons - DF - Raid Finder - Nth', '', '', '', '', '', '', '', '', 47187),
(72184, 'esES', 'LFGDungeons - DF - Raid Finder - 1st', '', '', '', '', '', '', '', '', 47187);
