(72182, 'esES', 'LFGDungeons - DF - Normal Random - Nth', '', '', '', '', '', '', '', '', 47187),
(72181, 'esES', 'LFGDungeons - DF - Normal Random - 1st', '', '', '', '', '', '', '', '', 47187),
(72175, 'esES', 'Un momento cetre-stacular', 'Fabrica $1oa cetro del espectáculo: Fuego y $2oa cetro del espectáculo: Aire para Soragosa en Valdrakken.', 'Esta semana tenemos unos pedidos muy importantes. Los estudiantes de la Academia Algeth\'ar están como locos por estos cetros.\n\n¿Por qué no nos ayudas con alguno?', '', '', '', '', '', '', 47187),
(72172, 'esES', 'Esencia, fragmentos y polvo cromático', 'Fabrica $1oa de polvo cromático para Soragosa en Valdrakken.', 'Parece que siempre nos faltan componentes básicos. Esencia, fragmentos... Además, nuestros suministros de polvo cromático están bajo mínimos.\n\nSi no te importa ayudarnos en esto, quizás podamos pasar más de una semana sin tener que reponer suministros.', '', '', '', '', '', '', 47187),
(72171, 'esES', 'Demostración en solitario', 'Completa 12 rondas de Batiburrillo de solitarios.', 'Tu afán por buscar conflictos por tu cuenta me agrada. Si confías tanto en tus propias habilidades, te observaré para entretenerme.\n\nA ver qué eres capaz de demostrar. Después, vuelve a verme.', '', '', '', '', '', '', 47187),
(72168, 'esES', 'Demostración en escaramuzas', 'Consigue puntos de honor en escaramuzas de arena.', 'Confías en tus dotes tácticas, ¿eh? He oído que los mortales peleáis en escaramuzas a pequeña escala. Ve y busca rivales a los que enfrentarte.\n\nA ver qué eres capaz de demostrar. Después, vuelve a verme.', '', '', '', '', '', '', 47187),
(72167, 'esES', 'Demostración en la guerra', 'Consigue puntos de honor en campos de batalla épicos.', '¿Quieres un \"desafío real\"? Que así sea. Conozco algunos conflictos a gran escala que podrían suponer un reto hasta para mí.\n\nTengo mucha curiosidad por ver cómo fracasas... O sea, cómo lo haces. Veamos si puedes demostrar tu valía.', '', '', '', '', '', '', 47187),
(72166, 'esES', 'Demostración en batalla', 'Consigue puntos de honor en campos de batalla aleatorios.', 'A los mortales os encanta pelearos por cualquier motivo. Pues que así sea.\n\nAl menos será divertido. Es decir, para mí. Vamos a ver si eres capaz de demostrar lo que vales, como os gusta decir a vosotros.', '', '', '', '', '', '', 47187),
(72159, 'esES', 'Menos escamas', 'Recolecta $1oa pellejos de escamas lustrosas para Ralathor el Robusto, que está en Valdrakken.', 'Las escamas tienen un sinfín de usos: brindan protección, pero, en algunos casos, también pueden ofrecer una perfecta superficie reflectante. Muchos de nuestros mejores espejos son, de hecho, escamas.\n\nEsos espejos también tienen mucha demanda. Tráeme algunos pellejos de escamas y compartiré algunos de mis secretos.', '', '', '', '', '', '', 47187),
(72157, 'esES', 'El peso de la Tierra', 'Recolecta $1oa de Tierra reanimadora para Sekita el Excavador en Valdrakken.', 'Tengo un pedido de varios cientos de toneladas de aleación de magma primigenio, pero me he quedado sin Tierra reanimadora. Sé que es una tarea pesada, ¡pero puedo hacer que merezca la pena!', '', '', '', '', '', '', 47187),
(72154, 'esES', 'Skag el Lanzador', '', '', '', '', '', '', '', '', 47187),
(72137, 'esES', 'Planes de prole', '', '', '', '', '', '', '', '', 47187),
(72135, 'esES', 'Neltharus: Los secretos más profundos', 'Recupera $1oa notas de Neltharion, $2oa diarios de obsidiana y un tomo de investigación en Neltharus.', 'Tenemos un problema. Los Djaradin salieron de Neltharus, ¡lo que quiere decir que lo están saqueando!\n\nNeltharus contiene muchos tesoros, pero, y esto es aún más importante, alberga conocimiento. La historia de nuestro Vuelo, su caída en desgracia... Tanto Sabellian como Wrathion buscan más información sobre la vida y obra de Neltharion.\n\n¡Vete y recupera cuanto puedas antes de que los Djaradin lo saqueen todo!', '', '', '', '', '', '', 47187),
(72134, 'esES', 'La ayuda de un aventurero', 'Usa el mapa de exploración para elegir tu primera zona.', 'Hemos descubierto que hay muchos problemas en las Islas Abruptas, la tierra sobre la que flotamos.\n\nHaremos lo que podamos desde aquí. Quiero que eches un vistazo al mapa cercano para ver a quién puedes ayudar primero.', '', '', '', '', '', '', 47187),
(72131, 'esES', 'Exceso de abastecimiento', '', '', '', '', '', '', '', '', 47187),
(72130, 'esES', 'Grifo olvidado', '', '', '', '', '', '', '', '', 47187),
(72129, 'esES', 'Ayudar a Khadgar', 'Reúnete con Khadgar en la Ciudadela Violeta, que está en Dalaran.', '$gBienvenido:Bienvenida; a Dalaran, $n. Me alegro de que hayas llegado a salvo.\n\nHabla conmigo en la Ciudadela Violeta, hay mucho que hacer.', '', '', '', '', '', 'Reúnete con Khadgar en la Ciudadela Violeta, que está en Dalaran.', 47187),
(72128, 'esES', 'Enkine el Voraz', '', '', '', '', '', '', '', '', 47187),
(72127, 'esES', 'Capitana lancera', '', '', '', '', '', '', '', '', 47187),
(72126, 'esES', 'Slurpo, el Caracol Increíble', '', '', '', '', '', '', '', '', 47187),
(72122, 'esES', 'En busca de los ecologistas perdidos', 'Encuentra a los ecologistas perdidos.', 'Hemos podido estabilizar a los heridos, pero hay algo que me preocupa, $n.\n\nUn par de ecologistas dragauros habían venido a la avanzada a estudiar los humedales. No he sabido nada de ellos desde el ataque, y eso me preocupa.\n\nSi vas a salir ahí fuera, ¿te importaría echar un ojo y asegurarte de que están a salvo?\n\nY ten cuidado. Se rumorea que los humedales están infestados de górlocs.', '', '', '', '', '', '', 47187),
(72121, 'esES', 'El gran Shellkhan', '', '', '', '', '', '', '', '', 47187),
(72117, 'esES', 'Intercambio cultural', '', '', '', '', '', '', '', '', 47187),
(72116, 'esES', 'Liskron el Deslumbrante', '', '', '', '', '', '', '', '', 47187),
(72114, 'esES', 'Acrosoth', '', '', '', '', '', '', '', '', 47187),
