(72090, 'esES', 'Desbaratar el plan de los Primalistas', '', '', '', '', '', '', '', '', 47187),
(72089, 'esES', 'Al Observatorio Cima Celestial', 'Atraviesa los anillos planeando.', 'Vuela a través de los anillos de control que marcan el recorrido.', '', '', '', '', '', '', 47187),
(72083, 'esES', 'El cebo de la suerte', 'Recupera el cebo de la suerte del capitán Haab.', 'Estoy abatido, $r, y no es porque esté muerto.\n\nMorí durante una caza y me aseguré de que la bestia que mató a mi tripulación no viviese para volver a matar. No hay nada malo en eso, es lo que mi padre hubiera querido.\n\nNo, el problema es que el combate acabó en empate.\n\nEl espíritu de la bestia sigue ahí fuera, igual que yo estoy aquí ante ti. Pero, al ser un fantasma, ni siquiera puedo recuperar mi cebo de la suerte de las alimañas que limpiaron mi cuerpo para volver a intentarlo.\n\n¿Te importaría ayudarme?', '', '', '', '', '', '', 47187),
(72079, 'esES', 'Festín comunitario', '', '', '', '', '', '', '', '', 47187),
(72075, 'esES', 'Nuevas existencias', 'Recoge peces para reponer el agujero de pesca y monta en tu draco para soltarlos desde el aire.', 'Podrían picar muchos más peces, ¿no crees?\n\nTengo una idea. La leyenda dice que estos lagos de lava no siempre tienen peces afines al calor. Cuentan que estos estanques se llenaron de peces porque unos dragones los lanzaron dentro mientras los sobrevolaban. ¿Te lo puedes creer?\n\n¿Crees que tu draco y tú podríais hacer lo mismo?', '', '', '', '', '', '', 47187),
(72072, 'esES', 'Lluvia de peces en las Fuentes de Dragón', 'Recoge peces para reponer el agujero de pesca y monta en tu draco para soltarlos desde el aire.', 'Podrían picar muchos más peces, ¿no crees?\n\nTengo una idea. La leyenda dice que estos lagos y ríos no siempre han tenido pesca. Cuentan que estos pozos de agua se llenaron de peces porque unos dragones los lanzaron dentro mientras los sobrevolaban. ¿Te lo puedes creer?\n\n¿Crees que tu draco y tú podríais hacer lo mismo?', '', '', '', '', '', '', 47187),
(72071, 'esES', 'Segunda ronda, ¡a pescar!', 'Mata a Mochoby.', '¿Qué te parece si pescas un poco, $n?\n\nHay un banco de peces de carnada frente a la costa que la bestia estúpida ataca cuando se juntan, olvidándose de que ya está muerta.\n\nNada hasta allí y agita el cebo. Puedes tratar de imitar a una foca herida, seguro que no podrá resistirse.', '', 'Un terror de las profundidades.\n\nLa cacería del capitán Haab acabó con ambos muertos, pero ni siquiera la muerte ha calmado su ansia de venganza.', 'Mochoby', '', '', '', 47187),
(72068, 'esES', 'Ayudar al Acuerdo de Valdrakken: Un festín para todos', 'Viaja a Iskaara en las Tierras Azures y participa en un festín comunitario. Sigue trabajando para ayudar al Acuerdo de Valdrakken y a sus aliados en las Islas Dragón.', '¡Nuestros aliados necesitan tu ayuda, $n!\n\nTus esfuerzos en las islas no han pasado desapercibidos. Nuestros leales amigos del sur, los Colmillarr de Iskaara, quieren celebrar tus logros con la madre de todos los festines.\n\nViaja a las tierras de Iskaara mientras sigues colaborando con tus aliados del Acuerdo de Valdrakken. Cuando llegues a las relucientes aguas de las tierras del sur, no dudes en sumarte a los festejos.', '', '', '', '', '', '', 47187),
(72067, 'esES', '¡Hora de descansar!', 'Ve a la Sauna de Sueños Serenos.', '¡Tú!\n\nEstás para el arrastre. Tienes pinta de necesitar un descanso urgentemente, ¡y yo tengo justo lo que necesitas! La Sauna de Sueños Serenos es el lugar perfecto para ti.\n\nDisfruta de nuestras nuevas clases de youga, ¡son alucinantes! ¿O prefieres un tratamiento facial con una mascarilla de barro? Te recomiendo ambas actividades.\n\nPara llegar a la sauna, solo tienes que salir de la ciudad por el norte.', '', '', '', '', '', '', 47187),
(72063, 'esES', 'Devolver el barco de juguete de Yennu', 'Devuelve el barco de juguete a Yennu.', 'Es el barco de juguete de Yennu. Estará encantado de recuperarlo.', '', '', '', '', '', '', 47187),
(72061, 'esES', 'Clamatormentas Veldra', '', '', '', '', '', '', '', '', 47187),
(72060, 'esES', 'Tratamiento especial', 'Devuelve las gafas de sol a Zeldis. Otra vez.', '<La máscara de barro parece sentir curiosidad por tus intenciones, pero está arrinconada en la rama>.', '', '', '', '', '', '', 47187),
(72052, 'esES', 'Prueba del circuito del Vitasagrario Rubí', 'Atraviesa los anillos planeando.', 'Vuela a través de los anillos de control que marcan el recorrido.', '', '', '', '', '', '', 47187),
