(72019, 'esES', 'Ver a través del enemigo: Nezascar', '', '', '', '', '', '', '', '', 47187),
(72008, 'esES', 'Superar una montaña: Krolkoth', '', '', '', '', '', '', '', '', 47187),
(71242, 'esES', 'Apoyar a los investigadores de la tormenta', 'Lleva el cúmulo de poder rebosante elemental a un investigador en Valdrakken.', 'Parece un buen cúmulo de poder rebosante de las criaturas de la tormenta primalista.\n\nSeguro que algún investigador de Valdrakken estará interesado.', '', '', '', '', '', '', 47187),
(71241, 'esES', 'Pato, pato, trampa', 'Prepara las trampas del Clan Aylaag en el Valle Primordial.', 'La arboleda que llaman el Valle Primordial rebosa magia de los antiguos dragones. Mis hermanos aprecian especialmente la piel de unos astudracos que habitan en esa arboleda, pero son muy esquivos y difíciles de encontrar.\n\nEn lugar de ponerte a rastrearlos, puedes usar las trampas que hay por la zona. Deja algo de carne de las aves fluviales de la zona sobre ellas para activarlas. Enviaré a alguien a recoger lo que hayas atrapado.', '', '', '', '', '', '', 47187),
(71239, 'esES', 'Perdida en el cielo', 'Encuentra a Harleen Chirridos en los Riscos Plumazul.', 'Necesito un favor y tú pareces la persona adecuada.\n\nUna vieja amiga mía, Harleen Chirridos, debía reunirse conmigo en la ciudad hace unos días. Planeábamos atiborrarnos en el Festín Rubí, pasar por la peluquería y visitar esa casa de subastas de postín que tienen aquí.\n\nPero no apareció. A veces el trabajo la absorbe, pero me sentiría más tranquilo si supiera dónde está.\n\nPrueba en las montañas al sur de aquí. Mencionó que se pasaría por allí de camino.', '', '', '', '', '', '', 47187),
(71238, 'esES', '¡El Festín Rubí!', 'Habla con los chefs Rumiastrasza y Bocado en el Festín Rubí.', '¡A todos los aspirantes a chef!\n\n¿Tu corazón ansía conocer los sabores definitivos de este mundo? ¿Buscas oportunidades para explorar? ¿Arriesgarías tu vida por completos desconocidos?\n\nSi has respondido a todo que sí, ¡ven a hablar con el inconfundible y distinguido dúo de chefs, Rumiastrasza y Bocado! Actualmente están celebrando el Festín Rubí en la ciudad de Valdrakken.', '', '', '', '', '', '', 47187),
(71235, 'esES', 'Magos de campo', 'Busca a los magos del Kirin Tor cerca del Salto de los Astudracos, que está en las Tierras Azures.', 'Lok\'tar, $r. \n\nSi tienes tiempo, hay dos magos realizando trabajo de campo cerca, y estoy seguro de que les vendría bien algo de ayuda.\n\nEsta es una tierra peligrosa incluso en los buenos tiempos. \n\nY no son buenos tiempos.', '', '', '', '', '', '', 47187),
(71234, 'esES', 'Noticias del Rincón', 'Visita el Rincón del Ballenero en las Tierras Azures.', 'Eh, tú, $r. \n\nTienes pinta de haber viajado mucho. \n\nMi primo Wayun me trajo una pieza desde Rincón del Ballenero y mencionó que cierta... gente extraña ha acampado allí.\n\nParece que se están comportando, pero ¿te importaría ir a ver cómo está?\n\nWayun puede ser algo desagradable.', '', '', '', '', '', '', 47187),
(71233, 'esES', 'Cataratas', 'Habla con Willa en la Atalaya de Tres Cascadas, que está en las Tierras Azures.', 'Me encantan las cascadas. \n\n¿Sabes qué es mejor que una cascada? \n\nDos cascadas. \n\nY lo único mejor que eso es... bueno, ve a Tres Cascadas, al oeste de aquí, y lo verás.\n\nLa tabernera es muy amable.', '', '', '', '', '', '', 47187),
(71232, 'esES', 'Renombre de las Islas Dragón', 'Habla con Therazal en Valdrakken.', 'Aún hay mucho que hacer para ayudar a las Islas Dragón.\n\nHabla con Therazal. Sabe quién necesita ayuda en esta tierra.', '', '', '', '', '', 'Habla con Therazal en Valdrakken.', 47187),
(71231, 'esES', 'La llamada de la cacería', 'Habla con el instructor Frodrum en las Llanuras de Ohn\'ahra.', '<Roki deja caer la nota en tu mano>.\n\n$n, el Clan Shikaar te invita a la gran cacería. Reúnete con el instructor Frodrum en las Llanuras de Ohn\'ahra.', '', '', '', '', '', '', 47187),
(71230, 'esES', 'Equipo de pesca colmillarr', 'Habla con Tavio en Iskaara, que está en las Tierras Azures.', 'Hola de nuevo, $n.\n\n<Rowie mira a su alrededor y tararea una melodía>.\n\n¡Ah, sí! Tavio me estaba haciendo una nueva red y dijo que podía hacerte una a ti. También puede hacer más equipo de pesca si le llevas el material necesario.\n\nDeberías ir a hablar con ella.', '', '', '', '', '', '', 47187),
(71229, 'esES', 'Llamada de las llanuras', 'Habla con la khan Hadari en las Llanuras de Ohn\'ahra.', '<Roki deja caer un mensaje en tu mano>.\n\n$n, el Clan Aylaag ha oído historias de tus grandes hazañas. Te invitamos a conocer nuestro clan y a compartir nuestras costumbres.\n\nKhan Hadari', '', '', '', '', '', '', 47187),
(71227, 'esES', 'Retos aéreos', 'Habla con un vigilante del tiempo bronce para saber más sobre los retos aéreos.', '<Aleteos sacude las alas con entusiasmo y deja caer una nota y un roedor chamuscado a tus pies>.\n\n¡Jinete de dragones! Tu destreza en vuelo ha llegado a ser muy conocida. Ven a probar los retos aéreos de las Islas Dragón.\n\nHabla con cualquier vigilante del tiempo bronce para empezar.', '', '', '', '', '', '', 47187),
(71226, 'esES', 'Matar caracoles de piedra', 'Mata a $1oa conejito de fatalidad en la Plaza de Entrenamiento.', '¡Socorro! ¡Los conejos me están devorando! Por favor, ¡acaba con ellos antes de que nos maten a todos!', '', '', '', '', '', '', 47187),
(71219, 'esES', 'La oteadora díscola', 'Encuentra a la oteadora Alvi.', 'Parece que algunos de los oteadores más jóvenes han estado holgazaneando últimamente.\n\nLa oteadora Nori me ha pedido que controle a su hermana pequeña, Alvi, que está destinada en la entrada al Pasadizo del Tiempo. Al parecer, su rendimiento ha dejado bastante que desear últimamente.\n\nSi te diriges al este y te encuentras con la oteadora Alvi, por favor recuérdale la importancia de su trabajo, y hazle saber que su hermana está bastante preocupada por ella.', '', '', '', '', '', '', 47187),
(71212, 'esES', 'Atacar a los Frondacuero', '', '', '', '', '', '', '', '', 47187),
(71210, 'esES', '¡A la Fortaleza de Ruinadragón!', 'Viaja a las Orillas del Despertar y únete a los desterrados obsidiana en el asedio a la Fortaleza de Ruinadragón.', '<Aleteos deja una nota ligeramente chamuscada en tu mano>.\n\n$n, los desterrados obsidiana han oído hablar de tu valentía. Nuestro antiguo hogar, la Fortaleza de Ruinadragón, ha caído en manos de los Djaradin. No podemos permitir que siga así. Únete a nosotros para reclamar nuestro territorio.\n\n- Jefe', '', '', '', '', '', '', 47187),
(71209, 'esES', 'Bestia de las llanuras', 'Acepta las riendas de Lizi.', 'Creo que Lizi está lista para volver a las llanuras. Ahora se muestra muy amistosa con $gnosotros:nosotras;, pero sé que quiere volver a su entorno.\n\nAlgún día, cuando sea una sabia del viento, exploraré todo el mundo más allá de estas fuentes. ¡Pronto tendrán lugar las pruebas de los iniciados de mitad de temporada! El tiempo vuela.\n\nHe hecho una silla y unas riendas con la lana que trajiste. Lizi estará encantada de acudir a tu llamada.\n\nLlévala en todas tus aventuras, $p.', '', '', '', '', '', '', 47187),
(71205, 'esES', 'Hidrocolmillarr', '', '', '', '', '', '', '', '', 47187),
(71202, 'esES', 'Maligno de maná cuerpo a cuerpo pequeño', 'Derrota a Arcantus en un duelo de mascotas.', '', '', '', '', '', '', '', 47187),
(71199, 'esES', 'Domesticar un espinatrueno', '', '', '', '', '', '', '', '', 47187),
(71198, 'esES', 'Domesticar un espinatrueno', '', '', '', '', '', '', '', '', 47187),
(71197, 'esES', 'Domesticar un espinatrueno', '', '', '', '', '', '', '', '', 47187),
(71196, 'esES', 'Domesticar un espinatrueno', 'Consigue $1oa fluidos fluorescentes de los insectos de las Islas Dragón y $2oa suministros de las Islas Dragón.', 'Me alegra mucho que Lizi esté a salvo con nosotros.\n\nSin embargo, sus heridas sanan más despacio de lo esperado. Espero que la magia no le haya causado daños permanentes.\n\n¿Podrías ayudarme a recolectar icor de insecto? Sí, ya sé que suena asqueroso, pero en realidad es la base de muchos ungüentos curativos.', '', '', '', '', '', '', 47187),
(71195, 'esES', 'Domesticar un espinatrueno', 'Consigue el curri verde de Meluun en los Manantiales Ohn\'iri y $2oa suministros de las Islas Dragón.', 'Parece que este es el nuevo lugar preferido de Lizi. No ha mostrado interés en volver a casa. Al fin y al cabo, es una bestia salvaje.\n\nPero debo confesar que... no he hablado con Meluun desde que salvamos a Lizi. Sé que ella tenía razón, pero... no sé cómo abordar el tema. No parece que le guste nada de lo que hago. Sé que debería centrarme más en mi entrenamiento.\n\nMeluun hace un curri delicioso que le encantaría a Lizi. ¿Crees que podrías pedirle un poco? Suele estar trabajando en la casa del Ohn, al oeste de los manantiales.', '', '', '', '', '', '', 47187),
(71194, 'esES', 'Ranas de fuego', 'Enseña a un par de pinchocuernos a evitar el brebaje de carámbanos.', 'He encontrado un lugar perfecto para echar una red de pesca, pero tengo un problema: los pinchocuernos. Tengo la certeza de que harán pedazos las redes en cuanto las deje solas. ¿Qué hacemos?\n\nTengo una idea. Podemos aplicar brebaje de carámbanos a nuestras redes de pesca en lava para que sean resistentes al calor. Me parece que solo hará falta enseñar a esos pinchocuernos que se alejen del olor.\n\nLanza un frasco de brebaje de carámbanos a un pinchocuerno e inflígele un poco de daño. Procura no matarlos. No aprenderán nada si están muertos, ¿verdad?', '', '', '', '', '', '', 47187),
(71193, 'esES', 'Amenaza subacuática', 'Usa 5 caracolas siniestras en el agujero de pesca de Tyrhold para invocar a una enorme bestia de las profundidades y trae algo como prueba de su muerte.', '¿Has visto eso? ¡Ahí, bajo el agua! ¡Una enorme y hambrienta bestia acorazada! No pienso acercarme a mi red mientras esa monstruosidad siga acechando. Si quieres, puedes atraerlo con un puñado de caracolas siniestras. No tendrás problemas en atrapar unas cuantas.', '', '', '', '', '', '', 47187),
(71192, 'esES', 'Control de depredadores', 'Coloca las efigies aterradoras.', '¡Saludos, $gamigo:amiga;!\n\nHe estado buscando un buen sitio para lanzar redes de pesca, pero parece que por aquí hay demasiados ánades. Se comen a casi todos los peces jóvenes antes de que puedan madurar.\n\nHe fabricado unas efigies, que asustarán a algunas de esas aves tan voraces. Eso nos ayudará a mantener la abundancia de pescado en las Fuentes de Dragón.\n\n¿Me ayudas a colocarlas?', '', '', '', '', '', '', 47187),
(71191, 'esES', 'Valor de red', 'Recupera la red del pescador huraño en los agujeros en el hielo de las Tierras Azures.', 'Ay, la corriente se llevó mi red de pesca. <Suspira>. Y no me gusta usar cañas para pescar como a mis camaradas...\nSi por casualidad encuentras mi red de pesca por ahí, tráemela.', '', '', '', '', '', '', 47187),
(71182, 'esES', 'Archivistas díscolos', 'Reúnete con Sindragosa en los archivos superiores del Archivo Azur.', 'Tú, dracthyr.\n\nDos de los tuyos han estado buscando en los archivos justo al sur de aquí. No me he presentado aún, y apreciaría tu compañía.\n\nSi tienes tiempo, podemos reunirnos en los archivos superiores.', '', '', '', '', '', '', 47187),
(71179, 'esES', 'Mira al Mirador', 'Habla con el comandante Thadezus en el Mirador Gelikyr.', '$n, tengo otra tarea para ti.\n\nHa habido informes de actividad de primalistas cerca del Puesto Gelikyr que amenaza nuestro control de Tyrhold.\n\nHabla con el comandante Thadezus y averigua cómo puedes ayudar.', '', '', '', '', '', 'Habla con el comandante Thadezus en el Mirador Gelikyr.', 47187),
(71178, 'esES', 'Puerta: Santuario Sombreado', 'Encuentra la puerta latente en el Santuario Sombreado de las Llanuras de Ohn\'ahra.', 'Nos hemos enterado de que hay una piedra latente en las exuberantes colinas del suroeste. Es un viaje bastante largo, pero merece la pena enviar a alguien con tus conocimientos a investigar.', '', '', '', '', '', '', 47187),
(71166, 'esES', 'La libélula más antigua', 'Derrota al cornisapo en un duelo de mascotas.', '', '', '', '', '', '', '', 47187),
(71165, 'esES', 'Puerta: Margen del Eón', 'Localiza la puerta latente del Margen del Eón, en Thaldraszus.', 'Al otro lado de las montañas de Thaldraszus, en las laderas, hay una pequeña posada. Justo en la entrada descansa una piedra latente olvidada.\n\n¿Qué te parece? ¿$gListo:Lista; para otra aventura, $n?', '', '', '', '', '', '', 47187),
(71162, 'esES', 'Puerta: Algeth\'era', 'Localiza la puerta latente en lo alto de la aguja de Algeth\'era, en Thaldraszus.', 'Otra piedra. Otra aguja.\n\nSerá mejor que empieces. Esta va a ser una gran caminata. Y peligrosa, según los que la descubrieron.\n\n¿Te apuntas?', '', '', '', '', '', '', 47187),
(71161, 'esES', 'Puerta: Vakthros', 'Localiza la puerta latente en lo alto de la aguja en Vakthros, en las Tierras Azures.', 'He recibido un informe sobre otra de esas piedras latentes en la región invernal que hay al sureste.\n\nAntes de que te emociones, debo decirte que es un lugar al que la mayoría no iría por propia voluntad, pero si te apasiona la aventura y tal vez hallar una muerte prematura, ¡es un trabajo para ti!\n\n¿Te lo he vendido bien? ¡Perfecto!\n\nPonte tus ropas más cálidas y dirígete al este hasta que el viento helado te haga cosquillas en la nariz, y luego sigue adelante. Sabrás que estás cerca cuando te cueste respirar y sientas el frío en los huesos.', '', '', '', '', '', '', 47187),
(71160, 'esES', 'Carga de profundidad', '', '', '', '', '', '', '', '', 47187),
(71157, 'esES', 'Puerta: Observatorio Cima Celestial', 'Localiza la puerta latente en el Observatorio Cima Celestial, que está en las Orillas del Despertar.', 'Algunos de nuestros expedicionarios del norte nos han comunicado que hay otra de aquellas piedras en lo alto de la aguja, al noreste.\n\nHe oído que es difícil llegar por aquello de que está muy alto, ¡pero seguro que encuentras el modo!', '', '', '', '', '', '', 47187),
(71155, 'esES', 'La Cámara Azur', 'Detén a la Llama Hendida en la Cámara Azur.', 'Tenemos un problema, $n.\n\nBajo el Archivo Azur se encuentra la Cámara Azur. A lo largo de mi vida, he almacenado allí importantes y peligrosas curiosidades mágicas.\n\nUn gran grupo de la Llama Hendida ha irrumpido en la cámara, convencidos de que alberga algún secreto.\n\nDebes entrar ahí y detener este asalto antes de que liberen peligros que no comprenden.\n\nEsos ladrones no saben lo que hay dentro.', '', '', '', '', '', '', 47187),
(71153, 'esES', 'Misión del mundo, objetivos de bonificación y escenarios increíbles', 'Completa 3 misiones del mundo de los tortolianos.', 'Completa 3 misiones del mundo para ayudar a los tortolianos.', '', '', '', '', '', 'Vuelve con el recolector Kajo.', 47187),
(71152, 'esES', 'De vuelta a la cámara principal', 'Reúnete con Toddy en la cámara principal.', 'Ahora que hemos accedido a las consolas de anulación, deberíamos poder atravesar esa barrera.\n\n¡Reúnete conmigo en la cámara principal y acabemos con esto!', '', '', '', '', '', '', 47187),
(71151, 'esES', 'Seguir explorando las puertas', 'Reúnete con Thaelin Yunquenegro en la Avanzada Escama Rubí, que está en las Orillas del Despertar.', '<La carta está limpia y su escritura es de lo más nítida. Además, lleva el sello de la Expedición Dragontina.\n\nThaelin Yunquenegro solicita tu presencia>.', '', '', '', '', '', '', 47187),
(71150, 'esES', 'Seguir explorando las puertas', 'Reúnete con Thaelin Yunquenegro en la Avanzada Escama Rubí, que está en las Orillas del Despertar.', '<El papiro desprende un desagradable olor a moho. Tras hacer un esfuerzo por recuperar la concentración, queda claro que Thaelin necesita tu ayuda para encontrar nuevas respuestas.\n\nLa única pregunta que queda es qué hacer con este papiro tan apestoso>.', '', '', '', '', '', '', 47187),
(71149, 'esES', 'Seguir explorando las puertas', 'Reúnete con Thaelin Yunquenegro en la Avanzada Escama Rubí, que está en las Orillas del Despertar.', '<Sorprendentemente, esta vez el mensajero no te ha dejado una mochila ni una nota, sino un objeto de la colección personal de Thaelin.\n\nAl investigarlo más a fondo, encuentras un pequeño mensaje suyo donde te pide ayuda>.', '', '', '', '', '', '', 47187),
(71148, 'esES', 'Seguir explorando las puertas', 'Reúnete con Thaelin Yunquenegro en la Avanzada Escama Rubí, que está en las Orillas del Despertar.', '<La curiosa criatura que tienes ante ti te hace entrega de una nota firmada y sellada por la Expedición Dragontina.\n\nQuizás sea una petición de ayuda de algún afamado explorador>.', '', '', '', '', '', '', 47187),
(71146, 'esES', 'Seguir explorando las puertas', 'Reúnete con Thaelin Yunquenegro en la Avanzada Escama Rubí, que está en las Orillas del Despertar.', '<El expedicionario en instrucción te entrega una nota enrollada. Al investigarla, descubres que es de un viejo amigo, Thaelin Yunquenegro, que necesita tu ayuda.\n\nAntes de salir corriendo, la criatura extiende su mano como si pidiera un premio. Segundos después, suelta un fuerte chirrido y se aleja con las manos vacías>.', '', '', '', '', '', '', 47187),
(71145, 'esES', 'El gran maestro', 'Derrota a Patchu en un duelo de mascotas', '', '', '', '', '', '', '', 47187),
(71144, 'esES', 'El asesino de la Alianza', 'Mata 10 miembros de la Alianza sin morir y con una recompensa por tu cabeza.', '¡Bien! ¡Sigue así, no des tregua a esos perros de la Alianza!\n\nMata más miembros de la Alianza y acabarás en los libros de historia, $c.\n\nNo será fácil, ya que la Alianza ha puesto precio a tu cabeza, ¡así que ten cuidado!\n\n¡Por la Horda!', '', '', '', '', '', '', 47187),
(71143, 'esES', 'El asesino de la Horda', 'Mientras la Horda te da caza, mata 10 miembros de la Horda sin morir.', '¡Guau! ¡Sigue así, soldado!\n\nMata más miembros de la Horda y acabarás en los libros de historia de la Alianza.\n\nNo será fácil, ya que la Horda ha puesto precio a tu cabeza, ¡así que ten cuidado!\n\n¡Por la Alianza!', '', '', '', '', '', '', 47187),
(71141, 'esES', 'Agallas canallas', 'Mata a Gurblbrblr el Invasor en el Campamento Gotarrisco.', 'Kad\'irsza es imprudente, pero conoce a sus cangrejos. ¡Los górlocs han ido demasiado lejos!\n\nMe he dado cuenta de que los górlocs siguen las órdenes de Gurblbrblr. Les está ordenando apresar a los cangrejos. No podemos permitir que esto continúe, por el equilibrio de la vida y la seguridad de los que la atienden.\n\nDerrota a Gurblbrblr. ¡Impide que puedan expandirse más allá del río!', '', '¿Górlocs de tamaño repugnante? Desde luego.', 'Gurblbrblr el Invasor', '', '', '', 47187),
(71140, 'esES', 'Dos y dos juntos', 'Derrota a Bakhushek en un duelo de mascotas.', '', '', '', '', '', '', '', 47187),
(71139, 'esES', 'Joya Arcana resplandeciente', 'Llévale la joya Arcana resplandeciente a Noriko la Omnisciente, que está en el Campamento de Antonidas.', '<Esta gema parece bastante poderosa. Tiene un brillo inquietante.\n\nQuizá sea mejor entregársela al Kirin Tor para que la guarden en un lugar seguro>.', '', '', '', '', '', 'Llévale la joya Arcana resplandeciente a Noriko la Omnisciente, que está en el Campamento de Antonidas.', 47187),
(71138, 'esES', 'Puerta: Trecho de Rusza\'thar', 'Encuentra la puerta latente en el Trecho de Rusza\'thar de las Llanuras de Ohn\'ahra.', 'Un miembro de la expedición ha informado del avistamiento de una piedra latente en las Llanuras de Ohn\'ahra.\n\n¿Te animas a una aventura?', '', '', '', '', '', '', 47187),
(71135, 'esES', 'Cabos sueltos', 'Enfréntate a Muerdefrío en el Campamento Nievepiel, que está en las Tierras Azures.', 'Si algo he aprendido de mi estancia en la naturaleza, es que si te topas con un mal y no le rompes los huesos y le arrancas las raíces, seguirá creciendo. Y luego será más complicado eliminarlo.\n\nEstas montañas ya sufrían la amenaza de Muerdefrío cuando yo era un cachorro como tú, y la cosa solo irá a peor cuando se haga con el control de la tribu Nievepiel.\n\nDebí hacer algo al respecto hace mucho tiempo, pero ahora somos los únicos capaces de enmendar ese error.', '', 'Es hora de poner fin al cruel reinado de Muerdefrío.', 'Muerdefrío', '', '', '', 47187),
(71097, 'esES', 'Una zarpa amiga', 'Activa el artefacto en la torre que hay sobre la Galería Cobalto y vigila las acciones de Venderthvan.', 'Bien, has cargado el artefacto. Vamos a encenderlo...\n\nY deja de mirarme así. No hagas como si no tuvieras curiosidad por ver si funciona. \n\nDale otra sacudida, retírate despacio y déjame terminar el trabajo.', '', '', '', '', '', '', 47187),
(71096, 'esES', 'Una zarpa en la necesidad', 'Intenta activar el artefacto.', '<Venderthvan se frota los ojos y gruñe de dolor>.\n\nVale. Si no quieres dármelo, descubre por tu cuenta cómo hacer que funcione. \n\nTe lo arrebataré cuando hayas acabado. Por la fuerza, si es necesario.\n\nAsí que adelante. Sacúdelo o algo.', '', '', '', '', '', '', 47187),
(71095, 'esES', 'Una zarpa en apuros', 'Pregunta a Venderthvan cómo puedes ayudarlo y haz lo que te pida.', '¡Veamos qué podemos hacer para ayudar a este tipo!\n\n<Heleth se inclina y te susurra>.\n\nNo te preocupes, no vamos a dejar que se lleve nada ni cosas así. ¡Vamos a divertirnos!\n\nHace siglos que nadie viene por aquí para ver cómo nos va. ¡Estamos MUY aburridos!\n\n<Heleth te guiña un ojo>. \n\n¿Por qué no le preguntas lo que quiere?', '', '', '', '', '', '', 47187),
(71094, 'esES', '¡Siempre ayudamos!', 'Encuentra vendas en la torre que hay sobre la Galería Cobalto para sanar a Venderthvan.', '¡Hola! \n\n¿También has venido a ayudar? ¡Tienes pinta de ser útil!\n\n<Heleth señala al dracthyr herido>.\n\t\t\t\nEste se ha hecho daño en el ala tratando de volar hasta aquí. Parece uno de esos tipos malos de abajo, ¡pero no me da miedo! Lo ayudaré de todas formas, porque así somos nosotros.\n\n<Heleth saca pecho>. \n\t\t\t\n¡Yo lo vigilaré mientras tú me buscas unas vendas!', '', '', '', '', '', '', 47187),
(71093, 'esES', 'Legado de Tyr: secretos del pasado', 'Entra en Uldaman: Legado de Tyr, que está en las Tierras Inhóspitas, y recupera el disco.', 'Debemos restaurar el poder de los Aspectos para impedir que Raszageth libere al resto de Encarnaciones.\n\nPor desgracia, los titanes están bastante preocupados y el guardián Tyr murió hace mucho tiempo.\n\nLa reina Alexstrasza ha propuesto un plan. En lo profundo de las Tierras Inhóspitas hay una instalación titánica llamada Uldaman. Al parecer, es posible que los aliados de Tyr hayan escondido allí un disco con sus recuerdos.\n \nDicen que los troggs han invadido el lugar. ¡Reúne a tus aliados, dirígete a Uldaman y consigue el disco en nombre de la reina de dragones!', '', '', '', '', '', '', 47187),
