(71030, 'esES', 'Tácticas de caza: tutelaje Shikaar', '', '', '', '', '', '', '', '', 47187),
(71029, 'esES', 'Tácticas de caza: entrenamiento de compañero', 'Elige una facultad de compañero adicional para usarla durante la gran cacería.', 'Tu renombre con los Maruuk sigue creciendo. Por tus esfuerzos, te enseñaré a comandar a tu compañero de caza con mayor eficacia durante el combate.', '', '', '', '', '', '', 47187),
(71028, 'esES', 'Tácticas de caza: bendición de Ohn\'ahra', 'Selecciona una bendición de Ohn\'ahra para usarla durante la gran cacería.', 'Tu renombre con los Maruuk crece. Escucha con atención y te enseñaré a invocar una bendición de Ohn\'ahra para que os proteja a ti y a tus aliados.', '', '', '', '', '', '', 47187),
(71027, 'esES', 'SE BUSCA: Mara\'nar el Atronador', 'Mata a Mara\'nar el Atronador en el Valle Primordial y recupera una de sus placas.', '¡Se busca a un poderoso cazador para acabar con una bestia desenfrenada!\n\nUn truenagarto llamado Mara\'nar el Atronador se ha abierto camino desde el Zarzal Espinatrueno hasta el Valle Primordial, alterando la fauna local. Ha electrificado el agua, derribado árboles y destruido nidos de pato.\n\nHay que detener esta amenaza. Mátalo y lleva una de sus placas al guardián del khan Jebotai como prueba.\n\nQue Ohn\'ahra te guíe.', '', 'Esta bestia perturba la fauna local del Valle Primordial y ha destruido demasiados nidos de pato.', 'Mara\'nar el Atronador', '', '', '', 47187),
(71026, 'esES', 'Contra toda adversidad', 'Mata a 25 jugadores de la Horda de nivel 70 o más en cualquier parte de las Islas Dragón.', 'Aunque algunos de vosotros, mortales insignificantes, hayáis acordado una tregua, tengo entendido que hay quien todavía alberga algún rencor.\n\nSi reúnes a algunos amigos, sé de un lugar en el que podrás mostrar qué bando es el que manda.\n\nY para que todo sea más interesante, si tienes éxito, te haré un regalito.', '', '', '', '', '', '', 47187),
(71024, 'esES', 'Caos y revuelo', 'Ayuda a Erima a investigar el incidente en la planta baja del Trono de los Aspectos.', '¡$n! ¿Has oído ese ruido? Ha habido un incidente en la planta baja.\n\nUno de mis investigadores de confianza, Erima, ya estaba ahí. Necesitará ayuda para reunir pruebas mientras intenta entrevistar a la multitud.', '', '', '', '', '', '', 47187),
(71023, 'esES', 'Renombrado con el Acuerdo de Valdrakken', 'Habla con Unatos en Valdrakken.', 'Tus hazañas coinciden con tu legendaria reputación previa a tu llegada a las Islas Dragón.\n\nMe gustaría ayudarte más proporcionándote suministros adicionales. Búscame en Valdrakken.', '', '', '', '', '', '', 47187),
(71022, 'esES', 'Reino de los carneros', 'Ordena a Taivan que se enfrente al carnero obcecado de la manada.', 'Como los argalíes no parecen tener mucho respeto por Taivan, deberíamos ver si puede con el carnero del rebaño.\n\nEs el jefe de todos los argalíes, y bastante testarudo. Si Taivan puede dominar al carnero, el rebaño empezará a obedecerle.\n\nLo encontrarás justo allí, en la colina. Buena suerte, Taivan. Si esto no funciona, me temo que no hay mucha esperanza de que se convierta en pastor.', '', '', '', '', '', '', 47187),
(71020, 'esES', 'Cámara de las Encarnaciones: Vamos a romper algunos huevos', 'Consigue 3 fragmentos del gran bastón de la vigilante de linaje Dyurna en la Cámara de las Encarnaciones en dificultad mítica.', 'La vigilante de linaje Dyurna está en algún lugar de esta fortaleza, custodiando la cámara desde sus aposentos. Si logras hacerte con piezas de su gran bastón, podremos asaltar su guarida directamente.\n\nCon tres fragmentos nos bastaría; cuatro me parece excesivo.', '', '', '', '', '', '', 47187),
(71019, 'esES', 'Cámara de las Encarnaciones: Vamos a romper algunos huevos', 'Consigue 3 fragmentos del gran bastón de la vigilante de linaje Dyurna en la Cámara de las Encarnaciones en dificultad heroica.', 'La vigilante de linaje Dyurna está en algún lugar de esta fortaleza, custodiando la cámara desde sus aposentos. Si logras hacerte con piezas de su gran bastón, podremos asaltar su guarida directamente.\n\nCon tres fragmentos nos bastaría; cuatro me parece excesivo.', '', '', '', '', '', '', 47187),
(71018, 'esES', 'Cámara de las Encarnaciones: Vamos a romper algunos huevos', 'Consigue 3 fragmentos del gran bastón de la vigilante de linaje Dyurna en la Cámara de las Encarnaciones en dificultad normal.', 'La vigilante de linaje Dyurna está en algún lugar de esta fortaleza, custodiando la cámara desde sus aposentos. Si logras hacerte con piezas de su gran bastón, podremos asaltar su guarida directamente.\n\nCon tres fragmentos nos bastaría; cuatro me parece excesivo.', '', '', '', '', '', '', 47187),
(71017, 'esES', 'Carta de Naluki', 'Entrega la cabeza de pescado de Naluki al viejo Colmigrima.', 'A ver si lo adivino, Colmi te dijo que no abrieras la carta, ¿verdad?\n\nParece que cumpliste sus órdenes; ¡no me extraña que confíe tanto en ti! \n\nDale esta cabeza de pez de mi parte. Él sabrá lo que significa.', '', '', '', '', '', 'Entrega la cabeza de pez de Naluki a Colmigrima.', 47187),
(71016, 'esES', 'Hermana de Colmigrima', 'Entrega la carta de Colmigrima a su hermana Naluki, que está en Iskaara.', 'La última es mi hermana, Naluki. Ahora ayuda a llevar la posada de Iskaara.\n\nDale esta carta. \n\nNo la abras.', '', '', '', '', '', 'Entrega la carta de Colmigrima a su hermana Naluki, que está en Iskaara.', 47187),
(71015, 'esES', 'Mucho músculo, poco cerebro', 'Encuentra a Varsek en el Mirador Antiguo.', 'Varsek es uno de los dracónidos más duros que conocerás jamás. Y uno de los más estúpidos, aunque nunca lo admitirá.\n\nDespués de lo de Muerdefrío, se asustó y comenzó a replantearse la vida... o algo así. Dijo que nunca había podido estudiar las ruinas que dejaron sus ancestros, así que huyó y se convirtió en \"erudito\".\n\nTráelo de vuelta. ¡Ese lugar no le corresponde!', '', '', '', '', '', 'Encuentra a Varsek en el Mirador Antiguo.', 47187),
(71014, 'esES', 'Un amigo fúrbolg lejano', 'Encuentra a Barst en la Isla Garralarga.', 'Barst era uno de los fúrbolgs más duros que he conocido. No es moco de pavo que la manada de Muerdefrío lo derrotara en una pelea.\n\nLo último que sé de él es que partió hacia una isla frente a la costa de Iskaara. Decía que se \"jubilaba\" o no sé qué estupidez parecida.\n\nDile a Barst que es hora de volver a la acción.\n\nAh, y no te dejes engañar por su forma de hablar. Es capaz de hacerte pedazos si lo miras mal.', '', '', '', '', '', 'Encuentra a Barst en la Isla Garralarga.', 47187),
(71013, 'esES', 'Nada de vengarse con el estómago vacío', 'Pesca $2oa dardos de cola congelada en el Escondrijo de Colmigrima.', 'Ahora que hemos vuelto a centrarnos en nuestro objetivo, tenemos que hablar con los colmillos de frente. ¿Te acuerdas de Muerdefrío, ese gnoll con el que hablaste?\n\nHan pasado cosas entre nosotros.\n\nPuede que tarde un poco en explicarlo. Tú ve y consigue algo de pescado mientras hablo, joven. Tenemos que alimentar a todo el mundo. Necesitan fuerzas para el siguiente paso.', '', '', '', '', '', '', 47187),
(71012, 'esES', 'Varsek reclutado', 'Informa a Colmigrima de que has reclutado a Varsek.', 'Parece que seré capaz de resolver los misterios de este lugar sin problemas en el futuro. \n\nNo hace falta que le contemos esto al viejo Colmigrima, ¿vale?\n\nMe dirigiré a su escondrijo. Creo que disfrutaré soltando algo de agresividad acumulada contra Muerdefrío.', '', '', '', '', '', 'Vuelve con Colmigrima.', 47187),
(71011, 'esES', 'Se busca: lirio torrencial', 'Encuentra el lirio torrencial.', '<El cartel está escrito con una bonita caligrafía>.\n\nLos archivistas solicitan humildemente que todos los miembros de la expedición busquen el lirio torrencial para nuestro archivo de artefactos.\n\nQuien lo consiga, que lo entregue a la catalogadora Jakes para procesarlo y recibir compensación por su labor.\n\nAlgunos miembros de la expedición afirman haber avistado a una poderosa primalista en el Mirador Gelikyr de Thaldraszus con una flor mágica en el cuello. Desconocemos si se trata del legendario lirio torrencial, pero es un buen punto de partida.', '', 'Un poderoso primalista acuático de Thaldraszus lleva el lirio torrencial en su caperuza.', 'Alora Nieblabruma', '', '', 'Vuelve con la catalogadora Jakes, que está en el Campamento Base Dragontina.', 47187),
(71010, 'esES', 'Se busca: catalejo temporal', 'Encuentra el catalejo temporal.', '<El cartel está escrito con una bonita caligrafía>.\n\nLos archivistas solicitan humildemente que todos los miembros de la expedición busquen el catalejo temporal para nuestro archivo de artefactos.\n\nQuien lo consiga, que lo entregue a la catalogadora Jakes para procesarlo y recibir compensación por su labor.\n\nMiembros de la expedición informan de que un enano presumía de este catalejo mágico en las tabernas del sur de Thaldraszus. Recomendamos centrar la búsqueda en esa región.', '', 'Un oteador primalista de Thaldraszus usa el catalejo temporal para planear su próximo ataque.', 'Oteador Mordren', '', '', 'Vuelve con la catalogadora Jakes, que está en el Campamento Base Dragontina.', 47187),
(71009, 'esES', 'Elemental, mi querido dracónido', 'Ayuda a Varsek a resolver el misterio del Mirador Antiguo.', 'Colmigrima quiere darle otra vez a Muerdefrío, ¿eh? Lamento decepcionarlo, pero dejé esa vida atrás para convertirme en erudito.\n\nEstoy tratando de estudiar la historia... y de hacerla, pero me he topado con este acertijo esotérico en estas ruinas antiguas.\n\nLa cosa va así: si tocas un cristal que hay aquí cerca, dice \"sigue el patrón\". ¡Pero no tengo ni idea de lo que significa!\n\n¿Sabes qué? Si me ayudas a descifrarlo, ayudaré a Colmigrima a acabar con Muerdefrío de una vez por todas.', '', '', '', '', '', '', 47187),
(71008, 'esES', 'Se busca: corazón de piedra de Corazón Pétreo', 'Encuentra el corazón de piedra de Corazón Pétreo.', '<El cartel está escrito con una bonita caligrafía>.\n\nLos archivistas solicitan humildemente que todos los miembros de la expedición busquen el corazón de piedra de Corazón Pétreo para nuestro archivo de artefactos.\n\nQuien lo consiga, que lo entregue a la catalogadora Jakes para procesarlo y recibir compensación por su labor.\n\nMiembros de la expedición afirman haber visto a Corazón Pétreo en una cueva situada en el centro de las Tierras Azures.', '', 'Corazón pétreo guarda su corazón pétreo en... Bueno, esa parte probablemente la puedas deducir.', 'Corazón pétreo', '', '', 'Vuelve con la catalogadora Jakes, que está en el Campamento Base Dragontina.', 47187),
(71004, 'esES', 'Se busca: tótem vinculador masivo de ohunas', 'Encuentra el tótem vinculador masivo de ohunas.', '<El cartel está escrito con una bonita caligrafía>.\n\nLos archivistas solicitan humildemente que todos los miembros de la expedición busquen el tótem vinculador masivo de ohunas para nuestro archivo de artefactos.\n\nQuien lo consiga, que lo entregue a la catalogadora Jakes para procesarlo y recibir compensación por su labor.\n\nAlgunos miembros de la expedición han informado de la presencia de un primalista especialmente poderoso en el Alto Son del Viento de las Llanuras de Ohn\'ahra, el cual parece controlar los poderes de este tótem.', '', 'Un primalista de aire de las Llanuras de Ohn\'ahra blande el tótem vinculador masivo de ohunas.', 'Prozela Tirovendaval', '', '', 'Vuelve con la catalogadora Jakes, que está en el Campamento Base Dragontina.', 47187),
(71002, 'esES', 'El mejor hechizo de la historia', 'Lee \"Tormentas de maná para principiantes\" y descubre el hechizo secreto de Molino.', '<Este libro, que levita suavemente y emite magia Arcana, contiene innumerables hechizos y encantamientos creados por la bella aunque caótica mente de Molino Tormenta de Maná>.', '', '', '', '', '', '', 47187),
(71001, 'esES', 'Se busca: núcleo primordial vinculado a la tierra', 'Encuentra el núcleo primordial vinculado a la tierra en Neltharus.', '<El cartel está escrito con una bonita caligrafía>.\n\nLos archivistas solicitan humildemente que todos los miembros de la expedición busquen el núcleo primordial vinculado a la tierra para nuestro archivo de artefactos.\n\nQuien lo consiga, que lo entregue a la catalogadora Jakes para procesarlo y recibir compensación por su labor.\n\nLos registros recuperados de la Ciudadela Obsidiana indican que pudo haber estado almacenado en el Tesoro Oculto del Dragón de Neltharus, aunque su ubicación actual es incierta.', '', 'Se rumorea que el núcleo se perdió en El Tesoro Oculto del Dragón de Neltharus.', 'Núcleo primordial vinculado a la tierra', '', '', 'Vuelve con la catalogadora Jakes, que está en el Campamento Base Dragontina.', 47187),
(71000, 'esES', 'Barst reclutado', 'Informa a Colmigrima de que has reclutado a Barst.', 'Bueno, un trato es un trato. Si Colmigrima necesita una mano para matar a Muerdefrío de una vez por todas, me apunto.\n\nEl odio que pueda quedar en mi corazón, lo reservo para Muerdefrío. ¿Colmigrima te contó lo que ocurrió? \n\nTodos los que cazábamos con Colmigrima creíamos que éramos imparables, hasta que nos topamos con Muerdefrío. \n\nNo solo nos derrotó: nos humilló delante de todos. \n\nFuimos derrotados y dejados ensangrentados y maltrechos en el escondrijo. Muerdefrío nos usó como ejemplo.\n\nEs hora de la venganza.', '', '', '', '', '', 'Vuelve con el viejo Colmigrima.', 47187),
(70996, 'esES', 'Una pequeña alga para mis amigos', 'Derrota al elemental de algas salvaje en Isla Garralarga.', 'Vaya, parece que Colmigrima está en un aprieto. Estoy hasta el gorro de los conflictos del continente, pero...\n\nHan pasado cosas entre Muerdefrío y yo. Hay cuentas que ajustar.\n\nQué demonios, no puedo dejar indefensos a los demás... Tenemos problemas con un elemental que está causando estragos en la playa. Solo yo puedo mantenerlo a raya. Es un bicho escurridizo... Literalmente.\n\nMira, encárgate de ese elemental por mí y yo me daré un garbeo por el campamento de Colmigrima.\n\n¿Qué te parece, colega?', '', '¡En marcha!', 'Elemental de algas', '', '', '', 47187),
(70995, 'esES', 'Se busca: calavera de Fenistrasza', 'Encuentra la calavera de Fenistrasza.', '<El cartel está escrito con una caligrafía preciosa>.\n\nLos archivistas solicitan humildemente que todos los miembros de la expedición busquen la calavera de Fenistrasza para nuestro archivo de artefactos.\n\nQuien la consiga, que la entregue a la catalogadora Jakes para procesarla y compensar por la labor.\n\nAlgunos miembros de la expedición han informado de que la vieron en manos de un djaradin desterrado en las montañas del oeste, pero nadie ha podido convencerlo de que se desprenda de ella.', '', 'Un solitario djaradin guarda el cráneo encantado en su alcoba.', 'Tarjin el Ciego', '', '', 'Vuelve con la catalogadora Jakes, que está en el Campamento Base Dragontina.', 47187),
(70994, 'esES', 'Soluciones de drenaje', 'Succiona $1oa corrientes brillantes en la cueva este de las Ruinas de la Cámara de la Vida.', '¿Quieres el honor de ayudar a la famosísima geóloga jefa de la Expedición Dragontina? Eso es. Soy exactamente quien crees que soy. ¡Y estoy en un aprieto!\n\nEstaba examinando este río en busca de nuevas muestras sedimentarias, ¡pero entonces el agua arrastró los trozos de limo más interesantes!\n\nTengo aquí mi dispositivo patentado de captación de agua, pero necesita desesperadamente que alguien vaya y succione esos elementales.\n\n¿Crees que estás a la altura de la tarea?', '', '', '', '', '', '', 47187),
(70992, 'esES', 'Se busca: cometa colmillarr perdida', 'Encuentra la cometa colmillarr perdida.', '<El cartel está escrito con una caligrafía preciosa>.\n\nLos archivistas solicitan humildemente que todos los miembros de la expedición busquen la cometa colmillarr perdida para nuestro archivo de artefactos.\n\nQuien la consiga, que la entregue a la catalogadora Jakes para procesarla y compensar por la labor.\n\nAlgunos miembros de la expedición han informado de una cometa sujeta a un transporte colmillarr a lo largo de la costa occidental, pero nadie ha podido alcanzarla, pues el transporte la mantiene en el aire y fuera del alcance mientras se mueve.', '', 'La cometa vuela orgullosa detrás del Arvillo Perdido mientras se mueve...', 'La cometa colmillarr perdida', '', '', 'Vuelve con la catalogadora Jakes, que está en el Campamento Base Dragontina.', 47187),
(70990, 'esES', 'La lana es el camino', 'Esquila a los argalíes pezuñarrisco por su lana.', 'Aunque la mayoría de nuestra lana procede de nuestros propios rebaños de argalíes, a veces tenemos que recurrir a las criaturas salvajes cuando los nuestros escasean.\n\nPuedes encontrar argalíes salvajes en las llanuras cercanas. Suelen ser más temperamentales que el rebaño de nuestro clan. Si pudieras tomar esta hoja e intentar esquilar su lana, harías un gran servicio a los Aylaag.', '', '', '', '', '', '', 47187),
(70989, 'esES', 'Parte de una manada', 'Caza al draco voraz con Taivan y la manada de bakars de caza.', 'Quizá tu bakar necesite que los de su propia especie le enseñen a cazar.\n\nPuedes tomar prestados algunos de nuestros bakars adiestrados. Llévatelos y acaba con el draco que merodea por la zona. \n\n¡Veamos cómo se desenvuelve Taivan en una manada!', '', '', '', '', '', '', 47187),
(70987, 'esES', 'Corazones de almidón', 'Habla con Meliane Enorath en las Ruinas de la Cámara de la Vida, que está en las Orillas del Despertar.', '¿Qué puede haber que sea mejor que una comida que puedes llevar mientras exploras?\n\nLa comida callejera es la esencia de las ciudades bulliciosas de este gran mundo. Pero no todas las comidas son aptas. El secreto de los grandes platos para llevar es el almidón, puesto que se mantiene firme mientras te mueves. El pan, las patatas y el arroz, entre otras cosas, son la clave de este tipo de comida.\n\nMe gustaría invitar a mis compañeros pandaren a probar un sabroso ingrediente llamado acechamaíz. Bocado me lo enseñó cuando nos conocimos cerca de unas ruinas de los titanes en las Orillas del Despertar.', '', '', '', '', '', '', 47187),
(70986, 'esES', 'Soldado Shikzar', '', '', '', '', '', '', '', '', 47187),
(70985, 'esES', 'La exploradora solitaria', 'Habla con dríades en el Santuario Sombreado.', 'Lo sé, lo sé, es ridículo. ¿Un centauro y una dríade? No podemos ser más diferentes.\n\nPero desde que vi los Jardines Esmeralda, he querido conocer mejor a una de ellas. Lo que pasa es que no soy capaz de decir ni hacer nada para mantener su interés.\n\nHe oído que les gustan... las plantas. Y las crías de animales. Y quizá matar furtivos, pero ni siquiera sé por dónde empezar.\n\nTú puedes hablar con ellas, ¿no? ¿Podrías preguntarles y averiguar qué les interesa? Entonces tal vez tenga una oportunidad.', '', '', '', '', '', 'Vuelve con la exploradora Santuun.', 47187),
(70984, 'esES', 'Aniquilaolas', '', '', '', '', '', '', '', '', 47187),
(70983, 'esES', 'O\'nank Peinacostas', '', '', '', '', '', '', '', '', 47187),
(70981, 'esES', 'La mar de sabrosa', 'Habla con Wayun en el Rincón del Ballenero, que está en las Tierras Azures.', '¡Ah, qué olor a mar! ¿Lo notas, $n? ¿Hueles los minerales cargados con sal marina gruesa? ¿Eh?\n\nExiste una variedad poco común de pescado que probé hace tiempo cerca de Iskaara, en las Tierras Azures. Dos colmillarr estaban asando uno en un fuego y desprendía un olor de lo más delicioso por toda la tundra glacial.\n\nIntenta conseguir uno para nosotros. Sé que nuestros clientes quedarán tan embelesados por el sabor del mar como yo aquel día.', '', '', '', '', '', '', 47187),
(70979, 'esES', 'Magmatón', '', '', '', '', '', '', '', '', 47187),
(70978, 'esES', 'Relatos de campeones de las Islas Dragón', '', '', '', '', '', '', '', '', 47187),
(70977, 'esES', 'Paquetes de Despojito', '', '', '', '', '', '', '', '', 47187),
(70976, 'esES', 'Gandulear y deslizarse en trineo', 'Busca a Kiopo en la isla que está al sureste.', 'Como sabrás, los hijos de Iskaara son extremadamente independientes. Aprenden a valerse por sí mismos a una edad temprana.\n\nPara muchos de los críos mayores, escabullirse al iceberg que hay al sureste de aquí es un rito de iniciación. Kiopo, el mayor de nuestros hijos, está allí ahora mismo. Dile que te envié yo y te ofrecerá uno de nuestros trineos.\n\nAh, esto me recuerda a mis días de juventud con los amigos...', '', '', '', '', '', '', 47187),
(70972, 'esES', 'Nuestros leales y desgarbados corceles', '', '', '', '', '', '', '', '', 47187),
(70971, 'esES', 'Un arma para cada mano', '', '', '', '', '', '', '', '', 47187),
(70970, 'esES', 'Buenas intenciones', 'Detén a Alia Alzasol y destruye el artefacto Valthrux.', 'Puede que sepa dónde está el artefacto. Alia no dejaba de susurrar frenéticamente cuando trajiste todos los fragmentos.\n\nDecía algo sobre una cueva que parecía atraer a las arañas.\n\nNo hay ninguna cueva en la zona frente a nosotros, lo que me lleva a pensar que podría haber una en las profundidades de las ruinas.\n\n$n, nosotros nos quedaremos aquí para mantener abierta la ruta de escape. Tú salva a Alia y destruye ese artefacto maldito.', '', 'Esperemos llegar a tiempo, antes de que el artefacto consuma a Alia.', 'Valthrux', '', '', '', 47187),
(70969, 'esES', 'Miembro de nuestra comunidad', '', '', '', '', '', '', '', '', 47187),
(70968, 'esES', 'De la tela, de la comunidad', '', '', '', '', '', '', '', '', 47187),
(70967, 'esES', 'Entretenimiento con pececillos', '', '', '', '', '', '', '', '', 47187),
(70966, 'esES', 'Comerciar nunca fue tan fácil', '', '', '', '', '', '', '', '', 47187),
(70964, 'esES', '¡Que no falten las hombreras!', '', '', '', '', '', '', '', '', 47187),
(70963, 'esES', 'Apoyo para la muñeca', '', '', '', '', '', '', '', '', 47187),
(70962, 'esES', 'Un asiento cómodo', '', '', '', '', '', '', '', '', 47187),
(70961, 'esES', 'Con la armadura necesaria a hombros', '', '', '', '', '', '', '', '', 47187),
(70960, 'esES', 'El equipo del oficio', '', '', '', '', '', '', '', '', 47187),
(70959, 'esES', 'Bonito y achuchable', '', '', '', '', '', '', '', '', 47187),
(70958, 'esES', 'Los mejores hongos del festín', 'Habla con la capitana celadora Sinjoirmi en la Confluencia Temporal de Thaldraszus.', 'La buena cocina consiste en usar las mejores técnicas con los mejores ingredientes, como es natural. La comida pensada para la buena cocina suele costar una fortuna, pero en el Festín Rubí nunca permitiríamos eso.\n\nBocado me ha hablado de un ingrediente perfecto para el tema de hoy. Uno tan poco común y tan exquisito que... aún no existe. Tentador, ¿verdad?\n\nLos dragones bronce han descubierto un portal a un futuro peligroso. Uno donde existe una trufa negra con un sabor inimaginable.\n\n¡Tienes que ir!', '', '', '', '', '', '', 47187),
(70957, 'esES', 'El mar al oeste', 'Habla con Azucarillo en el Santuario Sombreado, que está en las Llanuras de Ohn\'ahra.', '¿Disfrutando de la vegetación que rodea nuestro paisaje, $n?\n\nMe recuerda a un plato que me ofrecieron un par de hermanas dríades y su amable amigo antárbol. Se llamaba Azucarillo. Un residente del Santuario Sombreado en la costa occidental de las llanuras.\n\nEra una mezcla de hierbas frescas, verduras y especias. En el centro del plato estaba la capa más deliciosa de algas marinas que haya probado jamás.\n\n¿Qué? ¿Nunca has probado las algas marinas? Solo tienes que ir a buscar unas pocas. ¡Y trae también para mí!', '', '', '', '', '', '', 47187),
(70956, 'esES', 'De escamas azures', '', '', '', '', '', '', '', '', 47187),
(70955, 'esES', 'Voladores fascinantes', '', '', '', '', '', '', '', '', 47187),
(70954, 'esES', 'Curiosidad creciente', '', '', '', '', '', '', '', '', 47187),
(70953, 'esES', 'Cubrecabezas colmillarr', '', '', '', '', '', '', '', '', 47187),
(70952, 'esES', 'Alijos ocultos o... abandonados', '', '', '', '', '', '', '', '', 47187),
(70950, 'esES', '¡Peces más grandes, aún más grandes!', '', '', '', '', '', '', '', '', 47187),
(70948, 'esES', '¡Gancho, sedal y calor!', '', '', '', '', '', '', '', '', 47187),
(70947, 'esES', 'Trambladd el Codicioso', '', '', '', '', '', '', '', '', 47187),
(70946, 'esES', 'Nadie debe blandirlo', 'Convence a Alia de que destruya a Valthrux.', 'Por lo que has encontrado, se diría que el poder del artefacto ha condenado a todo aquel que lo ha usado hasta ahora.\n\nLos dragauros que vivían aquí se mataron unos a otros por él. Parece que también está corrompiendo a la Llama Hendida.\n\nEste no es un artefacto que haya que recuperar; debemos destruirlo antes de que pueda dañar a nadie más.\n\nTenemos que convencer a Alia y a Kattigat.', '', '', '', '', '', '', 47187),
(70945, 'esES', 'Redes más llenas', '', '', '', '', '', '', '', '', 47187),
(70944, 'esES', 'Pesca en hielo', '', '', '', '', '', '', '', '', 47187),
(70943, 'esES', 'Arponeando, que es gerundio', '', '', '', '', '', '', '', '', 47187),
(70942, 'esES', 'Pesca en las Tierras Altas', '', '', '', '', '', '', '', '', 47187),
(70941, 'esES', 'Agujeros de pesca', 'Habla con Nunvuq en Iskaara, que está en las Tierras Azures.', '¡Hola de nuevo! ¿Sabías que voy a ser el mejor pescador de la aldea? Una vez pesqué una piraña gigante. ¡Quería comerme la cara!\n\n<Rowie mira a su alrededor con aire distraído>.\n\n¡Ah, sí! Tengo un mensaje para ti. Nunvuq ha vuelto a Iskaara y quiere hablar contigo sobre los agujeros de pesca.', '', '', '', '', '', '', 47187),
(70940, 'esES', 'Relatos de campeones colmillarr', '', '', '', '', '', '', '', '', 47187),
(70939, 'esES', 'Utensilios para cocinar', '', '', '', '', '', '', '', '', 47187),
(70938, 'esES', 'Festines comunitarios', 'Habla con Gran Kinook en Iskaara en las Tierras Azures.', '¡Aquí estás, $n! La sopa está lista.\n\nMás te vale darte prisa y llegar a Iskaara. Gran Kinook te ha estado buscando.\n\nUna vez me pidió que le diera un pez espinoso viscoso y asqueroso para la sopa y, como no quería, le grité: \"¡No, chef!\".\n\n¡Se enfadó tanto que pensé que iba a meterme en la sopa!', '', '', '', '', '', '', 47187),
(70937, 'esES', 'Lo que Valthrux fue antaño', 'Encuentra pistas sobre qué es en realidad el artefacto Valthrux.', '<To\'tik te susurra>. \n\nEsto no me gusta. Eso de que un artefacto misterioso te susurre promesas de grandeza no suena bien.\n\nPero no podemos hacernos a un lado. De lo contrario, la Llama Hendida se hará con él... Sea lo que sea.\n\nConozco este tipo de ruinas. Los dragones azules suelen dejar notas sobre su trabajo. Mantén los ojos bien abiertos y tal vez encuentres alguna.\n\nPodemos usar cualquier prueba que halles para avisar a Alia y a Kattigat.', '', '', '', '', '', '', 47187),
(70936, 'esES', 'Los tótems colmillarr robados', '', '', '', '', '', '', '', '', 47187),
(70935, 'esES', 'Pescar y soltar: dorado islaaleta', '', '', '', '', '', '', '', '', 47187),
(70932, 'esES', 'La vida de las especias', 'Habla con Griftah en el Trono Obsidiana.', 'Para muchos, la carne es esencial en cualquier comida de verdad. Pero ¿qué es lo esencial en un plato de carne?\n\n¡Las especias!\n\nEn estas islas existe una especia que supera a todas las demás en términos de sabor, textura y rareza. Por desgracia, solo se puede encontrar en los elementales que habitan en las profundidades del Bastión Obsidiana. Se trata de una zona ocupada por los Djaradin.\n\nQuizás puedas consultarlo con un trol peculiar que conocí mientras cruzaba por allí. Creo que se llamaba... Griftah.', '', '', '', '', '', '', 47187),
(70931, 'esES', 'Fragmentos susurrantes', 'Recupera $1oa fragmentos susurrantes de manos de la Llama Hendida.', 'Creo que Valthrux intenta comunicarse con nosotros a través del fragmento que recuperamos.\n\nPodemos usar esto a nuestro favor siempre que protejamos nuestra mente de la influencia del artefacto.\n\nMe equivoqué con respecto a la Llama Hendida. Por desgracia, ya han conseguido varios fragmentos. \n\nLos susurros de Valthrux indican que no les queda mucho para encontrar su ubicación.\n\n¡Ve y recupera los fragmentos de manos de la Llama Hendida antes de que lleguen al artefacto!', '', '', '', '', '', '', 47187),
(70930, 'esES', '\"Té\" lo digo en serio', 'Habla con Lilial Estallamanecer en el Valle Red Trémula.', 'La fiesta de hoy es una celebración del té: caliente, helado y de cualquier otra forma. Y con pastelitos y galletitas extravagantes.\n\nPero hay un ingrediente poco común de las islas que creo que podría darle una nueva dimensión de sabor. En lo más profundo de los dominios infestados de reptadores del Valle Red Trémula hay un maravilloso arbusto con la hoja más estimulante que existe: la sagittata muerdescarcha.\n\nLa Expedición Dragontina ha estado explorando la zona hace poco. Tal vez alguien allí te pueda ayudar, ¿no?', '', '', '', '', '', '', 47187),
