(70919, 'esES', 'Graznando a un héroe', 'Lleva el patito en burbuja de vuelta al campamento de los ecologistas.', '<Este patito lleva tanto en la burbuja que se ha quedado profundamente dormido. Grazna silenciosamente mientras ronca>.\n\n<Quizás los ecologistas sepan cómo ayudar>.', '', '', '', '', '', 'Lleva el patito en burbuja de vuelta al campamento de los ecologistas.', 47187),
(70918, 'esES', 'Grazna por tu vida', 'Lleva el patito en burbuja de vuelta al campamento de los ecologistas.', '<Este patito grazna frenéticamente. Si alguien no echa una mano, ¡los górlocs se van a cabrear!>.\n\n<Quizás los ecologistas sepan cómo ayudar>.', '', '', '', '', '', 'Lleva el patito en burbuja de vuelta al campamento de los ecologistas.', 47187),
(70917, 'esES', 'Un cuac sobre el que llorar', 'Lleva el patito en burbuja de vuelta al campamento de los ecologistas.', '<Este nervioso patito está lleno de energía. Parece que está deseando salir de este aprieto>.\n\n<Quizás los ecologistas sepan cómo ayudar>.', '', '', '', '', '', 'Lleva el patito en burbuja de vuelta al campamento de los ecologistas.', 47187),
