(70893, 'esES', 'El festín comunitario', 'Lleva a cabo $1oa tareas en el festín comunitario.', '¡El festín comunitario se está celebrando en este momento! Ahora todo el mundo colaborará para preparar la mejor sopa posible.\n\n¡Deberías participar!', '', '', '', '', '', '', 47187),
