(70883, 'esES', 'Echar una mano en el cultivo', 'Busca a Gryrmpech en los Jardines de la Unidad.', 'Saludos, mortal. Tengo noticias de nuestro jardinero jefe Gryrmpech. Me cuenta que los jardines están sumidos en el caos, pero no sé si eso es algo inusual.\n\nMe ha garantizado que lo tiene todo bajo control. Bueno, \"bajo la pala\" es la expresión que usó. No tengo claro qué significa, pero seguro que él te lo explicará como es debido. Por favor, ve a buscarlo y te equipará como es debido para esta situación.', '', '', '', '', '', '', 47187),
(70882, 'esES', 'Suministros de renombre', '', '', '', '', '', '', '', '', 47187),
(70880, 'esES', 'Las mejores galas para cocinar', '', '', '', '', '', '', '', '', 47187),
(70879, 'esES', 'Informe sobre los rebeldes', 'Reúnete con la capitana Drine en la planta superior del Trono de los Aspectos.', 'Estoy impresionado con lo que hemos logrado hoy. Espero que estés de acuerdo, $n.\n\nHemos logrado acabar con las nefastas actividades de estos rebeldes aliados de los Primalistas. Al menos, de momento. Tendremos que seguir vigilantes ante cualquier posible disidencia.\n\nVuelve con la capitana Drine en cuanto puedas. Querrá un informe completo.', '', '', '', '', '', '', 47187),
(70878, 'esES', 'Anillo de Fuego', 'Protege a Maldra Lenguallama mientras cierra el portal de los Primalistas.', 'Los Primalistas han abierto un portal ígneo en lo más profundo de la Caverna Pizarrascua, desde el que están surgiendo elementales.\n\nPuedo sellarlo, pero eso atraerá la ira de lo que sea que haya al otro lado, incluido el aparecido Magmaticus al que han estado ayudando los Primalistas.\n\nVoy a necesitar tu protección si queremos detenerlos.', '', 'Hay que acabar con ese aparecido de llamas desenfrenado antes de que los Primalistas lo dejen suelto en las Islas Dragón.', 'Magmaticus', '', '', '', 47187),
(70877, 'esES', 'Un cuac en el tiempo', 'Lleva el patito en burbuja de vuelta al campamento de los ecologistas.', '<Este desalentado patito grazna en silencio para sí mismo con la mirada aterrada>.\n\n<Quizás los ecologistas sepan cómo ayudar>.', '', '', '', '', '', 'Lleva el patito en burbuja de vuelta al campamento de los ecologistas.', 47187),
(70876, 'esES', 'Fracturar los focos', 'Destruye $1oa focos primalistas en la Caverna Pizarrascua.', 'Si Maldra está en lo cierto, los rebeldes están creando piedras rúnicas en la Caverna Pizarrascua.\n\nDada la naturaleza de estos dispositivos, sabemos que debe haber focos primalistas de por medio.\n\nDestrúyelos. Los reconocerás cuando los veas.\n\nNo podemos permitir que los rebeldes sigan creando armas de destrucción.', '', '', '', '', '', '', 47187),
(70875, 'esES', 'Lo peor de lo peor', 'Mata a $1oa rebeldes y a $2oa elementales en la Caverna Pizarrascua.', 'Los rebeldes de la Caverna Pizarrascua muestran una lealtad inquebrantable hacia los Primalistas y, por lo tanto, representan la mayor amenaza para Valdrakken.\n\nMátalos y elimina cualquier elemental que hayan liberado.', '', '', '', '', '', '', 47187),
(70874, 'esES', 'La brecha en el muro de fuego', 'Recibe la bendición elemental de Maldra.', 'Los rebeldes de la caverna han sido imbuidos de una bendición elemental que les permite atravesar el muro de llamas sin peligro. Te puedo conceder ese mismo don.\n\nNo te preocupes, he visto muchas veces cómo lo hacen. Debería poder hacerlo sin problemas.', '', '', '', '', '', '', 47187),
(70873, 'esES', 'Perseguir las cascadas', 'Cosecha $1oa motas de la cascada.', 'La verdadera amenaza se encuentra en la Caverna Pizarrascua. En ese lugar tallan las piedras rúnicas y las imbuyen de Fuego primigenio.\n\nSeguro que has visto el muro de llamas que bloquea la entrada. No puedo disiparlo. Sin embargo, quizás pueda hacer algo para ayudar. Creo que, con una aplicación adecuada de caudalo, podremos atravesarlo sin peligro.\n\nConsigue motas de agua de los elementales cercanos.', '', '', '', '', '', '', 47187),
(70871, 'esES', 'Red de pesca de Iskaara', 'Lleva materiales a Tavio para que te fabrique una red de pesca de Iskaara.', 'Veo que te llevas bien con los aldeanos.\n\n¿Quieres aprender cómo pescamos? Pues lo primero que debes saber es que nadie pesca con las manos. Te puedo fabricar una red de calidad y resistente, digna de los nativos de Iskaara.', '', '', '', '', '', '', 47187),
(70867, 'esES', 'Fortaleza del Azote Escamado', '', '', '', '', '', '', '', '', 47187),
(70859, 'esES', 'Lo que contempla el guardián', 'Recupera el fragmento susurrante de Edavix, el guardián corrupto.', 'Agradezco tu ayuda, $c. Yo fui la maga del Kirin Tor que descubrió el artefacto, Valthrux y los planes de la Llama Hendida.\n\nLa recuperación y el estudio de este artefacto supuestamente consciente y poderoso es de vital importancia, y recuerda mis palabras: seré yo quien lo haga.\n\nLa Llama Hendida intuye su ubicación, pero yo he usado mi magia para trazar una ruta para nosotros.\n\nHay un guardián corrupto cerca que posee un fragmento mágico conectado con Valthrux. Puedo usarlo para encontrar el resto del artefacto.', '', 'Un guardián corrupto por el poder de Valthrux. Posee los secretos para descubrir la ubicación del artefacto.', 'Edavix', '', '', '', 47187),
(70858, 'esES', 'De vuelta a la acción', 'Usa el antídoto frío como el hielo en Alia Alzasol.', 'Vale, el antídoto está listo. Yo sujeto a Alia y tú viertes el contenido del vial en su boca.\n\nEspero que viva... Necesitaremos su magia para rastrear el artefacto.', '', '', '', '', '', 'Habla con Alia Alzasol.', 47187),
(70856, 'esES', 'Mátalo con fuego', 'Destruye $1oa cadáveres infectados con la antorcha lanzallamas.', 'Estas viles arañas ponen sus huevos en cadáveres...\n\nY a veces también en los vivos.\n\nHemos visto varios cuerpos de miembros de la Llama Hendida que han caído ante ellas.\n\nSi queremos sobrevivir y derrotar a la Llama Hendida, no podemos permitir que eclosionen esos huevos.\n\nToma esta antorcha. Está imbuida del poder del aire y el fuego. Apunta hacia lo que quieras chamuscar y listo.\n\nLos colmillarr no nos andamos con chiquitas; he venido preparada.', '', '', '', '', '', '', 47187),
(70854, 'esES', 'Bueno, ¿cómo ha ido?', 'Vuelve con Jyhanna, que está en la Guardería de Crías, en Valdrakken.', 'Lo has hecho bien, $n. Loche ha mejorado mucho y está de un humor excelente. \n\nJyhanna querrá estar informada, ¡así que vuelve y dale la buena noticia!', '', '', '', '', '', '', 47187),
(70853, 'esES', 'Un amigo para Loche', 'Captura a una moscaesquiva en la Reserva Agreste, en las Orillas del Despertar.', 'Como te dije, Loche necesita dos cosas: un colega y un combate.\n\nCreo que podemos darle ambas cosas a la vez.\n\nEsta zona es un terreno de apareamiento primordial para las moscaesquivas. Si buscas un poco, seguro que encuentras algunas.\n\nRecuerda, tienes que debilitarlas antes de poder capturarlas con tu trampas.\n\nVuelve cuando hayas atrapado a una. Puede que esté un poco magullada tras la batalla, ¡pero tengo unas piedras de entrenamiento de duelo que la dejarán como nueva!', '', '', '', '', '', '', 47187),
(70851, 'esES', 'Nacido para ser más salvaje', 'Infórmate sobre lo que Loche necesita de Haniko.', 'Hay mucha información que necesitas saber. Vamos a hablar y luego decidiremos qué es lo mejor para Loche.', '', '', '', '', '', '', 47187),
(70850, 'esES', 'Maldra con el agua al cuello', 'Rescata a Maldra de Orian Aguaoscura.', 'Un trabajo excelente. Mientras hacías tu trabajo, yo he estado explorando el campamento. No esperaba encontrarme a mi vieja amiga Maldra Lenguallama.\n\nSabía que había desaparecido, pero los rumores decían que se había unido a los rebeldes. Aunque, por lo que he podido ver, la tienen prisionera.\n\nNo podemos dejarla aquí. ¡Rescátala de los dragauros!', '', 'El líder rebelde ha apresado a su prisionera, Maldra Lenguallama, con cadenas de Agua primigenia.', 'Orian Aguaoscura', '', '', '', 47187),
(70849, 'esES', 'Se necesita a un especialista', 'Habla con Haniko en la Reserva Agreste, que está en las Orillas del Despertar.', 'Loche ha mejorado muchísimo, pero creo que necesita más ayuda. \n\nHace poco conocí a una exploradora de la Expedición Dragontina superlista llamada Haniko que trabaja mucho con protodracos. También es instructora de mascotas. ¡Apuesto a que podría ayudar a Loche! \n\nCreo que se dirigía a las Orillas del Despertar. Si vas allí, seguro que la encontrarás. \n\n¡Me alegro de haber podido ayudarte! \n\n<Se despide alegremente con la mano>.\n\n¡Adiós! Buena suerte, Loche.', '', '', '', '', '', '', 47187),
(70848, 'esES', 'Blasón de dragón olvidado', 'Entrégale el objeto a Exadria.', '<Puede que Exadria quiera esto>.', '', '', '', '', '', '', 47187),
(70847, 'esES', 'Talismán de obsidiana antiguo', 'Entrégale el objeto a la acechagarra Kavia.', '<Puede que la acechagarra Kavia quiera esto>.', '', '', '', '', '', '', 47187),
(70845, 'esES', 'Tras los pasos de Tyr', 'Encuentra el primer desafío de Tyr en las Tierras Azures.', 'El guardián Tyr planeó cualquier imprevisto. Sospechaba que algún día sería necesario potenciar a los artesanos de Azeroth, por lo que creó el motor de innovación. El motor posee la facultad de crear un material único que puede hacer que un objeto alcance una calidad imposible para la capacidad de cualquier mortal.\n\nPara asegurarse de que el motor no cayera en malas manos, Tyr me creó con la misión de supervisar a quienes buscaran su poder. Solo quienes sean dignos podrán desbloquear todo su potencial.\n\n¿Estás a la altura del desafío?', '', '', '', '', '', 'Encuentra el primer desafío de Tyr en las Tierras Azures.', 47187),
(70843, 'esES', 'Arruinar las piedras rúnicas', 'Destruye alijos de piedras rúnicas incendiarias.', '<Esta piedra rúnica es muy parecida a la que el rebelde trató de colocar en Valdrakken.\n\nAunque está sin terminar, ves más alijos de piedras rúnicas completas a lo lejos.\n\nSi destruyes los alijos, los rebeles no podrán utilizarlos>.', '', '', '', '', '', '', 47187),
(70842, 'esES', 'Ubicaciones de detonación', 'Consigue mapas del Valle Calígine.', 'Estoy seguro de que los rebeldes están documentando sus planes para futuros ataques. Debemos descubrir qué planean antes de que puedan hacerlo.\n\nRegistra su campamento en busca de mapas marcados como el que encontramos en Valdrakken.', '', '', '', '', '', '', 47187),
(70841, 'esES', 'Más reliquias titánicas', '', '', '', '', '', '', '', '', 47187),
(70840, 'esES', 'Una reliquia titánica', '', '', '', '', '', '', '', '', 47187),
(70839, 'esES', 'La búsqueda de reliquias titánicas', '', '', '', '', '', '', '', '', 47187),
(70838, 'esES', 'Rebeldes con causa', 'Mata a $1oa rebeldes y primalistas.', 'La base de los rebeldes. Hemos estado buscando este lugar. Qué suerte que el saboteador nos guiara hasta aquí en su descuido.\n\nNo puedo creer que mis camaradas se rebajaran a trabajar con los Primalistas. Tenemos que hacer algo. Acaba con los rebeldes y sus amigos primalistas antes de que siembren el caos.', '', '', '', '', '', '', 47187),
(70837, 'esES', 'Seguir las pistas', 'Reúnete con el investigador Erima en el Valle Calígine.', '<El investigador Erima revisa el mapa>.\n\nEstá claro lo que representa la X en el Trono de los Aspectos.\n\nPero también hay un círculo dibujado alrededor del Valle Calígine. ¿Podría ser el próximo objetivo de los rebeldes? O quizá una base de operaciones.\n\nSolo hay una forma de averiguarlo. Reúnete conmigo en el valle.', '', '', '', '', '', '', 47187),
