(70790, 'esES', 'Diente de dragón pétreo', 'Entrégale el objeto a Emilia Bellocq.', '<Esto podría ser de interés para Emila Bellocq>.', '', '', '', '', '', '', 47187),
(70789, 'esES', 'Ala tallada con esmero', 'Entrégale el objeto a Emilia Bellocq.', '<Esto podría ser de interés para Emila Bellocq>.', '', '', '', '', '', '', 47187),
