(70783, 'esES', 'Skaara', '', '', '', '', '', '', '', '', 47187),
(70781, 'esES', 'Caída del cielo', 'Encuentra a Harleen Chirridos en los Riscos Plumazul.', '¡¿Has visto eso?!\n\n¡Esta criatura alada acaba de caer del cielo! No sé qué tipo de ser es, pero desde luego no es originario de las islas.\n\nEspera... Recuerdo que una pequeña goblin me pidió indicaciones para llegar a los Riscos Plumazul, que están justo encima de nosotros. ¿Crees que sabrá algo al respecto?', '', '', '', '', '', '', 47187),
(70780, 'esES', 'Los estandartes de Ohn\'ahra', '', '', '', '', '', '', '', '', 47187),
(70779, 'esES', 'Historias de Tarjin', 'Recoge $1oa calaveras de dragón impresionantes de dragones y protodragones poderosos de las Islas Dragón.', '<Tarjin sigue mirando a la isla lejana mientras te habla>.\n\n¿Te crees $gdigno:digna; de las increíbles leyendas e historias de los djaradin?\n\n¿Tú, que apenas tienes el tamaño de una de nuestras armas? Pfft.\n\nDudo que tengas el estómago para cargar el legado de mi gente.\n\nDemuestra que estoy equivocado, si es que puedes. Busca dragones, los únicos rivales dignos en estas islas.\n\nTráeme trofeos de tu victoria sobre los más fuertes.', '', '', '', '', '', '', 47187),
(70763, 'esES', 'A\'tir Trinchamundos', '', '', '', '', '', '', '', '', 47187),
(70754, 'esES', 'Apagar a los primalistas de fuego', 'Llévale el núcleo primigenio a Rethelshi.', 'Rethelshi agradecerá que le lleves esto a Valdrakken para contribuir a su investigación sobre los Primalistas.', '', '', '', '', '', '', 47187),
(70753, 'esES', 'Disipar a los primalistas de aire', 'Llévale el núcleo primigenio a Rethelshi.', 'Rethelshi agradecerá que le lleves esto a Valdrakken para contribuir a su investigación sobre los Primalistas.', '', '', '', '', '', '', 47187),
(70752, 'esES', 'Vaporizar a los primalistas acuáticos', 'Llévale el núcleo primigenio a Rethelshi.', 'Rethelshi agradecerá que le lleves esto a Valdrakken para contribuir a su investigación sobre los Primalistas.', '', '', '', '', '', '', 47187),
(70751, 'esES', 'Terillod el Devoto', '', '', '', '', '', '', '', '', 47187),
(70750, 'esES', 'Ayudar al Acuerdo de Valdrakken', 'Sigue trabajando para ayudar al Acuerdo de Valdrakken y a sus aliados en las Islas Dragón.', '¡Tú! Sí, te estoy hablando a ti. ¿Ves a alguien más por aquí?\n\n<Therazal mira de reojo a unos cuantos transeúntes>.\n\nEsos no cuentan. No tienen nada que ver con lo que voy a pedirte. ¡He oído hablar de ti y es contigo con quien quiero hablar!\n\nEl Acuerdo de Valdrakken me ha pedido que busque a quienes se están forjando una reputación en las islas y a quienes tienen como prioridad la seguridad de nuestros aliados.\n\nHaz lo que se te da mejor, $gamigo mío:amiga mía;. Se te recompensará generosamente.', '', '', '', '', '', '', 47187),
(70748, 'esES', 'Solo para tus ojos... azules', 'Busca las notas de Malygos en el Archivo Azur.', 'No me extraña que tus compañeros no hayan encontrado nada.\n\nEstos libros eran solo para ojos de los azules.\n\nSin embargo, mi presencia debería bastar para que algunos de los libros más pertinentes revelen sus secretos.', '', '', '', '', '', '', 47187),
(70747, 'esES', 'El mago azur', 'Habla con el archimago Khadgar en el Campamento de Antonidas.', 'No tengo tiempo para discutir con hechiceros.\n\nVe y trata con este \"archimago\", $p. Aprende cuanto puedas y mantente siempre en guardia. Podrían ser tanto aliados como enemigos...\n\nNuestros informes indican que hay un gran archivo al sur.\n\nAhí es adonde me dirijo.', '', '', '', '', '', '', 47187),
(70746, 'esES', 'Tonos de azul', 'Acompaña a Pavethal y a Telash al Campamento de Antonidas.', '¡Eh, $p!\nMe alegra ver una cara amigable en estos lugares. Telash y yo estábamos hablando de los informes que hemos recibido sobre los... recién llegados a la zona.\n\n<Pavethal baja la voz>.\n\nDragones azules.\n\nDada nuestra... historia con los azules, Telash y yo pensamos que era necesario evaluar la situación con nuestros propios ojos.\n\nPor favor, acompáñanos.', '', '', '', '', '', '', 47187),
(70745, 'esES', 'Relajación forzosa', 'Mata a la invocadora de elementales.', 'Los primalistas que viste no tenían pinta de líderes. ¿Quién le va a tener miedo a un perrito? ¡Ja!\n\nSi han mencionado a Vadne, entonces significa que ella es su líder. Debe ser la responsable de la aparición de estos elementales. Debemos acabar con esa invocadora. Si son capaces de provocar tanto caos, entonces es que están cerca. Echa un vistazo en la cueva que tenemos debajo. Sé que algunos de los empleados menos diligentes van allí para tomarse un descanso algo más largo.', '', 'Esta primalista, una invocadora de vapor y llamas, prefiere cocinar vivos a sus enemigos.', 'Vadne Corazón Umbrío', '', '', '', 47187),
(70744, 'esES', '¡Mira qué huesos!', 'Limpia $1oa puntos del desastre.', '<Seguro que el gerente de la sauna agradecería que no hubiera sangre por todas partes>.', '', '', '', '', '', '', 47187),
(70743, 'esES', 'Bebé precioso', 'Encuentra al bebé de Elzara.', '¡Eh, $pr! ¿Eres más o menos competente?\n\n¿Cómo andas de prioridades?\n\n¡Bien!\n\nMi preciosa bebé ha desaparecido. Sálvala inmediatamente. Date prisa; no puede defenderse por sí sola en estas horribles circunstancias.', '', '', '', '', '', '', 47187),
(70742, 'esES', 'Es cosa de familia', 'Busca pistas sobre el pasado de los drachyr en el Observatorio Obsidiana.', 'Desde el aire, examiné uno de los artefactos que Edress descubrió junto a la entrada de las ruinas. Sin duda hay más dentro.\n\nEstán protegidos de alguna manera, aunque tendré que acercarme antes de poder examinarlos. La magia de aquí es muy antigua.\n\nLos terrenos parecen desiertos, pero no confiaría en que eso dure mucho cuando empecemos a entrometernos. Mantente alerta. Descubramos todo lo que podamos.', '', '', '', '', '', '', 47187),
(70741, 'esES', 'Algunas cosas favoritas', 'Recoge $1oa pertenencias perdidas.', '<Parece que la clase de youga se interrumpió y las pertenencias de los estudiantes están repartidas por todas partes.\n\nSi recoges estos objetos, ayudarás a la Sauna de Sueños Serenos>.', '', '', '', '', '', '', 47187),
(70740, 'esES', 'Limpieza al vapor', 'Mata a $1oa elementales en la sauna inferior.', 'Xijan parece pensar que la invasión de nuestra hermosa sauna por parte de los elementales es un problema menor, pero esta oleada de llamas y vapor debe ser controlada de inmediato.\n\nHemos contratado a unos músicos para que toquen en el nivel inferior, pero los elementales han destruido sus instrumentos. Como nunca hemos presenciado tal nivel de destrucción elemental en esta zona, sospecho que los Primalistas están detrás de esto.\n\nSi quieres ayudar, acaba con los elementales que hay en la parte oriental de la sauna inferior. Ahí es donde están programados los primeros conciertos.', '', '', '', '', '', '', 47187),
(70739, 'esES', 'Linajes, dulces y Teerai', 'Ayuda al cazador Narman a conseguir una bendición tradicional para su propuesta de matrimonio.', 'He cazado con khanes, he corrido más rápido que nuestro bakar más veloz y he luchado contra un toro brúfalo con las manos desnudas. Como cazador, no me queda nada que demostrar.\n\nSin embargo, como compañero, aún tengo mucho que aprender.\n\nEl sabio del viento Dawa, del Clan Ohn\'ir, es mi corazón y mi felicidad. Solo quiero demostrar que soy digno de su amor, pero no sé nada sobre tradiciones y rituales. Necesito la sabiduría de los ancianos de Maruukai.', '', '', '', '', '', 'Habla con el cazador Narman en la congregación Shikaar de Maruukai.', 47187),
(70738, 'esES', 'Clase de youga', 'Encuentra al instructor y a $1oa estudiantes de youga.', 'Todo iba bien, pero ya no. Los elementales están planteando algunos... desafíos menores.\n\nNuestros invitados estaban disfrutando de las instalaciones cuando, de repente, ¡aparecieron todos estos elementales! Esos malditos monstruos lo han estropeado todo. Puede que le hayan dado problemas al nuevo instructor de youga.\n\nOh, el youga es una nueva disciplina de estiramientos que también sirve para meditar. Seguro que el instructor y los estudiantes están tan relajados que ni se han fijado en los elementales.\n\nAun así, más vale prevenir que curar. Por favor, encuéntralos.', '', '', '', '', '', '', 47187),
(70732, 'esES', 'Un duelo de práctica', 'Derrota a Gwosh en un duelo de mascotas.', '¡Muy bien! Ahora que has usado esa piedra en Loche, pongamos a prueba sus habilidades en un duelo de práctica. \n\nEn la orilla al norte de aquí vive un gran cornisapo llamado Gwosh al que le encanta luchar. Bueno, jugar. ¡Y es muy bueno con las mascotas! \n\nSerá un juego... digo... combate perfecto para Loche.', '', '', '', '', '', '', 47187),
(70730, 'esES', 'Asignador Shikaar', 'Ayuda al sabio del viento Dawa a prepararse para la propuesta perfecta.', 'Oh, $p.\n\n¿Sientes como el sol te reconforta? ¿Te sientes a salvo en su abrazo luminoso? ¿Cada nuevo día representa esperanza para el futuro y una oportunidad de vivir tu vida como siempre has soñado?\n\nEntonces, como yo, sabes qué es el amor.\n\nNarman del Clan Shikaar es mi sol, mi calor, mi luz, mi esperanza.\n\nUn hombre como él merece una propuesta digna de su estatura.\n\nDebemos buscar el consejo de un Ohn.', '', '', '', '', '', '', 47187),
(70723, 'esES', 'Destrozar a los primalistas terráneos', 'Llévale el núcleo primigenio a Rethelshi.', 'Rethelshi agradecerá que le lleves esto a Valdrakken para contribuir a su investigación sobre los Primalistas.', '', '', '', '', '', '', 47187),
(70722, 'esES', 'Lo que Loche necesita', 'Habla con Patchu en Iskaara.', 'Creo que sé lo que tenemos que hacer, $n. \n\nPero hablemos de ello antes.\n\n¡Hasta tengo un regalo que darte cuando terminemos! Qué díver, ¿eh?', '', '', '', '', '', '', 47187),
(70721, 'esES', 'Mi corazón de Ohn', 'Ayuda al sabio del viento Dawa y al cazador Narman con sus propuestas.', 'Hay un pequeño estanque junto al Espejo del Cielo, donde Narman y yo nos conocimos durante mi instrucción.\n\nLos iniciados van allí para estar más cerca de Ohn\'ahra y sentir el viento. Lo vi en el reflejo del agua cuando una brisa repentina abrió mis ojos. Es el paisaje más hermoso de todas las llanuras.\n\nSerá el lugar perfecto para nuestra propuesta.', '', '', '', '', '', '', 47187),
(70720, 'esES', 'Nada de eso', '', '', '', '', '', '', '', '', 47187),
(70719, 'esES', 'Tajosombra Trakken', '', '', '', '', '', '', '', '', 47187),
(70717, 'esES', 'Dragonflight (70) E', '', '', '', '', '', '', '', '', 47187),
(70716, 'esES', 'Dragonflight (70) E', '', '', '', '', '', '', '', '', 47187),
(70715, 'esES', 'Dragonflight (70) E', '', '', '', '', '', '', '', '', 47187),
(70713, 'esES', 'Pesca en las tierras altas', '', '', '', '', '', '', '', '', 47187),
(70711, 'esES', 'La ruta avanzada de los rápidos del río', 'Atraviesa los anillos planeando.', 'Vuela a través de los anillos de control que marcan el recorrido.', '', '', '', '', '', '', 47187),
(70710, 'esES', 'La ruta de los rápidos del río', 'Atraviesa los anillos planeando.', 'Vuela a través de los anillos de control que marcan el recorrido.', '', '', '', '', '', '', 47187),
(70708, 'esES', 'Hueco', 'Toma un trago con Kolgar.', 'Parece que hubieran pasado años. Pero también es como si solo hubieran sido unos minutos.\n\nMe vendría bien alguien con quien hablar, si tienes tiempo.\n\n¿Te apetece ir a por una ronda? Pide lo que quieras, yo invito.', '', '', '', '', '', '', 47187),
(70706, 'esES', 'Puerta: Santuario Sombreado', 'Encuentra la puerta latente en el Santuario Sombreado de las Llanuras de Ohn\'ahra.', 'Nos hemos enterado de que hay una piedra latente en las exuberantes colinas del suroeste. Es un viaje bastante largo, pero merece la pena enviar a alguien con tus conocimientos a investigar.', '', '', '', '', '', '', 47187),
(70703, 'esES', 'El legado de Tyrhold', 'Investiga la escama de plata con Koranos en Tyrhold.', 'Al guardián Tyr le encantan los misterios. Está claro que el regalo que nos dio tiene un significado más profundo. Como es probable que forjara esta escama en su antigua ciudadela, quizá sea la clave para desvelar sus secretos.\n\nVe con Koranos hasta Tyrhold, $n. Como consejero de confianza y guardián de esta tierra, seguro que sabrá algo sobre este asunto.', '', '', '', '', '', 'Habla con Koranos en Tyrhold.', 47187),
(70702, 'esES', 'Seguir explorando las puertas', 'Reúnete con Thaelin Yunquenegro en la Avanzada Escama Rubí, que está en las Orillas del Despertar.', '<La estridente y fuerte llamada del pequeño mensajero capta tu atención. Te entrega una nota antes de salir corriendo.\n\nSe trata de una petición de ayuda de Thaelin Yunquenegro>.', '', '', '', '', '', '', 47187),
(70701, 'esES', '¿Sueñan los bakar con argalíes perdidos?', 'Devuelve a los argalíes perdidos al Clan Aylaag.', 'Algunos de los argalíes del clan han vuelto a alejarse del rebaño.\n\nEl risco que nos rodea es demasiado peligroso para que nuestros pastores se aventuren por ahí para buscarlos. Nos harías un enorme favor si te llevaras a uno de nuestros bakar y nos trajeses los argalíes. Nuestros pastores te dirán por dónde ir.', '', '', '', '', '', '', 47187),
(70698, 'esES', 'La investigadora Alaescape', '', '', '', '', '', '', '', '', 47187),
(70697, 'esES', 'Una opinión experta', 'Habla con Patchu en las Tierras Azures.', 'Puede que las heridas de Loche se hayan curado, pero no así su confianza. Creo que es hora de pedir ayuda.\n\nAl suroeste, en una sección remota de las Tierras Azures, hay una instructora de mascotas llamada Patchu. Es una de las mayores expertas del mundo en estos asuntos.\n\nPor favor, ve a verla, ¡seguro que puede ayudar a Loche!', '', '', '', '', '', '', 47187),
(70662, 'esES', 'Un pico pendiente', '', '', '', '', '', '', '', '', 47187),
(70659, 'esES', 'Catalogando las Llanuras de Ohn\'ahra', '', '', '', '', '', '', '', '', 47187),
(70658, 'esES', 'Artefacto o ficción', '', '', '', '', '', '', '', '', 47187),
(70653, 'esES', 'Ciencia bajo cero', '', '', '', '', '', '', '', '', 47187),
(70652, 'esES', 'Coge uno y pásalo', '', '', '', '', '', '', '', '', 47187),
(70648, 'esES', 'Firava el Reavivador', '', '', '', '', '', '', '', '', 47187),
(70647, 'esES', 'Ay, ay, ¿dónde estará, dónde estará?', 'Rescata a Loche y llévalo ante Jyhanna en la Guardería Escamitas, que está en Valdrakken.', '¡Me alegro de verte, $n! Estoy preocupadísima y me vendría bien tu ayuda.\n\nHace poco rescaté a un cría de protodraco abandonada. Le puse Loche de nombre. ¡Es tan adorable! Lo traje aquí para cuidar de él y buscarle un buen hogar como mascota.\n\nPero ahora ha desaparecido y temo que se haya perdido o esté herido. Lo buscaría yo misma, pero tengo que vigilar al resto de mis pequeños. ¿Podrías buscarlo?', '', '', '', '', '', '', 47187),
(70644, 'esES', 'Domando a la cabra salvaje', '', '', '', '', '', '', '', '', 47187),
(70643, 'esES', 'Explosivos Arcanos', '', '', '', '', '', '', '', '', 47187),
(70641, 'esES', 'Un juramento al despertar', 'Habla con los miembros del Vuelo Rojo en el Vitasagrario Rubí.', 'Espera un momento, $p. Quiero darte las gracias personalmente por tu ayuda a la hora de restaurar nuestra piedra de juramento.\n\nNo conocía a los dracthyr hasta vuestro despertar en el Confín Olvidado. No estaba claro lo que vuestra llegada significaba para nosotros. Si suponíais una bendición... o una maldición.\n\nTe animaría a aprender más cosas sobre nuestra piedra de juramento. Habla con algunos de mis hermanos en el Vitasagrario Rubí. Quizás nuestras historias te resulten familiares.', '', '', '', '', '', '', 47187),
(70640, 'esES', 'SE BUSCA: jefe', 'Mata a Frigellus cerca del Campamento de Antonidas.', '<La escritura de la hoja despide una suave luz azul>.\n\nEl elemental Frigellus, en su momento un juguete muy querido de Malygos, acabó sufriendo el abandono de su amo.\n\nMientras este asentamiento, antaño rebosante de felicidad, se desmoronaba, la malhumorada y traviesa criatura se fue deformando y retorciendo por los males que asolan esta tierra.\n\nPor favor, asegúrate de neutralizarlo.\n\nY cuando lo consigas, informa de ello al custodio Cynegos.', '', '', 'Frigellus', '', '', '', 47187),
(70638, 'esES', 'Rompevientos', '', '', '', '', '', '', '', '', 47187),
(70634, 'esES', 'Arrastrado', '', '', '', '', '', '', '', '', 47187),
(70633, 'esES', 'Combustible para el motor', 'Usa la esencia embotellada para potenciar el motor de innovación.', 'Has superado el primer desafío que dejó el guardián Tyr. Aunque este no es más que el primer paso de tu viaje, tengo fe en que lo harás bien. Te has ganado la oportunidad de empezar a desvelar los secretos de la forja. \n\nAñade la esencia embotellada al motor de innovación y descubre qué ocurre.', '', '', '', '', '', '', 47187),
(70632, 'esES', 'Catalogar las Orillas del Despertar', '', '', '', '', '', '', '', '', 47187),
(70631, 'esES', 'Despejando los cielos', '', '', '', '', '', '', '', '', 47187),
(70627, 'esES', '¿Qué hay del Clan Pelaje Invernal?', 'Reúnete con Sonova Cubilnevado en la Atalaya de Theron.', 'Si supiéramos que sería seguro..., nos uniríamos a otro clan.\n\nMe preocupa que los Primalistas tentaran a otros clanes como hicieron con el nuestro.\n\nLa \"Expedición Dragontina\" dice que tiene una posición cerca del Clan Pelaje Invernal.\n\nPuede que estén corruptos o puede que escuchen nuestra advertencia. Sea como sea, nos necesitan.\n\nEn la Atalaya de Theron hay un \"experto en fúrbolgs\", Sonova Cubilnevado. Ve a verlo y averigua lo que sabe.', '', '', '', '', '', '', 47187),
(70625, 'esES', 'Creaciones forjadas con hechizos', '', '', '', '', '', '', '', '', 47187),
(70620, 'esES', 'Escalando', 'Recolecta $1oa escamas de adamantita para Ralathor el Robusto en Valdrakken.', 'Mucha gente me pregunta cómo es que se me da tan bien desollar. Yo les digo que el secreto está en las escamas.\n\n¿Te gustaría saber el secreto? Tráeme unas escamas y te mostraré a qué me refiero.', '', '', '', '', '', '', 47187),
(70618, 'esES', 'La llamada de la forja', 'Recolecta $1oa menas de serevita para Sekita el Excavador, que está en Valdrakken.', 'La forja... me llama. Y me pide serevita. ¡Tú! ¡Tráeme serevita! ¡Sí, mucha serevita! <Sekita empieza a reírse de forma extraña>.', '', '', '', '', '', '', 47187),
(70617, 'esES', '¡Mío! ¡Mío! ¡MÍO! ¡Todo mío!', 'Recolecta $1oa menas de draconio para Sekita el Excavador, que está en Valdrakken.', 'No hay nada tan útil como las menas de draconio ¡Se pueden hacer tantas cosas con ellas! Es la mena perfecta, pura en todos los sentidos.\n\nTráeme draconio. Debo tenerlo. Eres $gminero:minera;, ¿no? ¡Pues a picar!', '', '', '', '', '', '', 47187),
(70613, 'esES', 'Dales el pino antes de que te hagan una caja con él', 'Recolecta $1oa de pino retorcido para Agrikus, que está en Valdrakken.', '$p, eres $gun:una; herborista la mar de hábil, ¿sabes? Tengo a un montón de alquimistas en la puerta suplicándome que les venda pino retorcido... O los tendría si tuviera puerta. ¡Y casi no nos queda!\n\n¿Me ayudarías a conseguir más? Me temo que, si no pueden crear las ampollas que necesitan, empezarán a experimentar con mis pertenencias.', '', '', '', '', '', '', 47187),
(70595, 'esES', 'Servicios de sastrería solicitados', 'Completa pedidos de fabricación de sastrería para el Consorcio de Artesanía.', '¡Hola, hola, hola, $p! Llegan pedidos de fabricación a diestro y siniestro.\n\nSi buscas trabajo, el Consorcio de Artesanía siempre tiene pedidos pendientes.\n\nPuedes echar un vistazo a nuestros pedidos públicos o, si ya has acumulado una buena red de clientes, completar pedidos de hermandad o pedidos personales! ¡Venga, a trabajar, a trabajar, a trabajar!', '', '', '', '', '', '', 47187),
(70594, 'esES', 'Peletería a su servicio', 'Completa pedidos de fabricación de peletería para el Consorcio de Artesanía.', '¡Hola, hola, hola, $p! Llegan pedidos de fabricación a diestro y siniestro.\n\nSi buscas trabajo, el Consorcio de Artesanía siempre tiene pedidos pendientes.\n\nPuedes echar un vistazo a nuestros pedidos públicos o, si ya has acumulado una buena red de clientes, completar pedidos de hermandad o pedidos personales! ¡Venga, a trabajar, a trabajar, a trabajar!', '', '', '', '', '', '', 47187),
(70593, 'esES', 'Joyería a su servicio', 'Completa pedidos de fabricación de joyería para el Consorcio de Artesanía.', '¡Hola, hola, hola, $p! Llegan pedidos de fabricación a diestro y siniestro.\n\nSi buscas trabajo, el Consorcio de Artesanía siempre tiene pedidos pendientes.\n\nPuedes echar un vistazo a nuestros pedidos públicos o, si ya has acumulado una buena red de clientes, completar pedidos de hermandad o pedidos personales! ¡Venga, a trabajar, a trabajar, a trabajar!', '', '', '', '', '', '', 47187),
(70592, 'esES', 'Inscripción a su servicio', 'Completa pedidos de fabricación de inscripción para el Consorcio de Artesanía.', '¡Hola, hola, hola, $p! Llegan pedidos de fabricación a diestro y siniestro.\n\nSi buscas trabajo, el Consorcio de Artesanía siempre tiene pedidos pendientes.\n\nPuedes echar un vistazo a nuestros pedidos públicos o, si ya has acumulado una buena red de clientes, completar pedidos de hermandad o pedidos personales! ¡Venga, a trabajar, a trabajar, a trabajar!', '', '', '', '', '', '', 47187),
(70591, 'esES', 'Ingeniería a su servicio', 'Completa pedidos de fabricación de ingeniería para el Consorcio de Artesanía.', '¡Hola, hola, hola, $p! Llegan pedidos de fabricación a diestro y siniestro.\n\nSi buscas trabajo, el Consorcio de Artesanía siempre tiene pedidos pendientes.\n\nPuedes echar un vistazo a nuestros pedidos públicos o, si ya has acumulado una buena red de clientes, completar pedidos de hermandad o pedidos personales! ¡Venga, a trabajar, a trabajar, a trabajar!', '', '', '', '', '', '', 47187),
(70589, 'esES', 'Herrería a su servicio', 'Completa pedidos de fabricación de herrería para el Consorcio de Artesanía.', '¡Hola, hola, hola, $p! Llegan pedidos de fabricación a diestro y siniestro.\n\nSi buscas trabajo, el Consorcio de Artesanía siempre tiene pedidos pendientes.\n\nPuedes echar un vistazo a nuestros pedidos públicos o, si ya has acumulado una buena red de clientes, completar pedidos de hermandad o pedidos personales! ¡Venga, a trabajar, a trabajar, a trabajar!', '', '', '', '', '', '', 47187),
(70586, 'esES', 'Demasiados cocineros...', 'Fabrica $1oa gorros de cocinero de tela salvaje para Fulafong, que está en Valdrakken.', '$p, si algo he aprendido en todos estos años como costurera, es que demasiados cocineros lo estropean todo.\n\nEn este caso, iba a salir a tomar un trago cuando llegó un pedido de último minuto: un ropero entero de uniformes de chef.\n\nSi pudieras coser los gorros, yo me encargaría de todo lo demás.', '', '', '', '', '', '', 47187),
(70582, 'esES', 'Tejer bien a solas', 'Fabrica $1oa rollos de tela salvaje para Fulafong, que está en Valdrakken.', '$p, si algo he aprendido en todos estos años como costurera, es la importancia de la práctica.\n\nNunca dejes de practicar aunque creas que ya lo has dominado todo. Quiero que seas capaz de tejer con prestancia sin mi supervisión.\n\n¿Por qué no practicas esta semana? Haz unos cuantos rollos de tela salvaje de la mejor calidad.', '', '', '', '', '', '', 47187),
(70571, 'esES', '¡Necesitamos tambores!', 'Fabrica $1oa tambores de pellejo feral para el moldeapieles Koruz, que está en Valdrakken.', 'Nos conocen en todas partes por nuestros tambores, algo que los centauros hemos perfeccionado durante generaciones. Por desgracia, eso significa que siempre andamos cortos de suministros.\n\nVeo que tu habilidad está al nivel, ¿podrías ayudarme a fabricar algunos tambores para nuestras tiendas?', '', '', '', '', '', '', 47187),
(70569, 'esES', 'Un kit para Trisket', 'Fabrica $1oa cestas florales de herborista para el moldeapieles Koruz, que está en Valdrakken.', 'Tengo muchos buenos clientes, pero Trisket es de mis favoritos. Hace poco vino a verme porque su faltriquera de herborista se había desgastado.\n\nMe ofrecí a hacerle una selección de cestas para sustituir a su vieja faltriquera.\n\n¿Me ayudas en esta tarea, $p? Trisket estará muy agradecido.', '', '', '', '', '', '', 47187),
(70567, 'esES', 'Cuando le des un hueso a un bakar...', 'Fabrica $1oa ballestas huesoforjado para el moldeapieles Koruz, que está en Valdrakken.', 'Tenía algunos arcos de huesoforjado hermosísimos, pero nuestros bakar se los llevaron antes de que pudiéramos usarlos. A los bakar les encanta masticar huesos aunque tengan forma de arco, ¡y ahora están inservibles!\n\n¿Puedes ayudarme a fabricar unos repuestos?', '', '', '', '', '', '', 47187),
(70565, 'esES', 'Separación por saturación', 'Fabrica $1oa colgantes de peligros inminentes para Tuluradormi, que está en Valdrakken.', 'Ah, $gjoyero:joyera;, ¿te gusta mi collar?\n\nClaro que sí. Pero no se puede apreciar como es debido si no destaca.\n\nYa sé, ¿por qué no fabricas unos cuantos colgantes simples e inundamos el mercado? ¡Cuando todo el mundo lleve tus diseños, mi collar los eclipsará a todos!', '', '', '', '', '', '', 47187),
(70564, 'esES', 'Especta-ocular', 'Fabrica $1oa lentes de aumento de ónice hendido para Tuluradormi, que está en Valdrakken.', '$gJoyero:Joyera;, se acerca una exposición, y me preocupa que los clientes no puedan apreciar la belleza de cada corte sin las lentes de aumento adecuadas.\n\nNo tienen que ser elegantes, solo hay que fabricar unos cuantos pares para que puedan ver con claridad.', '', '', '', '', '', '', 47187),
(70560, 'esES', 'La herramienta más poderosa: una buena documentación', 'Fabrica $1oa compendios básicos del expedicionario para Talendara, que está en Valdrakken.', '$gAprendiz:Aprendiza; de escriba, ¿te $gsientes listo:lista; para escribir hoy? La Expedición Dragontina ha traído una gran cantidad de notas de sus aventuras y nos han pedido que recopilemos sus horribles garabatos en un compendio de campo adecuado. Ah, y mi mano no está por la labor hoy. ¿Puedo confiar en ti una vez más?', '', '', '', '', '', '', 47187),
(70559, 'esES', '¿Me echas una pluma?', 'Fabrica $1oa plumas atadas de escriba para Talendara, que está en Valdrakken.', 'Me alegro de verte, $gaprendiz:aprendiza; de escriba.\n\nAntes han venido algunos novatos para probar sus aptitudes con la inscripción, pero todos escribían con demasiada fuerza y han roto sus plumas.\n\nDetesto pedírtelo, pero ¿podrías confeccionar unas cuantas plumas más?', '', '', '', '', '', '', 47187),
(70558, 'esES', 'Desilusiones con las ilusiones', 'Fabrica un $1oa pergamino de ilusión: Escudo contra hechizos para Talendara, que está en Valdrakken.', '¡Mi aprendiz de escriba! No podrías haber elegido mejor momento.\n\n¡Ha ocurrido un terrible accidente! Resulta que todos los pergaminos de ilusión que pedí son reales. ¿Te lo puedes creer? ¿Se creen que esto es un juego? ¡Alguien podría salir herido!\n\n¿Crees que podrías rectificar la situación y crear ilusiones auténticas?', '', '', '', '', '', '', 47187),
(70557, 'esES', 'Falta de miras', 'Fabrica $1oa petardos del Vuelo Bronce para Clinquiclic Explobum, que está en Valdrakken.', 'Chispitas, hoy quiero hablarte de un artilugio impresionante.\n\nPor lo visto, hay ciertos fuegos artificiales que se han puesto de moda entre los cazadores. Los usan para ahuyentar a los patos de forma que alcen el vuelo. En mi opinión, los patos son demasiado listos como para caer en algo así, ¡pero eso no nos impedirá sacarle provecho! ¿Crees que puedes con esta tarea?', '', '', '', '', '', '', 47187),
(70550, 'esES', 'Bienvenido a la Asamblea', 'Habla con Xavin en la Galería Cobalto para ver qué facultades se pueden usar en la zona.', 'Nos vendría bien tu ayuda.\n\nLa Llama Hendida ha tomado el control de la mayor parte de la Galería Cobalto.\n\nPor favor, ayúdanos en esta lucha contra ellos. No somos muchos, pero, aun así, podemos echarte una mano.', '', '', '', '', '', '', 47187),
(70542, 'esES', 'Rally de las Tierras Azures', '', 'Vuela a través de los anillos de control que marcan el recorrido.', '', '', '', '', '', '', 47187),
(70541, 'esES', 'Tácticas de caza: compañero', 'Elige luchar junto a un bakar o un ohuna durante la gran cacería.', 'Tu renombre con los Maruuk aumenta. Ahora puedes cazar junto con un tenaz bakar o un veloz ohuna compañero.', '', '', '', '', '', '', 47187),
(70540, 'esES', 'El mejor amigo del ingeniero', 'Fabrica $1oa multiherramientas para Clinquiclic Explobum, que está en Valdrakken.', 'Oye, chispitas, ¿has visto mi...?\n\nEmmm... ¿Puedes pasarme el...?\n\nSe acabó, creo que va siendo hora de hacernos con más herramientas para el taller, ¿no te parece?', '', '', '', '', '', '', 47187),
(70533, 'esES', 'Aceite para los jarabes', 'Fabrica $1oa de aceite retuercefuego para Conflago, que está en Valdrakken.', '¿Sabías que el aceite retuercefuego es el componente ideal para dar el toque final a tus jarabes? Yo sí. Y ahora me he quedado sin nada. No puedo trabajar sin una abundante reserva de aceites. Por favor, $p, ayúdame a reponer las existencias de mi laboratorio.', '', '', '', '', '', '', 47187),
(70532, 'esES', 'Colaborar en el ataque', 'Fabrica $1oa pociones de sanación refrescante para Conflago, que está en Valdrakken.', 'Ah, $p, me alegro de verte. Varios campeones han resultado heridos en el último asalto contra los Primalistas. Tenemos una gran necesidad de pociones de sanación. Supongo que, como $gaventurero:aventurera;, llevarás varias encima. Vamos a necesitar muchas.', '', '', '', '', '', '', 47187),
(70526, 'esES', 'Rally de las Llanuras de Ohn\'ahra', '', 'Vuela a través de los anillos de control que marcan el recorrido.', '', '', '', '', '', '', 47187),
(70501, 'esES', 'Licencia para cazar', 'Completa las tareas de entrenamiento de la gran cacería.', '¿Por fin vas a demostrar tu destreza en la caza? Ten en cuenta que no es tan sencillo como correr y cazar todo lo que se mueve. Los Shikaar cazamos con un propósito. Cazamos para alimentar y vestir a nuestro clan, para demostrar nuestra fuerza contra enemigos poderosos y para equilibrar la naturaleza.\n\nNo cazamos en tierras baldías y sembramos las semillas de las futuras grandes cacerías a nuestro paso. Demuestra que eres capaz de seguir estas instrucciones y podrás unirte a nosotros.\n\nSin embargo, no creo que tu colega lo consiga.', '', '', '', '', '', '', 47187),
(70450, 'esES', 'Devastación de nutrias', 'Asusta a los nutriones fastidiosos.', '¡Hola! Estos nutriones no paran de robar mi pesca.\n\nSi fuera por mí, los haría volar en mil pedazos, pero nuestros amigos colmillarr no parecen estar demasiado de acuerdo. He fabricado este dispositivo disuasorio de nutriones, el MK-SH4RK, pero... no se me da muy bien nadar.\n\nParece que a ti sí, ¿por qué no nos haces un favor? Activa el dispositivo, date un baño por ahí y asústalos.', '', '', '', '', '', '', 47187),
(70446, 'esES', 'Una historia personal', 'Reúnete con Pavethal en el Observatorio Obsidiana.', 'Mientras investigaba los archivos, he encontrado pistas que indican que el Observatorio Obsidiana es un lugar de especial importancia para el Guardián de la Tierra. Lo único que puedo hacer es elucubrar sobre los registros que contendrá con la historia de nuestro Vuelo.\n\nDado el interés de Pavethal en el asunto, la he informado de mi descubrimiento. Espero que no haya sido un error.\n\nSe ha ido allí a explorar. Por favor, no la pierdas de vista. Es una soldado competente, pero se trata de un asunto... delicado. Quién sabe lo que encontraréis.', '', '', '', '', '', '', 47187),
(70444, 'esES', 'Los Campos de la Ferocidad', 'Reúnete con Gurgthock en los Campos de la Ferocidad.', '¡A los Shikaar más valientes!\n\nPreparaos y dirigíos a los Campos de la Ferocidad. ¿Quién se hará con la corona del combatiente más poderoso?\n\n¡Demostrad vuestro poderío! ¡Enseñadnos vuestra fuerza!\n\nSe aplican términos y condiciones.', '', '', '', '', '', '', 47187),
(70442, 'esES', 'Batalla de banquetes', '', '', '', '', '', '', '', '', 47187),
(70439, 'esES', 'Arcana salvaje', '', '', '', '', '', '', '', '', 47187),
(70438, 'esES', '¿Pez volador?', 'Recoge peces para reponer el agujero de pesca y monta en tu draco para soltarlos desde el aire.', 'Podrían picar muchos más peces, ¿no crees?\n\nTengo una idea. La leyenda dice que estos lagos y ríos no siempre tuvieron peces. Cuentan que estos pozos de agua se llenaron de peces cuando los dragones que los sobrevolaban los lanzaron dentro. ¿Te lo puedes creer?\n\n¿Crees que tu draco y tú podréis intentar hacer lo mismo?', '', '', '', '', '', '', 47187),
(70437, 'esES', 'Hacia Tyrhold', 'Reúnete con Alexstrasza en el Trono de los Aspectos.', 'Han pasado siglos desde la última vez que los Vuelos visitaron Tyrhold.\n\nSin embargo, debemos ir allí e investigar si la piedra de juramento madre aún funciona.\n\nVen, habla conmigo en el Trono de los Aspectos. Debemos investigar los peligros que pueden estar esperándonos en la antigua fortaleza de Tyr.', '', '', '', '', '', 'Reúnete con Alexstrasza en Tyrhold.', 47187),
