(70414, 'esES', 'Tierras inestables', 'Coloca los tótems devastadores para liberar las rocavernas atrapadas.', 'En nombre de Khaz\'goroth, ¿qué pasa aquí?\n\nEste magma tiene mente propia; está consumiendo las rocavernas elementales desde abajo. Esto no es una simple casualidad. Tengo que averiguar qué ocurre.\n\nColoca estos tótems devastadores junto a cada elemental atrapado para liberarlo.', '', '', '', '', '', '', 47187),
(70412, 'esES', 'Carrera de jinete de dragones - Eslalon de la Reserva Agreste', '', '', '', '', '', '', '', '', 47187),
(70410, 'esES', 'Carrera de jinete de dragones - Recorrido aéreo de Raudoescarcha', '', '', '', '', '', '', '', '', 47187),
(70390, 'esES', '(DNT) Chloe\'s Onboarding Kill Quest', 'Kill %1oa CREATURE NAME in POI NAME.', '¡Mata a esas criaturas que aún no están formadas y ayúdame a aprender!', '', '', '', '', '', '', 47187),
(70377, 'esES', 'Moda abandonada', 'Encuentra al dueño de las gafas de sol.', '<Estas asquerosas gafas de sol están pringadas de babas, pero parecen muy caras.\n\nSeguro que alguien las ha perdido. Este estilo está muy de moda ahora mismo>.', '', '', '', '', '', '', 47187),
(70376, 'esES', 'Segundo desafío de Tyr: poder', 'Completa el segundo desafío de Tyr en las Llanuras de Ohn\'ahra.', '<Al acercarte, la inscripción de la estatua emite un brillo tenue>.\n\n\"Blande el poder del guardián y muestra la intrépida determinación del que se mantiene firme\".', '', '', '', '', '', '', 47187),
(70374, 'esES', 'Himia, la Bendita', 'Derrota a los elementos.', 'Los elementos reclaman esta tierra y no aprueban nuestra intrusión.\n\n¡Oh, elementos, os habéis olvidado de nuestro protector! El aire, invisible, pero omnipresente y vital para toda la existencia. Lo habéis olvidado con un simple suspiro. Tras enfrentaros a mí, no volveréis a olvidarlo.', '', '', '', '', '', 'Vuelve con la anciana Nazuun en Teerakai.', 47187),
(70373, 'esES', 'Alamuergurlugull', '¡Súbete al saltarín y derrota a Alamuergurlugull!', '¡Alamuergurlugull, Alamuergurlugull, Alamuergurlugull!\n\n¡Grrrooooooooom blarglg!!\n\n<No necesitas una traducción para saber que quieren que acabes con su versión múrloc de Alamuerte. Antes de que puedas aceptar o negarte, se dirigen hacia ti los rugidos del motor de una máquina>.', '', '¡Alamuergurlugull, Alamuergurlugull! ¡Alamuergurlugull, alamlgrbrrl!', 'Alamuergurlugull', '', '', '', 47187),
(70371, 'esES', 'Alamuergurlugull', '¡Súbete al saltarín y derrota a Alamuergurlugull!', '¡Alamuergurlugull, Alamuergurlugull, Alamuergurlugull!\n\n¡Grrrooooooooom blarglg!!\n\n<No necesitas una traducción para saber que quieren que acabes con su versión múrloc de Alamuerte. Antes de que puedas aceptar o negarte, se dirigen hacia ti los rugidos del motor de una máquina>.', '', '¡Alamuergurlugull, Alamuergurlugull! ¡Alamuergurlugull, alamlgrbrrl!', 'Alamuergurlugull', '', '', '', 47187),
(70370, 'esES', 'Oposiciones para profesiones', 'Haz el cuestionario de personalidad de Haephesta para conocer tu profesión ideal.', '¡Hola! ¿Te interesa trabajar con el Consorcio de Artesanía para obtener beneficios abundantes y proporcionar valiosos bienes y servicios a clientes de todo Azeroth?\n\n¡Excelente! ¿En qué dos habilidades tienes experiencia?\n\nMmm... ¿Que no tienes profesiones? ¡Pues te pierdes una oportunidad única!\n\n<Haephesta reflexiona un momento>.\n\n¡Ya sé! Te haré una serie de preguntas sobre tu personalidad, y así descubriremos qué otra profesión puede complementar mejor a la primera. ¿Qué te parece?', '', '', '', '', '', '', 47187),
(70368, 'esES', 'Oposiciones para profesiones', 'Haz el cuestionario de personalidad de Haephesta para conocer tu profesión ideal.', '¡Hola! ¿Te interesa trabajar con el Consorcio de Artesanía para obtener beneficios abundantes y proporcionar valiosos bienes y servicios a clientes de todo Azeroth?\n\nMmm... ¿Que no tienes profesiones? ¡Pues te pierdes una oportunidad única!\n\n<Haephesta reflexiona un momento>.\n\n¡Ya sé! Te haré una serie de preguntas sobre tu personalidad, y así descubriremos qué profesión te va mejor. ¿Qué te parece?', '', '', '', '', '', '', 47187),
