(70352, 'esES', 'Escamas hasta el infinito', 'Mata a cornisapos y a protodracos territoriales con Toluiqi.', '¡Eh, tú! Has matado protodragones antes, ¿verdad?\n\nSería lógico pensar que si combinamos tu experiencia con mi pericia para la caza, acabaríamos con unos cuantos. Hay fuentes por aquí que atraen a bestias dracónicas.\n\nAyúdame a demostrar a mi estúpida otra mitad que soy la mejor cazadora.', '', '', '', '', '', '', 47187),
(70351, 'esES', 'Fiesta en el jardín', 'Habla con Akora en los Estanques de Vida Rubí.', 'Llevo años cuidando este jardín como preparación para el día en el que pueda aceptar mi convocavida. ¡Ese día ha llegado!\n\nMe encantan las flores, los árboles y las plantas. ¡Hasta los bichos que tienen dentro! Cuando cuido el jardín, siento el espíritu de la naturaleza, el espíritu de la gran dragona.\n\nSolo queda una cosa por hacer. Voy a invocar al espíritu de la gran dragona, igual que en las leyendas.\n\n<Akora sonríe feliz>.\n\nReúnete conmigo en el jardín de abajo, junto al estanque donde descansan sus huesos. Allí te lo contaré todo.', '', '', '', '', '', '', 47187),
(70341, 'esES', 'Una victoria bien merecida', 'Vuelve al motor de innovación en Valdrakken.', 'La cosa más pequeña puede contener el mayor de los tesoros.\n\nLleva la esencia al motor de innovación.', '', '', '', '', '', '', 47187),
(70339, 'esES', 'Tras los pasos de Tyr: Llanuras de Ohn\'ahra', 'Busca el segundo desafío de Tyr en las Llanuras de Ohn\'ahra.', 'Aunque lo has hecho bien en el primer desafío, no creas que los superarás todos tan fácilmente. El guardián Tyr quería que el motor de innovación fuese solo para aquellos lo bastante dignos para usarlo con sabiduría.\n\nSi no te amilanas, encontrarás el siguiente desafío en las Llanuras de Ohn\'ahra. Estoy deseando poner a prueba tus capacidades, $gaventurero:aventurera;.', '', '', '', '', '', 'Busca el segundo desafío de Tyr en las Llanuras de Ohn\'ahra.', 47187),
(70338, 'esES', 'Se han llevado los cachorros', 'Rescata a los cachorros.', 'Si Sylvie está así de angustiada, ¡solo puede significar que sus cachorros están allí!\n\nLos gigantes han debido secuestrar a sus cachorros mientras estaba infectada y demasiado débil como para salvarlos.\n\nLos cachorros son muy vivaces a esta edad y quizá hayan sido lo suficientemente veloces como para evitar a los gigantes hasta ahora...\n\nToma, usa mi talismán de invisibilidad. Rápido, ¡debes salvarlos antes de que se los coman!', '', '', '', '', '', '', 47187),
(70337, 'esES', 'Vigía de Ascuas', 'Lleva las campanillas de viento Ohn\'ir a Vigía de Ascuas.', 'Saludos, $gforastero:forastera;.\n\nLos vientos me han contado que hay un grupo de refugiados en las ruinas de Vigía de Ascuas. Parecen que solo están interesados en el pasado, pero los centauros preferimos vivir el presente bajo la gracia de Ohn\'ahra.\n\nSin embargo, son invitados en nuestro hogar. He creado estas campanillas de viento para que puedan oír la presencia de Ohn\'ahra. Esperemos que les aporten un poco de alegría y consuelo.', '', '', '', '', '', '', 47187),
(70335, 'esES', 'Herramientas de excavación sencillas', '', '', '', '', '', '', '', '', 47187),
(70319, 'esES', 'Nergazurai', 'Lleva un corazón de nutrión, un fémur colmillorroca, una escama de zancacuerno y una molleja de buitre a Muqur Tocado por la Lluvia en la Avanzada Pasoleño.', 'Mi tío me contó muchas historias sobre su batalla con un zancacuerno llamado Nergazurai. Me habló de sus escamas fucsia, que zigzagueaban en las colinas de las llanuras al acechar a su presa, de sus afiladas garfas y de sus mordeduras venenosas.\n\nMientras estaba cazando, vi un destello, pero era demasiado tarde. Me mordió en el hombro. Era tan terrible como describió mi tío, pero logré salir con vida.\n\nTengo que limpiar la infección del mordisco. Por favor, reúne los componentes que necesito. El tiempo es oro.', '', '', '', '', '', '', 47187),
(70299, 'esES', 'Defensa dracónica', 'Mata primalistas en la Cicatriz de la Tormenta.', 'He oído en el viento que unos forasteros se han aliado con el Clan Nokhud para derrotar a nuestros vecinos los dragones. Estos Primalistas son una desgracia para las llanuras de nuestros ancestros.\n\nMátalos y tráeme los núcleos de los elementales a los que dirigen.', '', '', '', '', '', '', 47187),
(70279, 'esES', 'Sangre de dragones', 'Mata a Karkidan.', 'Como sin duda habrás visto, en esta tierra habitan criaturas que crecen más allá de su tamaño normal.\n\nCreemos que han sido bendecidas por los dioses de la naturaleza, y suelen considerarse objetivos honorables para que los cazadores demuestren su fuerza. Una de estas bestias, a la que llamamos Karkidan, está por aquí cerca. Quedaría muy impresionado si lograras acabar con ella.', '', '', '', '', '', '', 47187),
(70268, 'esES', 'Recuerdos revividos', 'Dale el diario a Veritistrasz.', 'Has encontrado un diario parcialmente destruido. Parece que está escrito desde el punto de vista de una joven dragona negra, antes de la corrupción.\n\nAunque la parte trasera resulta ilegible, al leer por encima la primera parte, un nombre llama tu atención. Veritistrasz.', '', '', '', '', '', 'Entrega el diario a Veritistrasz, que está en el Sagrario Rubí.', 47187),
(70244, 'esES', 'Nokhud malo nunca muere', 'Entra en la aldea con la khanam Matra Sarest y arrebata el cuerno a los Nokhud.', 'Durante miles de años, los Teerai han protegido el Cuerno de Drusahl, nuestra reliquia más sagrada. Al saquear esta aldea, Balakar ha traicionado todo lo que significa ser un Maruuk. Ya no hay redención posible para él.\n\nDebemos recuperar el cuerno antes de que Balakar pueda destruirlo y rescatar a los Teerai que aún viven. Voy contigo a llevar personalmente a ese falso khan ante la justicia. ¡Los Nokhud conocerán la ira de la khanam Matra!', '', '', '', '', '', '', 47187),
(70242, 'esES', 'Vida tras vida', 'Recoge un receptáculo inerte de Trellain en el Vitasagrario Rubí.', 'Noté que su amigo tenía una cicatriz profunda. Algo en este lugar la reavivó..., quizá para que pudiera sanar adecuadamente esta vez.\n\nAhora le toca recuperarse a Kolgar.\n\nPodrás encontrar a mi amigo Trellain trabajando con los encantadores en el bancal que está sobre nosotros. Dile que necesito uno de los recipientes que usa él; te lo entregará sin rechistar.', '', '', '', '', '', '', 47187),
(70241, 'esES', 'Un final amargo', 'Lleva a Bathoras a Duroz y Kolgar.', 'Acaba de pasar. Estaba durmiendo y miré hacia otro lado y... Volvíamos aquí todos los días, él solo quería sentarse con las crías, no tenía ni idea de que...\n\n<La cara de Kolgar está surcada de lágrimas. Se frota los ojos con el dorso de la mano>.\n\nNo, sí lo sabía. Lo sabía. Pero no sé qué hacer ahora. ¿Qué hago con él?\n\n¿Puedes... llamar a Bathoras?', '', '', '', '', '', '', 47187),
(70240, 'esES', 'Gestión del dolor', 'Recolecta $1oa bocaflores lechosas, $2oa lirios de bajío florecidos y un vial de los Estanques de Vida lleno.', 'Menos mal que lo has traído aquí. Se nota que está sufriendo mucho, aunque lo soporta bien. Todos debemos hacerlo cuando nos llega el momento.\n\nMe temo que es la edad lo que lo aflige y no una enfermedad, pero tal vez pueda aliviar parte de su sufrimiento.\n\n¿Te importaría conseguir unas bocaflores, varios lirios de bajío y agua pura del jardín cercano? Si encuentras los suficientes, podré usarlos para crear algo que alivie su dolor.', '', '', '', '', '', '', 47187),
(70239, 'esES', 'Remordimientos inimaginables', 'Acompaña a Duroz y Kolgar para encontrar ayuda.', 'Duroz está mayor, enfermo y es cabezota como un kodo. No hubo forma de impedir que se subiese a la nave para venir aquí. Lo máximo que he podido hacer es ayudarlo a andar.\n\nLe he visto sufrir tantas veces en el campo de batalla que ya sé cuándo oculta el dolor. Cada día está peor. ¿Puedes ayudarme a llevarlo con los alquimistas? La cerveza ya no ayuda.\n\nSi puedes llevar nuestras armas, yo lo ayudaré a caminar.', '', '', '', '', '', '', 47187),
(70236, 'esES', 'Ojo de dragón desprendido', 'Entrégale el objeto a Emilia Bellocq.', '<Esto podría ser de interés para Emila Bellocq>.', '', '', '', '', '', '', 47187),
(70235, 'esES', 'Factura de reparación', 'Fabrica $1oa martillos de reparación de serevita para la forjametales Kuroko, que está en Valdrakken.', 'Las Islas Dragón no han vivido un conflicto como este desde hace milenios. Nadie pone en duda nuestro trabajo, pero cualquier buena armadura acusa los daños del uso constante. Tengo un gran pedido de martillos de reparación de serevita y necesito que todo el mundo colabore. Si me ayudas, volveré a darte más información para ampliar tus habilidades en herrería de las Islas Dragón.', '', '', '', '', '', '', 47187),
(70233, 'esES', 'Escasez de hachas', 'Fabrica $1oa hachas de draconio para la forjametales Kuroko, que está en Valdrakken.', 'Un error en los pedidos ha provocado una enorme escasez de hachas nuevas para nuestros expedicionarios. Necesitamos más hachas de draconio urgentemente y buscamos a cualquier herrero que pueda ayudarnos. A cambio, te impartiré nuevos conocimientos de herrería para ayudarte a forjar piezas aún más increíbles.', '', '', '', '', '', '', 47187),
(70229, 'esES', 'Boku el Místico', 'Encuentra a Boku en Teerakai.', 'Hace unos días, los místicos se retiraron al Retiro Crestagua, pero aún queda uno. Se llama Boku. Lo encontrarás en lo alto de la colina del santuario de Ohn\'ahra.\n\nEs un iniciado, pero debería poder entrar en comunión con Ohn\'ahra y conseguir su bendición. Con Ohn\'ahra de nuestro lado, quizás podamos ganar esta guerra antes de que empiece.', '', '', '', '', '', 'Encuentra a Boku en Teerakai.', 47187),
(70221, 'esES', 'Demostrar tu entereza', '', '', '', '', '', '', '', 'Recibe la entereza de artesano de Thomas Brillante.', 47187),
(70220, 'esES', 'Santuario Sombreado', 'Habla con la capitana de la guardia Alowen, Sariosa, Sidra la Cuidadora y Viranikus.', 'Debemos informar al resto del Vuelo Verde de que la barrera de la Rama Ancestral está siendo amenazada. Gerithus y yo tenemos mucho de qué hablar.\n\n$n, pondré mi marca sobre ti. Los dragones que la vean sabrán que tienes mi absoluta confianza.\n\nVe y reúne a mi Vuelo. Tienen que saber esto y prepararse para la batalla que se avecina.', '', '', '', '', '', '', 47187),
(70215, 'esES', 'La curiosidad es la clave', 'Habla con la taumaturga de distorsión Delandra en el Campamento de Antonidas.', 'Que dudara de hablar sobre estos símbolos no fue por falta de confianza en ti, sino por la naturaleza desconocida de estos símbolos y las piedras en las que habitan.\n\nSí, piedras. Varias, de hecho, repartidas por las islas.\n\n<La taumaturga de distorsión Delandra te mira. Una pizca de curiosidad y emoción aparece en su mirada>.\n\nNo lo sabías.\n\nMuy bien. Tu perseverancia y tu afán por encontrarme demuestran que tienes ganas de comprender tu reciente descubrimiento. Quizás sea hora de hablar largo y tendido.', '', '', '', '', '', '', 47187),
(70213, 'esES', 'Harkyn Piedrasiniestra', '', '', '', '', '', '', '', '', 47187),
(70212, 'esES', 'Penumbrus', '', '', '', '', '', '', '', '', 47187),
(70210, 'esES', 'Tradición no olvidada', 'Coloca incienso y elimina a las bestias fantasmales de los Kurgans Eternos.', 'Para los Aylaag es tradición, mientras estamos en este campamento, que nuestros miembros peregrinen a los Kurgans Eternos para pedir viajes libres de la plaga que asoló a nuestros ancestros. La presencia de los Nokhud ha hecho que este peregrinaje sea peligroso.\n\nSi no te importa, te pediría que defendieses nuestra tradición por nosotros.', '', '', '', '', '', '', 47187),
