(70199, 'esES', 'Pescar y soltar: caballa tripaescama', '', '', '', '', '', '', '', '', 47187),
(70198, 'esES', 'La llamada de los cielos', 'Reúnete con Naleidea Brillorrío en Durotar.', 'Nuestros aliados se reúnen en Durotar. Es un momento muy emocionante.\n\n¡Únete a nosotros, $n! ¡Es hora de zarpar rumbo a las Islas Dragón!', '', '', '', '', '', '', 47187),
(70197, 'esES', 'La llamada de los cielos', 'Reúnete con Toddy Bigotis en el Puerto de Ventormenta.', '¿Tienes todo listo para esta aventura irrepetible? ¡Yo sí, sin duda!\n\nHan venido todos nuestros aliados y los suministros están cargados. Así que, ¿a qué esperas?\n\nReúnete conmigo en los muelles de Ventormenta. ¡Es hora de zarpar rumbo a las Islas Dragón!', '', '', '', '', '', '', 47187),
(70196, 'esES', 'Reducir la Reserva', '', '', '', '', '', '', '', '', 47187),
(70195, 'esES', 'Tomados por la tormenta', 'Rescata a Altan y busca pistas sobre el forastero.', 'Según los informes, los Nokhud iban acompañados por un forastero con unas habilidades mágicas nunca vistas. Arrasó nuestras filas como una tempestad.\n\nSi los Nokhud tienen aliados capaces de causar estos estragos, debemos averiguar todo lo que podamos sobre ellos.\n\nEnvié a mi ohuna, Altan, para que buscase al forastero. No ha regresado aún y eso me preocupa. $n, ¿puedes buscar pistas sobre el forastero y ver qué ha sido de Altan?', '', '', '', '', '', '', 47187),
