(70185, 'esES', 'Bestia misteriosa', 'Encuentra y mata a la bestia y lleva pruebas a la exploradora Tomul.', '<Encuentras una huella de zarpa enorme hundida en el barro. Miras a tu alrededor, pero ninguna de las criaturas cercanas tiene zarpas, y menos de ese tamaño.\n\nPodrías impresionar a los centauros si cazas a esta enorme bestia>.', '', '', '', '', '', 'Lleva la pelambre de Konkhular a la exploradora Tomul.', 47187),
(70184, 'esES', 'Secretos especializados: herrería', '', '', '', '', '', '', '', '', 47187),
(70183, 'esES', 'Secretos especializados: alquimia', '', '', '', '', '', '', '', '', 47187),
(70182, 'esES', 'El dulce sabor de la victoria', 'Vuelve al motor de innovación en Valdrakken.', 'Hay un gran potencial en las cosas pequeñas. La esencia embotellada es ligera como una pluma, pero guarda un poder inmenso.\n\nLlévala al motor de innovación.', '', '', '', '', '', '', 47187),
(70181, 'esES', 'Primer desafío de Tyr: sutileza', 'Completa el primer desafío de Tyr en las Tierras Azures.', '<Al acercarte, la inscripción de la estatua emite un brillo tenue>.\n\n\"Blande el poder del guardián y lleva su luz a un futuro mejor para todos\".', '', '', '', '', '', '', 47187),
(70180, 'esES', '¿En marcha? ¡En marcha!', 'Ayuda a Greyzik a encender el dispositivo misterioso.', 'Algunos de los habitantes de la ciudad afirman que este dispositivo fue creado por el legendario vigía de los titanes, Tyr.\n\n¡El problema es que no logramos que funcione! Hemos probado todos los trucos habituales: desmontaje, giroscopio, una leve descarga eléctrica... Nada ha funcionado, salvo la descarga. En realidad..., acabo de tener una idea genial.\n\n¿Ves ese girocóptero? Sube y veamos si podemos darle un poco más de corriente a este trasto de los titanes.', '', '', '', '', '', '', 47187),
(70179, 'esES', 'Dos pájaros de un tiro', 'Consigue materiales de construcción de los elementales de tierra de la zona.', '¡Saludos, adalid! Pareces bastante capaz. ¿Podrías echarme una mano?\n\nAzkra y yo tenemos que vigilar una torre que se encuentra en lo que a mí me gusta llamar \"un emocionante estado de renovación previa\". El problema es que cuando nos hemos puesto a trabajar, nos han atacado los elementales de tierra de la zona.\n\nAsí que me he dicho: \"Zefren, ¿no sería maravilloso ocuparse de esos elementales de tierra y conseguir materiales de construcción al mismo tiempo?\". ¡Y ahí es donde entras tú! ¿Puedes ayudarme?', '', '', '', '', '', '', 47187),
(70178, 'esES', 'Kit de suministros de expedición', 'Examina las nuevas herramientas disponibles en el kit de suministros de expedición en el Campamento Base Dragontina.', 'Tus descubrimientos han sido de gran valor.\n\nAún quedan cosas por descubrir y tenemos herramientas que te serán de utilidad.\n\nVuelve al Campamento Base Dragontina y pertréchate con el kit de suministros de expedición.', '', '', '', '', '', '', 47187);
INSERT INTO `quest_template_locale` (`ID`, `locale`, `LogTitle`, `LogDescription`, `QuestDescription`, `AreaDescription`, `PortraitGiverText`, `PortraitGiverName`, `PortraitTurnInText`, `PortraitTurnInName`, `QuestCompletionLog`, `VerifiedBuild`) VALUES
(70175, 'esES', 'Banda rota', 'Entrégale el objeto a Emilia Bellocq.', '<Esto podría ser de interés para Emila Bellocq>.', '', '', '', '', '', '', 47187),
(70174, 'esES', 'Los Shikaar', 'Reúnete con la khan Sansok.', 'La khan Sansok es la cazadora más hábil de nuestro clan. Si bien no puede oír, demuestra sus capacidades como cazadora y líder una y otra vez.\n\nEs una mentora para todos, una líder de confianza y una feroz defensora de los Maruuk.\n\nEs un honor que hables con ella.', '', '', '', '', '', '', 47187),
(70172, 'esES', 'Misterios montañosos', '', '', '', '', '', '', '', '', 47187),
(70171, 'esES', 'Accidentes afortunados', 'Encuentra la última obra de Hudson.', '<Los ojos de Ranpiata se humedecen>.\n\n¿Es culpa mía? ¿Soy el motivo por el que ha perdido la inspiración?\n\nDice que me quiere, pero... ya has oído cómo le sienta dejar de pintar.\n\nQuiero lo mejor para él. Si le hace sentir mejor..., me marcharé.\n\nTiró su última obra. Lo último que dibujó antes de rendirse.\n\nNo pude soportar la idea de que se perdiese. La escondí en nuestra casa. Por favor..., llévasela... como recuerdo.', '', '', '', '', '', '', 47187),
(70170, 'esES', 'Recuperando la inspiración a golpes', 'Recupera las pinturas perdidas de Hudson de los jefes finales de las Salas de Infusión, la Academia Algeth\'ar, la Cámara Azur y Neltharus.', 'Me temo que puede ser muy testarudo.\n\nNo pienso rendirme con él. ¡Debemos intentarlo de nuevo!\n\nAún quedan por ahí más pinturas de las que había tirado. Están en lugares aún más peligrosos, ¡así que espero que estés a la altura del desafío!', '', '', '', '', '', '', 47187),
(70169, 'esES', 'Hasta los árboles necesitan amigos', 'Habla con Rauvros.', 'Sé que Ran y tú estáis intentando ayudar.\n\nPero dudo que ayudarme sirva para algo. He perdido... la inspiración y mi voluntad para pintar, sin más.\n\nPero Ran tiene razón. Te debo el intentarlo.\n\nPreséntame a ese artista en ciernes.', '', '', '', '', '', '', 47187),
(70168, 'esES', 'Pequeños accidentes tristes', 'Recupera las pinturas perdidas de Hudson de los jefes finales de los Estanques de Vida Rubí, la Ofensiva Nokhud y la Hondonada Frondacuero.', 'Has venido hasta aquí. Lo siento...\n\nA mi querido Hudson le encantaba pintar. ¡Era su razón de ser! No sé qué habrá causado que se bloqueara.\n\nHace unas semanas, de vuelta de uno de sus viajes para pintar, cogió todas sus obras inacabadas y las tiró en un ataque de rabia.\n\nPor favor, si no te importa..., ¿podrías encontrarlas? Puede que le devuelvan la chispa que necesita.\n\nHudson no rehúye los lugares peligrosos para encontrar las mejores vistas, así que prepárate bien.', '', '', '', '', '', '', 47187),
(70166, 'esES', 'El placer de la pintura', 'Entrega el cuadro de presentación de Rauvros a Hudson.', '¿Te gusta mi colección? Son obras de Hudson, el mejor pintor de toda la historia.\n\nSon poco comunes y puede que muy valiosas..., más que nada porque él es un ermitaño y lleva un tiempo sin pintar nada nuevo. Ay, ¡me encantaría conocerlo! ¡O aprender algo de él!\n\nOye... Parece que tienes agallas. ¿Podrías dar con él? ¡T-ten! Llévate una de mis obras. ¡Puede que le impresione!\n\nO quizá le parezca horrorosa... Madre mía.', '', '', '', '', '', '', 47187),
(70164, 'esES', 'La oportunidad de una manitas', 'Habla con el cronomántico Phosildral y Sibrit Puntapágina en las Ruinas de la Cámara de la Vida.', '¿Tienes un momento, $p? ¡Estoy cerca de un nuevo avance!\n\nTras el colapso del nido, perdí algo más que mi capacidad de volar. Perdí mi identidad como dracthyr. Quizás puedas entenderlo.\n\nSiempre he disfrutado montando y desmontando cosas, por lo que la Expedición me pareció una buena opción. Pero este artefacto me está volviendo loca.\n\n¿Podrías pedirle a Phosildral y a Sibrit que revisen mis notas? Quiero demostrar que puedo ser una verdadera manitas... tanto a ellos como a mí misma.', '', '', '', '', '', '', 47187),
(70163, 'esES', 'Los cruces avanzados de las cavernas', 'Atraviesa los anillos planeando.', 'Vuela a través de los anillos de control que marcan el recorrido.', '', '', '', '', '', '', 47187),
(70161, 'esES', 'Los cruces de las cavernas', 'Atraviesa los anillos planeando.', 'Vuela a través de los anillos de control que marcan el recorrido.', '', '', '', '', '', '', 47187),
(70159, 'esES', 'El sabor del hogar', 'Pregunta a los miembros de la Horda en el Campamento Base Dragontina si te pueden prestar los ingredientes que necesitas.', '¡Por fin aparece $gun:una; dracthyr para echar una mano!\n\nMi hermano y yo hemos intentado preparar algunas raciones, pero...\n\n<Scaralesh gesticula a su alrededor>.\n\nPor aquí todo es muy diferente. Es difícil encontrar los mismos ingredientes que utilizábamos para cocinar.\n\nPero podemos adaptarnos. Ve a preguntar a los miembros de la Horda si tienen algo que podamos usar como materia vegetal, proteínas y líquido emulsionante. Luego comeremos como es debido.', '', '', '', '', '', '', 47187),
(70158, 'esES', 'El paseo avanzado por los jardines', 'Atraviesa los anillos planeando.', 'Vuela a través de los anillos de control que marcan el recorrido.', '', '', '', '', '', '', 47187),
(70157, 'esES', 'El paseo por los jardines', 'Atraviesa los anillos planeando.', 'Vuela a través de los anillos de control que marcan el recorrido.', '', '', '', '', '', '', 47187),
(70156, 'esES', 'Un despertar ancestral', 'Potencia la puerta.', 'La puerta está justo detrás de mí. No hay forma de saber cuánto tiempo tenemos hasta que el encantamiento de este recipiente se desvanezca o, peor, se rompa.\n\nLa cantidad de energía inestable liberada podría ser catastrófica.\n\n¿Seguimos?', '', '', '', '', '', '', 47187),
(70155, 'esES', 'Mira, escucha y respira', 'Pesca con Threshrak.', 'Saludos, $r. Pocos se paran a saludar y son menos todavía los que se quedan un rato. La mayoría se apresuran a seguir hacia su siguiente destino.\n\n¿Te gustaría pescar conmigo?', '', '', '', '', '', '', 47187),
(70154, 'esES', 'Un portal a algún lugar', 'Sigue a la taumaturga de distorsión Delandra hasta la ubicación de la puerta.', 'El encantamiento nos protegerá de la energía inestable que contiene.\n\nAbriré paso hasta la piedra más cercana.\n\nUna vez que cruces, no te alejes. Necesitaré tu ayuda cuando lleguemos para activar el dispositivo.', '', '', '', '', '', '', 47187),
(70149, 'esES', 'Esperanza para las Tierras Altas', '', '', '', '', '', '', '', '', 47187),
(70148, 'esES', 'Sin propósito', 'Encuentra al garfa Ethrethi en la Embajada Reposo Alado.', '¿Me concedes un momento?\n\nMe preocupa un dracthyr que pasó por aquí. Nos preguntó a mis compañeros y a mí todo tipo de cosas, pero parecía... decepcionado con las respuestas.\n\nSe hacía llamar \"garfa Ethrethi\". Creo que eso implica que es un novato entre nuestras filas.\n\nMe dio la impresión de que le vendría bien algo de ayuda. ¿Puedes ayudarme con esto?\n\nLo vi hablar con Kholmar por allí.', '', '', '', '', '', '', 47187),
(70146, 'esES', 'Impugnación de las Tierras Altas', '', '', '', '', '', '', '', '', 47187),
(70139, 'esES', 'Este resguardo me lo guardo', 'Evalúa los daños causados a las piedras de resguardo en la Reserva de Tyrhold.', 'Antes, la reserva estaba protegida por tres piedras de resguardo colocadas por Tyr.\n\nSe suponía que debían estabilizar la magia elemental de las Islas Dragón.\n\nCuando me despertaste, percibí el daño causado al resguardo del oeste. Me temo que los Primalistas pueden haber causado el mismo daño a todos los resguardos.\n\nAun así, debemos evaluar los daños para saber qué hacer a continuación.', '', '', '', '', '', '', 47187),
(70136, 'esES', 'No hay tiempo para el dolor', 'Recupera el bastón de Caminante del Tiempo y las notas de Caminante del Tiempo y mata al alfa enloquecido por el tiempo en el Bosque Fluyente de Thaldraszus.', 'Agh... Necesito un momento...\n\nEra mi primera misión... La energía temporal inestable se está filtrando en el bosque... y afectando a la fauna... Yo debía evaluar las consecuencias y, si era posible, recolectar esa magia para los Caminantes del Tiempo...\n\n<Zera sacude la cabeza un momento>.\n\nEstaba examinando una manada de vorquin cuando me atacó un oso enloquecido rebosante de magia temporal. Me pilló desprevenida y solo conseguí escapar por los pelos.\n\n¿Podrías encontrar el equipo que he perdido, $c? Ah, es posible que también tengas que encargarte de ese oso.', '', '', '', '', '', '', 47187),
(70135, 'esES', 'Elementales invasores', 'Mata a $1oa elementales primigenios en la Embajada Reposo Alado.', 'Los forjadores, artesanos y exploradores de la Expedición Dragontina no son aptos para el fragor de la batalla.\n\nTú y yo sí, $p.\n\nUsemos esa fuerza en las Islas Dragón para proteger a aquellos que no pueden protegerse por sí mismos.\n\nElimina a los elementales que se aproximan desde el norte para que la expedición pueda centrarse en sus nobles quehaceres.', '', '', '', '', '', '', 47187),
(70134, 'esES', 'Recuerdos', 'Recupera la cápsula del tiempo de Veritistrasz.', 'Gracias por escucharme, joven. Tengo que pedirte un favor.\n\nNo te preocupes, no se trata de más historias.\n\nCuando abandonamos este lugar dejé una... especie de cápsula del tiempo. ¿Podrías recuperarla? La dejé al fondo del Santuario de Vida Rubí, escondida detrás de uno de los pilares.\n\nLa escondí con un sigilo. Si lo activas, deberías poder ver mi cápsula del tiempo.', '', '', '', '', '', '', 47187),
(70132, 'esES', 'Quédate un rato', 'Siéntate un rato y observa el paisaje.', '<El viejo enano no reacciona ante tu presencia cuando te acercas. Frunce el ceño mientras observa el paisaje. Es una vista agradable. Quizá sea buena idea tomarse un respiro y disfrutarla>.', '', '', '', '', '', '', 47187),
(70129, 'esES', 'Tascopié el Terrible', 'Ayuda a Rowie a matar a Tascopié el Terrible.', 'Tienes razón, no tengo la fuerza suficiente para acabar con este yeti... si voy por mi cuenta.\n\n¡Pero estás aquí!\n\nLa guarida del malvado yeti, Tascopié el Terrible, está ahí delante. La cueva es... grande. ¡Pero no da miedo! Bueno, quizá un poco.\n\n¿Podrías entrar ahí y machacarlo un poco? ¡Te... te cubriré las espaldas!', '', '', '', '', '', '', 47187),
(70126, 'esES', 'El toque final', 'Convence al cliente de Miguel para que le encargue más pedidos de fabricación.', 'Ah, $p, me alegro de verte.\n\nTu ayuda al Consorcio de Artesanía, a Thomas y a mí ha sido de inestimable valor. Gracias.\n\nHay una cosa más de la que deberías estar al tanto como profesional: la relación con tus clientes.\n\nHoy he completado un pedido de fabricación para uno de ellos. ¿Podrías hablar con él de mi parte? Intenta convencerlo para que acuda a mí cuando necesite más cosas. Recuérdale que, si quiere productos de la mejor calidad, tiene que hablar conmigo personalmente.', '', '', '', '', '', '', 47187),
(70125, 'esES', '¿Dónde está Wrathion?', 'Pregúntale a Sendrax cuándo se espera que lleguen los dragones.', 'Mm, ¿dónde estará Wrathion?\n\nDijo que nos estaría esperando junto a una embajadora de Alexstrasza la Protectora, reina de los dragones.\n\nNo es propio de un dragón romper una promesa.\n\nPero al menos tenemos aquí a esta peculiar dracónida para recibirnos. ¿Podrías preguntarle cuándo llegarán los demás?', '', '', '', '', '', '', 47187),
(70124, 'esES', 'Materiales de práctica', 'Consigue $1oa escamas de protocría primigenia.', 'Estos protodracos no se parecen a ninguno que haya visto.\n\nSus escamas son resistentes al fuego y más fuertes que el acero sin perder flexibilidad alguna. Es increíble.\n\nLos artesanos me están pidiendo a gritos que les consiga algunas de esas escamas para trabajar con ellas.\n\nEmpieza por las crías. Sus pequeñas escamas deberían ser más flexibles hasta que hayamos dominado nuestra técnica trabajándolas.', '', '', '', '', '', 'Reúnete con Thaelin Yunquenegro en la Embajada Reposo Alado.', 47187),
(70123, 'esES', 'Alimañas primigenias', 'Mata $1oa protodracos primigenios en la Costa Indómita.', '<Azurathel observa con sospecha a los protodragones que acechan en la cresta que hay detrás de él>.\n\nJuraría que esos protodragones se acercan un poco más al campamento cada vez que me doy la vuelta.\n\nEsos no son los dragones que Wrathion nos invitó a conocer.\n\nLos protodragones son depredadores despiadados con los que no se puede razonar. Nosotros debemos ser igual de despiadados.\n\nReduce su número para mantener a raya sus ambiciones, o esta expedición terminará antes de empezar.', '', '', '', '', '', 'Reúnete con el escamandante Azurathel en la Embajada Reposo Alado.', 47187),
(70122, 'esES', 'Exploradores en peligro', 'Rescata a 3 miembros de la Expedición Dragontina en la Costa Indómita.', 'No confundas los objetivos académicos de la expedición con timidez, $p.\n\nNo somos eruditos recluidos en altas torres para estudiar antiguos tomos.\n\n¡Somos aventureros, capaces de ir en busca de conocimiento hasta el rincón más inhóspito de Azeroth!\n\nNuestra pasión por la aventura nos lleva por caminos llenos de peligros, y algunos miembros de la expedición se han llevado algún mordisco más de los que quieren admitir...\n\nPero, bueno, ¡el peligro lo hace más divertido!', '', '', '', '', '', 'Reúnete con Toddy Bigotis en la Embajada Reposo Alado.', 47187),
(70112, 'esES', 'Amenaza fúrbolg', '', '', '', '', '', '', '', '', 47187),
(70110, 'esES', 'Catalogar Thaldraszus', '', '', '', '', '', '', '', '', 47187),
(70100, 'esES', 'Catalogar las Tierras Azures', '', '', '', '', '', '', '', '', 47187),
(70079, 'esES', 'Catalogando las Llanuras de Ohn\'ahra', '', '', '', '', '', '', '', '', 47187),
(70070, 'esES', 'Pero... yo soy el héroe de los patos', 'Encuentra a Ignogalletita y asegúrate de que vuelve con Gracus.', 'Espera... Hay algo...\n\n<Gracus mira alrededor>. \n\n¡Ignocuaquens! ¡El pequeño debe de haberse ido río abajo de nuevo! No importa cuántas veces se lo diga, ¡siempre intenta jugar con los cornisapos!\n\nNecesito que vayas a ver cómo está. Espero que no se lo hayan vuelto a tragar.', '', '', '', '', '', 'Habla con Gracus sobre lo que has visto.', 47187),
(70069, 'esES', 'Otros me llaman pastor de patos', 'Da de comer a $1oa patitos y vuelve con Gracus.', 'Mi tiempo se acaba, pero aún no he terminado con mis obligaciones.\n\nToda la prole debería estar junto al arroyo. Los dejo allí con la esperanza de que se vuelvan más independientes. Pronto deberán valerse por sí mismos.\n\nHoy dependen de ti. Por favor, aliméntalos con la comida que has conseguido y luego trae a los patitos conmigo. Cuidado con Piloto, siempre está saltando por ahí.', '', '', '', '', '', '', 47187),
(70068, 'esES', 'Catástrofe de cobalto', '', '', '', '', '', '', '', '', 47187),
(70067, 'esES', 'Un mensaje para los Nokhud', '', '', '', '', '', '', '', '', 47187),
(70064, 'esES', '¡Por Imbu!', '', '', '', '', '', '', '', '', 47187),
(70062, 'esES', 'Algunos me llaman cazabichos', 'Recoge $1oa trozos de desove de alfazaque.', 'Ah, joven $r, me vendría bien tu ayuda. He criado a varias generaciones de criaturas en este lugar.\n\nMis preferidos son los patitos. Pero mi cuerpo se ha vuelto viejo y débil... Aunque eso no detiene el ciclo.\n\nNecesito que consigas comida para mis queridos patitos.', '', '', '', '', '', '', 47187),
(70061, 'esES', 'Alas en entrenamiento', 'Guía a una cría para que elimine $2oa hierbajos inquietos, $3oa criaguijoneros intrusivos y $4oa soplos incansables.', 'Los dragones se ausentaron de las islas durante bastante tiempo, $p. Si te soy sincera..., algunas de nuestras habilidades se han atrofiado a medida que se transmitían de generación en generación.\n\nNo debería ser muy difícil adiestrar a estas crías, pero nos está resultando complicado meterlas en vereda.\n\nVeamos.\n\nHe visto que incluso la mayordoma Selistra te confía las tareas más importantes. ¿Y si nos echas una mano y ayudas a una de nuestras crías?', '', '', '', '', '', '', 47187),
(70060, 'esES', 'El ascenso avanzado de la academia', 'Atraviesa los anillos planeando.', 'Vuela a través de los anillos de control que marcan el recorrido.', '', '', '', '', '', '', 47187),
(70059, 'esES', 'El ascenso de la academia', 'Atraviesa los anillos planeando.', 'Vuela a través de los anillos de control que marcan el recorrido.', '', '', '', '', '', '', 47187),
(70058, 'esES', 'Amigo en reparación', 'Recoge $1oa plumas rubíes suaves, $2oa trozos de tela y $3oa cuentas de cristal de los alrededores del Vitasagrario Rubí para ayudar a reparar el pato feliz.', 'El pato feliz se ha hecho daño mientras volábamos... Estaba perfectamente, pero, de repente..., ¡me he chocado con un árbol!\n\n<Lillistrasza señala con lástima al pato de peluche que tiene en la cabeza>.\n\n¡Se le está saliendo el relleno! ¡Tiene todas las plumas dobladas! ¡Se le ha saltado un ojo! ¡Noooo!\n\nPuedes arreglar al pato feliz, ¿verdad?', '', '', '', '', '', '', 47187),
(70055, 'esES', 'Sigilo de tormentas', 'Entrega el sigilo de tormentas al cazador de tormentas William en Ventormenta.', '<Alguien con un profundo conocimiento de la magia podría tener interés en estudiar un hallazgo como este>.', '', '', '', '', '', 'Entrega el sigilo de tormentas al cazador de tormentas William en Ventormenta.', 47187),
(70052, 'esES', 'El circuito avanzado del acantilado', 'Atraviesa los anillos planeando.', 'Vuela a través de los anillos de control que marcan el recorrido.', '', '', '', '', '', '', 47187),
(70051, 'esES', 'El circuito del acantilado', 'Atraviesa los anillos planeando.', 'Vuela a través de los anillos de control que marcan el recorrido.', '', '', '', '', '', '', 47187),
(70050, 'esES', 'Persiguiendo tormentas', 'Habla con el cazador de tormentas William en el Puerto de Ventormenta.', 'Conque esos guapetones te van a enviar a la aventura, ¿eh?\n\nMe parece bien. De todos modos, la expedición no podrá zarpar hasta que alguien ponga bajo control esas tormentas elementales.\n\nHabla con el cazador de tormentas William. Lidera los esfuerzos de la expedición para investigar las tormentas y podrá ofrecerte el equipo que necesites.\n\nYo coordinaré el resto de los preparativos mientras tú te lo pasas en grande por ahí.\n\n¡Pero me debes una!', '', '', '', '', '', 'Habla con el cazador de tormentas William en el Puerto de Ventormenta.', 47187),
(70049, 'esES', 'Aplacar las tormentas', 'Recoge $1oa motas de energía primigenia de enemigos en ubicaciones de Tormentas primigenias de Kalimdor y los Reinos del Este.', 'Los Primalistas son implacables. Han desatado la devastación elemental a lo largo de los Reinos del Este y Kalimdor.\n\nDebes demostrar la misma determinación, $n. Es la única forma de detenerlos.\n\nEncuentra su próxima incursión, acaba con los enemigos de la Tormenta primigenia antes de que sea demasiado tarde y desbarata sus planes.\n\n¡Debemos proteger Azeroth!', '', '', '', '', '', '', 47187),
(70048, 'esES', 'Una amenaza primigenia', 'Recoge $1oa motas de energía primigenia de enemigos en ubicaciones de Tormentas primigenias de Kalimdor y los Reinos del Este.', 'Raszageth no ha perdido el tiempo y está preparando sus fuerzas primalistas.\n\nEl Kirin Tor ha detectado unas tormentas enormes en puntos clave de Kalimdor y los Reinos del Este.\n\nLos Primalistas están desatando los elementos para sumarlos a sus fuerzas. Parece que planean sembrar el caos no solo en las Islas Dragón, sino también en las tierras de la Alianza y la Horda.\n\nBusca al enemigo y observa su modo de actuar. Debemos detenerlos antes de que sea demasiado tarde.', '', '', '', '', '', '', 47187),
(70047, 'esES', 'Prisiones heladas', '', '', '', '', '', '', '', '', 47187),
(70042, 'esES', 'Abundancia de oportunidades', 'Consigue varios objetos para Vish el Ratero.', 'Me has asustado, pensaba que me iban a pillar.\n\nMira cuántos expedicionarios valientes listos para conquistar las Islas Dragón... con las mochilas repletas de herramientas y equipo.\n\n¡Podríamos hacernos ricos!\n\nEcha un vistazo a ver si puedes coger algo y compartiremos los beneficios.', '', '', '', '', '', '', 47187),
(70041, 'esES', 'La furia de la Devoradora de Tormentas', 'Monta en el disco volador de Khadgar y mantén a raya el ejército primalista.', 'Raszageth está intentando arrancar toda la magia Arcana de la torre para poder destruirla.\n\nKalecgos está haciendo todo lo que puede para contenerla mientas yo utilizo mi magia para intentar reponer la energía Ley.\n\nMe temo que no aguantaremos mucho más. Mientras hablamos, se acercan más primalistas para atacarnos.\n\nLlévate mi disco Arcano modificado. Mantén a raya a los primalistas que se acercan... y esperemos que suceda un milagro.', '', '', '', '', '', 'Habla con Kalecgos, que está en la base de Vakthros.', 47187),
(70040, 'esES', 'Cayendo en el tiempo', 'Reúne a tus aliados y habla con Nozdormu.', 'El choque de las magias de la dragona bronce Chronormu y la dragona infinita Eternus ha hecho que caigan sin control a través del tiempo.\n\nConforme caen, rompen el propio tejido del tiempo, lo que provoca innumerables ondas en el tiempo y el espacio. Debemos localizarlas y traerlas de vuelta. Solo entonces podremos impedir que aumenten los daños. Tengo la certeza de que podrás detener la caída de Chronormu.\n\nReúne a los aliados que necesites para hacerlo mientras yo me concentro en su magia.', '', '', '', '', '', 'Reúne a tus aliados y habla con Nozdormu.', 47187),
(70035, 'esES', 'La carrera en los rápidos del río de Ruriq', '', '', '', '', '', '', '', '', 47187),
(70034, 'esES', 'Suministros de artesano: escama de salamantra', 'Entrega una escama de salamantra a Haephesta en el Vitasagrario Rubí.', '¿Buscas trabajo, $gdesollador:desolladora;? El Consorcio de Artesanía me ha pedido que consiga la escama de una salamantra para sus clientes.\n\nPuede que sea una artesana, ¡pero no una chica de los recados!\n\nEn fin... ¿Tú podrías encontrar una?', '', '', '', '', '', 'Entrega una escama de salamantra a Haephesta en el Vitasagrario Rubí.', 47187),
(70033, 'esES', 'Suministros de artesano: botas de cuero de pionero', 'Entrega unas botas de cuero de pionero a Haephesta en el Vitasagrario Rubí.', '¿Buscas trabajo, $gpeletero:peletera;? El Consorcio de Artesanía me ha pedido que fabrique unas botas para sus clientes.\n\nSe ve que no saben lo solicitada que estoy. ¿Sabes cuántos expedicionarios han venido hoy a quejarse de que tienen agujeros en los zapatos?\n\nSi tienes tiempo, estas son las medidas. Puede que el Consorcio de Artesanía sea una oportunidad de negocio prometedora para ti.', '', '', '', '', '', 'Entrega unas botas de cuero de pionero a Haephesta en el Vitasagrario Rubí.', 47187),
(70032, 'esES', 'Suministros de artesano: lentes de joyero', 'Entrega unas lentes de aumento de ónice hendido a Haephesta en el Vitasagrario Rubí.', '¿Buscas trabajo, $gjoyero:joyera;? El Consorcio de Artesanía me ha pedido que fabrique unas lentes para sus clientes.\n\n¡A mí! Como si tuviera tiempo para esto.\n\nTú puedes encargarte, ¿no?', '', '', '', '', '', 'Entrega unas lentes de aumento de ónice hendido a Haephesta en el Vitasagrario Rubí.', 47187),
(70031, 'esES', 'Suministros de artesano: rodillo liso de chef', 'Entrega un rodillo liso de chef a Haephesta en el Vitasagrario Rubí.', '¿Buscas trabajo, escriba?\n\nMe ha llegado un pedido de una empresa llamada el Consorcio de Artesanía.\n\nCreo que es una tarea lo bastante sencilla para $gun aprendiz:una aprendiza; como tú.', '', '', '', '', '', 'Entrega un rodillo liso de chef a Haephesta en el Vitasagrario Rubí.', 47187),
(70030, 'esES', 'Suministros de artesano: ópticas de calidad garantizada', 'Entrega un par de ópticas de calidad garantizada a Haephesta en el Vitasagrario Rubí.', '¡Ah, $gun ingeniero:una ingeniera;! Justo a tiempo.\n\nTengo que corregir algunos esquemas, pero ha visitado una mujer muy alta para pedirme un par de ópticas.\n\nTú sabes cómo fabricarlas, ¿verdad?\n\nLlévalas al Vitasagrario Rubí cuando las hayas fabricado. Dice que trabaja para Consorcio de Artesanía o algo así.', '', '', '', '', '', 'Entrega un par de ópticas de calidad garantizada a Haephesta en el Vitasagrario Rubí.', 47187),
(70029, 'esES', 'Suministros de artesano: varas de serevita rúnica', 'Entrega $1oa varas de serevita rúnica a Haephesta en el Vitasagrario Rubí.', 'Parece que tienes un toque mágico, $gencantador:encantadora;. ¿Podrías ayudarme con un pedido?\n\nEl Consorcio de Artesanía ha solicitado algunas varas de serevita para un cliente, pero las varas encantadoras no son mi especialidad.\n\nSi estás $gdispuesto:dispuesta; a hacerlo, Haephesta en el Vitasagrario Rubí te compensará por tu tiempo y esfuerzo.', '', '', '', '', '', '', 47187),
(70028, 'esES', 'Suministros de artesano: depósitos de sal', 'Entrega $1oa depósitos de sal a Haephesta en el Vitasagrario Rubí.', '¿Buscas trabajo, $gminero:minera;?\n\nEstaba hablando con Haephesta y dice que el Consorcio de Artesanía necesita sal para sus clientes.\n\nNormalmente lo haría yo mismo, pero... Bueno, que no me apetece hacerlo.\n\nÉchame una mano y ve a buscarla, ¿quieres?', '', '', '', '', '', 'Entrega $1oa depósitos de sal a Haephesta en el Vitasagrario Rubí.', 47187),
(70027, 'esES', 'Suministros de artesano: braciles de tela de perito', 'Entrega los braciles de tela de perito a Haephesta en el Vitasagrario Rubí.', '¿Buscas trabajo, $gsastre:sastra;? El Consorcio de Artesanía me ha pedido que fabrique unos braciles para sus clientes.\n\nAunque agradezco que los expedicionarios se interesen por nuestras labores, no tengo tiempo para un pedido como este.\n\n¿Quieres encargarte?', '', '', '', '', '', 'Entrega los braciles de tela de perito a Haephesta en el Vitasagrario Rubí.', 47187),
(70026, 'esES', 'Suministros de artesano: alfazaques de lava', 'Entrega $1oa alfazaques de lava a Haephesta en el Vitasagrario Rubí.', '¿Buscas trabajo, herborista? El Consorcio de Artesanía me ha pedido que reúna alfazaques para sus clientes.\n\nLa tierra tiene mucho que ofrecer, pero no hasta el punto de que pueda ausentarme un rato y volver con su petición.\n\nSi vas a salir de aventuras, ¿podrías recoger un par de alfazaques por el camino?', '', '', '', '', '', 'Entrega $1oa alfazaques de lava a Haephesta en el Vitasagrario Rubí.', 47187),
(70025, 'esES', 'Suministros de artesano: hoz de draconio', 'Entrega una hoz de draconio a Haephesta en el Vitasagrario Rubí.', 'Parece que no tienes nada que hacer. ¿Te interesa trabajar?\n\nEl Consorcio de Artesanía tiene un pedido de fabricación pendiente: una hoz de draconio. Yo podría encargarme de ello sin problemas, pero como tú eres $gel aprendiz:la aprendiza;, creo que la tarea te corresponde.\n\nFabrica la hoz, llévala al Vitasagrario Rubí y entrégasela a una draenei llamada Haephesta. Te pagará por tu trabajo.', '', '', '', '', '', 'Entrega una hoz de draconio a Haephesta en el Vitasagrario Rubí.', 47187),
(70016, 'esES', 'Apaciguar la tierra', '', '', '', '', '', '', '', '', 47187),
(70012, 'esES', '¡Protege las redes!', '', '', '', '', '', '', '', '', 47187),
(69995, 'esES', 'El Campo de Ferocidad, redivivo: ¡la maestra de la caza!', '', '', '', '', '', '', '', '', 47187),
(69994, 'esES', 'El Campo de Ferocidad, redivivo: ¡ronda de venganza elemental!', '', '', '', '', '', '', '', '', 47187),
(69993, 'esES', 'El Campo de Ferocidad, redivivo: ¡perdido en el Sueño!', '', '', '', '', '', '', '', '', 47187),
(69992, 'esES', 'El sigilo de tormentas', 'Entrega el sigilo de tormentas a la cazadora de tormentas Suhrakka en Durotar.', '<Alguien con un profundo conocimiento de la magia podría tener interés en estudiar un hallazgo como este>.', '', '', '', '', '', 'Entrega el sigilo de tormentas a la cazadora de tormentas Suhrakka en Durotar.', 47187),
(69984, 'esES', 'El diente de dragón con franjas doradas', 'Entrégale el objeto a Exadria.', '<Has descubierto los restos de un dragón caído. Quizá Exadria quiera echarle un vistazo>.', '', '', '', '', '', '', 47187),
(69983, 'esES', 'El hueso grabado con llamas', 'Entrégale el objeto a la acechagarra Kavia.', '<El hueso tiene grabadas unas misteriosas runas djaradin. Puede que la acechagarra Kavia quiera verlo>.', '', '', '', '', '', '', 47187),
(69981, 'esES', 'A satisfacción del cliente', 'Pregunta a los clientes del Consorcio de Artesanía si están contentos con sus pedidos de refabricación.', 'Eh, $c. ¿Tienes ganas de ayudar?\n\nAlgunos de nuestros clientes predilectos enviaron pedidos de refabricación al Consorcio de Artesanía, pero no tenemos noticias de ellos.\n\nSi te los cruzas, ¿podrías preguntarles y asegurarte de que están satisfechos con sus compras? ¡Los clientes siempre deben estar contentos contentos contentos!', '', '', '', '', '', 'Entrega el equipo a Mahra Doblárbol en el Paso de Crucerrío.', 47187),
(69980, 'esES', 'Vid marina: el regalo del pescador Tinnak', 'Lleva la cuerda de vid marina a Nunvuq en Iskaara.', '<Ves que la mano espectral del pobre pescador aún sujeta una cuerda tejida con algas resistentes aunque ligeras. Puede que Nunvuq le encuentre alguna utilidad en Iskaara>.', '', '', '', '', '', '', 47187),
(69979, 'esES', 'Una digna presa', 'Mata a Milmillar el Anciastado.', 'La sabiduría no cae de los árboles, debes cultivarla. Si quieres demostrar tu valía, lo harás a la manera de mi pueblo, aprendiendo mientras actúas.\n\nEncuentra y caza a Milmillar el Anciastado. Lleva generaciones escapando en las cacerías.\n\nDe este modo, obtendrás la sabiduría que buscas.', '', 'Milmillar el Anciastado ha logrado eludir a los cazadores durante generaciones. Quizá tú puedas dar caza a esa bestia.', 'Milmillar', '', '', '', 47187),
