(69965, 'esES', 'Controles de calidad', 'Prueba las herramientas de Haephesta en geodas cercanas para el Consorcio de Artesanía.', '¿Buscas trabajo, $c?\n\nRepresento a una nueva compañía comercial llamada el Consorcio de Artesanía. Se encarga de poner en contacto a artesanos y clientes mediante una red de pedidos de fabricación.\n\nLa Expedición Dragontina ha hecho un pedido de herramientas de minería encantadas. Las herramientas ya están fabricadas, pero nos gustaría probarlas antes de entregarlas.\n\nTe pagaremos por tus servicios, claro.', '', '', '', '', '', '', 47187),
(69964, 'esES', 'Elemental agravarrisco', '', '', '', '', '', '', '', '', 47187),
(69963, 'esES', 'Anciano protector', '', '', '', '', '', '', '', '', 47187),
(69962, 'esES', 'Protodragón corrupto', '', '', '', '', '', '', '', '', 47187),
(69961, 'esES', 'Frozion', '', '', '', '', '', '', '', '', 47187),
(69960, 'esES', 'Gravlion', '', '', '', '', '', '', '', '', 47187),
(69959, 'esES', 'Gaelzion', '', '', '', '', '', '', '', '', 47187),
(69958, 'esES', 'La prueba avanzada de Tyrhold', 'Atraviesa los anillos planeando.', 'Vuela a través de los anillos de control que marcan el recorrido.', '', '', '', '', '', '', 47187),
(69957, 'esES', 'La prueba de Tyrhold', 'Atraviesa los anillos planeando.', 'Vuela a través de los anillos de control que marcan el recorrido.', '', '', '', '', '', '', 47187),
