(69946, 'esES', 'El maestro de su oficio', 'Busca al maestro Khadin para aprender su sabiduría profesional.', 'Mientras viajaba por estas llanuras, conocí a un viejo centauro en una cueva al norte. Me quedó claro que había dominado su profesión y poseía sabiduría a raudales.\n\nMe ayudó a entender lo que aprendí en las Islas Dragón.\n\nSi tienes interés en especializarte en tu profesión, búscalo. Se llama Khadin, del Clan Teerai.', '', '', '', '', '', 'Habla con Khadin en la Cueva de Khadin.', 47187),
(69944, 'esES', 'Persiguiendo tormentas', 'Habla con la cazadora de tormentas Suhrakka en la torre de zepelines.', 'Ese mago tiene sentido del espectáculo, ¿eh?\n\nNo podremos zarpar hasta que alguien ponga bajo control esas tormentas elementales.\n\nHabla con la cazadora de tormentas Suhrakka. Lidera la expedición para investigar las tormentas y podrá ayudarte a ponerte el equipo que necesites.\n\nMientras tú te ocupas de ese asunto, yo coordinaré el resto de los preparativos. Al menos me dará tiempo a leer unos cuantos libros sobre la historia de los dragones antes de zarpar.', '', '', '', '', '', 'Habla con la cazadora de tormentas Suhrakka en la torre de zepelines.', 47187),
(69939, 'esES', 'Socorro nemoroso', 'Consigue un cono de granizado y dáselo a la nutria alterada.', 'Ah, $n, estás aquí. Te he estado buscando por todas partes.\n\nOtra de nuestras alimañas ha estado sufriendo una triste falta de golosinas últimamente. ¿Puedes ir a buscarle algo dulce para picar?', '', '', '', '', '', '', 47187),
(69938, 'esES', '¡Locos por la pesca!', '', '', '', '', '', '', '', '', 47187),
(69936, 'esES', 'Zambul, Cabecilla de los Vándalos', 'Derrota al sobrestante Zambul.', 'Buen trabajo. Esos herejes no pueden obligar a más ancestros a luchar por ellos. Pero tenemos que encargarnos del bruto que les da órdenes.\n\nEs su sobrestante, Zambul. Debemos detenerlo.\n\nAcaba con él.', '', '', 'Sobrestante Zambul', '', '', '', 47187),
(69934, 'esES', 'Corazones sangrantes', 'Entrega los suministros médicos.', 'Las pociones están listas, y ya solo falta entregarlas.\n\nLleva un cajón a una pequeña cueva en el barranco que hay debajo de nosotros. No verás a nadie para recoger la entrega, pero te garantizo que se le dará buen uso.\n\nLleva otra caja a la enfermería del Puesto Gelikyr. Allí hay alguien de mi confianza que se encarga de los enfermos.\n\nAhora caigo... en que esta tarea no te corresponde. Ni a mí. No obstante, has sido sorprendentemente útil, y estos medicamentos podrían salvar vidas.', '', '', '', '', '', '', 47187),
(69933, 'esES', 'La curiosidad tiene un precio', 'Recoge un trozo de la vid obcecada.', 'Echa un vistazo al barranco, $r. Los Primalistas atacaron el Puesto Gelikyr hace días, y la batalla continúa.\n\nEsa gente necesita bálsamos y costuras. Puedo fabricarlo todo, pero me estoy quedando sin ingredientes. Como te has colado en mi hogar, quedas a mis órdenes.\n\nVe a mi jardín y encuentra la vid más grande que veas. Arráncala de raíz y tráemela.', '', '', '', '', '', '', 47187),
(69932, 'esES', 'Tu granito de arena', 'Recoge ingredientes para sustituir los vendajes de Chorrito.', 'Me paso el día haciendo pociones para todo Gelikyr, así que no tengo tiempo para el resto de mis tareas.\n\nUn pato llegó a mi jardín con una costilla rota. Me he ocupado de la herida, pero hay que cambiarle la gasa. Como tienes tantas ganas de ayudar...\n\n<Szareth te entrega una lista con ingredientes>.\n\nAquí está lo que necesitas. Tráemelo.', '', '', '', '', '', '', 47187),
(69930, 'esES', 'Basrikron', '', '', '', '', '', '', '', '', 47187),
(69925, 'esES', 'Aplacar las tormentas', 'Recoge $1oa motas de energía primigenia de enemigos en ubicaciones de Tormentas primigenias de Kalimdor y los Reinos del Este.', 'Los Primalistas son implacables. Han desatado la devastación elemental a lo largo de los Reinos del Este y Kalimdor.\n\nDebes demostrar la misma determinación, $n. Es la única forma de detenerlos.\n\nEncuentra su próxima incursión, acaba con los enemigos de la Tormenta primigenia antes de que sea demasiado tarde y desbarata sus planes.\n\n¡Debemos proteger Azeroth!', '', '', '', '', '', '', 47187),
(69924, 'esES', 'Torres de poder llameante', '', '', '', '', '', '', '', '', 47187),
(69923, 'esES', 'Una amenaza primigenia', 'Recoge $1oa motas de energía primigenia de enemigos en ubicaciones de Tormentas primigenias de Kalimdor y los Reinos del Este.', 'Raszageth no ha perdido el tiempo y está preparando sus fuerzas primalistas.\n\nEl Kirin Tor ha detectado unas tormentas enormes en puntos clave de Kalimdor y los Reinos del Este.\n\nLos Primalistas están desatando los elementos para sumarlos a sus fuerzas. Parece que planean sembrar el caos no solo en las Islas Dragón, sino también en las tierras de la Alianza y la Horda.\n\nBusca al enemigo y observa su modo de actuar. Debemos detenerlos antes de que sea demasiado tarde.', '', '', '', '', '', '', 47187),
(69919, 'esES', 'Necesidades de la profesión', 'Habla con Azley para aprender a realizar pedidos de fabricación.', 'Tienes pinta de que se te da bien la artesanía. ¿Te gustaría completar algunos pedidos de fabricación para otros aventureros y ganar mucho mucho mucho dinero?\n\nTe explicaré las normas para trabajar con el Consorcio de Artesanía y luego podrás aceptar pedidos de fabricación en cualquier estación de fabricación de las Islas Dragón.', '', '', '', '', '', '', 47187),
(69918, 'esES', 'Sacudir nuestros cimientos', 'Mata a Tokara la Muelepiedras, a Molka la Picadora y a los elementales que han liberado.', '¡Los amarrapiedras djaradin amenazan con destruir los cimientos de la Ciudadela! ¡Tenemos que detenerlos!\n\nNi siquiera hemos tenido la oportunidad de reclamar la ciudadela como nuestra, y ya puede que se derrumbe bajo nuestros pies. No podemos permitir que ocurra.\n\nHaz lo que puedas, $n... ¡Y con eso me refiero a que acabes con ellos!', '', 'Al igual que Tokara la Muelepiedras, Molka es una experta manipuladora de la dura piedra obsidiana que hay bajo la ciudadela.', 'Molka la Picadora', '', '', '', 47187),
(69915, 'esES', 'Publicidad agresiva', 'Recupera los folletos de las cabras crucerrío y las cabras entrometidas.', '¡Hola, hola, hola! ¿Buscas trabajo?\n\nEstamos preparando una gran oferta de apertura para nuestro nuevo puesto de pedidos de fabricación, ¡y necesitamos llamar la atención! Pero el viento se llevó mis folletos y creo que algunas de las cabras locales huyeron con ellos.\n\n¿Podrías recuperarlos?', '', '', '', '', '', '', 47187),
(69914, 'esES', 'Los Djaradin han despertado', 'Recibe tus órdenes de la mayordoma Selistra.', 'Ojalá tuviéramos tiempo para presentaciones más agradables, pero no todos podemos ser Chronormu, ¿verdad?\n\nSoy Selistra, mayordoma de Alexstrasza la Protectora, reina de los dragones.\n\nLa reina Alexstrasza me pidió que te transmitiera sus más cordiales saludos y que te acompañara a los Estanques de Vida.\n\nPero me temo que debo pedir tu ayuda antes de ir hacia allá.\n\nNuestros antiguos rivales, los Djaradin, han despertado de su letargo bajo la tierra y ya han asaltado un puesto de avanzada cercano.', '', '', '', '', '', 'Reúnete con Sendrax en la Embajada Reposo Alado.', 47187),
(69912, 'esES', '¡Mi primera emergencia real!', 'Convence a Sendrax para que lance su bengala de emergencia y avise a los dragones de tu llegada.', '<Sendrax parece desconcertada>.\n\nMe cuesta creer que la mayordoma llegue tarde a nada, y menos a algo tan importante como esto.\n\nEs muy raro...\n\n<De repente, parece tener una idea>.\n\nPodría usar mi bengala de emergencia para avisar de vuestra llegada. ¡Así vendrían corriendo a recibiros!\n\nAunque nunca he lanzado la bengala de emergencia...', '', '', '', '', '', 'Reúnete con Wrathion en la Embajada Reposo Alado.', 47187),
(69911, 'esES', 'Perdón por el desastre', 'Ayuda al embajador Fastrasz a arreglar la embajada.', 'Ojalá supiera más sobre cómo daros la bienvenida a las Islas Dragón, pero no soy más que una centinela.\n\n<Sendrax señala la torre detrás de sí>.\n\nPodrías intentar hablar con el embajador Fastrasz en el centro de visitantes. Quizá pueda responder más preguntas antes de que lleguen los dragones.\n\nMira bien dónde pisas. Estaba limpiando los escombros la última vez que lo vi.', '', '', '', '', '', '', 47187),
(69910, 'esES', '¿Dónde está Wrathion?', 'Pregúntale a Sendrax cuándo se espera que lleguen los dragones.', 'Qué raro.\n\nEbyssian nos dijo que Wrathion nos estaría esperando junto a un embajador de Alexstrasza la Protectora, reina de los dragones.\n\nNo es propio de un dragón romper una promesa.\n\nPero al menos está aquí esta peculiar dracónida para recibirnos. ¿Serías tan amable de averiguar cuándo llegarán los demás?', '', '', '', '', '', '', 47187),
(69904, 'esES', 'Silencio sospechoso', 'Encuentra a los aprendices de Noriko en el Campamento de Antonidas.', '¿Tienes un momento, $p? Hace tiempo que no sé nada de mis aprendices Sidrácido y Tucky.\n\nTengo miedo.\n\nLos envié a buscar suministros para la posada. No pueden andar lejos de aquí...\n\nBúscalos, pero ve con ojo... Son de armas tomar.', '', '', '', '', '', '', 47187),
(69902, 'esES', 'Teoría en práctica', 'Ayuda a Tyrgon a sanar a la criatura.', '$n, necesito tu ayuda...\n\nEspero que nadie se crea que puedo fabricar cosas, aplacar a la cría, ejercer de sanador y enseñar a los niños... ¡a la vez! Qué obsesión con la multitarea...\n\nEn fin, puedes empezar por usar esas flores. Yo necesitaré unos minutos para prepararme antes de sanar a la protocría.\n\nCon suerte, los niños sacarán una lección de este incidente...', '', '', '', '', '', '', 47187),
(69901, 'esES', 'En manos expertas', 'Recoge $1oa flores de luz solar.', '¿Te ha dicho Iyali cuánto tiempo ha estado sufriendo esta criatura? Si está demasiado herida como para comer, debemos tratarla inmediatamente.\n\nNormalmente, un campamento de la Expedición Dragontina tendría todo lo que necesito para ayudar a esta cría, pero traer suministros a las Islas Dragón no ha sido tan fácil como pensábamos, y ha habido bastantes retrasos en nuestras rutas de suministros.\n\nPero no temas, ¡las mismas islas nos proveerán! Si me traes flores de luz solar, podré elaborar un bálsamo que calme al draco mientras lo curo.', '', '', '', '', '', '', 47187),
(69900, 'esES', 'Identificar la fuente', 'Mata al primalista que está experimentando en la Reserva Agreste.', 'A juzgar por lo que han dicho los niños, puede que haya un primalista acechando en la Reserva Agreste.\n\nEsto requiere investigación inmediata.\n\nDe acuerdo a las investigaciones de mis compañeros, a los Primalistas les encanta robar huevos y crías para imbuirlos de poder y corromperlos. Quienes no se aclimatan al proceso sufren una lenta muerte... Tampoco es que a ellos les importe.\n\nHay que sacarlos de la Reserva. Encárgate y yo intentaré distraer a los niños. No deben enterarse de esto.', '', '', '', '', '', '', 47187),
(69899, 'esES', 'Investigación secreta', 'Ayuda a Iyali y a sus amigos.', 'Sé... que estoy actuando de forma extraña. ¡Lo siento!\n\nProbablemente hayas adivinado que no estoy siendo sincera.\n\nTe puedo contar mi secreto, si quieres. ¡Pero tienes que prometer que no se lo dirás a los mayores!', '', '', '', '', '', '', 47187),
(69898, 'esES', 'Método carnífico', 'Recoge $1oa trozos de carne de bestia fluvial superdeliciosa.', 'Esto... Tengo más deberes. Sí, deberes. ¡Las lecciones del profesor Tyrgon son superdifíciles! Quiere que averigüemos qué comen las protocrías. Sí...\n\n¡Y ya sé la respuesta! ¡Carne de bestia fluvial!\n\n¿Puedes traerme un trozo de carne de bestia fluvial? Una imagen vale más que mil palabras para mi proyecto.\n\nPero tiene que ser un trozo muy bueno, ¿vale? Por ejemplo..., de bestia fluvial del lodo. Como el que una mamá protodraco le daría a su cría para que creciera fuerte porque... esto... eso alegraría al profesor Tyrgon.', '', '', '', '', '', '', 47187),
(69897, 'esES', 'La \"tarea\" sobre el análisis de comportamiento', 'Acaricia a $4oa crías adormiladas e informa a Iyali.', 'Necesito hablar con alguien que sepa de protocrías. Como las que viven en la Reserva Agreste.\n\n¿Son tan furiosas como cuando son grandes? ¿Muerden o escupen fuego?\n\nY si yo... eh... ¿Y si tú acaricias a una protocría? ¿Sabrían que vas en son de paz y que estás intentando ayudarlas?\n\nTe lo pregunto en nombre de la ciencia, por supuesto. Tyrgon siempre dice que probemos nuestras hipa... no... hepo... No. ¡Ay! ¡NUESTRAS TEORÍAS!\n\nCreo que les gustaría que las acariciasen y que les haría sentir bien. ¿Puedes probar por mí?', '', '', '', '', '', '', 47187),
(69896, 'esES', 'Desvío desastroso', 'Reúnete con la elementalista Taiyang en las Ruinas de la Cámara de la Vida.', 'Sabía que unirme a la Expedición Dragontina implicaría adentrarme en territorio peligroso. ¡Lo que no esperaba es tener que luchar contra elementales!\n\n¡Nuestra excavación en las Ruinas de la Cámara de la Vida está sumida en el caos! ¡Unas monstruosidades de piedra se están alzando de la tierra! Llamamos a una elementalista para pedirle consejo, pero creo que necesitará toda la ayuda posible.\n\n¿Y si vas a ayudarla? Nuestro campamento está al otro lado del río.', '', '', '', '', '', '', 47187),
