(69870, 'esES', 'Imágenes con propósito', 'Reúnete con Akunda la Catalogadora y la artillera Fren cerca de los Rápidos Desbordantes.', 'Las imágenes unen a la gente, $p.\n\nSuelen enviar a nuestros catalogadores de dos en dos por seguridad, pero ha sido un placer ver que miembros de facciones y orígenes distintos son capaces de trabajar codo con codo en pos del conocimiento en estas islas tan increíbles.\n\nUno de estos dúos se encuentra registrando uno de los ríos centrales de las Orillas del Despertar.\n\nSi quieres ayudarnos, únete a ellas para catalogar la fauna que hay allí.', '', '', '', '', '', 'Reúnete con Akunda la Catalogadora y la artillera Fren cerca de los Rápidos Desbordantes.', 47187),
(69869, 'esES', 'El paraíso de una catalogadora', 'Habla con la catalogadora Coralie en el Campamento Base Dragontina.', '<El doctor Nanners parece quedarse sin aliento mientras te entrega una carta en la que se te invita a volver al campamento base de la Expedición Dragontina para recibir instrucción. Intenta darte explicaciones con nerviosismo>.\n\nElfo amable. Hombrecito orgulloso. Muchas cámaras. ¿Sí?\n\n<El doctor Nanners asiente con emoción esperando tu respuesta>.', '', '', '', '', '', 'Habla con la catalogadora Coralie en el Campamento Base Dragontina.', 47187),
