(69862, 'esES', 'Salvar a un astudraco', 'Averigua qué perturba a Sylvie.', 'Ahora que se ha curado, creo que Sylvie quiere mostrarnos algo.\n\n¡Nuestro trabajo aún no ha terminado, $n! Veamos qué le pasa.', '', '', '', '', '', '', 47187),
