(69855, 'esES', 'Vocación de escalador', 'Habla con el abrecaminos Jeb en el Campamento Base Dragontina.', '<El doctor Nanners parece quedarse sin aliento mientras te entrega una carta en la que se te invita a volver al campamento base de la Expedición Dragontina para recibir instrucción. Intenta darte explicaciones con nerviosismo>.\n\nDel gran Jeb. Buen amigo. Escalar ya. ¿Sí?\n\n<El doctor Nanners asiente con emoción esperando tu respuesta>.', '', '', '', '', '', 'Habla con el abrecaminos Jeb en el Campamento Base Dragontina.', 47187),
