(69097, 'esES', 'Una cámara sin sellar', 'Habla con la catalogadora Jakes en el Campamento Base Dragontina.', '<El doctor Nanners parece quedarse sin aliento mientras te entrega una carta en la que se te invita a volver al campamento base de la Expedición Dragontina. Intenta darte explicaciones con nerviosismo>.\n\nEnana ruidosa. Elfa seria. Te esperan. ¿Sí?\n\n<El doctor Nanners asiente con emoción esperando tu respuesta>.', '', '', '', '', '', 'Habla con la catalogadora Jakes en el Campamento Base Dragontina.', 47187),
(69096, 'esES', 'El propósito de Taivan', 'Intenta calmar a la centáuride huérfana Chimei.', '¿Ves a esa joven, sentada junto al arrollo?\n\n<Señala al noreste, donde ves a una joven centauro mirando el agua>.\n\nChimei perdió a sus padres durante un ataque de los Nokhud. He curado todas sus heridas físicas, pero no ha comido ni ha dicho nada desde que la encontramos. Solo se sienta y mira fijamente a la nada.\n\nEsto va más allá de mis habilidades, y no sé qué hacer. $n, ¿podrías intentar hablar con Chimei?', '', '', '', '', '', '', 47187),
(69095, 'esES', 'Sabueso de vuelta a casa', 'Monta en Taivan y vuelve a Maruukai', 'Hemos podido estabilizarlos a todos gracias a ti y a Taivan, pero muchos de los aldeanos necesitarán más tiempo en Maruukai para curarse del todo.\n\n¿Por qué no guiais la caravana de vuelta? ¡Os lo habéis ganado después de vuestras hazañas de hoy!', '', '', '', '', '', '', 47187),
(69094, 'esES', 'Salvando centauros', 'Rescata a centauros heridos en la aldea de Daruukhan.', '¡La traición de los Nokhud no conoce límites! En la aldea de Daruukhan solo viven artesanos. No tenían ninguna posibilidad contra los asaltantes.\n\nNecesitamos tu ayuda desesperadamente, $n. Los Nokhud siguen cerca y debemos atender a los heridos.\n\nRegistra la aldea y tráeme a los supervivientes que encuentres. ¡Les ayudaremos cuanto podamos!', '', '', '', '', '', '', 47187),
(69093, 'esES', 'Un nuevo misterio', 'Habla con Naleidea Brillorrío en el Campamento Base Dragontina.', '<El doctor Nanners parece quedarse sin aliento mientras te entrega una carta en la que se te invita a volver al campamento base de la Expedición Dragontina. Intenta darte explicaciones con nerviosismo>.\n\nPuerta sellada. Secretos titánicos. ¿Sí?\n\n<El doctor Nanners asiente con emoción esperando tu respuesta>.', '', '', '', '', '', 'Habla con Naleidea Brillorrío en el Campamento Base Dragontina.', 47187),
(68799, 'esES', 'Retorno al Vitasagrario Rubí', 'Vuelve al Vitasagrario Rubí.', '¡Y esto es solo el principio de tu andadura como jinete de dragones!\n\nMantén los ojos abiertos en busca de nuevas aventuras y experiencias por las Islas Dragón y no olvides visitarnos en cualquiera de nuestras avanzadas.\n\nAhora vuelve con Alexstrasza para seguir explorando estas tierras.', '', '', '', '', '', 'Vuelve con Alexstrasza en el Vitasagrario Rubí.', 47187),
(68798, 'esES', 'Los glifos dracónicos y tú', 'Recoge el glifo dracónico en el Observatorio Cima Celestial y después habla con Lithragosa para usar tu talento.', 'Es evidente que no solo Glensera y yo estamos interesados en estas aventuras. Lithragosa también está ansiosa por ayudarte a perfeccionar tus habilidades como jinete de dragones y ya has conocido a Celormu, cosa que está muy bien.\n\nHay unos glifos repartidos por las Islas Dragón que te ayudarán a aprender más trucos y facultades relacionados con la monta de dragones. De hecho, hay uno justo aquí, en el Observatorio Cima Celestial.\n\nCuando lo encuentres, Lithragosa te ayudará a usarlo.', '', 'Los glifos que se encuentran a lo largo de las Islas Dragón te ayudarán a aprender más trucos y facultades de jinete de dragones.', 'Glifo dracónico', '', '', '', 47187),
(68797, 'esES', 'Cuernos nuevos', 'Reúnete con Glensera y usa el podio de transformación para personalizar a tu draco.', 'Al igual que los mortales, los dragones se preocupan mucho por su apariencia. Tu draco también puede cambiar según lo que encuentres y tu experiencia.\n\n¡Habla con Glensera en el podio de transformación para comprobarlo con tus propios ojos!', '', '', '', '', '', '', 47187),
(68796, 'esES', 'El Observatorio Cima Celestial', 'Viaja al Observatorio Cima Celestial en las Orillas del Despertar.', '¡Y esto es todo lo básico sobre montar en draco! Lo estás haciendo bastante bien.\n\nAhora me gustaría presentarte a otras personas implicadas en esta aventura. Hemos establecido nuestro hogar en el Observatorio Cima Celestial.\n\nCelormu te guiará hasta allí. ¡Habla con él cuando quieras surcar los cielos!\n\n¡Nos vemos allí!', '', '', '', '', '', 'Reúnete con lord Andestrasz en el Observatorio Cima Celestial.', 47187),
(68795, 'esES', 'Jinete de dragones', 'Habla con lord Andestrasz en el Vitasagrario Rubí.', 'Ya has averiguado algo de este lugar: las Islas Dragón son enormes.\n\nAlgunos dracos han mostrado gran interés por explorar cada rincón y escondrijo secreto de este famoso lugar, incluidos aquellos que no son accesibles desde el suelo. Están ansiosos por contar con otro par de ojos que los ayuden en sus aventuras y, a cambio, no tendrán inconveniente en llevar un jinete por estas tierras.\n\nHabla con lord Andestrasz en el Vitasagrario Rubí. Te contará más cosas sobre sus intenciones.', '', '', '', '', '', 'Habla con lord Andestrasz en el Vitasagrario Rubí.', 47187),
(68794, 'esES', 'Aliado de los dragones', 'Habla con Alexstrasza en el Trono de los Aspectos, que está en Valdrakken.', 'Tu ayuda a las Islas Dragón no ha pasado desapercibida, $n.\n\nLa mismísima Protectora quiere enseñarte algo como recompensa por tu servicio a los dragónicos.\n\nVe y habla con ella en lo alto de la torre. Te están esperando todos los Aspectos.', '', '', '', '', '', 'Habla con Alexstrasza en el Trono de los Aspectos, que está en Valdrakken.', 47187),
(68644, 'esES', 'Azúcar, especias y muchas cosas bonitas', 'Ayuda a tratar a Sylvie.', '¡Eso es! Ya tengo todo lo que necesito para Sylvie.\n\nY justo a tiempo. Dudo que hubiera aguantado mucho más.\n\nPero... necesito que alguien me ayude. Se lo pediría a Cally, pero... ¿te importaría ayudarme una vez más?\n\nSi quieres hacerlo, avísame cuando estés $glisto:lista;, $n.', '', '', '', '', '', '', 47187),
(68643, 'esES', 'Vitaminas y minerales', 'Recolecta $1oa viales de agua mineral.', 'Tendría que haber supuesto que Steria se enfadaría al pedirte que pelearas contra los animales...\n\nPor supuesto, existen métodos de investigación alternativos.\n\nToma estos viales y recoge un poco de agua de los cristales de hielo cercanos.\n\nSegún mi teoría, deberían contener minerales imbuidos de energía de cristal Ley, y puede que estén alimentando el brote de la zona.', '', '', '', '', '', '', 47187),
(68642, 'esES', 'Espinas por doquier', 'Recoge $1oa espinas imbuidas de energía Arcana.', 'Quiero ayudar a Sylvie, pero no retrasar más a Cally.\n\nPara darle a Sylvie la medicina, necesito espinas imbuidas de energía Arcana de los pinocristales. Seguro que no les importa que le arranques unas cuantas.\n\n¡Ten cuidado con los bakars! Comen pinocristales y puede que se enfaden si los tocas. Si te atacan, también puedes coger espinas de ellos.\n\nAunque... intenta no hacerlo, por favor.', '', '', '', '', '', '', 47187),
(68641, 'esES', 'Marcando musgo', 'Recolecta $1oa matas de dracomusgo.', 'Pobrecilla...\n\nDebe haber enfermado tras comer algo contaminado.\n\nPor suerte, mi abuelo, que era druida, me enseñó a tratar enfermedades Arcanas.\n\nNo tengo todos los ingredientes, pero podemos hacer algo con lo que ahí por aquí.\n\nPrimero necesitaré un poco de dracomusgo. Es un liquen poco común que solo crece en los huesos de dragón.', '', '', '', '', '', '', 47187),
(68639, 'esES', 'Depredadores polares merodeadores', 'Mata a $1oa gelipieles infectados.', 'La especie que nos han enviado a estudiar son los gelipieles.\n\nLas líneas Ley han contaminado sus terrenos de caza. Las energías Arcanas parasitan el agua, las plantas... y las especies de las que dependen, como los astudracos.\n\nPero, a diferencia de otros organismos, los gelipieles sobreviven al proceso y absorben su poder.\n\nNo obstante, se vuelven agresivos... Y eso es un problema. Enfréntate a unos cuantos mientras yo tomo nota sobre su fuerza y agresividad.\n\nMi informe ayudará al Kirin Tor a decidir qué hacer con ellos.', '', '', '', '', '', '', 47187),
(68087, 'esES', 'Peligro en Daruukhan', 'Habla con el mensajero Teerai para escuchar la petición urgente de Selbekh.', 'Me parece que no hay nada que hacer. Tendrás que volver con Taivan a Maruukai.\n\nUn momento... ¿Qué es eso que se acerca? ¡Espero que no sea otra persona con un bakar gigante!', '', '', '', '', '', '', 47187),
(68085, 'esES', 'Modelar a un pastor', 'Enseña a Taivan a hacer de pastor con los argalíes en Mallakh.', '¿Quieres que entrene a tu bakar para que sea pastor? Aquí nos dedicamos a eso, pero nunca he entrenado a uno tan grande...\n\nAun así, a los argalíes se les da bien captar las actitudes y no parece que les moleste su presencia.\n\nEstoy dispuesto a ofrecerle una oportunidad, pero un bakar pastor no solo debe ser cuidadoso, sino también inteligente. Si no es capaz de asumir el mando del rebaño, los argalíes no le obedecerán. ¡Es más difícil de lo que parece! Venga, prueba mientras os observo.', '', '', '', '', '', '', 47187),
(68084, 'esES', 'El gigante amable', 'Envía a Taivan al pastor Tevatei en Mallakh para que reciba entrenamiento.', 'Si Taivan es tan \"poco feroz\" como dice Jadar, puede que le vaya mejor como bakar pastor.\n\nLos Aylaag son expertos pastores de argalíes y no son tan orgullosos como para pedir regalos fastuosos antes de ayudar a otro clan.\n\nLleva a Taivan con el pastor Tevatei en Mallakh, un sitio situado entre dos colinas, al sureste, donde entrenan a sus bakars.\n\nPor Ohn\'ahra, espero que esto funcione. De lo contrario, ya no sé qué hacer.', '', '', '', '', '', '', 47187),
(68083, 'esES', '¡Vuelve a intentarlo, Taivan!', 'Vuelve con la sanadora Selbekh en Maruukai y comparte las malas nuevas.', 'Vuelve con los Teerai y cuéntales que ni siquiera yo he sido capaz de entrenar a Taivan para la caza. No está hecho para esto.\n\nEs el bakar menos feroz que he visto en mi vida. Apuesto a que intentaría hacerse amigo de las presas si se lo permitiéramos. ¡Ja!', '', '', '', '', '', 'Vuelve con la sanadora Selbekh en Maruukai.', 47187),
(67921, 'esES', 'El can de caza', 'Caza bestias peligrosas con Taivan para demostrar que es digno de comenzar el entrenamiento.', 'Ve y da caza a las bestias cercanas con tu bakar. Cuanto más grandes sean, mejor. Observaré desde aquí y decidiré si es digno de recibir la instrucción de los Shikaar.\n\nTe aviso desde ya que solo aceptaré lo mejor.', '', '', '', '', '', '', 47187),
(67772, 'esES', 'El problema con Taivan', 'Ayuda a la sanadora Selbekh a preparar a Taivan para su entrenamiento.', 'Hola, $gamigo:amiga;. Te doy la bienvenida de nuevo a Maruukai. Soy Selbekh, sanadora del Clan Teerai.\n\n¿Se te dan bien los animales, $n? Puede que la influencia de $gun recién llegado:una recién llegada; sea justo lo que necesito.\n\nTe presento a Taivan. Es muy buen compañero, pero se ha convertido en una carga para mi clan. Temo que no podamos darle un buen uso y que tengamos que deshacernos de él. ¿Puedes ayudarme?', '', '', '', '', '', '', 47187),
(67744, 'esES', 'Shezra', '', '', '', '', '', '', '', '', 47187),
(67742, 'esES', 'Ámbito del archivo avanzado', 'Atraviesa los anillos planeando.', 'Vuela a través de los anillos de control que marcan el recorrido.', '', '', '', '', '', '', 47187),
(67741, 'esES', 'Ámbito del archivo', 'Atraviesa los anillos planeando.', 'Vuela a través de los anillos de control que marcan el recorrido.', '', '', '', '', '', '', 47187),
(67724, 'esES', 'Llamas para mantener a raya', 'Recoge $1oa de seda de red trémula.', 'Kattigat y yo vinimos aquí con el propósito de derrotar a la Llama Hendida y recuperar el Valthrux para demostrar nuestra valía.\n\nAhora estamos aquí papando moscas y cuidando de esta elfa que se ha llevado un par de picaduras de araña de hielo. ¡Aún no hemos luchado contra la Llama Hendida y resulta que es posible que unas arañas nos impidan hacerlo!\n\nDebemos mantenerlas a raya.\n\nPor suerte, existe un modo natural para hacerlo. Cuando la seda de sus capullos arde, se genera un olor que las repele.\n\nRecoge un poco de seda y la echaré al fuego ¡Eso las mantendrá lejos!', '', '', '', '', '', '', 47187),
(67717, 'esES', 'La reina de telarañas Ashkaz', '', '', '', '', '', '', '', '', 47187),
(67700, 'esES', '¡A las Islas Dragón!', 'Monta en la Dragontina Robusta a las Islas Dragón desde los muelles del Puerto de Ventormenta.', '¡Buenas noticias, $p! La punta de lanza de nuestra expedición ha desembarcado en las Islas Dragón.\n\nGracias a tus esfuerzos y a los de los demás miembros de la Expedición Dragontina, hemos logrado establecer una zona segura y entrar en contacto con la embajada de los Vuelos.\n\n¿Estas $glisto:lista; para acompañarnos en nuestro siguiente viaje a las Islas Dragón?', '', '', '', '', '', 'Reúnete con Toddy Bigotis en las costas de las Islas Dragón.', 47187),
(67606, 'esES', 'El remedio de las dríades', 'Consigue una golosina de prole sabrosa y dásela al patito desanimado.', 'Mientras estabas fuera, me enteré por una liebre onírica de que uno de los patitos de la zona está bastante triste. Por suerte, ¡sé exactamente cómo arreglarlo!\n\nCada vez que estoy triste, me tomo algo dulce y sabroso Como experta en criaturas adorables y achuchables, sé que este principio también funcionará en este caso.\n\nA este patito en particular le gusta un postre local conocido como golosina de prole sabrosa. ¿Podrías encontrar una y llevársela al pobrecillo? ¡Para eso estamos las dríades!', '', '', '', '', '', '', 47187),
(67605, 'esES', 'Llanuras atronadoras', 'Hazte con el cuerno de Ayanga.', 'Hay una gran bestia de tormenta merodeando por este risco. Muchos cazadores Shikaar han intentado darle caza, pero han sucumbido ante su ferocidad.\n\nSi ansías la gloria de una cacería, intenta acabar con ella. Y tráeme su cuerno como tributo, si lo consigues.', '', 'Un desagradable truenagarto al que le gusta destruir campamentos de centauros.', 'Ayanga', '', '', '', 47187),
(67566, 'esES', 'El recorrido aéreo avanzado de las Tierras de Escarcha', 'Atraviesa los anillos planeando.', 'Vuela a través de los anillos de control que marcan el recorrido.', '', '', '', '', '', '', 47187),
(67565, 'esES', 'El recorrido aéreo de las Tierras de Escarcha', 'Atraviesa los anillos planeando.', 'Vuela a través de los anillos de control que marcan el recorrido.', '', '', '', '', '', '', 47187),
(67564, 'esES', 'Mensajería para el consorcio', 'Entrégale la factura del Consorcio de Artesanía a Thomas Brillante.', 'Oye, ¿te diriges al vitasagrario?\n\n¿Te importaría entregarle esta factura a Thomas Brillante? Ha encargado unas cuantas botellas hechas a medida, y el vidriero ya nos ha confirmado el precio de los materiales necesarios.\n\nSi sigues el camino deberías encontrártelo. Lo más probable es que esté dándole la lata a algún infeliz sobre lo fantástico que es su marido...\n\nSeguro que te paga por tu tiempo.', '', '', '', '', '', 'Entrégale la factura del Consorcio de Artesanía a Thomas Brillante, que está en el Vitasagrario Rubí.', 47187),
(67299, 'esES', 'Repelente de dracos', 'Usa un acribillador Arcano para derrotar a $1oa protodracos.', '¡Los primalistas han estado atacando sin cesar el campamento con sus dracos!\n\nHemos podido mantenerlos a raya con nuestros escudos, pero nos vendría bien más ayuda para borrarlos del cielo.\n\n¡Usa uno de nuestros acribilladores para acabar con ellos!', '', '', '', '', '', '', 47187),
(67298, 'esES', 'Las maravillas del mundo', 'Descubre cómo obtiene Thomas su inspiración artesanal.', 'Mi marido Thomas ha aprendido mucho explorando estas tierras primigenias.\n\nQuizás si seguimos sus pasos, alcances la misma inspiración.', '', '', '', '', '', '', 47187),
(67297, 'esES', 'El recorrido avanzado de Iskaara', 'Atraviesa los anillos planeando.', 'Vuela a través de los anillos de control que marcan el recorrido.', '', '', '', '', '', '', 47187),
(67296, 'esES', 'El recorrido de Iskaara', 'Atraviesa los anillos planeando.', 'Vuela a través de los anillos de control que marcan el recorrido.', '', '', '', '', '', '', 47187),
(67295, 'esES', 'Esa es mi especialidad', 'Habla con Miguel Brillante sobre las especializaciones profesionales.', 'Así que has empezado a adoptar una especialización, ¿eh? Es maravilloso disponer de una habilidad propia.\n\nComo miembro del Consorcio de Artesanía, sería un placer para mí ayudarte a perfeccionar tu especialización.\n\n¿Tienes un minuto para escuchar mis sabios consejos y, con suerte, aprender algo útil para tus aventuras?', '', '', '', '', '', '', 47187),
(67222, 'esES', 'Nubes oscurecidas', 'Elimina la presencia primalista en el Alto Son del Viento.', 'Los Primalistas han infectado el Alto Son del Viento con sus absurdas enseñanzas. nuestros hermanos de allí son unos necios por escuchar sus ideas.\n\nSi ayudamos a purificar ese suelo sagrado de su presencia, es posible que el resto de los clanes acudan a ayudarnos en tiempos de necesidad. ¿Nos echas una mano?', '', '', '', '', '', '', 47187),
(67221, 'esES', 'Cabeza para el metal', 'Recoge $1oa de draconio cristalizado en la Veta Fragmento Cenizo.', 'Para usar todo el potencial de la forja del Guardián de la Tierra, antes debes aprender los conceptos básicos sobre la creación de la aleación abrasada de obsidiana. Solo entonces podrás seguir los pasos de los mejores herreros de Neltharion.\n\nTráeme una pieza de draconio cristalizado de las profundidades de la Veta Fragmento Cenizo. A cambio, te otorgaré el conocimiento que buscas.', '', 'Animado peligrosamente por el poder del draconio de su interior.', 'Duroacero cristalizado', '', '', '', 47187),
(67220, 'esES', '10.0 [DNT] [GAMEPLAY TEST] - [SPAWNTRACKING] (JSS)', '', '', '', '', '', '', '', '', 47187),
(67178, 'esES', 'Ojos blancos, dragón azul', 'Ayuda a Yumodormu a derrotar a Setogosa.', '$PC, ¿puedes ocuparte de que la partida sea lo más justa posible?\n\nTodos saben que Setogosa manipula las reglas a su capricho.\n\nNo quiero que Yumadormu pierda por sus trampas.', '', '', '', '', '', '', 47187),
(67177, 'esES', 'SE BUSCA: Engullidor', 'Mata a Engullidor y recupera sus cuernos.', 'Si pretendes relacionarte con los colmillarr, ¡harías bien en echar una mano!\n\nHace poco, una criatura a la que llamamos Engullidor ha establecido su guarida por aquí cerca.\n\nParece que otros de su especie están migrando a esta zona. Es una circunstancia que podemos aprovechar.\n\nMata a Engullidor y tráeme sus cuernos. Los necesitaremos para crear suministros y ampliar esta avanzada.', '', 'Una bestia enorme lejos de sus terrenos de caza habituales.', 'Engullidor', '', '', '', 47187),
(67175, 'esES', 'Cómo desactivar un barco de juguete explosivo', 'Habla con la madre de Toolk y recupera el barco de juguete.', 'Detesto quitarle un juguete a una niña, pero sería muy útil que el Kirin Tor pudiese estudiar cómo absorbió tanta energía Arcana.\n\nUna vez más..., no quiero ofender a nuestros nuevos aliados colmillarr. Tengo una varita que podría disipar la magia...\n\nHablemos con la madre de Toolk y luego decidiremos qué hacer.', '', '', '', '', '', '', 47187),
(67174, 'esES', 'Detección Arcana', 'Investiga los objetos colmillarr en el Punto de Pesca de Khuri para buscar indicios de magia Arcana.', '¡Saludos! Me llamo Miva Ojostrella y estoy llevando a cabo investigaciones Arcanas en la zona.\n\nLas Tierras Azures rebosan magia. Parte de ella es benigna..., pero hay otra que puede ser bastante peligrosa.\n\nMe han encargado que me asegure de que no quedan energías Arcanas en las pertenencias de los colmillarr.\n\nTuvimos un incidente en el Campamento de Antonidas en el que una caja de pesca explotó de forma espontánea.\n\n¿Te importaría usar mi detector para examinar algunos objetos? Tengo que continuar mi conversación con Julk.', '', '', '', '', '', '', 47187),
(67173, 'esES', 'Gnolls ladrones', '', '', '', '', '', '', '', '', 47187),
(67167, 'esES', '¡Bienvenidos al duelo!', 'Desafía a $1oa dracthyr a una partida de Hearthstone.', 'Ahora que he recuperado el mazo, puedo centrarme en reclutar nuevos socios para mi club. Estaba pensando en hablar con los dracthyr...\n\nAh, $n, ¡esa es otra cosa con la que me puedes ayudar!\n\nVoy a estar un poco ocupado intentando que se apunten otros dragones y también quiero contar con los dracthyr.\n\n¿Te importaría hablar con ellos por mí? Pero te aviso, muchos de ellos no han jugado nunca.', '', '', '', '', '', '', 47187),
(67154, 'esES', 'Restos entrópicos', 'Recoge $1oa montones de arena vitrificada de criaturas del Mar de Dunas.', 'Cuando una entidad atraviesa las líneas temporales, es posible que se acumulen arenas del tiempo en su cuerpo.\n\nPor lo general, la arena se disipa rápidamente, pero a veces las fluctuaciones entrópicas inherentes a los viajes en el tiempo pueden provocar que la arena se vitrifique. En ese caso, resulta bastante difícil de eliminar. Así he estropeado varios pares de zapatos.\n\nLa arena vitrificada puede ser lo bastante poderosa para nuestros propósitos. Lo mejor será reunir toda lo que podamos.', '', '', '', '', '', '', 47187),
(67143, 'esES', 'Un regalo desde el corazón', 'Fabrica un corazón en botella de calidad |A:Professions-Icon-Quality-Tier3-Small:20:20|a con cualquier profesión de fabricación.', 'Ahora que hemos reunido la esencia elemental, ¿crees que podrías meterla en esta botella?\n\nEs una receta sencilla que puedes elaborar igual que cualquier otra.\n\nSi pierdes o usas todos los componentes de calidad, siempre puedes conseguir más de los elementales que hay en la Cuenca de los Cornisapos.', '', '', '', '', '', 'Entrégale el regalo a Miguel Brillante, que está en el Vitasagrario Rubí.', 47187),
(67142, 'esES', 'Comida de vermis', 'Recoge carne chamuscada por la lava de rondadores de corteza en el Flujo de Ascuas.', 'La defensa de la Ciudadela Obsidiana da mucha hambre, y no sabes cuánto comen los dragones. Tenemos que reponer nuestras provisiones.\n\nHay unos gusanos muy sabrosos que recorren el magma bajo la lava endurecida. Puede que no te gusten, pero para un dragón hambriento son una autentica delicia.\n\nLlévate a nuestro sirviente Gulchak y usa esto para dirigirlo hacia las perturbaciones en la lava; el atraerá a los gusanos para que puedas recogerlos.', '', '', '', '', '', '', 47187),
(67137, 'esES', 'Equipo profesional', 'Habla con Mahra Doblárbol.', 'Haephesta me ha contado que también te dedicas a la artesanía.\n\nNos gustaría proveerte de equipamiento profesional. Y sin coste alguno. Para eso están los socios comerciales, ¿sabes?\n\nHabla con nuestra sastra, Mahra Doblárbol, para que te tome las medidas.', '', '', '', '', '', 'Habla con Mahra Doblárbol, que está en el Vitasagrario Rubí.', 47187),
(67111, 'esES', 'El aprendiz atribulado', 'Recoge $1oa glándulas de veneno congeladas.', 'Esta misión fue un error desde el principio. Alia Alzasol nos prestó su ayuda para impedir que la Llama Hendida se apoderase de un artefacto peligroso. Nuestras pistas sobre este objeto nos han llevado hasta estas ruinas.\n\nPero la Llama Hendida nos derrotó y ahora la zona está infestada de arañas de hielo. Han envenenado a Alia de gravedad y temo que no dure mucho más sin un antídoto.\n\nPuedo fabricarlo, pero necesito glándulas de veneno de las arañas cercanas. Me da miedo dejarla sola. ¿Me podrías traer algunas?', '', '', '', '', '', '', 47187),
(67100, 'esES', 'Un regalo para Miguel', 'Habla con Thomas sobre la calidad, y luego recolecta $2oa espíritus ígneos cerca de la Cuenca de los Cornisapos para el regalo de Miguel.', '¿Podrías hacerme un favor, $p?\n\nQuiero conseguir un regalo para mi marido, Miguel.\n\nSignifica mucho para mí, pero últimamente he estado tan ocupado que no he tenido tiempo para hacerle nada.\n\n¿Puedes ayudarme a hacerle algo de gran calidad?', '', '', '', '', '', '', 47187),
(67099, 'esES', 'Ojos de dragón', 'Habla con Myridian, Zepharion y Evorian en las zonas cercanas.', 'Sabemos que los Djaradin nos atacarán directamente, pero también me preocupan los otros peligros. Los que no son tan obvios.\n\nHe enviado a tres dragones para que inspeccionen la zona y busquen cualquier amenaza.\n\nHabla con todos ellos y recoge sus informes para mí. Cuando tengas la información, vuelve a verme para que podamos prepararnos lo mejor posible contra lo que estén planeando los Djaradin', '', '', '', '', '', '', 47187),
(67096, 'esES', 'El vuelo avanzado del Bosque Fluyente', 'Atraviesa los anillos planeando.', 'Vuela a través de los anillos de control que marcan el recorrido.', '', '', '', '', '', '', 47187),
(67095, 'esES', 'El vuelo del Bosque Fluyente', 'Atraviesa los anillos planeando.', 'Vuela a través de los anillos de control que marcan el recorrido.', '', '', '', '', '', '', 47187),
(67094, 'esES', 'Las dríades nunca descansan', 'Ayuda a Thalendra a alimentar a los animales pequeños de Valdrakken.', 'Es maravilloso ver que Valdrakken vuelve a estar tan animada, pero hay muchos que han sufrido tras miles de años de abandono, como las encantadoras criaturitas de la ciudad. Por desgracia, no hay suficientes dríades que cuiden de ellas.\n\n¿Qué te parece si te concedo el título honorario de dríade de Valdrakken? Algunos de nuestros amiguitos más simpáticos han pasado demasiado tiempo sin sus aperitivos preferidos. ¿Me ayudas a cuidar de ellos?', '', '', '', '', '', '', 47187),
(67093, 'esES', 'Un santuario anómalo', 'Busca el modo de conseguir la reliquia oculta en el Sagrario Perdido en las Arenas y, después, devuélvesela a Nozdormu en el Trono de los Aspectos, que está en Valdrakken.', 'Mi equipo de investigación ha localizado un extraño sagrario aquí cerca y hemos podido descifrar algunas escrituras en las afueras. Runas titánicas, para ser exactos. Creemos que hay varios lugares que hacen referencia a Aman\'thul, el Gran Padre y líder de los titanes.\n\nIntentamos investigar más de cerca, pero creo que hemos activado las defensas del sagrario. Una enorme amalgama de arena nos ha bloqueado el paso y hemos logrado escapar por los pelos.\n\nNo estamos seguros de lo que está protegiendo, pero debe ser importante. ¿Puedes investigar?', '', '', '', '', '', 'Vuelve con Nozdormu a Valdrakken.', 47187),
(67084, 'esES', 'El propósito de la plata', 'Coloca los lingotes de acero titánico ancestral en la forja y termina la tarea encomendada por Tyr.', '<El eco de Tyr se activa ante vuestra presencia>.\n\nY ahora otra tarea, amigos míos.\n\nEchad los lingotes al fuego y activad la forja. Ya he preparado los procedimientos necesarios.\n\nLa escama de plata contiene el esquema. Su propósito se os revelará.', '', '', '', '', '', 'Habla con Alexstrasza en Tyrhold.', 47187),
(67081, 'esES', 'Una infusión de materiales', 'Recupera $1oa lingotes de acero titánico ancestral y derrota al tsunami primigenio en las Salas de Infusión.', '<La imagen de Tyr vuelve a hablar>.\n\nHabéis reactivado la forja. La próxima tarea no será tan sencilla.\n\nEn la escama están transcritos los esquemas de algo que quiero que forjéis. Le he confiado los materiales necesarios para hacerlo a uno de mis vigías, Irideus. Estos materiales tienen un origen especial y quedan pocos en toda la existencia.\n\nBuscad a Irideus en las Salas de Infusión, donde espero que su cuidadosa vigía haya mantenido el correcto funcionamiento de la instalación.', '', '', '', '', '', '', 47187),
(67080, 'esES', 'Suministros de artesano: soluciones alquímicas del dragón', 'Usa la receta de los brebajes de reclamación para fabricar $1oa botellas de solución alquímica del dragón para Haephesta, que está en el Vitasagrario Rubí.', '¿Buscas trabajo, alquimista?\n\nEl Consorcio de Artesanía se ha puesto en contacto conmigo y me ha solicitado un \"pedido de fabricación\" de soluciones alquímicas. Tengo tanta curiosidad como cualquier otro dragonante por estas prácticas comerciales, pero estoy demasiado ocupado.\n\nPodría ser una buena oportunidad para ti, $gaprendiz:aprendiza;. Fabrica algunas soluciones alquímicas a partir de los brebajes anteriores y llévaselas a Haephesta. Está justo al final del camino.', '', '', '', '', '', '', 47187),
(67079, 'esES', 'Una vida dura', 'Recupera el disco de seguridad principal y el disco de seguridad secundario en Tyrhold.', 'La seguridad de la forja es más estricta que la de cualquier otra zona de Tyrhold. Esto va a ser un desafío para nosotros, $c.\n\nSolo algunas unidades de la ciudadela tienen la capacidad de ignorar la seguridad y, además, hay protocolos por desbloquear que requieren más de un código en caso de corrupción.\n\nSi algunas de estas unidades no permiten su anulación, deberás hacerlo por la fuerza. Ten cuidado, $n.', '', '', '', '', '', '', 47187),
(67078, 'esES', 'Últimas instrucciones', 'Coloca la escama de plata en la forja de Tyrhold.', '<El eco habla con una voz antigua>.\n\nQueridos amigos, os pido perdón por mi repentina marcha.\n\nOs prometo que no os dejaré sin ayuda. Sé que estáis en un momento de necesidad, pero, para que este regalo no se use con el fin equivocado, debo pediros algunas tareas.\n\nLa primera es sencilla: reactivad la forja de Tyrhold. La escama de plata es la clave.', '', '', '', '', '', 'Habla con Koranos en Tyrhold.', 47187),
(67077, 'esES', 'Recuerdos del pasado', 'Habla con Nozdormu para presenciar el recuerdo del pasado.', 'Este es el último lugar donde vimos a nuestro amigo Tyr.\n\nNo entendimos los motivos que lo llevaron a marcharse, pero sí nos dimos cuenta de que era importante.\n\nAunque nos rompa el corazón, creo que esta chispa nos ha convocado para que podamos presenciar ese momento una vez más. Con la ayuda de Nozdormu, quizá podamos revivir ese momento y averiguar si Tyr nos dejó alguna otra pista.', '', '', '', '', '', '', 47187),
(67076, 'esES', 'La chispa del descubrimiento', 'Investiga la chispa de titán en Tyrhold.', 'Aunque esta chispa tiene un origen peculiar, me resulta familiar. No tengo claro su propósito, pero creo quizá sea el siguiente paso para resolver este misterio.\n\nSíguela dondequiera que te guíe y tal vez averigües más sobre su propósito. Mientras, yo veré qué puedo descubrir.', '', '', '', '', '', 'Habla con Kalecgos en Tyrhold.', 47187),
(67075, 'esES', 'La magia interior', 'Extrae la magia oculta de las consolas de Tyrhold para descubrir el misterio de la escama de plata.', 'Qué interesante. Esta ciudadela alberga muchos misterios que, salvo el guardián Tyr, nadie entiende. Si pretendemos averiguar más, debemos seguir explorando Tyrhold.\n\nCreo que la escama arrojará algo de luz sobre los secretos que esconde este lugar.\n\nNo obstante, existe una complicación. Los guardianes de Tyrhold siguen siendo... inestables. Es posible que se tomen tus tareas de exploración como una perturbación e intenten interferir. Ten este conducto. Te ayudará si te dan problemas.', '', '', '', '', '', '', 47187),
(67074, 'esES', 'La ofrenda de la plata', 'Habla con Alexstrasza para revelar el regalo de Tyr.', 'Poco antes de su muerte, el guardián Tyr nos regaló una escama de dragón forjada con la plata más pura. La guardamos en las cámaras de Valdrakken en nuestra ausencia, pero creo que es hora de compartirla una vez más.\n\nAunque no tenemos ni idea de cuál es el propósito de este recuerdo, siempre ha sido un símbolo de unidad y amistad para nosotros. Como $gverdadero aliado:verdadera aliada; de los dragones que eres, nos gustaría compartirla contigo. Habla conmigo cuando estés $glisto:lista;, $n.', '', '', '', '', '', '', 47187),
(67073, 'esES', 'Alba roja', 'Localiza a Alexstrasza.', 'Estamos a un paso de recuperar nuestros poderes... Si Raszageth tiene éxito antes de que los recuperemos, las líneas temporales derivarán en un futuro oscuro para todo Azeroth.\n\n¡No debemos permitirlo, $n!\n\n¡Rápido, debes encontrar y ayudar a Alexstrasza antes de que todo esté perdido!', '', '', '', '', '', '', 47187),
(67067, 'esES', 'Explorar el acechamaíz', 'Recoge $1oa tallos de acechamaíz salvaje.', '¿Hay una chef dragón en Valdrakken? ¿De verdad? ¡Tendré que pedirle que pruebe mi sopa arcoluz! Es una vieja receta familiar.\n\nConozco la planta de la que hablas. Crece cerca de los arroyos de la zona, pero ha causado algunos problemas.\n\nLos tallos de acechamaíz parecen ser el alimento natural de alfazaques y pequeñas salamandras, que a su vez son la presa preferida de los cornisapos. No tendrás problemas si puedes detectarlos, pero hay algunos que son increíblemente sigilosos.\n\nYo en tu lugar tendría cuidado.', '', '', '', '', '', 'Vuelve con Rumiastrasza en el Festín Rubí de Valdrakken.', 47187),
(67066, 'esES', 'Delicias que merecen la pena', 'Consigue un pinopez desviado sabroso.', '¿Rumi y Bocado?\n\nUf, ha pasado mucho tiempo. Eso de comer pescado con un dragón y un pato parece el principio de una de las historias que la anciana Poa cuenta a los jovenzuelos. ¡Cómo olvidar algo así!\n\nEl pescado era un pinopez desviado sabroso, muy apreciado entre los colmillarr, No son muy comunes, pero se encuentran cerca de la costa.\n\nPor cierto, que sepas que es temporada de apareamiento del dienteazur. Esos demonios sedientos de sangre te darán un buen mordisco si tocas su tentempié favorito.', '', '', '', '', '', 'Vuelve con Rumiastrasza en el Festín Rubí de Valdrakken.', 47187),
(67065, 'esES', 'Hongos frescos del futuro', 'Hazte con 7 trufitas devastadas por el tiempo en el Futuro Primalista.', '¿Una seta deliciosa? Los futuros alternativos no son despensas que saquear para matar el gusanillo.\n\nPero... mentiría si dijera que jamás he soñado con volver a comer los platos de Rumi y Bocado.\n\n¡Vale! Tienes mi permiso para atravesar el portal, aunque te aconsejo que busques a otros para que te lleven.\n\nLos celadores han mencionado en alguna ocasión estas setas oscuras. Al parecer, no se quedan en el mismo sitio mucho tiempo. Interprétalo como quieras.', '', '', '', '', '', 'Vuelve con Rumiastrasza en el Festín Rubí de Valdrakken.', 47187),
(67064, 'esES', 'Una delicia errante', 'Consigue $1oa bulbos de algaerrante titilante.', '¡Oh, Rumiastrasza! Yo y las hermanas dríades, Celina y Felina, hemos pasado una tarde encantadora cocinando para ella.\n\nEl alga que hemos comido es de una variedad especial llamada algaerrante titilante. Los pecesfranja que hay por toda la costa la devoran; no me sorprendería que te atacaran mientras intentas arrancarles la comida del fondo marino.\n\nDales a los chefs recuerdos de mi parte. Siempre son bienvenidos en nuestro santuario.', '', '', '', '', '', 'Vuelve con Rumiastrasza en el Festín Rubí de Valdrakken.', 47187),
(67063, 'esES', 'Diez mil años al fuego', 'Recoge $1oa especias de lava picantes.', '¿Ehpeciah? Ah, debeh de ehtar con la cocinera dragón. La que lleva un patete en la cabeza.\n\nLoh djaradin recogen un polvo, ehpeciah de lava picanteh de loh elementaleh ígneoh de ahí. \n\n¡No me mireh así! ¡El nombre se lo han puehto elloh, no yo!\n\nBuena suerte ahí abajo. Yo que tú no iría solo:sola;.', '', '', '', '', '', 'Vuelve con Rumiastrasza en el Festín Rubí de Valdrakken.', 47187),
(67053, 'esES', 'Una oportunidad para la paz', 'Preséntate ante los representantes de la Horda.', 'Que la Luz te acompañe, $p.\n\nEsta expedición está bajo la protección de la Horda y la Alianza. Nuestras órdenes son claras, dar apoyo a cualquier miembro de la expedición, independientemente de sus otras lealtades.\n\nLos representantes de la Horda, la señora de la guerra Hacha Macabra y su hija Shuja, montan guardia al otro lado del campamento.\n\nLuché con la señora de la guerra Hacha Macabra contra la Plaga. Es honorable y servirá bien a esta expedición.\n\nOfrécele tu ayuda. Demuéstrale que la Alianza honra sus promesas.', '', '', '', '', '', 'Habla con la señora de la guerra Breka Hacha Macabra en la Embajada Reposo Alado.', 47187),
(67050, 'esES', 'Congelamiento: causas y síntomas', 'Coloca los tótems para liberar a los cazadores colmillarr atrapados en las Tierras Azures.', 'Elementos vivir en tótems, $r. Liberarlos y destruir el hielo. ¡Liberar tus amigos colmillarr!', '', '', '', '', '', '', 47187),
(67047, 'esES', 'Hay que entrar en calor', 'Recoge $1oa hojas de sagittata muerdescarcha.', 'Creo que la planta que estás buscando tiene un tallo fino y está cubierta de hojas rojas.\n\nSerá complicado que no te encuentres con ninguno de esos viles reptadores viles mientras recoges flores. Te aconsejo que los evites, si puedes, y que tengas un arma lista en caso de que no.\n\nY dile a tu amiga dragona que puede compensarme invitándome a una o dos tazas la próxima vez que visite la ciudad.', '', '', '', '', '', 'Vuelve con Rumiastrasza en el Festín Rubí de Valdrakken.', 47187),
(67044, 'esES', 'Historia de un héroe: Yanikk', 'Escucha la historia de Yanikk.', 'Deja que te cuente la historia de Yanikk.', '', '', '', '', '', '', 47187),
(67039, 'esES', 'Un viaje asombroso', 'Encuentra a los animales desaparecidos.', 'Algunas de las mascotas del clan acabaron perdiéndose en el último viaje entre campamentos. No son animales de caza, ¡así que dudo que puedan cuidarse por sí solos ahí fuera!\n\n¿Crees que podrías ir a buscarlos? Puede que no sean compañeros de caza, pero siguen siendo miembros importantes del clan.', '', '', '', '', '', '', 47187),
(67036, 'esES', 'La cólera del Kirin Tor', 'Usa el acribillador Arcano para ayudar a Khadgar a derrotar a los primalistas.', 'He montado las piezas del dispositivo que has recuperado.\n\nColócalo cerca de Khadgar y úsalo para rechazar a los Primalistas. \n\nSolo tenemos que aguantar un poco más hasta que llegue Kalecgos.', '', '', '', '', '', '', 47187);
INSERT INTO `quest_template_locale` (`ID`, `locale`, `LogTitle`, `LogDescription`, `QuestDescription`, `AreaDescription`, `PortraitGiverText`, `PortraitGiverName`, `PortraitTurnInText`, `PortraitTurnInName`, `QuestCompletionLog`, `VerifiedBuild`) VALUES
(67035, 'esES', 'La preservación del conocimiento', 'Encuentra $1oa tomos antiguos en los alrededores del Campamento de Antonidas.', 'Saludos, $r. Soy Althanus. Ojalá nos hubiéramos conocido en circunstancias menos... caóticas.\n\nEstábamos ayudando al Kirin Tor a estudiar la historia de este lugar unos instantes antes de que atacaran los Primalistas.\n\nMe temo que aún quedan libros por ahí que pueden ser destruidos por culpa de este terrorífico ataque.\n\nPor favor, ¡debes recuperarlos! Si se destruyen, la historia de este lugar se perderá.', '', '', '', '', '', '', 47187),
(67034, 'esES', 'De viento y agua', 'Recoge componentes en las Fuentes de Dragón Rugientes.', 'Al este hay un gran manantial de dragones donde anidan las águilas salvajes. Las plumas que sueltan siguen conteniendo su magia durante bastante tiempo y se emplean en muchos rituales.\n\nLa zona también alberga espíritus elementales furiosos, cuyos núcleos también son de cierta utilidad.\n\nTráeme un poco de todo..., y recuerda que las águilas son sagradas. No aceptaré plumas que les hayas arrancado a la fuerza.', '', '', '', '', '', '', 47187),
(67033, 'esES', 'Preparar las defensas', 'Recupera $1oa piezas del acribillador Arcano.', 'Los Primalistas han estado dando caza al Kirin Tor desde que llegamos a las Tierras Azures. Detestan nuestras prácticas de la magia Arcana.\n\nInformaré a Kalecgos para que vuelva del Archivo Azur. Mientras tanto debemos contenerlos.\n\nAl parecer, una de nuestras defensas Arcanas principales fue destruida durante su ataque inicial. Tráeme las piezas y podré reconstruirla.', '', '', '', '', '', '', 47187),
(67032, 'esES', 'El ascenso Vakthros avanzado', 'Atraviesa los anillos planeando.', 'Vuela a través de los anillos de control que marcan el recorrido.', '', '', '', '', '', '', 47187),
(67031, 'esES', 'El ascenso Vakthros', 'Atraviesa los anillos planeando.', 'Vuela a través de los anillos de control que marcan el recorrido.', '', '', '', '', '', '', 47187),
(67027, 'esES', 'Sombra de la muerte', '', '', '', '', '', '', '', '', 47187),
(67015, 'esES', 'Forjar la respuesta', '', '', '', '', '', '', '', '', 47187),
(67012, 'esES', 'Cuando las bestias fluviales vuelen', '', '', '', '', '', '', '', '', 47187),
(67007, 'esES', 'Ayuda en los archivos', 'Habla con Kemora en los archivos de Valdrakken.', '<La letra, nítida y limpia, escrita con un toque elegante, se desvanece rápidamente en la tinta húmeda y manchada del pergamino con un olor que recuerda a una bebida fermentada derramada>.\n\nBUSCADORES DE AVENTURAS, ENTUSIASTAS DE LOS ARCHIVOS...\n\nLos archivos llaman a quienes buscan respuestas, a quienes anhelan descubrir y a quienes desean revelar los secretos del pasado y, quizás, del futuro.\n\nEste llamamiento no es para los débiles de corazón, ni de flaca voluntad.\n\nSolo deben presentarse aventureros curiosos y valientes.\n\n- Kemora', '', '', '', '', '', '', 47187),
(67006, 'esES', 'Apagar la llama', '', '', '', '', '', '', '', '', 47187),
(67005, 'esES', 'Cómo entrenar a tu protodraco', '', '', '', '', '', '', '', '', 47187),
(67004, 'esES', 'Las cosas buenas van en cajas grandes', 'Encuentra un cofre del Guardián de la Tierra. Si lo traes de vuelta, podremos compartir el botín.', 'Con nuestros esfuerzos, hemos creado todo lo necesario para abrir un cofre del Guardián de la Tierra. Hay varios bajo la ciudadela. Encuentra uno y te recompensaré.\n\nHe fabricado unas cadenas que te ayudarán a moverlo. Si me lo traes, podremos compartir sus riquezas.\n\nAunque cuidado al trasladarlo, porque hay más aventureros buscándolos.', '', '', '', '', '', 'Regresa con el fogonero Volrax con o sin el cofre del Guardián de la Tierra.', 47187),
(67003, 'esES', 'El eslalon avanzado de las Tierras Azures', 'Atraviesa los anillos planeando.', 'Vuela a través de los anillos de control que marcan el recorrido.', '', '', '', '', '', '', 47187),
(67002, 'esES', 'El eslalon de las Tierras Azures', 'Atraviesa los anillos planeando.', 'Vuela a través de los anillos de control que marcan el recorrido.', '', '', '', '', '', '', 47187),
(66998, 'esES', 'Combate el fuego con... agua', 'Mata elementales de lava en la Cueva en Erupción.', 'En todos los años que llevo ocupándome de los elementales de lava, ¡nunca los había visto actuar así! Apenas podemos contenerlos en la cueva.\n\n¿Tienes un momento? Nos ocuparemos de la salida mientras tú reduces su número ahí dentro.\n\nTen, llévate este elemental de agua embotellado.\n\nSiempre llevo unos cuantos cuando me toca cuidar a los elemental de lava. ¡Los enemigos naturales son una distracción excelente!', '', '', '', '', '', '', 47187),
(66997, 'esES', 'La dirección de la guardería', 'Reúnete con Vaeros en los jardines de los Estanques de Vida Rubí.', '¡Cuánto me alegro de que Lasztak haya aceptado su vocación como cuidador de crías! Sobre todo, teniendo en cuenta que a muchos de estos pequeñines les están saliendo los dientes justo ahora.\n\nAdemás, ese no es el único problema que tiene este jardín. Las crías están bastante ansiosas y los cuidadores, pues... aún más estresados de lo normal.\n\nPor favor, reúnete conmigo en los jardines de abajo cuando tengas un momento. ¡Tu ayuda nos vendría muy bien!', '', '', '', '', '', '', 47187),
(66987, 'esES', '[DNT] 10.0 Explorers - Ch2 - Fake Quest Requirement (SMART)', '', '', '', '', '', '', '', '', 47187),
(66972, 'esES', 'El viejo Colmipétreo', 'Acaba con el viejo Colmipétreo cerca del Campamento de Antonidas.', 'Tengo una tarea macabra para ti, $p. No todas las muertes son por gusto. Algunas son actos de bondad.\n\nHay un viejo mamut que merodea por el bosque al este del Campamento de Antonidas. Lo vi de lejos hace un tiempo y aún puedo oír sus gemidos de vez en cuando. Está claro que está sufriendo.\n\nHa empezado a destrozar la maleza y me preocupa que se convierta en un peligro para los demás.\n\nDarías una alegría a este viejo corazón si ayudaras a descansar un alma tan anciana como la suya. Tráeme su colmillo para que podamos honrarlo.', '', 'Un mamut dominante anciano que se ha convertido en un peligro para sí mismo y para otros.', 'El Viejo Colmipétreo', '', '', 'Habla con Hemet Nesingwary Jr. en el Campamento Desubicado.', 47187),
(66971, 'esES', 'La cara de la muerte', 'Da caza a Faucescarcha al norte de la Cuenca Pelaje Invernal.', 'Dime, ¿alguna vez has visto el rostro de la muerte?\n\n<Nesingwary hace una pausa dramática>.\n\n¿Qué estoy diciendo? Pues claro que lo has hecho.\n\nA fin de cuentas, la muerte tiene muchas rostros distintos. \n\nDicen los colmillarr de Imbu que uno de esos rostros vive en estas colinas. Hasta pronunciar su nombre es abrir la puerta a una muerte violenta y gélida.\n\nFaucescarcha.\n\n<Nesingwary mira a su alrededor con cautela>.\n\nBueno, ahora tienes que cazarlo, ¡por mi bien al menos!', '', 'Un augurio legendario sobre la muerte en el hielo.', 'Faucescarcha', '', '', 'Habla con Hemet Nesingwary Jr. en el Campamento Desubicado.', 47187),
(66970, 'esES', 'Ty\'foon el Ascendido', '', '', '', '', '', '', '', '', 47187),
(66969, 'esES', 'Los clanes de las llanuras', 'Preséntate ante la khan Sansok en Maruukai.', 'Mientras esperas a que llegue el emisario, la khan Sansok ha mostrado interés en saber cómo ha ido la reunión de los clanes. Me ha enviado a buscarte para que te reúnas con ella en el centro de Maruukai para hablar.', '', '', '', '', '', '', 47187),
(66968, 'esES', 'Diezmar la manada', 'Da caza a Yetor cerca del Escudo de Rhonin.', '<Nesingwary hace un gesto hacia el lado del camino>.\n\n¿Ves esas huellas sobre la nieve? \n\nSon de yeti.\n\nAlgo debe de haberlos hecho enfadar para obligarlos a cazar tan cerca del camino. Ve y acaba con el líder de la manada. ¡No queremos que empiecen a atacar a los viajeros desprevenidos!\n\nSi es especialmente agresivo, recoge su cabeza. Eso debería disuadir a los demás.', '', 'Lo único peor que un yeti grande es un yeti grande con amigos.', 'Yetor', '', '', 'Habla con Hemet Nesingwary Jr. en el Campamento Desubicado.', 47187),
(66964, 'esES', 'Artefactos en las manos equivocadas', 'Encuentra a Alia Alzasol en las Ruinas Perdidas, que están en las Tierras Azures.', 'Tenemos miles... No, ¡un incalculable número de problemas!\n\nAy, ¡no sé ni por dónde empezar!\n\nEl Kirin Tor ha descubierto uno de los planes de la Llama Hendida. Van en busca de un artefacto llamado \"Valthrux\".\n\nSu poder es inmenso y tiene... consciencia... El peligro aumenta exponencialmente, dadas las circunstancias.\n\nUna tal Alia Alzasol partió al sur con un par de colmillarr para investigar a la Llama Hendida. Ya debería haber vuelto.\n\n¡Encuéntrala e impide que la Llama Hendida se haga con el artefacto!', '', '', '', '', '', '', 47187),
(66963, 'esES', 'En ruta de entrega', 'Ve al campamento base cercano y dile al catalogador Wulferd que no espere recibir suministros pronto.', 'He intentado decirle a Vevesi que soy capaz de sacar el carromato del barro.\n\nPero no, tenía que insistir en usar magia para sacarlo... Y ahora mira lo que ha pasado.\n\n<La transportista Bennet suspira>.\n\nMientras intento que Vevesi entre en razón, ¿te importaría subir por la colina hasta el campamento base y decirle al catalogador Wulferd que quizá tenga que pedir otro cajón de suministros para la cámara desde Boralus?', '', '', '', '', '', 'Dale al catalogador Wulferd la mala noticia. Se encuentra en el Campamento Base Dragontina.', 47187),
(66962, 'esES', '[DNT] 10.0 Explorers - Ch1 - Fake Quest Requirement (SMART)', '', '', '', '', '', '', '', '', 47187),
(66961, 'esES', 'Unirse a la cacería', '', '', '', '', '', '', '', '', 47187),
(66960, 'esES', 'Klozicc el Ascendido', '', '', '', '', '', '', '', '', 47187),
(66958, 'esES', 'Proteger y reunir', 'Da caza al cuernosangre que hay al este de Iskaara.', 'El otro día estuve hablando con unos cazadores de Iskaara y me comentaron que se habían encontrado con una escena bastante espeluznante.\n\nAl parecer, Cuernosangre, un rinoceronte especialmente agresivo, ha estado atacando a los brúfalos más pequeños de la zona.\n\nLos brúfalos ya tienen suficiente competencia en las Tierras Azures como para tener que preocuparse de que sus rebaños se vean atacados por un invasor brutal.\n\nTráeme su cuerno. ¡Me gustaría causar una buena impresión a nuestros amigos colmillarr!', '', 'Una bestia malvada que está diezmando la población de brúfalos locales.', 'Cuernosangre', '', '', 'Habla con Hemet Nesingwary Jr. en el Campamento Desubicado.', 47187),
(66957, 'esES', 'Una sombra en el hielo', 'Investiga la cima del glaciar sobre el Campamento de Antonidas.', 'He oído rumores al pasar por el Campamento de Antonidas. Hablaban de que se había encontrado fauna mutilada por las estepas heladas. En algunos casos no eran más que charcos de sangre.\n\nSea lo que sea, tiene asustados a los magos y ha acabado con parte de la fauna local.\n\nEcha un vistazo en lo alto del glaciar. Si me gustase apostar, apostaría lo que fuera a que ese sería el escondrijo perfecto para cualquier depredador alfa digno de ese nombre.\n\nTráeme un trozo suyo para que podamos apaciguar al Kirin Tor.', '', 'Un gigante malicioso que se deleita jugando con su presa.', 'Puñoscarcha', '', '', 'Habla con Hemet Nesingwary Jr. en el Campamento Desubicado.', 47187),
(66956, 'esES', 'Cazador de dragones Igordan', '', '', '', '', '', '', '', '', 47187),
(66952, 'esES', 'Trapos de gnolls', 'Recolecta 20 telas usadas por los gnolls de las Islas Dragón para Dothenos del Acuerdo de Valdrakken.', 'Los gnolls son una amenaza constante, siempre están lanzando asaltos y ataques sangrientos contra las expediciones y los pueblos de las Islas Dragón. Entonces, ¿cómo es que su ropa está tan limpia?\n\nTras enfrentarte a ellos, ¿podrías recoger una muestra de la tela que usan para que la pueda analizar?', '', '', '', '', '', '', 47187),
(66950, 'esES', 'Corazón de gigante', 'Recolecta 5 núcleos gigantes de los gigantes monteses, de hielo o fundidos de las Islas Dragón para Temnaayu de los Colmillarr de Iskaara.', 'Se dice que hay gigantes en las Islas Dragón que contienen unas gemas preciosas en su interior. Por lo general no damos caza a las criaturas de las islas para conseguir riquezas, pero estos gigantes nos han dado problemas.\n\nPodríamos hacernos con estas gemas mientras eliminamos a esas criaturas tan destructivas.', '', '', '', '', '', '', 47187),
(66948, 'esES', 'La llegada del emisario', 'Infórmate sobre la situación en los Jardines Esmeralda.', 'Admito que no he salido de los Jardines Esmeralda en toda mi vida y, por eso, nunca había conocido a un centauro, y mucho menos a un ser mortal del continente.\n\nSin embargo, no estoy aquí por cortesía. Quiero pedir la ayuda de los centauros para proteger nuestra piedra de juramento y nuestras responsabilidades.\n\nMe alegro de que también hayas venido a ayudar. Tenemos mucho de lo que hablar.', '', '', '', '', '', '', 47187),
(66947, 'esES', 'El sprint avanzado de las Tierras Azures', 'Atraviesa los anillos planeando.', 'Vuela a través de los anillos de control que marcan el recorrido.', '', '', '', '', '', '', 47187),
(66946, 'esES', 'El sprint de las Tierras Azures', 'Atraviesa los anillos planeando.', 'Vuela a través de los anillos de control que marcan el recorrido.', '', '', '', '', '', '', 47187),
(66944, 'esES', 'Pigmentos de pavo real', 'Recolecta 8 plumas de pavo real de los pavos reales de las Islas Dragón para Gnoklin Bobinavagante de la Expedición Dragontina.', '¡Los pavos reales de las Islas Dragón tienen unas plumas muy coloridas! Seguro que podemos fabricar pigmentos con ellas para que los escribas las usen como tinta.', '', '', '', '', '', '', 47187),
(66943, 'esES', 'Madera para escribir', 'Recolecta 15 pergaminos de corteza de los antárboles en descomposición de las Islas Dragón para Dothenos del Acuerdo de Valdrakken.', 'Hemos encontrado cierta información inusual en nuestros estudios de las Islas Dragón. Por ejemplo, la corteza de los antárboles afectados por la magia de descomposición actúa de forma similar al papiro de pellejo.\n\nEste extraño papiro es capaz de mantener la magia para las inscripciones más poderosas, lo que resulta muy útil. ¿Puedes ayudarnos a reunir algo de esa corteza?', '', '', '', '', '', '', 47187),
(66940, 'esES', 'Experimentos con elixires', 'Recolecta 15 muestras de mucosidad de los górlocs de las Islas Dragón para Dhurrel de los Centauros Maruuk.', 'Hace poco, nuestros alquimistas han investigado varios ingredientes nuevos con los que podríamos experimentar. Su última fijación es... interesante, por así decirlo.\n\nParece que la mucosidad de los górlocs tiene propiedades que pueden ser beneficiosas para determinados elixires.', '', '', '', '', '', '', 47187),
(66939, 'esES', 'Cazar al maestro de caza', 'Da caza al maestro de caza Krakle en las inmediaciones del Escudo de Imbu.', 'Uno de los guardias del Campamento Desubicado me ha contado que hay un desgraciado que se dedica a mutilar a la fauna local. Se hace llamar \"maestro de caza\".\n\nUna cosa es la caza, pero no puedo tolerar que se torture a los seres vivos. \n\nAdemás, a mi carromato le vendría bien un talismán de la suerte.\n\n<Nesingwary escupe a un lado>.\n\nTráeme su zarpa.', '', 'Un gnoll perverso que disfruta torturando a la fauna inocente.', 'Maestro de caza Krakle', '', '', 'Habla con Hemet Nesingwary Jr. en el Campamento Desubicado.', 47187),
(66934, 'esES', 'Aniquilar al Aniquilador', '', '', '', '', '', '', '', '', 47187),
(66933, 'esES', 'Carrera del Espejo del Cielo', 'Atraviesa los anillos planeando.', 'Vuela a través de los anillos de control que marcan el recorrido.', '', '', '', '', '', '', 47187),
(66931, 'esES', '¿Quién ha provocado tanto jaleo?', 'Averigua por qué hay tanto revuelo en el Vitasagrario Rubí.', 'Eso no ha sido un temblor de tierra cualquiera.', '', '', '', '', '', '', 47187),
(66929, 'esES', 'Hazte con todas... las cartas', 'Recupera el mazo de Yumadormu.', '$PC, ¿te importaría ayudarme a recuperar mis cartas?\n\nLe dije a Setogosa que las necesitaba para enseñar a otros estudiantes a jugar a Hearthstone. Quiero formar un club, ¡pero no me las devuelve!\n\nSiempre se ha portado fatal conmigo, pero esto ya es pasarse.', '', '', '', '', '', '', 47187),
(66921, 'esES', 'Carrera Maruukai', 'Atraviesa los anillos planeando.', 'Vuela a través de los anillos de control que marcan el recorrido.', '', '', '', '', '', '', 47187),
(66903, 'esES', 'En busca del cofre', '', '', '', '', '', '', '', '', 47187),
(66901, 'esES', 'Romper el mundo', '', '', '', '', '', '', '', '', 47187),
(66897, 'esES', 'Combustible para la forja', 'Recolecta 10 núcleos de arrabio de las criaturas de lava de las Islas Dragón para Dhurrel de los Centauros Maruuk.', 'Para hacer las mejores hojas, necesitas el calor que solo un núcleo de arrabio puede proporcionar. Intentamos tener algunos a mano como fuente de combustible para nuestras forjas. Últimamente nos estamos quedando sin núcleos y nos vendría bien reabastecernos.\n\nLos núcleos de arrabio se pueden obtener de la mayoría de las criaturas de lava de las Islas Dragón.', '', '', '', '', '', '', 47187),
(66895, 'esES', 'Igual que el viejo jefe', 'Elimina a Vyzos la Profetisa.', 'Los dragonantes rompemundos son muy confiados. Hemos seguido a muchos líderes diferentes durante años y hemos creído que con todos llegaría la Hora del Crepúsculo y presenciaríamos el regreso de Alamuerte.\n\nSin embargo, Alamuerte no ha regresado, y aún no hay ni rastro del Crepúsculo.\n\nNecesitamos un nuevo líder. Tú puedes ayudarnos a conseguir el cambio.', '', 'El último en una larga sucesión de líderes.', 'Vyzos la Beneficiosa', '', '', '', 47187),
(66893, 'esES', 'Venganza picuda', 'Sana a $1oa zancacuernos heridos en los Rápidos Desbordantes.', 'Puede que no sepa nada sobre elementales de agua, ¡pero sí sobre zancacuernos!\n\nHe fabricado un ungüento que mantendrá a los zancos sanos y listos para luchar. Nunca he tenido ocasión de aplicárselo a un zancacuerno real, pero he estudiado todos sus efectos.\n\n¡Es hora de echarle valor y enjabonarlos!', '', '', '', '', '', '', 47187),
(66892, 'esES', 'El dilema del diluvio', 'Mata a $1oa elementales de agua en los Rápidos Desbordantes.', '¡Los elementales están matando a los zancacuernos! Sé cómo pelear contra bichos grandes, pero nunca pensé que tendría que enfrentarme a un elemental. No se parecen en nada a los enormes bebés de truenagarto...\n\n<Dazakros suspira con angustia>.\n\nPor favor, acaba con unos cuantos de esos elementales. Los zancacuernos son más listos de lo que creemos. Si tienen los medios, ¡contraatacarán!', '', '', '', '', '', '', 47187),
(66891, 'esES', 'Ceniza explosiva', 'Recolecta 20 de ceniza explosiva de los fénix de las Islas Dragón para Gnoklin Bobinavagante de la Expedición Dragontina.', 'Los fénix de magma de las Islas Dragón generan una ceniza inusual cuando mueren. Se puede usar para crear algunas mejoras materiales para maquinaria compleja y esencial, aunque probablemente yo la usaría para fabricar explosivos.', '', '', '', '', '', '', 47187),
(66890, 'esES', 'Herramientas robadas', 'Recolecta 20 herramientas robadas de los gnolls de las Islas Dragón para Dothenos del Acuerdo de Valdrakken.', 'Los gnolls no dejan de asaltar nuestras caravanas de suministros. Parecen obsesionados por las diversas herramientas de ingeniería que hay en ellas. ¡No podemos arriesgarnos a que esos salvajes descubran nuestra artesanía especializada! Además, los robos han retrasado nuestro calendario de producción más de lo que me gustaría admitir.\n\nSi recuperas algunas de las partes robadas, podremos ponernos al día.', '', '', '', '', '', '', 47187),
(66886, 'esES', 'Ascensión avanzada a los Jardines Esmeralda', 'Atraviesa los anillos planeando.', 'Vuela a través de los anillos de control que marcan el recorrido.', '', '', '', '', '', '', 47187),
(66885, 'esES', 'Ascensión a los Jardines Esmeralda', 'Atraviesa los anillos planeando.', 'Vuela a través de los anillos de control que marcan el recorrido.', '', '', '', '', '', '', 47187),
(66884, 'esES', 'Equipamiento ignífugo', 'Recolecta 10 piezas de equipamiento ignífugo de los Djaradin de las Islas Dragón para Temnaayu de los Colmillarr de Iskaara.', 'Las armaduras de los Djaradin pueden resistir las llamas más feroces. ¡Una cualidad así sería de gran utilidad para combatir contra ellos!\n\nA ver qué puedes arrebatarles. Podríamos estudiarlas y aplicar los mismos encantamientos a nuestras armaduras.', '', '', '', '', '', '', 47187),
(66883, 'esES', 'El anillo de cuerno antiguo', 'Entrégale el objeto a Exadria.', '<Puede que Exadria quiera esto>.', '', '', '', '', '', '', 47187),
(66882, 'esES', 'La mochila de batalla perdida', 'Entrégale el objeto a la acechagarra Kavia.', '<Puede que la acechagarra Kavia quiera esto>.', '', '', '', '', '', '', 47187),
(66881, 'esES', 'Curso fluvial avanzado del barranco', 'Atraviesa los anillos planeando.', 'Vuela a través de los anillos de control que marcan el recorrido.', '', '', '', '', '', '', 47187),
(66880, 'esES', 'Curso fluvial del barranco', 'Atraviesa los anillos planeando.', 'Vuela a través de los anillos de control que marcan el recorrido.', '', '', '', '', '', '', 47187),
(66879, 'esES', 'Estragos entre los zancacuernos', 'Reúnete con Dazakros en los Rápidos Desbordantes.', 'Esos Zancacuernos... Tienen un pico que rompe los huesos, patas rápidas para escapar del peligro y estómago para comer cualquier cosa de las islas.\n\n¡Esta vocación es la más fácil! Solo yo y mis pajarracos favoritos, pasando el rato. Y si surge algo, sé manejar a todas las alimañas de la isla.\n\n¿Te importaría seguirme hasta las mesetas de zancacuernos del norte? Me vendría bien un par de manos más mientras me instalo.', '', '', '', '', '', '', 47187),
(66878, 'esES', 'Vuelo avanzado del pantano', 'Atraviesa los anillos planeando.', 'Vuela a través de los anillos de control que marcan el recorrido.', '', '', '', '', '', '', 47187),
(66877, 'esES', 'Vuelo del pantano', 'Atraviesa los anillos planeando.', 'Vuela a través de los anillos de control que marcan el recorrido.', '', '', '', '', '', '', 47187),
(66875, 'esES', 'Conservando el pasado: Academia Algeth\'ar', 'Consigue el sueño fatuo de recuerdos enredados de la directora en la Academia Algeth\'ar.', '¡Qué maravilla! La Academia Algeth\'ar vuelve a abrir sus puertas. La directora Doragosa debe de estar encantada de volver a sus clases.\n\nHace mucho que no tengo ocasión de hablar con mi querida amiga. ¿Y si vas y averiguas si está disponible para tomar el té? También será una buena oportunidad para apuntarte a la academia: tengo entendido que ahora acepta todo tipo de estudiantes.\n\nPensé que esto te podría interesar, habida cuenta de lo mucho que vienes a vernos a los archivos y a mí.', '', '', '', '', '', '', 47187),
(66874, 'esES', 'Conservando el pasado: Salas de Infusión', 'Consigue el distribuidor holográfico del tsunami primigenio en las Salas de Infusión.', '¿Sabías que en lo más profundo de Tyrhold hay una instalación gigante llamada... las Salas de Infusión? ¡Qué misterioso! ¡Qué intrigante! ¡Qué de posibilidades!\n\nEl guardián Tyr ocultaba muchos de sus secretos allí. ¿Qué podrían ser? No cabe duda de que era el más brillante de todos los guardianes.\n\n<Kemora parece estar sumida en una ensoñación>.\n\nSin embargo, los Primalistas están causando estragos. Seguro que provocarán daños a todas las maravillas del guardián Tyr si no se les detiene. Por favor, deshazte de ellos antes de que siembren el caos.', '', '', '', '', '', '', 47187),
(66868, 'esES', 'Conservando el pasado: Legado de Tyr', 'Consigue el bibelot perdido en el tiempo del cronolord Deios, que está en Uldaman.', 'He estado repasando los archivos intentando buscar información sobre el guardián Tyr y, sorprendentemente, se ha eliminado toda mención a Uldaman a excepción de media página que mencionaba algo sobre un secreto oculto en el lugar.\n\nEs fascinante, ¿verdad? Seguro que allí escondió otros secretos. Quizá tú y algunos de tus amigos podáis ir a investigar. Me gustaría atesorar cualquier cosa que puedas traerme.', '', '', '', '', '', '', 47187),
(66864, 'esES', 'Recuperación de reliquias: Hondonada Frondacuero', 'Consigue el fetiche de la descompotriarca Ojoiracundo en la Hondonada Frondacuero.', '¡Ah! Necesito tu ayuda. Se dice que los gnolls de la Hondonada Frondacuero usan la descomposición, una poderosa herramienta en las manos adecuadas.\n\nEs un asunto importante y deberíamos estar investigándolo. Ve a la Hondonada y tráeme un poco de su magia para que pueda... para que podamos ver qué clase de poderes han dominado.\n\nTen cuidado y llévate algunos amigos. Los Frondacuero tienen la habilidad de marchitarte hasta los huesos.\n\nEso sería una lástima.', '', '', '', '', '', '', 47187),
(66860, 'esES', 'Recuperación de reliquias: Legado de Tyr', 'Consigue el reloj de arenas cambiantes del cronolord Deios, que está en Uldaman.', 'Kemora me ha encargado buscar alguna referencia sobre el guardián Tyr y Uldaman. Tengo montones de recortes de todos los libros que he repasado intentando encontrar lo que busca.\n\nCasi todas las menciones están desgarradas o destruidas. Menos esta que he... guardado para enseñársela más tarde. Por lo visto, hay algo valioso oculto en Uldaman. Me interesaría mucho que me lo trajeras.\n\nEs para ayudar mejor a Kemora con su investigación, por supuesto.', '', '', '', '', '', '', 47187),
(66848, 'esES', 'Augurios del viento', 'Ayuda a Ohn Seshteng con su ritual.', 'Ohn\'ahra no habla mediante un idioma como nosotros. Su voz se transmite a través de los mismos vientos. A los místicos nos entrenan para sentir su presencia, seguir su llamada e interpretar sus mensajes.\n\nHe usado los materiales que has reunido para vincular tótems a esta llamada en concreto. Ayúdame con un ritual para concentrar su voz de modo que pueda interpretar su canción.', '', '', '', '', '', '', 47187),
(66847, 'esES', 'Cámara de las Encarnaciones: La furia de la Devoradora de Tormentas', 'Entra en la Cámara de las Encarnaciones y derrota a Raszageth.', '¡No! ¡Encerramos a las Encarnaciones para salvar el mundo, y ahora Raszageth quiere liberarlas!\n\nNo debemos permitir que lo consiga, $n. ¡Toda la vida en Azeroth corre grave peligro si no la detienes!\n\nDebo regresar con Nozdormu en el Trono de los Aspectos para tomar medidas contra lo que esté por llegar. No te preocupes, no me marcharé sin dejarte ayuda. Kalecgos y Khadgar se unirán a ti cuando te adentres en la cámara.\n\nBuena suerte, adalid.', '', '', '', '', '', 'Habla con Kalecgos en el Trono de los Aspectos, que está en Valdrakken.', 47187),
(66846, 'esES', 'El corazón de la colección', 'Ayuda a la aparición a crear una nueva carta.', 'El día en el que las Islas Dragón entraron en letargo, debía jugar mi última partida. El destino fue cruel y perdí mi carta más poderosa justo antes, así que no pude competir.\n\nLa carta de Guo-Hee era de mi propiedad. No sé cómo llegó a manos de sus ancestros.\n\nPor desgracia, no puedo decir que sea mía; lleva en su familia durante generaciones. He cometido una estupidez.\n\nQuizá podamos crear una nueva, tú y yo. Una carta única... ¡Sí! ¿Me ayudarás?\n\nHabla conmigo cuando quieras comenzar.', '', '', '', '', '', '', 47187),
(66845, 'esES', 'Brillo legendario', 'Encuentra el fantasma dracónido y recupera la carta legendaria.', 'Anoche estaba tumbada en mi saco de dormir, dando vueltas, cuando un escalofrío antinatural inundó la posada.\n\n¡En ese momento salió de la nada el fantasma de un dracónido! ¡Atravesó mi equipaje y se esfumó!\n\nPero lo peor llegó cuando me desperté... ¡El fantasma se había llevado mi carta preferida!\n\n¿Serías tan amable de ir a buscarlo y recuperar mi carta? Es mi posesión más preciada.', '', 'Sea cual sea el motivo, siempre hay opciones mejores y más inteligentes que robar.', 'Una aparición misteriosa', '', '', '', 47187),
(66844, 'esES', 'El gran Shokhari', 'Mata a la raposa del cielo Shokhari.', 'De todoh loh animaleh que he vihto aquí, Shokhari, la gran raposa del cielo, era la máh orgullosa.\n\nEh una pena que se haya cebao con un chamán gnoll y enloquecido por culpa de la dehcomposición. Cuando la vi comerse a una de suh críah, supe que algo no iba bien.\n\nMe llevé al rehto de lah críah y lah traje aquí, pero Shokhari me atacó y me dio pal pelo. Casi no sobrevivo.\n\nHay que acabar con ella. Si la dehcomposición sigue deteriorando su mente, será cuehtión de tiempo que venga pa comernoh.', '', 'Este astudraco majestuoso dominaba los bosques en su día, pero ahora ha enloquecido por culpa de la descomposición.', 'Raposa del cielo Shokhari', '', '', '', 47187),
(66843, 'esES', 'Lukh ya no está', 'Encuentra el paradero de Lukh.', '¿Has visto a mi ayudante, Lukh?\n\nEl chaval quería dar una vuelta, ¡pero hace una hora que se fue!\n\nLe tengo dicho que no es seguro y que no debe irse muy lejos, pero es terco como una mula.\n\nNo lo culpo. Los alrededores son bonitos, y a él le gustan mucho las flores.\n\n¿Me ayudas a encontrarlo? ¡Me necesitan de vuelta con mi carromato en la Atalaya de Tres Cascadas!', '', '', '', '', '', '', 47187),
(66841, 'esES', 'Un fragmento del pasado', 'Recupera el artefacto y llévaselo a Thanessa Florargenta.', 'Te he visto corriendo por todas partes ayudando a la gente. ¿Crees que podrías ayudar al viejo Gannar?\n\nHe inspeccionado la zona y hay algo que me ha llamado la atención. Parece un tiesto antiguo o un jarrón. Está al sur, en el borde de la cascada.\n\nA mí no se me da muy bien nadar, pero te daré algo de oro si le llevas lo que descubras a Thanessa Florargenta.', '', '', '', '', '', 'Lleva el artefacto a Thanessa Florargenta.', 47187),
(66840, 'esES', 'Seguridad del agua', 'Llévale tres muestras de agua a Manny Read.', 'Mi mayor responsabilidad es asegurarme de que todo el mundo tenga acceso al agua potable.\n\nDebo garantizar que el campamento es seguro, sobre todo con los gnolls del este y su maldita descomposición.\n\nNo quiero alarmar a nadie tomando muestras personalmente, pero creo que deberíamos asegurarnos.\n\nTráeme muestras de las tres cascadas cercanas y te recompensaré con generosidad.', '', '', '', '', '', '', 47187),
(66839, 'esES', '¡Hora del bebercio!', 'Recolecta bayas de sangre, bayas de cuerno de bronce y flores de hoja de dragón.', 'Los muchachos tenían algo de tiempo libre y ganas de tomarse una pinta, así que nos acercamos a la posada.\n\nPero ¿te lo puedes creer? ¡No les quedaba cerveza! ¿Qué clase de posada no tiene cerveza? ¡Pues una posada de los Goznepetra, claro!\n\n¡Así que vamos a coger el toro por los cuernos! En el bosque al este hay flores y hierbas que podríamos usar para destilar un poco de hidromiel. ¿Te importaría ayudarnos y recoger algunas flores? No temas, ¡no te irás con las manos vacías!', '', '', '', '', '', '', 47187),
(66838, 'esES', 'Aquí hace frío', 'Consigue pelambres de oso gruesas de osos melenagruesa.', 'Ser una buena tabernera significa anticiparse a las necesidades de tus huéspedes. Por desgracia, no anticipé que las noches aquí fueran tan frías. ¡Ay!\n\nMis huéspedes van a necesitar mantas, y bien gruesas. Puede que nos sirvan unas pieles de oso.\n\nHe visto unos bien grandotes en el bosque al este de aquí. ¡Te pagaré si me traes algunas de sus pieles! \n\nPor favor. Piensa en los aventureros y en sus pies helados...', '', '', '', '', '', '', 47187),
(66837, 'esES', 'Nada para desayunar', 'Consigue carne de vorquin zancador y de brúfalo a rayas al sur de la Atalaya de Tres Cascadas.', 'Se suponía que mi hermano Valdo iba a pedir más suministros. Pero ya ha pasado una semana y no ha llegado nada.\n\nNo me sorprende. ¡Seguramente el muy vago se haya tumbado a la bartola! Ahora casi no nos queda comida, ¡y ya tengo bastantes cosas que hacer como para encima salir a cazar! \n\n¿Podrías cazar por nosotros? Al sur de aquí hay vorquin zancadores y brúfalos a rayas, cuya carne nos bastaría para mantener la cocina abierta hasta que pueda pedir más suministros.', '', '', '', '', '', '', 47187),
(66836, 'esES', 'Circuito avanzado del Soto Llamanzana', 'Atraviesa los anillos planeando.', 'Vuela a través de los anillos de control que marcan el recorrido.', '', '', '', '', '', '', 47187),
(66835, 'esES', 'Circuito del Soto Llamanzana', 'Atraviesa los anillos planeando.', 'Vuela a través de los anillos de control que marcan el recorrido.', '', '', '', '', '', '', 47187),
(66834, 'esES', 'Rellen el Erudito', 'Presenta tus ofrendas en la guarida de las ofrendas y presencia cada una de las enseñanzas de Rellen.', 'Lleva las ofrendas a la guarida del centro. Podrás presenciar la leyenda de Rellen el Erudito, que estableció el modo de vida de los centauros tal y como lo conocemos.', '', '', '', '', '', '', 47187),
(66833, 'esES', 'Marmonis en apuros', '', '', '', '', '', '', '', '', 47187),
(66831, 'esES', 'El hogar está donde están las ranas', 'Reúnete con Keshki en los Estanques de Vida para liberar a las ranas rescatadas.', '¡Ranas reunidas, $n! Supongo que se las llevaremos a Akora de todas formas. Estarán a salvo en los Estanques de Vida hasta que los cornisapos se aburran y se marchen.\n\nHum, bueno, al final no llegamos a encontrar nada para animar a Akora. Espero que lo entienda...', '', '', '', '', '', '', 47187),
(66830, 'esES', '¡Cornisapos!', 'Usa el tarro de luciérnagas de Keshki para poner a $1oa ranas abusadas a salvo.', '¡Los cornisapos me sacan de quicio!\n\n<Keshki, enfadada, da un fuerte pisotón y las gafas se le tuercen>\n\n¡Son unos abusones enormes y avariciosos! ¡El mero hecho de que el lugar lleve su nombre no significa que puedan invadir la zona y comerse todo lo que sea más pequeño que ellos!\n\nTen, usa mi tarro de luciérnagas. Es la mejor herramienta de una cuidadora de ranas. Las calma lo suficiente como para recogerlas y alejarlas del peligro.\n\nY si alguno de esos falsarios se interpone en tu camino, ¡no te cortes y dale su merecido!', '', '', '', '', '', '', 47187),
(66828, 'esES', 'Acurrucarse en la cuenca', 'Reúnete con Keshki en la Cuenca de los Cornisapos.', 'Nunca había visto a Akora tan disgustada. Por lo general suele estar tan radiante como sus flores, pero esa leyenda significa mucho para ella. Habla de ella sin parar. Mmm...\n\n<Keshki juguetea con sus gafas>.\n\nNo sé mucho sobre plantas y no creo que las ranas puedan animar a nadie más que a mí.\n\nAhora bien, al norte hay un lugar tranquilo donde me dedico a meditar, la Cuenca de los Cornisapos. Puede que allí encontremos algo que la anime. O, al menos, nos ayudará a planear algo.', '', '', '', '', '', '', 47187),
(66827, 'esES', 'Flores de nuestro trabajo', 'Recoge $1oa piezas de frutadragón madura, $1oa flores de dragón aromáticas y $1oa vainas de semilla exuberante por todo el jardín para ofrecérselas al espíritu dragón.', 'La leyenda dice que solo la oyen aquellos que demuestran su devoción por la vida.\n\nHe cuidado este jardín durante años y... creo que mis plantas y yo por fin estamos listas.\n\nComenzaré a prepararlo todo junto al estanque. Puedes ayudarme con la cosecha.\n\nRecolecta vainas de semilla de los arbustos, flores de dragón en los campos soleados y frutadragón de los árboles. Puedes tomar prestado mi viejo rastrillo para facilitarte las cosas. Ten cuidado, ¡a veces a la maleza le da por morder!', '', '', '', '', '', '', 47187),
(66825, 'esES', 'La convocavida rubí', 'Participa en la ceremonia convocavida en el Vitasagrario Rubí.', '¡$p! Llegas en el momento justo. Estamos a punto de comenzar una ceremonia convocavida y sería un honor contar con tu ayuda.\n\nLa vocación de un dragauro es algo muy especial. Algunos se convierten en maestros jardineros y otros se ocupan de una fauna particular.\n\nEstos jóvenes dragauros han terminado su entrenamiento y están listos para elegir sus primeras vocaciones. Sé que estarán encantados de que participes. Cuando lo tengas todo listo, preséntales cada uno de los objetos en esta mesa.', '', '', '', '', '', '', 47187),
(66805, 'esES', 'Llaves de lealtad', 'Recoge $1oa llave obsidiana superior.', '', '', '', '', '', '', 'Entrega la llave a Sabellian, que está en la Ciudadela Obsidiana.', 47187),
(66788, 'esES', 'Ovocionados por el futuro', 'Ayuda a la madre Elion a restaurar la zona.', '¡Apenas doy crédito! ¡Huevos del Vuelo Negro! ¡Después de tanto tiempo!\n\n¡Pero mira el estado de este lugar! ¡Esto no sirve! Para estos huevos, cualquier cosa es poco.\n\n¡Está claro que esos dos cabezotas no han pensado en nosotros mientras reñían como críos por el favor de la Protectora! Tú, en cambio, no dejarías sola a una anciana cuidadora de huevos, ¿verdad?', '', '', '', '', '', '', 47187),
(66787, 'esES', 'Rotonda avanzada de Reposo Alado', 'Atraviesa los anillos planeando.', 'Vuela a través de los anillos de control que marcan el recorrido.', '', '', '', '', '', '', 47187),
(66786, 'esES', 'Rotonda de Reposo Alado', 'Atraviesa los anillos planeando.', 'Vuela a través de los anillos de control que marcan el recorrido.', '', '', '', '', '', '', 47187),
(66785, 'esES', 'La Última Cuidadora', 'Habla con la madre Elion.', 'Entiendo tu preocupación, $c, pero pronto se arreglará todo. Parece que estamos a punto de tener compañía.\n\nNo dudes en quedarte y presenciar lo que ocurre. Será bastante catártico.\n\nHabla con nuestra cuidadora de huevos cuando tengas un momento. Sin duda necesitará todo el apoyo posible.', '', '', '', '', '', 'Habla con la madre Elion', 47187),
(66784, 'esES', 'Matar de hambre a la tormenta', 'Mata invocatormentas primalistas para cerrar el portal del corredor de tormentas.', '¡Luchas bien para ser alguien que debe mantener el equilibrio con dos piernas!\n\nNo importa lo bien que luchemos si no dejan de llegar refuerzos para los Primalistas. ¡Debemos cerrar ese portal, el corredor de tormentas!\n\nÁbrete camino hasta la caverna cercana y mata a los invocatormentas primalistas que lo mantienen abierto. Te ayudaré en la medida de lo posible.', '', '', '', '', '', '', 47187),
(66783, 'esES', 'Renovación de votos', 'Ayuda a la khan Sansok, a la khan Tigari, a la khanam Matra Sarest y a Merithra a intercambiar regalos.', 'Hace siglos, hice un juramento de amistad y cooperación con el primer centauro. Aunque las cosas han cambiado mucho, me parece que es hora de renovar dicho juramento.\n\nSe compuso un recitado para ayudar a las generaciones futuras de centauros a recordar su vínculo con el Vuelo Verde. Hay que responder a cada verso con una ofrenda de los khanes. Espero que los centauros sigan recordando el significado original de la ceremonia.\n\nLa elección de la ofrenda es de suma importancia. Elige la ofrenda adecuada y nuestra lealtad quedará vinculada.', '', '', '', '', '', '', 47187),
(66781, 'esES', 'Cuestión de gustos', 'Encuentra una roca en el Rincón del Ballenero para que Mordigan Quijahierro pueda lamerla.', '¡Qué falta de respeto!\n\nUn par de górlocs apestosos nos roban el equipo y tenemos que cerrarlo todo... ¡Ja! ¡Llevo lamiendo rocas desde antes de que tú fueras un bebé! Y no necesitaba cachivaches gnómicos tan sofisticados.\n\n¡Tráeme una roca y te lo demostraré!', '', '', '', '', '', 'Vuelve con Mordigan Quijahierro.', 47187),
(66780, 'esES', 'Aspirante al trono', 'Habla con los seguidores de Wrathion.', '¿He consagrado mi vida a salvar Azeroth de la destrucción una y otra vez y este necio cree que puede aparecer de la nada y hacerse con el título de Aspecto? Ni hablar.\n\nHabla con mi gente, $n. Veamos que opinan sobre mí y sobre lo que he hecho por este mundo.', '', '', '', '', '', '', 47187),
(66779, 'esES', 'Heredero aparente', 'Habla con los seguidores de Sabellian.', 'Como heredero de Neltharion y líder del único Vuelo superviviente de dragones negros, no esperaba encontrarme una disputa por mi derecho de nacimiento. Y menos contra una cría con aires de grandeza y más joven que tú, mortal.\n\nDicho esto, si necesitas algo más que estos hechos incontrovertibles, no dudes en hablar con los miembros de mi Vuelo. No tienes por qué aceptar mi palabra en este asunto.', '', '', '', '', '', '', 47187),
(66778, 'esES', 'Montaña rusa avanzada de Uktulut', 'Atraviesa los anillos planeando.', 'Vuela a través de los anillos de control que marcan el recorrido.', '', '', '', '', '', '', 47187),
(66777, 'esES', 'Montaña rusa de Uktulut', 'Atraviesa los anillos planeando.', 'Vuela a través de los anillos de control que marcan el recorrido.', '', '', '', '', '', '', 47187),
(66737, 'esES', 'Un mejor comienzo', 'Planta $1oa semillas en parcelas de tierra fértil y deja que crezcan.', 'Vaeros es diligente, pero las crías saben cómo crear problemas. Las mías no, claro, pero supongo que no todos los dragones educan a su nidada para comprender la gravedad de su situación.\n\nAunque no me gusta fomentar el juego al aire libre cuando hay que estudiar, te ayudaré a proteger el jardín de forma más eficiente. Coge estas semillas y plántalas por aquí cerca. Cuando maduran, las flores producen una fragancia que los insectos encuentran desagradable.\n\nLos jardineros pueden ayudarte..., y quizá también mis hermanos bronce, si cuidas tus modales.', '', '', '', '', '', '', 47187),
(66735, 'esES', 'Cortar solo las puntas', 'Poda $1oa arbustos cubiertos de maleza.', 'Que las abejas asusten a las crías no es el único problema. Aunque la polinización suele ser algo bueno, el reciente enjambre ha provocado que la flora crezca sin control.\n\n¿Te importaría coger mis tijeras de jardinería y cortar los arbustos? Han empezado a surgir unos azotadores peligrosos, pero creo que podemos evitar que crezcan más. Más vale prevenir que curar, ya sabes.\n\nY me vendría bien un poco de prevención ahora mismo, $n.', '', '', '', '', '', '', 47187),
(66734, 'esES', 'Las mieles de la calma', 'Usa el difusor de humo para calmar y recoger $2oa abejas molestas. Luego libéralas cerca del lago.', 'Oh, ¡gracias a la Protectora! ¡Alguien con las manos vacías!\n\nEstos jardines suelen ser un precioso patio de recreo para nuestras crías, pero las abejas se han multiplicado de forma descontrolada. Ahora hay cada vez más flores... y más abejas. Las crías están aterrorizadas, y los dragones, hartos... Ayer mismo picaron a una de las crías y...\n\n<Vaeros respira hondo para centrarse y luego te lanza una mirada suplicante>.\n\n¿Podrías recoger las abejas y llevarlas al lago? Coge este difusor de humo, te ayudará a calmarlas.', '', '', '', '', '', '', 47187),
(66733, 'esES', 'Curso fluvial avanzado de la Fronda de la Cúspide', 'Atraviesa los anillos planeando.', 'Vuela a través de los anillos de control que marcan el recorrido.', '', '', '', '', '', '', 47187),
(66732, 'esES', 'Curso fluvial de la Fronda de la Cúspide', 'Atraviesa los anillos planeando.', 'Vuela a través de los anillos de control que marcan el recorrido.', '', '', '', '', '', '', 47187),
(66730, 'esES', 'Auténticos supervivientes', 'Busca al viejo Colmigrima en el lago congelado de las Tierras Azures y habla con él.', 'Sé que estamos bastante mal, pero no podemos olvidar por qué estamos aquí. Nuestra gente cuenta con nosotros, y no pienso defraudarlos. Tenemos que encontrar un refugio temporal para nosotros en este lugar salvaje, y conozco el lugar idóneo.\n\nAhora deja de lloriquear y en marcha.', '', '', '', '', '', 'Busca al viejo Colmigrima en el lago congelado de las Tierras Azures y habla con él.', 47187),
(66728, 'esES', 'Vuelo avanzado del Flujo de Ascuas', 'Atraviesa los anillos planeando.', 'Vuela a través de los anillos de control que marcan el recorrido.', '', '', '', '', '', '', 47187),
(66727, 'esES', 'Vuelo del Flujo de Ascuas', 'Atraviesa los anillos planeando.', 'Vuela a través de los anillos de control que marcan el recorrido.', '', '', '', '', '', '', 47187),
(66726, 'esES', 'Circuito avanzado de la Reserva Agreste', 'Atraviesa los anillos planeando.', 'Vuela a través de los anillos de control que marcan el recorrido.', '', '', '', '', '', '', 47187),
(66725, 'esES', 'Circuito de la Reserva Agreste', 'Atraviesa los anillos planeando.', 'Vuela a través de los anillos de control que marcan el recorrido.', '', '', '', '', '', '', 47187),
(66724, 'esES', 'La Escamabrillante', 'Consigue $1oa brillopeces y colócalos en la cesta de ofrenda.', 'Siento que te hayan metido en esto, $gviajero:viajera;. \n\nMi hermano tiende a.. dejarse llevar. Esta no es más que la última de sus locuras. Y me temo que podría acabar con él. \n\nNunca me presta atención. Quizá ni a ti te hará caso.\n\nNuestra antepasada, Kauriq la Escamabrillante, es el centro de su fijación. Ella sí podría conseguirlo.\n\nPor favor, pesca unos brillopeces y tráelos aquí. Los usaré para comunicarnos con su espíritu, que perdura en esta piedra.', '', '', '', '', '', '', 47187),
(66722, 'esES', 'Eslalon avanzado de la Reserva Agreste', 'Atraviesa los anillos planeando.', 'Vuela a través de los anillos de control que marcan el recorrido.', '', '', '', '', '', '', 47187),
(66721, 'esES', 'Eslalon de la Reserva Agreste', 'Atraviesa los anillos planeando.', 'Vuela a través de los anillos de control que marcan el recorrido.', '', '', '', '', '', '', 47187),
(66719, 'esES', 'Un paso atrás', 'Protégete de La llamada.', '$gAmigo mío:Amiga mía;, con gran pesar debo decir que conozco bien la situación a la que se enfrentan los tuyos en estas ruinas. Si sigues adelante, seguramente también sucumbas a su locura.\n\nSea como sea, esa llamada que oyes es puro instinto. En ti habita un anhelo que debe ser saciado.\n\nMe avergüenza afirmar que poseo los medios para sanar maldición. No será lo mismo, pero funcionará... por ahora.', '', '', '', '', '', '', 47187),
(66718, 'esES', 'Los gnolls deben morir', '', '', '', '', '', '', '', '', 47187),
(66715, 'esES', 'La extracción', 'Rescata a los colmillarr del Campamento Nievepiel en las Tierras Azures.', 'Ahora mismo, lo más importante es traer de vuelta a mi gente. De una pieza, a ser posible.\n\nY, por mucho que me duela reconocerlo, no estoy en condiciones de luchar solo.\n\n¿Nos ayudarás?', '', '', '', '', '', 'Habla con Muerdefrío para obtener más información sobre los cazadores colmillarr.', 47187),
(66714, 'esES', '[DNT]QuestNameHere', '', '', '', '', '', '', '', '', 47187),
(66713, 'esES', '[DNT]QuestNameHere', '', '', '', '', '', '', '', '', 47187),
(66712, 'esES', 'Recorrido aéreo avanzado de Raudoescarcha', 'Atraviesa los anillos planeando.', 'Vuela a través de los anillos de control que marcan el recorrido.', '', '', '', '', '', '', 47187),
(66711, 'esES', 'Una exquisitez en la oscuridad', 'Recoge $1oa buccinos de río para Hadari.', 'Debido a la naturaleza de nuestro clan, algunos recursos escasean. No podemos permitirnos el lujo de reclamar los recursos metálicos de la tierra.\n\nLa difunta khan estableció diversas conexiones comerciales con particulares, y no veo motivos para interrumpir sus servicios.\n\nEn la bahía cercana hay unos cubos donde capturamos buccinos. Algunos de nuestros vecinos los consideran un manjar. Tráeme unos cuantos para que pueda comerciar con ellos.', '', '', '', '', '', '', 47187),
(66710, 'esES', 'Recorrido aéreo de Raudoescarcha', 'Atraviesa los anillos planeando.', 'Vuela a través de los anillos de control que marcan el recorrido.', '', '', '', '', '', '', 47187),
(66709, 'esES', 'Fundamentos de medicina de campo', 'Ayuda al viejo Colmigrima a recuperarse de sus heridas.', '<Es difícil saber cuánto tiempo lleva aquí este colmillarr herido en medio del bosque, pero lo que está claro es que no aguantará mucho sin ayuda>.', '', '', '', '', '', '', 47187),
(66708, 'esES', 'Jinetes en la nieve', 'Encuentra a los cazadores colmillarr desaparecidos en las Tierras Azures.', 'Saludos, $c. La cúpula mágica es extraordinaria, ¿verdad? Pero, aunque nos proteja del frío y la naturaleza, no podemos contar con el Kirin Tor toda la vida.\n\nHace unos días, algunos de nuestros cazadores más veteranos salieron a los bosques en busca de comida y suministros, pero no regresaron. Aunque sé que su líder, el viejo Colmigrima, es un montañero y cazador veterano, no puedo evitar preocuparme por él y su grupo de caza.\n\n¿Podrías salir a buscarlos?', '', '', '', '', '', 'Encuentra a los cazadores colmillarr desaparecidos en las Tierras Azures.', 47187),
(66706, 'esES', '[DNT]QuestNameHere', '', '', '', '', '', '', '', '', 47187),
(66704, 'esES', '¡Mugurlglrlgl!', '¡Murglgulglrrglgul!', '¡Mrglgulglrrlglgul! ¡Grurguglullgurl!\n\nGruglrlgllrugl rrgulgrulgrgl grugll gurgull gur. Murgllgllrugl gurgllglrl Murgul gruggullgl. Murguglegurgllgur gurgll gurgulgul guruulgurllgr guuglrllgl.\n\nMgrgulllglll gurl gugll.\n\n<No tienes claro lo que está diciendo, pero apuñala el aire repetidas veces. Parece que el múrloc quiere que mates algo>.', '', '', '', '', '', '', 47187),
(66703, 'esES', 'Efecto bola de nieve', 'Recupera $1oa tótems Nievepiel de los chamanes Nievepiel en las Tierras Azures.', 'Gnolls Nievepiel listos. Saben guardar comida en hielo, y comida durar más tiempo. Pero hielo normal no servir. ¡Hielo mágico mejor!\n\nChamanes hacer el trabajo. Ellos dejar a Muerdefrío aquí para matarlo de hambre junto a toda esta rica carne de colmillarr.\n\nSi $r quiere ayudar a colmillarr, quedarse sin tiempo.\n\nPero Muerdefrío saber cómo romper hechizo.\n\n¿Por qué Muerdefrío ayudar? Él tampoco gustar chamanes.', '', '', '', '', '', '', 47187),
(66700, 'esES', 'El enclave negro', 'Devuelve el enclave negro a la telemántica Aerilyn.', 'Es muy tentador, ¿verdad? El enclave era demasiado para la Llama Hendida. Sin embargo, encaja a la perfección en mis manos. Qué curioso.\n\n<Adenedal sacude la cabeza>.\n\nO quizá no. Hoy no. Otra vez no. Llévatelo. No me corresponde llevar esta carga.\n\nAdiós, $gamigo:amiga;.', '', '', '', '', '', '', 47187),
(66699, 'esES', 'Preguntar a los lugareños', 'Habla con los colmillarr en torno al Campamento de Antonidas.', 'Kalecgos hace bien en pedir consejo a los colmillarr. Posees generaciones de experiencia con esta tierra.\n\nMuchos se paran a descansar de camino a los diferentes campamentos que hay en las tierras.\n\n¡Pregunta por ahí! Alguno debe saber más cosas sobre las líneas Ley locales.', '', '', '', '', '', '', 47187),
(66698, 'esES', 'Contando argalíes', 'Habla con el pastor Aylaag y devuelve la oveja perdida al clan.', 'Uno de nuestros recursos fundamentales es nuestro rebaño de argalíes. Cada pérdida merma la fuerza de nuestro clan.\n\nUnos cuantos argalíes se han separado y se han alejado del rebaño. Nuestros pastores agradecerían toda ayuda posible para recuperarlos.', '', '', '', '', '', '', 47187),
(66692, 'esES', 'El circuito avanzado del Vitasagrario Rubí', 'Atraviesa los anillos planeando.', 'Vuela a través de los anillos de control que marcan el recorrido.', '', '', '', '', '', '', 47187),
(66691, 'esES', 'Waking Shores - Race 01 - Intermediate', 'Atraviesa los anillos planeando.', 'Este recorrido tiene un diseño similar al anterior, excepto que sus anillos de control están dispuestos de una forma más variada.\n\nSi te atascas, toca el silbato y reiniciaré la carrera.', '', '', '', '', '', '', 47187),
(66690, 'esES', 'La Ofensiva Nokhud: El ancestro final', 'Derrota a Balakar Khan y consigue el medallón de los ancestros en la Ofensiva Nokhud.', 'Has demostrado ser $gun aliado:una aliada; con un interés genuino por nuestros valores y modo de vida. Quiero hablarte de un ancestro más, pero será peligroso.\n\nMata al traidor Balakar, líder de los Nokhud e hijo de nadie. No se separa de un medallón muy valioso. Tráemelo y estaré en deuda contigo eternamente.', '', '', '', '', '', '', 47187),
(66689, 'esES', 'Más que una piedra', 'Muestra los fragmentos tocados por la tormenta a Watu.', '<Los fragmentos son suaves y están ligeramente calientes al tacto. Unos relámpagos chispean en lo más profundo de sus núcleos>.\n\n<Quizá Watu o Olekk tengan más información>.\n\n<La idea de separarte de los fragmentos te inspira el impulso de mantenerlos cerca. Para siempre>.', '', '', '', '', '', 'Vuelve con Watu en el Puesto del Pinar.', 47187),
(66688, 'esES', 'Señales del viento', 'Recoge ofrendas de viento y colócalas en el recipiente de ofrendas que hay cerca de la piedra cantarina.', 'Cuando los elementos, los verdaderos primigenios del mundo, desafiaron a los centauros, Himia fue a su encuentro con nuestro don. El viento.\n\nUna piedra cantarina se mantiene firme en las llanuras. Allí podrás entregar ofrendas de viento para evocar su recuerdo. Estas ofrendas están por todas partes: las plumas de un ave, las esporas de una planta, los juncos del río...', '', '', '', '', '', '', 47187),
(66687, 'esES', 'La tierra de los alfas', 'Recoge $1oa telarañas de hilasombra, $2oa garfas de astudraco y $3oa escamas de espinatrueno.', 'Fue Rellen el Erudito quien dio a los centauros las herramientas para sobrevivir en esta tierra inmisericorde. Sus recuerdos requieren ofrendas de bestias dignas.\n\nTen cuidado. No son tan peligrosas como las de eras pasadas, pero siguen siendo los depredadores alfa de las llanuras.', '', '', '', '', '', '', 47187),
(66684, 'esES', 'En pos de tormentas', 'Destruye a los primalistas y la fuente de su magia de tormenta.', '<Watu arranca el fragmento y toma aire>.\n\nPerdí completamente el control... Olekk tenía razón. Esta terrible magia tiene que ser obra de los Primalistas. ¡Detenlos, por favor!\n\nDebo llevar a mi hermano de vuelta al campamento.', '', '', '', '', '', '', 47187),
(66683, 'esES', 'Análisis desesperado', 'Pregunta por el fragmento tocado por la tormenta en el Puesto del Pinar.', '<Watu murmura para sí con los ojos cerrados y los brazos cruzados>.\n\nDe todas las criaturas, tenía que cornearme un ciervo, precisamente. Y ahora solo soy otro desvalido más. Mi hermano se llevará todo el mérito, cosa que no sorprenderá a nadie en casa.\n\n<Watu mira hacia arriba> ¿Eh? ¿Qué tienes ahí? ¿Piedras resplandecientes? Le echaré un vistazo a una de ellas, pero llévale el resto a otro. Soy cazador, no arqueólogo. <Watu resopla y mira su pierna>. Quizá esto sea una señal para que cambie de profesión. Anda, ponte en marcha. Has demostrado ser más útil que yo.', '', '', '', '', '', '', 47187),
(66681, 'esES', 'Tempestades abundantes', 'Mata a $1oa bestias tocadas por la tormenta en el Pinar Sabiacresta.', 'Si piensas aventurarte entre los pinos, mata a cualquier animal tocado por la tormenta que veas. No me resulta fácil pedírtelo, pero está claro que están sufriendo y no hay nada que podamos hacer por ayudarlos. Así impediremos que se extienda su agresividad.\n\nSospecho que es obra de los Primalistas. Seguro que el altar que han construido en su puesto de avanzada cercano es la fuente de todos estos problemas. Emanaba una magia extraña.\n\nIré a investigar de nuevo. Si no he vuelto para cuando hayas regresado, Watu podrá encargarte otras tareas. Agradecemos cualquier ayuda.', '', '', '', '', '', '', 47187),
(66680, 'esES', 'Contar ovejas', 'Traba amistad con Deseo y usa el silbato de Deseo para salvar a $3oa argalíes perdidos en el Pinar Sabiacresta.', 'Qué frustrante. Un ciervo rabioso me hizo esto mientras mi hermano Olekk y yo explorábamos.\n\n<Watu señala su pierna ensangrentada y hace una mueca de dolor>.\n\n¿Has venido a ayudar? Cuando atacaron esos primalistas, nuestro rebaño de argalíes se dispersó entre los pinos. La lana y la leche que producen son fundamentales para poner en marcha el campamento.\n\nLlévate este silbato. Puedes usarlo para que Deseo guíe a los argalíes de vuelta a casa. El carnicero Sondo tiene sus golosinas preferidas, por si necesita algún incentivo.', '', '', '', '', '', '', 47187),
(66679, 'esES', 'El circuito del Vitasagrario Rubí', 'Atraviesa los anillos planeando.', 'Vuela a través de los anillos de control que marcan el recorrido.', '', '', '', '', '', '', 47187),
(66676, 'esES', 'Colándose a escondidas', 'Vuelve con Radiya a los Manantiales Ohn\'iri.', 'Esta es Lizi..., mi amiga secreta. Me he ocupado de ella desde que su madre la rechazó.\n\nEsto no tiene buena pinta. Sea lo que sea lo que le hicieran, escapa a mis conocimientos. Tengo que llevármela a casa. Mi Ohn me castigará severamente, pero Lizi necesita ayuda. Y agradezco la tuya, $p. Siento haberte dado más problemas de los que esperabas.\n\nSi todavía te quedan ganas para una aventura más..., ¿podrías acompañarme a enfrentarme a la ira de mi Ohn? ¡Reúnete conmigo en los manantiales!', '', '', '', '', '', 'Vuelve con Radiya a los Manantiales Ohn\'iri.', 47187),
(66675, 'esES', 'Poder de Aspecto', 'Ayuda a Alexstrasza en la piedra de juramento madre.', 'La piedra de juramento madre es un antiguo regalo de los titanes a nuestros Vuelos. Si lo que hemos descubierto es cierto, puede que sea capaz de reactivarla para recuperar nuestros poderes de Aspecto.\n\nAunque no podemos anticipar con certeza el resultado, si hay una ínfima posibilidad de que esto funcione, debo intentarlo.\n\n$n, me gustaría que me acompañaras mientras lo hago.', '', '', '', '', '', '', 47187),
(66671, 'esES', 'Camino a ninguna parte', 'Reúnete con Maddy Tirodisperso en el Campamento Desubicado de las Tierras Azures.', '¡Tienes pinta de ser muy capaz! ¿Qué te parecería echar una mano a la Expedición Dragontina?\n\nTenemos un campamento magnífico en medio de la naturaleza.\n\nHay mucho que hacer allí si quieres hacer el viaje.\n\nHabla con mi hermana Maddy cuando llegues. Ella te ayudará a instalarte.', '', '', '', '', '', 'Reúnete con Maddy Tirodisperso en el Campamento Desubicado de las Tierras Azures.', 47187),
(66660, 'esES', 'Preparados, listos...', 'Reúnete con Andantenormu y Siaszerathel en el pasado.', '<Nozdormu no enfoca la mirada>.\n\nCuanto más lejos caen, más rápido viajan. Perforan agujeros en el tejido del tiempo que generan grandes ondas. Tendrás que ser veloz para atraparlas.\n\n<La atención de Nozdormu se centra en ti>.\n\nEnviaré a mis Caminantes del Tiempo para que te ayuden a navegar por las líneas temporales y aceleren tus esfuerzos. ¡No te enzarces con los lugareños ni te detengas hasta que hayas encontrado a Chronormu!\n\nVete. Apenas tenemos tiempo.', '', '', '', '', '', '', 47187),
(66658, 'esES', 'La ofensiva Nokhud: Quien lo encuentra se lo queda', 'Entra en la Ofensiva Nokhud, derrota a Teera y a Maruuk, y coloca sus armas en el kurgan de Teerakai.', 'Se llevaron las armas de Teera y Maruuk antes de que pudiéramos detener al invocatumbas Arban. Es posible que nuestros ancestros más importantes estén luchando de nuevo en estas llanuras... junto a los Nokhud.\n\nVe a la Ofensiva Nokhud. Encuentra a Maruuk y a Teera. Cuando los hayas derrotado, lleva sus armas al túmulo funerario de los Teerakai. Volveremos a otorgarles descanso con el honor que merecen, donde podamos protegerlos más fácilmente.', '', '', '', '', '', '', 47187),
(66657, 'esES', '¡Y no te levantes!', 'Entra en el kurgan principal y derrota al invocatumbas Arban.', 'El invocatumbas Arban se ha atrincherado en el kurgan más grande, donde yacen los primeros ancestros Maruuk. ¡Detenlo antes de que resucite a Maruuk y a Teera!', '', '', '', '', '', '', 47187),
(66656, 'esES', 'Sueño eterno, sin duda', 'Derrota a cada uno de los espíritus de renombre de los centauros y luego usa el tótem de descanso de Zorig para liberarlos.', 'La magia oscura está atenazada a los ancestros. Lucharán antes de seguir. Los Ukhel han resucitado a nuestros guerreros y cazadores más feroces; no será fácil detenerlos.\n\nNecesitarás mi ayuda. Es hora de que vuelva a usar la lanza de mi madre.\n\nUna vez que los derrotes, usa este tótem que he fabricado para ayudar a los espíritus subyugados a encontrar el camino de vuelta a los kurgans.', '', '', '', '', '', '', 47187),
(66655, 'esES', 'Componentes de vivomancia', 'Recolecta $1oa calaveras intactas de compañeros resucitados y $2oa montones de tierra sagrada.', 'Me temo que los espíritus no podrán encontrar el camino a sus tumbas aunque los liberemos del yugo de los Ukhel.\n\nLos Ukhel también están resucitando a los compañeros animales de los ancestros, que los guiaron y protegieron en vida.\n\nTráeme los cráneos de esos animales y la tierra sagrada perturbada por nuestros enemigos. Si combinamos estos componentes, deberíamos poder ayudar a los ancestros a encontrar la paz.', '', '', '', '', '', 'Reúnete con Zorig en lo profundo de los Kurgans Eternos.', 47187),
(66654, 'esES', 'Aniquilación de profanadores', 'Mata a los profanadores Nokhud y a los agitatumbas Ukhel, y recupera las armas ancestrales que han tomado.', 'Mi madre era una heroína. Se merece paz y descanso, no esta... ¡esclavitud! Ninguno de nuestros héroes la merece.\n\nDeben pagar por esto. Nuestros ancestros deben descansar de nuevo con sus armas y honor. ¡Recupera las armas de esos profanadores!', '', '', '', '', '', 'Reúnete con Zorig en lo profundo de los Kurgans Eternos.', 47187),
(66652, 'esES', 'Volver con la ensalmadora', 'Investiga el ritual Ukhel que se celebra en el túmulo cercano.', 'Desde aquí no veo lo que están haciendo, pero me temo que están profanando los kurgans.\n\nVe a la tumba más cercana e intenta poner fin al ritual que están llevando a cabo.\n\nSi encuentras algo que nos revele su propósito, tráemelo.', '', '', '', '', '', 'Devuelve la lanza a Zorig.', 47187),
(66651, 'esES', 'Algo están tramando', 'Reúnete con el iniciado Zorig en los Kurgans Eternos.', 'Los clanes Nokhud y Ukhel se han apoderado de los Kurgans Eternos. Solo pueden tener intenciones malignas. Nuestros más estimados ancestros están enterrados allí.\n\nEnvié al iniciado Zorig a que investigara, pero aún no ha regresado.\n\nEs competente, pero le falta confianza. ¡Ayúdalo a acabar con sus horribles acciones!', '', '', '', '', '', '', 47187),
(66650, 'esES', 'Desenlace del destino', 'Derrota a $1oa jefes de bandas predestinadas distintos.', '<Estás en calma. La naturaleza de esta experiencia sigue revestida de misterio, pero ya no te resulta desconocida. Ahora, tu maestría sobre estas pruebas es tan clara como la recompensa definitiva>.\n\n<Avanzas con la mente clara y manos firmes una última vez. Crea tu propio destino y observa cómo se desvela a tu paso>.', '', '', '', '', '', '', 47187),
(66647, 'esES', 'Desenfoque elemental', 'Recupera el enfoque elemental.', 'Kalecgos y yo estamos sufriendo un duro ataque en los cielos sobre la montaña. Los Primalistas son implacables y su ejército no parece tener fin.\n\nA este paso, nos veremos superados por sus tropas.\n\nPero tengo un plan.\n\nEn la base de la montaña hay una orca perturbada llamada Ruvin Machacapiedras. El Kirin Tor ha luchado contra ella muchas veces.\n\nTiene un dispositivo que puede absorber y redirigir las energías elementales.\n\nQuítaselo y luego reúnete conmigo más adelante.', '', 'Ruvin es el propietario del poderoso enfoque elemental.', 'Ruvin Machacapiedras', '', '', 'Reúnete con la proyección de Khadgar dentro del Coto de Vakthros.', 47187),
(66646, 'esES', 'Reducción de las causalidades', 'Mata a los elementales de tiempo.', 'El Infinito ha provocado que las energías del tiempo se vuelvan agresivas. Eso no augura nada bueno.\n\nPor favor, mata a cualquier elemental de tiempo que te encuentres mientras echas una mano a la embajadora Chronormu. Yo me quedaré aquí y la ayudaré a mantener presa a Eternus.', '', '', '', '', '', '', 47187),
(66633, 'esES', 'Las cosas claras', 'Coloca un estandarte de dragón negro en los cadáveres de $1oa djaradin.', 'Los Djaradin creen que el Vuelo Negro está acabado. No temen ni respetan la autoridad de Wrathion.\n\nNecesitamos una demostración que les recuerde que el Vuelo Negro ha vuelto, y que somos más fuertes que nunca.\n\nMata a esos djaradin y marca cada cadáver para que no olviden quién gobierna aquí.', '', '', '', '', '', '', 47187),
(66622, 'esES', 'Las herramientas extraviadas', 'Rescata $1oa herramientas extraviadas.', '¡Es terrible! Mis... ¡hip! herramientas parecen haberse ido cuando no estaba mirando. No soporto... ¡hip! la idea de que estén solas por ahí. ¡Seguro que están aterradas!\n\n¿Podrías ir a buscarlas en mi lugar? Ten paciencia, trata de... ¡hip! calmarlas y seguro que te cogen cariño.', '', '', '', '', '', '', 47187),
(66612, 'esES', 'El dilema de la cuidadora de cangrejos', 'Mata a $1oa górlocs en el Campamento Gotarrisco.', '¡Los cangrejos están en peligro!\n\nEstos en particular han pasado por una racha bastante mala. Los Primalistas saquearon su anterior hábitat, y luego los traje a esta zona... ¡justo cuando la iban a invadir los górlocs!\n\nPensé que estarían a salvo aquí, pero los górlocs no dejan de ensañarse con ellos, y cada vez son menos.\n\n¡Por favor, derrota a algunos de ellos para que los cangrejos puedan escapar!', '', '', '', '', '', '', 47187),
(66611, 'esES', 'Despejando los cielos', 'Mata $1oa insectos.', '¿Oyes eso? ¡Son bichos! Por todas partes. Algunos se están poniendo enormes.\n\n¿Y si tú y tu colega planeador usáis esta térmica que hay detrás de mí para encargaros de ellos?', '', '', '', '', '', '', 47187),
(66598, 'esES', 'Conocimiento Nocheterna', 'Localiza a la taumaturga de distorsión Delandra en el Campamento de Antonidas, que está en las Tierras Azures.', 'Los símbolos antiguos no son lo mío. Pero...\n\n<Thaelin rebusca en sus pertenencias y acaba sacando un mapa. En la parte superior del pergamino aparece el nombre de Antonidas, garabateado en letras grandes y chapuceras>.\n\n¡Ajá! ¡Aquí está!\n\nEs un paseo, pero encontraremos varios usuarios de magia antigua... aquí.\n\n<Señala un punto en el mapa>.\n\nQuizá puedan darnos información.', '', '', '', '', '', '', 47187),
(66597, 'esES', 'Esta vieja piedra', 'Inspecciona el monolito antiguo grabado.', 'La piedra que tengo detrás es parte de lo que llamáis... tecnología ancestral, y se encuentra aquí, en las islas.\n\nLa cuestión es que no estamos muy seguros de lo que es en realidad. Resulta desconcertante, la verdad.\n\nHemos enviado un informe a algunos amigos para ver si pueden ayudar. Mientras tanto, trata de averiguar cómo se utiliza.', '', '', '', '', '', '', 47187),
(66596, 'esES', 'Susurros en el viento', 'Habla con el archimago Khadgar en Ventormenta.', 'Hola, $p. Cuánto tiempo. Ay, me encantaría tener más tiempo para ponernos al día.\n\nPero verás, acabo de tener una esclarecedora... No, digamos premonitoria..., sí, premonitoria, conversación con un viejo amigo.\n\nA veces una revelación puede ser ambas cosas, claro.\n\nTengo que contarte todo lo que he descubierto.', '', '', '', '', '', '', 47187),
(66595, 'esES', 'Descubrimiento latente', 'Entrega el mensaje a Thaelin Yunquenegro en la Avanzada Escama Rubí, que está en las Orillas del Despertar.', '<No importa cómo ha llegado este curioso papiro a tus bolsas. Lo importante es su contenido>.\n\nMiembros de la Expedición Dragontina:\n\n¡Se requiere vuestra ayuda! ¡Os necesitamos cuanto antes en la Avanzada Escama Rubí!\n\n<Antes de que se pueda leer la firma, la caligrafía mágica de la nota se disipa en una nube de polvo blanquecino y azulado dejando tras de sí un papiro en blanco y un delicioso aroma a flores>.', '', '', '', '', '', '', 47187),
(66589, 'esES', 'Coordinación expedicionaria', 'Recluta exploradores, artesanos y eruditos por todo Ventormenta para la expedición a las Islas Dragón.', 'Me llamo Toddy. Dirigiré a nuestro grupo de alegres aventureros bajo el estandarte de la Expedición Dragontina. Luego nos ocuparemos de los detalles. Por ahora, centrémonos en reunir al equipo.\n\nToda expedición que se precie cuenta con un grupo diverso. Necesitaremos eruditos, artesanos y, cómo no, exploradores.\n\n¿Y bien? ¿A qué esperas? ¡Reúne al equipo!', '', '', '', '', '', 'Comunica tu éxito a la Toddy Bigotis en el Puerto de Ventormenta.', 47187),
(66586, 'esES', 'Legado de Tyr: secretos del pasado', 'Entra en Uldaman, en las Tierras Inhóspitas. Descubre la causa de las perturbaciones.', 'Debemos restaurar el poder de los Aspectos para impedir que Raszageth libere al resto de las Encarnaciones.\n\nNo será nada fácil. Los titanes guardan silencio, y el guardián Tyr murió hace mucho tiempo.\n\nLa reina Alexstrasza ha elaborado un plan. En las Tierras Inhóspitas hay una instalación titánica llamada Uldaman, y la reina cree que los compañeros de Tyr escondieron allí un disco con sus recuerdos.\n \nLleva a tus aliados a Uldaman y consigue el disco para la reina de dragones. Esperemos que se pueda usar el conocimiento de Tyr para devolver el poder a los Aspectos.', '', '', '', '', '', '', 47187),
(66582, 'esES', 'Adquisición de poder', 'Reúne energía con el recipiente para la taumaturga de distorsión Delandra en el Campamento de Antonidas.', 'En circunstancias normales, la captura de energía no supone un problema. No obstante, la que queremos conseguir es inmensa e inestable. Este recipiente encantado debería servir para transportarla de forma segura.\n\nAl suroeste hay una región llena de criaturas rebosantes de una energía anómala, poderosa pero inestable.\n\nHazte con ella y vuelve conmigo. Después puede que emprendamos el resto de este viaje.', '', '', '', '', '', '', 47187),
(66578, 'esES', 'A > B Reward Test (Low Health)', '', '', '', '', '', '', '', '', 47187),
(66577, 'esES', 'La invitación de los Aspectos', 'Habla con Wrathion para averiguar más cosas sobre la reunión del consejo.', 'Ah, $p. ¡Justo a tiempo!\n\nAcabo de reunirme con el lord comandante Turalyon y sus aliados: han aceptado la invitación de los Aspectos para ir a las Islas Dragón.\n\nEntiendo que nos acompañarás, ¿no? ¡Esto no sería lo mismo sin ti!\n\nSupongo que te habrás dado cuenta de que hay algunas nuevas caras por aquí. Los de las alas son dracthyr. Me conocen desde hace poco, pero ya sienten una gran admiración por mí.\n\nAh, ¿y mis modales? Deberíamos charlar un momento.', '', '', '', '', '', '', 47187),
(66575, 'esES', 'Objeto como asignador de misión: vial', 'Entrega el objeto a la oteadora Alvi.', '<El extraño vial que se esconde entre los cachivaches del alijo de los tarasek parece estar repleto de un fluido viscoso y burbujeante>.\n\n<Sería aconsejable mostrárselo a Alvi>.', '', '', '', '', '', '', 47187),
(66559, 'esES', 'De vuelta al campamento', 'Vuelve con el examinador Rowe, que está en el Rincón del Ballenero.', 'Vi a Mordigan salir corriendo como un enano poseído. Iré tras él y me aseguraré de que vuelva con los demás de una pieza.\n\nSi te enganchas al acantilado y saltas por las cataratas, no despertarás más górlocs.\n\nNos vemos en el campamento.', '', '', '', '', '', '', 47187),
(66558, 'esES', 'Rowie', 'Encuentra a Rowie.', 'Tú fuiste quien volvió con el resto de Frondacuero, ¿no? Entonces quizá ya sepas lo que le ocurrió a Kaqiata...\n\nRowie, su hijo, lleva angustiado desde que Brena y los demás volvieron sin ella. Me quedaré aquí por si vuelve, pero ¿podrías ir buscarlo? \n\nCreo que se ha ido hacia la cueva de hielo del este. ¡Dijo algo de que iba a luchar contra los yetis que hay en ella!', '', '', '', '', '', '', 47187),
(66557, 'esES', 'Conocidos acuadémicos', 'Busca a otro experto en lenguas fúrbolgs en el Campamento Desubicado.', 'Sí, el dialecto del fúrbolg de los Pelaje Invernal es realmente complicado incluso para mí.\n\nTengo algunos colegas en el Campamento Desubicado que podrían ayudar. He oído que hay otras tribus fúrbolgs en la zona, y comparando notas con sus dialectos, puede que consigamos algo por donde empezar.', '', '', '', '', '', '', 47187),
(66556, 'esES', 'Acento grotesco', 'Investiga la cueva.', 'Bueno, tienes un acento atroz, y diez mil años de aislamiento y deriva lingüística nos han hecho un flaco favor, pero, al menos, creo que tengo una ligera idea.\n\nEl hilo general de lo que intentaban decir era algo sobre un \"viento de la cueva mala\" o una \"cueva de la tormenta malvada\". O eso, o que hacen la colada los jueves...\n\nMira, esto no es como aprender gnómico; habrá algunos contratiempos. Ahora bien, estoy bastante seguro de que en la cueva hay algo, así que empecemos por ahí.', '', '', '', '', '', '', 47187),
(66555, 'esES', 'Ten paciencia conmigo', 'Colabora en la traducción de Sonova.', 'Sí, parece que se ha liado allí, como si hubiera pasado una tormenta y hubiera arrasado con todo. Entiendo por qué han tomado las armas, pero ¿por qué nos atacan?\n\nEsto sería mucho más fácil si pudiéramos discutirlo, pero los Pelaje Invernal son muy herméticos y no parece que hablen ninguno de los dialectos comunes del fúrbolg. ¿O era furbóligo? Bueno, ya me entiendes.\n\nSupongo que no habrás hablado con nadie mientras les estabas echando un vistazo, ¿verdad?', '', '', '', '', '', '', 47187),
(66554, 'esES', 'Autodefensa agresiva', 'Derrota a $1oa fúrbolgs Pelaje Invernal.', 'Con los Pelaje Invernal tan alterados, no creo que les guste que andes por ahí.\n\nNo tengas miedo de defenderte si hacen algo; quizá entren en razón si les haces entender que vas en serio.\n\nIntenta no matar a nadie, ¿vale? Sé cómo pueden ser los aventureros.', '', '', '', '', '', '', 47187),
(66553, 'esES', 'Cuenca bajo lupa', 'Descubre $1oa pistas en la Cuenca Pelaje Invernal.', 'Los Pelaje Invernal son un caso especial entre los fúrbolgs.\n\nDiría que son un poco \"aislacionistas\". Su pelaje les ayuda a camuflarse perfectamente con la nieve.\n\nAntes eran bastante reservados, pero ahora son totalmente agresivos. ¡Atacaron nuestro campamento sin que los provocásemos!\n\nAlgo ha debido de empujarlos a hacerlo. No puedo preguntarles lo que ha pasado..., pero quizás tú puedas encontrar alguna pista en su poblado.', '', '', '', '', '', '', 47187),
(66550, 'esES', '[PH] More Storms!', '', '', '', '', '', '', '', '', 47187),
(66549, 'esES', 'Rally de las Orillas del Despertar', '', 'Vuela a través de los anillos de control que marcan el recorrido.', '', '', '', '', '', '', 47187),
(66534, 'esES', 'De permiso', 'Explora Orgrimmar.', 'Parece que nuestra llegada se ha hecho notar. Puede que aún haya esperanza para esta gente.\n\nMe reuniré con Ebyssian y los líderes de la Horda para calmar la situación. Estás en misión de reconocimiento.\n\nAverigua qué ofrece este lugar. Al fin y al cabo, puede que pasemos aquí un tiempo.\n\nVen a buscarnos cuando hayas terminado. Espero que para entonces ya hayamos zanjado todos los temas aburridos.', '', '', '', '', '', '', 47187),
(66529, 'esES', 'Mil palabras', 'Fotografía a Derviche cerca del esqueleto de protodragón.', 'Con todo lo que hemos aprendido aquí, no puedo irme sin un recuerdo. \n\n¿Serías tan amable de hacerme una foto junto a estos fósiles de protodragón?', '', '', '', '', '', '', 47187),
(66528, 'esES', 'Rey sin corona', 'Investiga el esqueleto de protodragón.', 'Este protodragón anciano debe haber sido una criatura gloriosa cuando estaba vivo; tal vez la más grande que se haya visto en la Reserva Agreste.\n\nPero no fue suficiente. Observa el esqueleto más de cerca para que podamos conocer que ocurrió durante sus últimos momentos.', '', '', '', '', '', '', 47187),
(66527, 'esES', 'Protografía profesional', 'Usa el aparato de mejora vertical y fotografía al protodragón durmiente.', 'Nunca había entrenado a nadie con tanto talento para la fotografía como tú... que siga con vida, claro. Es una profesión peligrosa.\n\nY hablando de peligro, nuestro objetivo final es un enorme protodragón que creemos que puede ser uno de los próximos depredadores alfa de la reserva. ¡Acerquémonos y hagámosle una foto!', '', '', '', '', '', '', 47187),
(66526, 'esES', 'Proteger lo salvaje', 'Libera a 5 protocrías capturadas o protodracos capturados.', 'La Reserva Agreste es una de las pocas zonas en las que prosperan los protodragones. Pero los Primalistas están perturbando sus nidos para capturarlos y experimentar con los protodracos y las protocrías.\n\nNo tengas piedad. Localiza a los cazadores furtivos primalistas, acaba con ellos y libera a sus presas. El futuro de los protodragones depende de ello.', '', '', '', '', '', '', 47187),
(66525, 'esES', 'Protografía competitiva', 'Fotografía un huevo de protodragón imbuido y un protodraco imbuido.', 'Bueno, ahora que ya te has curtido con fotos de principiante, ¿qué te parece si pasamos a algo con más chicha?\n\nHe visto a un hermoso protodraco volando por ahí detrás, con unos cuernos preciosos y unas escamas que crepitan con electricidad... Seguramente sea obra de los Primalistas, ¡pero el arte sigue siendo arte!\n\nA ver si puedes conseguir una foto de ese protodraco y de algunos de sus huevos. ¡Puede que tengas que trepar un poco para conseguir la imagen perfecta!', '', '', '', '', '', '', 47187),
(66524, 'esES', 'Protografía de aficionados', 'Saca fotos de protodragones.', 'Así que quieres seguir los pasos de un catalogador tan increíble como yo, ¿eh? ¡Pues has venido al lugar adecuado!\n\n¡La Reserva Agreste está repleta de conocimientos que esperan ser encontrados y archivados! ¿Y cómo lo hago? Pues con mi Catalogador 3000 Edición Islas Dragón, ¡ahora con captura de movimientos mejorada!\n\nPara aprender a usarlo, haz fotos a un huevo de protodragón, a un vástago que esté aprendiendo a volar y a un protodraco mientras caza. Luego reúnete conmigo en el esqueleto del protodragón anciano que hay al oeste de aquí, y yo evaluaré lo que me traigas.', '', '', '', '', '', '', 47187),
(66523, 'esES', 'Cuidar la forja', 'Reúne componentes para la forja recogiendo pellejos de cornisapo, bellotas brasales latentes y núcleos de partición en torno al Campamento de Antonidas.', 'Si buscas un instructor, siento decirte que... Ah, ¡no eres $gun:una; aprendiz! Mis disculpas. Permite que me presente.\n\nSoy la custodia Vernagos y formo parte de los custodios que hay en estas ruinas. En concreto, ha recaído sobre mis cansados hombros la tarea de devolver su antigua gloria a este espacio de trabajo.\n\n¿Podrías echarme una mano? Todos los componentes que necesito están por aquí: núcleos elementales de hielo, bellotas brasales, cuero de cornisapo...\n\nMateriales bastante corrientes y fáciles de conseguir. ¿Qué me dices?', '', '', '', '', '', 'Vuelve con la custodia Vernagos, que está en el Campamento de Antonidas.', 47187),
(66517, 'esES', 'Una nueva fuente de armas', 'Consigue 25 armas dracthyr intactas de miembros de la Llama Hendida de las Islas Dragón para Dhurrel de los Centauros Maruuk.', 'La Llama Hendida suponen una gran amenaza para nuestras fronteras, y sus armas son de lo más preocupante. Consigue cuantas puedas para que podamos estudiar sus debilidades e incluso utilizarlas para defendernos.\n\nTengo fe en ti. Si realizas esta tarea para nosotros, te enseñaré algunos secretos de nuestra herrería.', '', '', '', '', '', '', 47187),
(66516, 'esES', '¿Gemas normales? ¡Mejor no!', 'Reúne 25 gemas \"normales\" de los Djaradin de las Islas Dragón para Gnoklin Bobinavagante de la Expedición Dragontina.', 'Qué desperdicio. Los djaradin de estas tierras usan poderosas gemas como mero adorno ¡Como simples joyas! Y eso que tienen infinidad de aplicaciones: telescopios, espejos, indicadores de enfoque... Por no mencionar la miríada de propiedades mágicas que poseen.\n\nDebemos rectificar esta situación. Quítales las gemas a los djaradin y tráemelas, me aseguraré de que se les dé mejor uso. Pero ten cuidado, los djaradin son guerreros feroces.', '', '', '', '', '', '', 47187),
(66513, 'esES', 'De permiso', 'Explora Ventormenta.', 'Si esta ciudad va a ser nuestro nuevo hogar, quizá debamos conocerla mejor. Una misión de exploración, por así decirlo.\n\nVe a ver qué ofrece este lugar. Yo seguiré a Wrathion e intentaré ayudar en lo que pueda.\n\nIntenta no molestar a los lugareños más de lo necesario. Dudo que muchos de ellos estén acostumbrados a ver dragones caminando por sus calles.\n\nReúnete con nosotros cuando te hayas familiarizado con el terreno.', '', '', '', '', '', '', 47187),
(66511, 'esES', 'Mucho renombre con los Colmillarr de Iskaara', 'Habla con Murik en Iskaara.', 'Sigues demostrándonos que eres parte fundamental de nuestra comunidad.\n\nPara honrar ese vínculo, ven a verme en Iskaara. He preparado una mochila con suministros que te serán de ayuda.', '', '', '', '', '', '', 47187),
(66509, 'esES', 'Paranoico 1', '', 'Agura me ha enviado aquí para recoger FLORES para mi ANSIEDAD, pero hay CRIATURAS y tengo mucho miedo.', '', '', '', '', '', '', 47187),
(66504, 'esES', 'Un fragmento de maná cristalizado', 'Llévale el cristal a Lathos.', '<El pequeño cristal azul vibra ligeramente al tocarlo y, a continuación, produce una melodía sorda que suena como una canción lejana. Puedes oír en tu cabeza las palabras que resuenan como una suave melodía>.\n\nPuede que a Lathos le parezca interesante.', '', '', '', '', '', 'Llévale el cristal a Lathos.', 47187),
(66503, 'esES', 'Por el amor de otros', 'Investiga lo alto de la torre en ruinas del Campamento de Antonidas.', 'Ah, veo que mis aprendices te han enredado en sus jueguecitos. \n\n<Noriko se ríe>.\n\nParece que os habéis encontrado con algo. El propósito de estas ruinas se nos revela poco a poco y guardan algo más que canciones e imágenes borrosas...\n\nAlgo clama desde lo alto de esta torre.\n\nVeo la intriga en tus ojos. Ve. Tienes mi permiso.\n\nDime qué es lo que ves.', '', '', '', '', '', 'Vuelve con Noriko, que está en el Campamento de Antonidas.', 47187),
(66500, 'esES', 'Formas de ver', 'Encuentra imágenes antiguas en el Campamento de Antonidas.', '¡No estamos haciendo nada! ¡Nada en absoluto!\n\nEspera un segundo...\n\nPareces $gun:una; $r importante... ¿Te cuento un secreto?\n\nResulta que en estas rutinas hay arte mágico, ¡y nosotros podemos verlo!\n\n<Sidrácido saca pecho con orgullo>.\n\nPuedo enseñarte a verlo. Pero... no se lo digas a Noriko aún.', '', '', '', '', '', '', 47187),
(66493, 'esES', '¡Enviadlo!', 'Lanza paquetes a los aprendices del Kirin Tor en el Campamento de Antonidas.', '<Oyes un murmullo sordo que procede del otro lado del portal>.\n\n¡Eh! ¡Eh, tú!\n\nTengo correo para nuestros aprendices: botiquines, regalos y más cosas que han pedido por correo mágico.\n\nTodo de lo más normal, la verdad.\n\n¿Te importaría hacerme un favor y entregarlos?', '', '', '', '', '', '', 47187),
(66489, 'esES', 'Preparar la defensa', 'Potencia a los defensores azur en el Campamento de Antonidas.', 'El custodio Cynegos y yo estábamos hablando del impacto que ha tenido el ataque primalista en los planes de asaltar la Galería Cobalto, y se me ha ocurrido una idea. \n\n<Celeste saca una varita de los pliegues de su toga>.\n\n¡Coge mi varita y potencia sus armas!\n\nUn poquito de fuego debería servir...', '', '', '', '', '', '', 47187),
(66488, 'esES', 'SE BUSCA: Frigellus', 'Mata a Frigellus cerca del Campamento de Antonidas.', '<La escritura de la hoja despide una suave luz azul>.\n\nEl elemental Frigellus, en su momento un juguete muy querido de Malygos, acabó sufriendo el abandono de su amo.\n\nMientras este asentamiento, antaño rebosante de felicidad, se desmoronaba, la malhumorada y traviesa criatura se fue deformando y retorciendo por los males que asolan esta tierra.\n\nPor favor, asegúrate de neutralizarlo.\n\nY cuando lo consigas, informa de ello al custodio Cynegos.', '', '', 'Frigellus', '', '', '', 47187),
(66484, 'esES', 'Conoce a tu enemigo: protodragones', 'Caza varios protodragones alrededor de la Fronda de la Cúspide.', 'La zona está repleta de bestias poderosas. Por suerte, la mira de reconocimiento te ha permitido detectar varios puntos débiles en sus duras escamas. También puedes idear diferentes trucos para evitar sus colmillos y sus afiladas garras.', '', '', '', '', '', '', 47187),
(66482, 'esES', 'A la caza del trofeo: Fauceterra', '', '[PH] Get rid of that annoying flying lizard!', '', '', 'Fauceterra', '', '', '', 47187),
(66473, 'esES', 'La tierra despierta', 'Derrota a la cólera primigenia y a la lluvia primordial en el Mirador Gelikyr.', 'Los monstruos de esta cueva son demasiado peligrosos para mí.\n\n<Sharnax tose con dificultad>.\n\nHe visto de lo que eres capaz.\n\nNecesito que mates a esos elementales antes de que alcancen todo su potencial. ¡No podemos permitir que los Primalistas se hagan con el control de Tyrhold!', '', '', '', '', '', '', 47187),
(66472, 'esES', 'Lista primigenia', 'Lleva el fardo de órdenes primalistas al comandante Thadezus, que está en el puente del Mirador Gelikyr.', 'Los portales cerrados, los elementales asesinados y los Primalistas detenidos... por ahora.\n\n<Sharnax se ríe>.\n\n¿Hay algo que no podamos hacer, $c? Supongo que solo el tiempo lo dirá.\n\nEntrégale los planes al comandante. Seguro que se alegrará de saber que hemos tenido éxito.', '', '', '', '', '', 'Habla con el comandante Thadezus en el puente del Mirador Gelikyr.', 47187),
(66471, 'esES', 'Planificación de primera', 'Recoge $1oa órdenes primalistas de los primalistas cercanos que hay en el bancal superior del Mirador Gelikyr.', 'El comandante me ordenó establecer una base avanzada y acabar con cualquier resistencia. Cuando acabé con todos, me di cuenta de algo.\n\n<Sharnax suelta un largo suspiro>.\n\nLos primalistas estaban hablando sobre Tyrhold.\n\nA menos que seas excepcionalmente hábil con los interrogatorios, necesito que descubras sus planes.', '', '', '', '', '', 'Reúnete con Sharnax fuera de la cueva del Mirador Gelikyr.', 47187),
(66470, 'esES', 'Un empujón más', 'Consigue piedras de portal tocadas por la bruma, terráneas y creadas del hielo. Después, cierra $7oa portales elementales.', '<Sharnax se rasca la barbilla>.\n\nEl comandante tenía razón. Los Primalistas están trayendo refuerzos desde los planos elementales.\n\n<Sharnax sonríe>.\n\nSería una pena que les ocurriera algo a sus portales, $c.', '', '', '', '', '', 'Reúnete con Sharnax fuera de la cueva del Mirador Gelikyr.', 47187),
(66468, 'esES', 'Lo que una vez fue nuestro', 'Derrota a los Primalistas que ocupan el Mirador Gelikyr.', '<Thadezus resopla al ver que te acercas>.\n\n¿Vas a pasar a la acción o vas a apartarte, $c?\n\nHe perdido muchos soldados buenos a manos de esos primalistas que se encuentran más adelante.\n\nCreemos saber cuáles son sus planes, pero antes debemos echar al enemigo y rescatar a los que estaban bajo mis órdenes.', '', '', '', '', '', 'Habla con Sharnax en el Mirador Gelikyr.', 47187),
(66467, 'esES', 'El arte imita a la vida', 'Mata al chorronocivo superior.', 'La última vez que estuve en esta cueva, bosquejé una flor enorme que goteaba una savia vil y viscosa. Es uno de mis mejores dibujos, no podría olvidarlo aunque quisiera.\n\nEsa savia es lo que cubre las lanzas de los tarasek, no cabe duda. Deben de haber empezado a recolectarla para envenenar sus armas.\n\nLa planta es hermosa, y sería una pena matarla, pero no podemos permitir que los tarasek sigan recolectando su savia. $n, deshazte de ella y pon fin a todo este desastre.', '', '', 'Chorronocivo superior', '', '', '', 47187),
(66465, 'esES', 'Alijo y liberación', 'Destruye $1oa alijos de lanzas envenenadas.', 'Incluso sin líder, es improbable que los tarasek dejen de usar sus lanzas envenenadas tan solo porque se lo pidamos educadamente. No puedo arriesgarme a que se use una de estas armas en viajeros desprevenidos.\n\nHay que destruirlas todas. Si no has visto ninguna en los alijos de los estanques, seguramente los Dientebrasa guarden las lanzas más cerca de la fuente.\n\nNo habrá más heridos por culpa de mi descuido. Entra en la cueva y destruye cualquier alijo de armas que encuentres.', '', '', '', '', '', '', 47187),
(66464, 'esES', 'El Campo de Ferocidad: ¡la maestra de la caza!', 'Derrota a la maestra de caza Amaa.', 'Lo conseguihteis. Tuh colegah y tú habéih llegado a lo máh alto: un combate contra la campeona, la maehtra de caza Amaa. No oh deih palmaditah en la ehpalda aún. Eh implacable. Ha sido un placer conoceros.\n\nCuando oh mate, ¿puedo quedarme con vuestrah cosah?', '', '', '', '', '', '', 47187),
(66463, 'esES', 'El Campo de Ferocidad: ¡ronda de venganza elemental!', 'Derrota al campeón primalista.', 'Ha habido un cambio de participantes a última hora. Un pez gordo de los Primalistas quiere unirse a la competición y enfrentarse a ti. ¿Y quién soy yo para decirle que no a un dragón elemental enfadado?\n\nSeguro que todo sale bien. Y si no, pues... Has firmado el consentimiento, ¿verdad?', '', '', '', '', '', '', 47187),
(66462, 'esES', 'El Campo de Ferocidad: ¡perdido en el Sueño!', 'Derrota a Sherath y Taresh.', 'La verdad es que, para estar en las Islas Dragón, tampoco es que haya visto muchos dragones. Pero aquí tenemos a un dúo de dragonantes que solicitaron unirse a la competición juntos.\n\nParece que se mueren de ganas por demostrar lo que valen, ¡así que buena suerte!', '', '', '', '', '', '', 47187),
(66461, 'esES', 'El Campo de Ferocidad: ¡un enemigo desde el volcán!', 'Derrota a Ceeqa el Tomatreguas.', 'Uno de los primeros voluntarios en apuntarse a esta competición viene de las Orillas del Despertar. Un djaradin grandullón, no tan furioso como suelen ser.\n\nParece disfrutar de este deporte. Y mira, me conformo con eso.', '', '', '', '', '', '', 47187),
(66460, 'esES', 'El Campo de Ferocidad: ¡el Señor de la Descomposición!', 'Derrota a Podrenoche.', 'Intenté conseguir uno de esos asquerosos gnolls para esta competición. Pero, por desgracia, ninguno de mis socios sabe cómo hablar con ellos.\n\nAunque sí que hemos conseguido atrapar a una de sus extrañar creaciones. ¡Servirá como oponente! ¡Avísame cuando quieras empezar la segunda ronda!', '', '', '', '', '', '', 47187),
(66459, 'esES', 'El Campo de Ferocidad: ¡el Terror del Pantano!', 'Derrota a Maneet.', '¡Sean todos bienvenidos a los Campos de la Ferocidad!\n\nAunque este campo de entrenamiento se usa para eventos más tradicionales, los centauros me han permitido amablemente instalarme una temporada. Dicen que pone a prueba su fuerza y que es un acto honorable.\n\n¿Quieres llevarte a casa el título de $gcampeón:campeona;? Pues avísame cuando quieras unirte a la competición.', '', '', '', '', '', '', 47187),
(66458, 'esES', 'Legado de Tyr: secretos del pasado', 'Entra en Uldaman: Legado de Tyr, que está en las Tierras Inhóspitas, y recupera el disco.', 'Debemos restaurar el poder de los Aspectos para impedir que Raszageth libere al resto de Encarnaciones.\n\nPor desgracia, los titanes están bastante preocupados y el guardián Tyr murió hace mucho tiempo.\n\nLa reina Alexstrasza ha propuesto un plan. En lo profundo de las Tierras Inhóspitas hay una instalación titánica llamada Uldaman. Al parecer, es posible que los aliados de Tyr hayan escondido allí un disco con sus recuerdos.\n \nDicen que los troggs han invadido el lugar. ¡Reúne a tus aliados, dirígete a Uldaman y consigue el disco en nombre de la reina de dragones!', '', '', '', '', '', '', 47187),
(66457, 'esES', 'El final del periodo azul', 'Mata a Escamazul.', 'Los Dientebrasa siguen a una criatura descomunal que he empezado a llamar Escamazul. Siempre ha sido agresivo, pero hasta ahora mantenía a su grupo de carroñeros alejados de los caminos principales. Por supuesto que eran territoriales, ¿pero hostiles? Hasta ahora no.\n\nEscamazul debe ser responsable de esta escalada repentina. Encuéntralo y acaba con él.', '', 'Líder de los Dientebrasa. No se le dan muy bien las negociaciones.', 'Escamazul', '', '', '', 47187),
(66456, 'esES', 'Una paleta venenosa', 'Reúne 8 lanzas envenenadas.', 'Puede que no sea excepcional en mi trabajo, pero al menos prestaba atención cuando estaba aprendiendo a hacerlo. Cualquier oteadora que merezca sus escamas sabe cómo hacer un antídoto. Solo necesito veneno suficiente para mezclarlo como es debido.\n\nNori dijo que el tarasek que la atacó tenía lanzas cubiertas del veneno. Encuéntralos y tráeme sus lanzas. Si mi corazonada es correcta, podré preparar un antídoto con el residuo de las puntas de lanza.\n\nEspero que tengamos tiempo suficiente.', '', '', '', '', '', '', 47187),
(66449, 'esES', 'Operación Manos Libres', 'Salva a $1oa crías en peligro y elimina a $2oa fénix garrabrasa y a la vinculaceniza Tornecha.', 'Los vinculapolvos qalashi están intentando encarcelar a nuestras crías. Parece que su líder pretende usarlas con algún propósito malvado. ¡No podemos permitirlo!\n\nPero los Djaradin no son el único enemigo. Los fénix también están atacando a nuestras crías y suponen un peligro aún mayor.\n\nDebes protegerlas y eliminar a los enemigos que las amenazan. Osoria te ayudará.', '', 'Una peligrosa oponente, experta en la manipulación de cenizas y hollín.', 'Vinculaceniza Tornecha', '', '', '', 47187),
(66448, 'esES', 'La oteadora díscola', 'Encuentra a la oteadora Alvi.', 'Los oteadores han protegido los caminos de Thaldraszus para los viajeros desde que tengo memoria. Es un deber que mi familia ha cumplido con honor durante generaciones.\n\nPor desgracia, últimamente mi hermana Alvi parece menos interesada en dicho honor. Se supone que tiene que presentarse ante mí cada mañana, pero no sé nada de ella desde hace más de un día. \n\nSi te encuentras con una dracónida bronce al este de aquí, holgazaneando y con la cabeza en las nubes, te ruego que me la envíes. Si no, tendré que ir yo a buscarla.', '', '', '', '', '', '', 47187),
(66447, 'esES', 'Más allá de la barrera', 'Investiga la Cámara de la Vida en las Ruinas de la Cámara de la Vida.', 'Ahora que la barrera ha caído, ¡ya podemos explorar la cámara!', '', '', '', '', '', '', 47187),
(66445, 'esES', 'Honrar a nuestros caídos', 'Recupera los siguientes objetos robados por los Djaradin.', '¡Los Djaradin no sienten ningún respeto por la santidad de la ciudadela ni por nuestros camaradas caídos! Rompen los huesos de sus cadáveres y se los llevan como trofeo.\n\nEsta falta de respeto es un golpe terrible para cada dragón negro. Nuestros caídos merecen un trato honorable.\n\nRecupera estos objetos que les han arrebatado los Djaradin a nuestros caídos.', '', '', '', '', '', '', 47187),
(66442, 'esES', 'Toca teoría', 'Ayuda a probar los orbes contra la barrera titánica en las Ruinas de la Cámara de la Vida.', '¡Ya tenemos cuatro orbes elementales! Veamos qué hipótesis es más certera.', '', '', '', '', '', '', 47187),
(66441, 'esES', 'Esfuerzo destilado', 'Mata a Acequian en la cueva este de las Ruinas de la Cámara de la Vida.', 'El orbe de piedra primigenia es un hallazgo fortuito, pero Acadia y Tae\'shara tienen hipótesis contradictorias sobre la barrera.\n\nYo tengo la mía. Y puede que, con más orbes elementales, encuentre una respuesta clara.\n\nUno de los expedicionarios ha visto a un elemental de agua descomunal en una cueva cercana. Derrótalo y quizás encuentres otro orbe.', '', 'Los exploradores informan de que este elemental está aumentando de tamaño rápidamente.', 'Acequian', '', '', '', 47187),
(66439, 'esES', 'Planes de fuego rápido', 'Consigue fragmento de llama primigenia de las fuerzas primalistas en la Cuenca de los Cornisapos.', '¿Orbes elementales, dices? Si hay de tierra..., ¡debe de haber de fuego!\n\nLos Primalistas que están cerca de los nidos de cornisapos están reformando la tierra con lava. Si a alguien le interesa el orbe de llamas primigenias, es a ellos.\n\nAcaba con ellos y descubre si tienen alguna información que nos sirva.', '', '', '', '', '', '', 47187),
(66438, 'esES', 'Propósitos elevados', 'Encuentra a la exploradora Ri\'tal en la Cuenca de los Cornisapos.', 'El aire es un elemento poderoso. Corta la piedra y llena las velas para llevarnos donde necesitamos ir.\n\nMi hipótesis es que el aire será el elemento más eficaz para eliminar esta barrera. Es sencillo, en serio.\n\nMis exploradores informan que han encontrado el orbe de vendavales primigenios. La exploradora Ri\'tal puede llevarte hasta él. Puedes encontrarla cerca de la Cuenca de los Cornisapos. ¡Rápido!', '', '', '', '', '', '', 47187),
(66437, 'esES', 'Un elemento clave', 'Devuelve el orbe de piedra primigenia a la elementalista Taiyang en las Ruinas de la Cámara de la Vida.', '<Este orbe despide energía.>\n\n<La elementalista Taiyang sabrá qué hacer con él>.', '', '', '', '', '', '', 47187),
(66436, 'esES', 'Alborotadores desenterrados', 'Mata $1oa elementales de tierra en las Ruinas de la Cámara de la Vida.', 'Los elementales de tierra no solo están intentando echarnos: ¡también están destrozando artefactos y equipamiento! Es como si los hubiesen programado para destruir todo lo que sea de origen titánico...\n\nLos estamos reteniendo, pero no podemos seguir estudiando este lugar mientras sigan aquí. ¡Ayúdanos a hacerlos retroceder para que dispongamos de algo de margen!', '', '', '', '', '', '', 47187),
(66435, 'esES', 'Recuperación del sitio', 'Rescata a $1oa expedicionarios atribulados en las Ruinas de la Cámara de la Vida.', 'Soy chamán, por lo que estoy acostumbrada a trabajar con elementales, pero nunca había visto ninguno tan agresivo.\n\nLa Expedición descubrió una cámara de los titanes aquí, pero una barrera protege la cámara interior. Creo que activamos algún tipo de sistema de seguridad al intentar disiparla porque, de repente, nos atacaron un montón de elementales furiosos.\n\nMuchos expedicionarios seguían trabajando en la excavación cuando atacaron los elementales. Muchos de ellos siguen atrapados, ¡y ninguno sabe luchar!\n\n¡Desciende a la excavación y ayúdalos!', '', '', '', '', '', '', 47187),
(66429, 'esES', 'Lo recordaré', 'Reúnete con Rannan fuera del Campamento Desubicado.', 'Solo necesito un momento, por favor.\n\nVuelve al Campamento Desubicado, $p. Nos veremos allí.', '', '', '', '', '', '', 47187),
(66428, 'esES', 'Amistad descuidada', 'Utiliza el S.U.P.E.R.C.H.A.C.H.I.G.U.A.Y. para disipar la barrera Arcana.', '¡Vale! El S.U.P.E.R.C.H.A.C.H.I.G.U.A.Y. ya está calibrado y listo... ¡para ti!\n\n¿Que por qué no lo uso yo? Es muy sencillo.\n\nHay que tener en cuenta todas las posibilidades.\n\nDigamos que explota. ¿Quién lo arregla si estoy herido o incluso muero? ¿Te imaginas?\n\nAhora vete y disipa la barrera para que podamos volver al campamento y curar a Lathos. Yo me quedaré... aquí atrás.', '', '', '', '', '', '', 47187),
(66427, 'esES', 'Una amenaza ominosa', 'Mata a Tharohn.', 'Las heridas Arcanas que he sufrido no pueden sanarse tan fácilmente. Me temo que no podré ayudar en la lucha.\n\nDebo pedirte ayuda de nuevo, $n.\n\nTienes que encontrar a Tharohn y evitar que sobrecargue más consolas.\n\nEso le daría a Rannan unos momentos muy valiosos para calibrar el G.U.A.Y..., el C.H.A.C.H.I.G.U.A.Y. o comoquiera que lo llame ahora.\n\nQuizás así podamos frustrar los planes de la Llama Hendida.', '', 'La líder de la Llama Hendida no se detendrá ante nada hasta tomar el poder de las Ruinas de Karnthar.', 'La manipuladora Arcana Tharohn', '', '', '', 47187),
(66426, 'esES', 'Se agota el tiempo', 'Llega a la torre este.', 'Puedo sentir cómo aumenta la oleada Arcana mientras hablamos.\n\nSospecho que no queda mucho tiempo antes de que las ruinas conviertan la M.A.S. de Rannan en algo parecido a una estrella lejana en el firmamento.\n\nDebemos ir allí y poner fin a esto.\n\nTen cuidado, $p.\n\nReúnete con nosotros junto a la torre este. Allí veremos cuál es la situación.', '', '', '', '', '', 'Reúnete con Rannan y Lathos en la torre del este.', 47187),
(66425, 'esES', 'Sobrecarga Arcana', 'Ayuda a Rannan a disipar las burbujas Arcanas.', '¡Ya está! ¡Terminado!\n\nTe presento... ¡el C.H.A.C.H.I.G.U.A.Y.!\n\n¡TA-TA-CHÁAAAAN!\n\nLo he calibrado con la frecuencia de la energía que rodea las consolas de dragón y le he inscrito un glifo para disipar magia.\n\nEl C.H.A.C.H.I.G.U.A.Y. disipará la energía Arcana y desactivará la consola de dragón, pero el glifo se debilitará con cada uso.\n\nNo está nada mal, ¿verdad?\n\nDetecto cuatro consolas cerca. ¡A por ellas!', '', '', '', '', '', '', 47187),
(66423, 'esES', 'Preocupaciones y validaciones', 'Encuentra pistas sobre el origen de las ruinas.', 'Las muertes de los miembros de la Llama Hendida dejan claro lo peligrosas que son las Ruinas de Karnthar.\n\nPero Rannan cree que, con algunos retoques el G.U.A.Y., podría contener estas energías.\n\nPero así solo estamos tratando los síntomas, no la verdadera causa del problema.\n\nInvestiga las ruinas para encontrar pistas e intenta averiguar su función original. Y date prisa, $n. Puede que no tengamos mucho tiempo.', '', '', '', '', '', '', 47187),
(66422, 'esES', '¡La expedición continúa!', 'Reúnete con Rannan y Lathos en la torre.', 'Un lugar ancestral, una organización con unos objetivos inescrutables... Incluso el G.U.A.Y. de Rannan y sus análisis...\n\nTodo emociona al expedicionario que llevo dentro.\n\nDebemos averiguar más cosas sobre lo que está ocurriendo aquí.\n\nAl sur hay unas escaleras que llevan a una torre. Deberíamos continuar.', '', '', '', '', '', '', 47187),
(66421, 'esES', 'La Cicatriz de la Tormenta', '', '', '', '', '', '', '', '', 47187),
(66419, 'esES', 'Lealtad a uno mismo', '', '', '', '', '', '', '', '', 47187),
(66412, 'esES', 'Adelante, Albahácaton', 'Habla con Albahácaton en los Jardines.', 'Hay algo más que este viejo dracónido querría pedirte antes de que te vayas.\n\nCuando lord Albahácaton y yo nos conocimos, vivíamos juntos en todo tipo de aventuras. Creo que por eso se aleja y deambula. Echa de menos explorar.\n\nYo ya no puedo hacerlo, pero tú sí. Puedes llevarlo a ver lugares que jamás habría soñado, lo presiento.\n\nSin embargo, deberíamos preguntarle antes a Albahácaton qué piensa de todo esto.', '', '', '', '', '', '', 47187),
(66391, 'esES', '¡A las ruinas!', 'Reúnete con Rannan y Lathos en las Ruinas de Karnthar.', '¿Quieres que te cuente cosas sobre mi invento, el G.U.A.Y.? ¿No?\n\nBueno, te las contaré de todos modos porque he descubierto algo.\n\nHoy ha detectado una ENORME oleada de energía Arcana en las ruinas de Karnthar. Lathos cree que la culpa la tiene la Llama Hendida. ¡Es la oportunidad perfecta para demostrar la utilidad del G.U.A.Y.!\n\n¿Vienes? Va a ser genial.', '', '', '', '', '', '', 47187),
(66369, 'esES', 'El resguardo terráneo', 'Activa el resguardo terráneo.', 'He potenciado un resguardo con los anillos que has conseguido. Ha reunido las piedras de la tierra a su alrededor y ha dado forma a un defensor terráneo viviente que se encargará de proteger este territorio.\n\nPrueba el resguardo terráneo para comprobar que es funcional.', '', '', '', '', '', '', 47187),
(66368, 'esES', 'Una isla en medio de una tormenta', 'Elimina $1oa manifestaciones ardientes y al fundidor Igneus.', 'No ha habido apenas tiempo para descansar. ¡El asalto elemental es implacable!\n\nSería de agradecer un respiro, porque me permitiría fabricar más resguardos para defendernos.\n\nA ver qué puedes hacer para disminuir los ataques contra nuestro perímetro.', '', '', 'El fundidor Igneus', '', '', '', 47187),
(66364, 'esES', 'Cómo hacer volar una cometa', 'Recolecta 10 alas de protodragón recién cortadas de los protodracos y protodragones de las Islas Dragón para Temnaayu de los Colmillarr de Iskaara.', 'Permite que te cuente algo que te interesará.\n\nLos protodracos y los protodragones disponen de una amplia libertad de movimiento en las alas. El tejido elástico es de lo más extensible. Normalmente fabricamos nuestras cometas con pellejos que estiramos, pero ahora que los dracos están sembrando el caos, te diré que, si me traes algunas de sus alas, me encargaré de fabricar unas cometas que serán la envidia de la tribu.', '', '', '', '', '', '', 47187),
(66363, 'esES', 'Rodelas de basilisco', 'Recolecta 20 pellejos de crocolisco rígidos de los basiliscos de las Islas Dragón para Dhurrel de los Centauros Maruuk.', 'Las escamas entrelazadas son la clave para detener una flecha. Las rodelas que fabricamos son las mejores de las llanuras, pero me estoy quedando sin pellejos de basilisco para mi próximo pedido. \n\nVeo que te interesa conocer nuestra profesión. Tráeme pellejos de basilisco de las Islas Dragón, y te enseñaré nuestras técnicas.', '', '', '', '', '', '', 47187),
(66356, 'esES', 'Troncoferro', '', '', '', '', '', '', '', '', 47187),
(66354, 'esES', 'La chispa', 'Reforma las partes dañadas de la piedra de juramento.', 'La forja está lista. Ahora lo único que necesita es llamas.\n\nColoca los fragmentos de piedra de juramento dañados en ella y Wrathion nos ofrecerá la chispa que hace falta para comenzar.', '', '', '', '', '', '', 47187),
(66353, 'esES', 'Anomalías G.U.A.Y.', 'Utiliza el G.U.A.Y. para disipar tres anomalías Arcanas.', 'Aquí hay un montón de energía Arcana...\n\nNo obstante, el G.U.A.Y. puede hacer algo al respecto. Es uno de los increíbles artilugios de Rannan. Es capaz de detectar y disipar energía Arcana.\n\nTen... ¡Cógelo! ¿Sientes el poder en tus manos? ¿No?\n\nBueno, ya lo tienes, ¡ahora ve y disipa las anomalías!', '', '', '', '', '', '', 47187),
(66352, 'esES', 'Lo que sabe el enemigo', 'Busca documentos de la Llama Hendida y llévaselos a Lathos.', 'Es vital que descubramos la misión de la Llama Hendida en estas ruinas y su relación con la oleada Arcana.\n\nLo haremos a la antigua usanza: reconocimiento y espionaje.\n\nLas ruinas están infestadas de devotos de la Llama Hendida. Seguro que alguno de ellos lleva órdenes que arrojarán luz sobre sus misteriosos objetivos.\n\nHaz lo que sea necesario para hacerte con esos documentos.', '', '', '', '', '', '', 47187),
(66351, 'esES', 'Humo sobre la montaña', 'Encuentra el avión de la abrecaminos Yips.', '<El abrecaminos Jeb observa la cresta de la montaña que se extiende más allá del campamento y olfatea el aire>.\n\nEsto no me gusta. La abrecaminos Yips debería haber vuelto aquí hace días. Iba a ayudarme a enseñar a este nuevo grupo de expedicionarios a escalar esos pilares sin peligro.\n\nVeo humo a lo lejos.\n\nNo tiene buena pinta.', '', '', '', '', '', '', 47187),
(66349, 'esES', 'Roca de instrucción', 'Retira $1oa piedras.', '¡Retira esas piedras!', '', '', '', '', '', '', 47187),
(66344, 'esES', 'Con el viento a la espalda', 'Monta con Gerithus y Merithra.', 'Conque los Primalistas han reclutado al Clan Nokhud como aliados...\n\nLos hemos contenido hasta ahora, pero los Nokhud han traído un arma nueva: una balista matadragones. Temo que Solethus no será el último dragón en caer debido a esa infame magia de tormenta.\n\nVen. Te llevaré al Santuario Sombreado, un refugio de los dragones. Podrás contarme lo que sabes de los Nokhud mientras la khanam Matra reúne sus fuerzas. Debemos prepararnos para el siguiente paso.', '', '', '', '', '', '', 47187),
(66340, 'esES', 'Hacia el azur', 'Reúnete con Masud el Sagaz en el Paso de Crucerrío.', 'Hemos hecho nuestra parte. Aunque debo quedarme aquí para vigilar la piedra de juramento y guiar al Vuelo Verde, quiero que sepas que partes con nuestra gratitud y nuestra fe.\n\nHe oído que el Kirin Tor busca ayuda para reclamar la piedra de juramento azur. Si los ayudas, estaremos un paso más cerca de sanar Azeroth.\n\nBusca a Pakina y a Masud el Sagaz del Kirin Tor. Ellos podrán darte más información. Buen viaje y sueños gratos, $n.', '', '', '', '', '', '', 47187),
(66339, 'esES', 'La Ofensiva Nokhud: El viento pertenece al cielo', 'Derrota a Balakar Khan y rescata a Ohn\'ahra en la Ofensiva Nokhud.', '¿Acaba aquí tu viaje con nosotros, $n, o nos ayudarás una vez más?\n\nMis exploradores dicen que Balakar se ha retirado a su fortaleza, donde tienen a Ohn\'ahra. ¡Es inaceptable!\n\nMientras tanto, sus asaltantes Nokhud asaltan las llanuras causando estragos. Mientras nos enfrentamos a ellos, podrías infiltrarte en el bastión de Nokhud y rescatar a Ohn\'ahra. ¿Harías esto por nosotros?', '', '', '', '', '', '', 47187),
(66337, 'esES', 'Rompetormentas', 'Derrota a Koroleth.', '$n, ¡a mí! ¡La victoria está a nuestro alcance!\n\nLas filas de los Primalistas están rotas, y su derrota es segura. Todo lo que hemos logrado depende de la batalla final contra su líder, Koroleth.\n\nAcabemos con esto $gjuntos:juntas;. ¡A la batalla, $Ghermano:hermana;!', '', 'Este líder primalista quiere destruir el santuario de los dragones verdes.', 'Koroleth', '', '', '', 47187),
(66336, 'esES', 'La isla de esmeralda', 'Reúnete con Merithra en la Rama Ancestral.', 'Tu papel en todo esto no ha pasado desapercibido, mortal. Hemos podido derrotar a los Primalistas gracias, en gran medida, a tu valentía.\n\nHe invitado a los centauros a reunirse conmigo bajo la Rama Ancestral. Tú, la khanam Matra y su pueblo sois bienvenidos en nuestro hogar.\n\nSigue este camino por el arco que atraviesa el agua hasta los árboles que hay más allá. Yo esperaré allí.', '', '', '', '', '', '', 47187);
INSERT INTO `quest_template_locale` (`ID`, `locale`, `LogTitle`, `LogDescription`, `QuestDescription`, `AreaDescription`, `PortraitGiverText`, `PortraitGiverName`, `PortraitTurnInText`, `PortraitTurnInName`, `QuestCompletionLog`, `VerifiedBuild`) VALUES
(66335, 'esES', 'Deconstruir más pilones', 'Marca los pilones de los Primalistas con las semillas encantadas.', 'Ahora que esas malditas armas han sido destruidas, el Vuelo Verde puede unirse a la contienda.\n\nConocemos mucho mejor la situación en tierra que ellos. Debemos iluminar objetivos para que Merithra y sus dragones puedan atacarlos desde el cielo.\n\nMerithra me dio estas semillas encantadas. Colócalas cerca de los pilones de los Primalistas y usaremos la luz que emiten para dirigir los ataques de los dragones que están en el aire.', '', '', '', '', '', '', 47187),
(66333, 'esES', 'Justicia para Solethus', 'Mata a $1oa belicistas Nokhud y destruye $2oa balistas matadragones.', 'Mientras haya un dragón verde en pie, los Primalistas no profanarán la Rama Ancestral sin tener que luchar.\n\nEstamos ansiosos por cumplir nuestro papel en esta batalla, pero mientras haya balistas matadragones en el campo de batalla, no podremos acercarnos. Los guerreros Nokhud más fuertes las custodian, así que también tendrás que acabar con ellos.\n\nDestruye las balistas y a los belicistas Nokhud. Elimina esta amenaza y los dragones verdes cambiarán el curso de la batalla.', '', '', '', '', '', '', 47187),
(66331, 'esES', 'El Frente de los Primalistas', 'Habla con la exploradora Tomul, Ari y Belika, Ohn Seshteng y Merithra en la Cicatriz de la Tormenta.', 'La khanam Matra ha enviado la noticia de que ella y sus fuerzas han llegado a los Jardines Esmeralda. Han localizado a Koroleth y a sus Primalistas. Parece que se está reuniendo una enorme fuerza invasora en una playa al norte.\n\nPor suerte, ha colocado varios exploradores en lugares estratégicos alrededor del campo de batalla. Ve, recoge sus informes y luego reúnete conmigo y mis fuerzas en el frente. En la batalla nos aguarda la gloria y, si tenemos éxito, nos cobraremos nuestra venganza.', '', '', '', '', '', '', 47187),
(66329, 'esES', 'Soplar el cuerno', 'Presencia los planes de Balakar y Koroleth.', '¿Por qué traerían a Ohn\'ahra aquí? A menos que... \n\n¡$n! No creo que Balakar pretenda destruir el cuerno. ¡Creo que es una trampa! ¡Debemos encontrar una manera de atravesar este viento, rápido!', '', '', '', '', '', '', 47187),
(66328, 'esES', 'Dragón verde caído', 'Reúnete con la khanam Matra en el Abrevadero.', 'Esos dragones han caído en las llanuras al oeste. Debemos llegar antes de que lo hagan los Nokhud.\n\nNo queremos que piensen que todos los Maruuk son sus enemigos por culpa de las acciones de Balakar.', '', '', '', '', '', '', 47187),
(66327, 'esES', 'Persiguiendo el viento', 'Escucha el informe de la exploradora Tomul.', 'Debemos darnos un momento para pensar en nuestra estrategia.\n\nNecesitamos la bendición de Ohn\'ahra para hacer sonar el Cuerno de Drusahl e invocar a los dragones verdes. Sin su ayuda, no podemos ganar esta guerra. Los Nokhud ya superan en número a los otros clanes, y encima ahora cuentan con la ventaja de los Primalistas. Y, por si fuera poco, ¡Koroleth ha capturado a nuestra madre del viento! Debemos encontrar a Ohn\'ahra antes de que los Nokhud puedan lanzar su ataque final y asediar Maruukai.\n\nEnviaré a todos nuestros exploradores. Solo espero que podamos localizarla a tiempo.', '', '', '', '', '', '', 47187),
(66326, 'esES', 'Las herramientas de la profesión', 'Recoge $4oa martillos de escamas de precisión, $3oa yunques obsidiana, $2oa tenazas de acero negro y $1oa puños de garra de dragón.', 'Una forja de este poder necesita herramientas especializadas, herramientas que puedan soportar semejante calor.\n\nPero los Djaradin han saqueado el lugar y han robado muchas de las que necesitamos para este trabajo.\n\nSi puedes, recupéralas para que podamos continuar fabricando armas para nuestros aliados.', '', '', '', '', '', '', 47187),
(66324, 'esES', 'No caerán en el olvido', 'Recupera los objetos y ayuda a los supervivientes en el Nido de Apoyo.', 'El antídoto está listo. Utilízalo para buscar supervivientes en el Nido de Apoyo. Date prisa. El efecto no dura mucho, así que puede que tengas que volver a aplicarlo.\n\nDebes rescatar a todos los que aún respiren.\n\nSi no lo hacen, te pido que recuperes sus sellos de cuerno para que podamos recordar sus nombres con honor.\n\nPuede que allí dentro encuentres pruebas sobre el origen de esta infestación.', '', '', '', '', '', '', 47187),
(66320, 'esES', 'El flujo del tiempo', 'Viaja al Mar de Dunas y habla con Cromi.', 'Los hilos del tiempo fluyen como un río, con recodos y ramificaciones por todas partes. A veces, las corrientes pueden cambiar. Sin embargo, una anomalía sin resolver puede condenar nuestro destino dentro de una falsa línea temporal.\n\nNos acercamos rápidamente a una de ellas. He enviado a Chronormu al Mar de Dunas para que investigue y corrija cualquier problema en la única línea temporal verdadera.\n\nPreveo que tu ayuda será de gran valor.\n\nAyúdanos y reúnete con Chronormu.', '', '', '', '', '', '', 47187),
(66308, 'esES', 'Alimentar el fuego', 'Recoge $1oa pedazos de carbón de fragmento cenizo.', 'La creación de nuevas armas y armaduras en la Forja del Guardián de la Tierra garantizará nuestra victoria final sobre los Djaradin.\n\nNo obstante, debemos seguir alimentando las llamas de la forja sin parar. El carbón de fragmento cenizo genera más calor que ninguno y lo necesitamos para forjar armas.\n\nPuedes encontrar el carbón en los depósitos y elementales que hay en la Veta Fragmento Cenizo.', '', '', '', '', '', '', 47187),
(66299, 'esES', 'La esperada ovoexplosión', 'Mata a la matriarca alachirrido.', '¡El prototipo ha funcionado! ¡Excelente!\n\nAhora viene el plato principal. Y esta vez te toca a ti cocinar.\n\nCon unos pocos ajustes, podrás volver a usar el disfraz. Después, toma nuestra explosiva obra maestra, échala en este estofado tan rancio, vete a la cueva de la matriarca, emplátalo allí y luego vuelve planeando mientras todo explota a tus espaldas.\n\nSi todo va según lo previsto, será ella la que acabe estofada. Por la explosión. Que la dejará bien chamuscada.', '', '¡La esquiva matriarca de las arpías alachirrido! ¿Satisfarás su apetito voraz con un explosivo de Chirridos o con tu propia carne?', 'Matriarca Avethyra, líder de las arpías alachirrido', '', '', '', 47187),
(66279, 'esES', 'El reloj del nuevo', 'Llévale el reloj de bolsillo a Orizmu, que está en los Jardines.', 'Ah, sí, este reloj de bolsillo pertenece a uno de los administradores que me ayudan a cuidar los jardines. \n\nUno de los de Nozdormu. Orizmu, creo... Siempre se me olvidan los nombres de esos jovenzuelos. La mayoría de los días no se aleja del reloj de arena que hay cerca del árbol de Alexstrasza. No mueve ni un músculo, ni siquiera parpadea.\n\nLa prole de Nozdormu siempre ha sido bastante extraña, si quieres saber mi opinión. Pero te agradecerá que le hayas traído esto.', '', '', '', '', '', 'Llévale el reloj de bolsillo a Orizmu, que está en los Jardines.', 47187),
(66278, 'esES', 'Lo que es basura para un dracónido...', 'Llévale el reloj de bolsillo a Gryrmpech en los Jardines.', '<Entre los montones de chatarra yace un reluciente reloj de bolsillo. Quizás Gryrmpech sepa qué hacer con él>.', '', '', '', '', '', 'Llévale el reloj de bolsillo a Gryrmpech en los Jardines.', 47187),
(66277, 'esES', '[DNT] Making Quest', 'Mata a $1oa bandidos.', '¡Te doy la bienvenida a tu primera misión! Hoy se trata de matar a unos bandidos asquerosos. ¡Ve y mátalos!', '', '', '', '', '', '', 47187),
(66270, 'esES', 'Golpea al gnoll', 'Derrota a los aspirantes a señores de la guerra.', 'Oh, por la Luz... ¡Vienen más! ¿Cómo es posible?\n\n¡Toda mi cuidadosa planificación! ¡Los días que he pasado escondiéndome en este apestoso lago! ¡Los asesinatos!\n\nEsto debería haberlos sumido en el caos y provocado el derrumbe de su sociedad, pero apenas los hemos ralentizado.\n\nQuizá... quizá tengas razón, $n. Estaba equivocado...\n\n¡No, imposible! De todas formas, ya estamos metidos hasta el cuello en esto.\n\nVe y ocúpate de los recién llegados. Necesito tiempo para serenarme.', '', '', '', '', '', '', 47187),
(66269, 'esES', 'Más vale asegurarse', 'Mata a $1oa elementalistas colmitormenta.', 'Tú... mata a cualquiera que parezca tener afinidad por la magia. O que posea habilidades organizativas. O que parezca demasiado ambicioso.\n\nMira, a partir de ahora, guíate por tu criterio.\n\n¿Que según tu criterio deberías dejar de hablarme? ¡Venga, $c! ¡Obviamente están planeando... algo malvado!', '', '', '', '', '', '', 47187),
(66268, 'esES', 'A la tercera...', 'Mata a Garrasangre.', '¿Cómo? ¿Que otro se ha hecho con el poder? ¿Qué pasó con lo de detestar el vacío? ¿O lo de mantener un luto respetuoso durante un tiempo para disimular?\n\n¿No tienen decencia? ¿Carecen de sentido de la propiedad? ¿No respetan un plan bien diseñado? ¡Si había hecho unas quinielas!\n\nEncárgate de ese tal Garrasangre. Necesito un minuto.\n\nEn cambio, lo que no necesito son tus mordaces comentarios, muchas gracias.', '', '¿Quién ha muerto y lo ha nombrado líder de guerra?', 'Garrasangre', '', '', '', 47187),
(66267, 'esES', 'M.T.E.A.', 'Libera a $1oa animales maltratados.', '¡Malditos! Una cosa es saquear y asesinar, pero ¡¿maltrato animal?! Eso no lo voy a permitir.\n\nLos gnolls han colocado trampas para atrapar animales y alimentar a esas hienas babeantes. ¡Encuentra el modo de liberar a sus peludos prisioneros y enseña a esos rufianes cómo tratan los magos a los animales!\n\nPor supuesto que esta ética tiene sentido a la luz de mis recientes actos. ¿Qué estas tratando de insinuar?', '', '', '', '', '', '', 47187),
(66266, 'esES', 'Gusanos inmundos', 'Mata a $1oa matriarcas hiena y a $2oa hienas sabueso.', '¡Esas bestias pulgosas de las hienas sabueso que crían los gnolls deben desaparecer! No solo carecen de modales (no creerías los lugares en los que las he visto evacuar), sino que encima son capaces de detectar mi olor ignorando mis prístinas ilusiones.\n\nHaz un favor al mundo civilizado y acaba con ellas.', '', '', '', '', '', '', 47187),
(66265, 'esES', '¡Siguiente!', 'Mata a Rompediente.', 'Ajá, parece que otro gnoll ha decidido asumir el mando. Tal y como esperaba. Sí.\n\nLo cierto es que contar con un viceseñor de la guerra leal para garantizar la continuidad del gobierno tiene sentido, ¿verdad? Tendremos que golpear un poco más fuerte para que se venga abajo toda su burocracia.\n\n¿Qué? ¿Que si voy a tomarme un momento para reflexionar si me he precipitado al juzgar a estos gnolls? ¡Qué ridiculez! ¡Son gnolls \n\nApresúrate a matar a Rompediente antes de que se calmen las cosas o, lo que es peor, organicen unas elecciones.', '', '¿Cuántas hienas puede comerse un gnoll?', 'Rompediente', '', '', '', 47187),
(66264, 'esES', 'Desarmado y dócil', 'Consigue $1oa armamentos Roehuesos.', 'Hay una inquietante cantidad de armamento amontonado allí. Si les arrebatamos algo, las cosas deberían calmarse un poco. Al menos calmará mis nervios.\n\n¿Qué podrán hacer sin armas? ¿Atacarte con las manos? ¡Ja!', '', '', '', '', '', '', 47187),
(66263, 'esES', 'Un enfoque preciso', 'Mata a Azotapuño.', 'Los gnolls son criaturas horribles y malolientes que se pasan el día rascándose y riéndose de ti. Aquí hay una multitud y, encima no paran de llegar más. Podríamos, o más bien podrías, matarlos como moscas y no serviría para nada. No podemos permitir que se queden.\n\n¡Debemos cortar la cabeza de la serpiente! Elimina a su líder y quedarán paralizados por la indecisión y la desesperación.\n\n¿Qué quieres decir con \"por qué\"? ¿No es evidente? ¡Son gnolls! ¿Qué otro motivo necesitas?', '', '¿Qué posibilidades tienen sin su amado líder?', 'Azotapuño', '', '', '', 47187),
(66262, 'esES', 'Limpieza de aguas contaminadas', 'Limpia $1oa pilas hediondas del lago.', 'Lo primero es lo primero. ¡Necesito recuperar mi base de operaciones! Pero, con los elementales causando estragos por la zona, ha sido imposible establecerse.\n\nY todo es culpa de esos malditos gnolls, claro.\n\nLos gnolls han tirado al lago tanta basura, vísceras y la Luz sabe qué más que los elementales locales han empezado a enfurecerse.\n\n¿Serías tan amable de limpiar los restos más repugnantes antes de que la cosa pase a mayores? Y, sobre todo, ¡antes de que se me manche la toga sin remedio!', '', '', '', '', '', '', 47187),
(66261, 'esES', 'Un pequeño revés', 'Alcanza a Detry.', '¡Ah! Justo la clase de persona bien armada que esperaba encontrarme.\n\nVerás, estaba yo aquí, ocupándome de asuntos muy importantes para el Kirin Tor en este lugar perdido, cuando, mientras montaba el campamento, me han empezado a perseguir unos gnolls sarnosos.\n\nDe hecho, cerca de aquí se ha reunido una cantidad preocupante de ellos; los suficientes como para suponer una amenaza para las Tierras Azures.\n\nNo temas, tengo un plan. Reúnete conmigo en aquel lago de allí y te lo explicaré todo.', '', '', '', '', '', '', 47187),
(66259, 'esES', 'Una tormenta de malos presagios', 'Entrégale tu informe a la khanam Matra en Maruukai.', '$n, tenemos que informar a la khanam Matra de todo lo ocurrido, incluida la captura de Ohn\'ahra.\n\nDebes ir a Maruukai lo antes posible. Tendrás que ir $gsolo:sola;. Me lastimé durante la caída, y solo te retrasaría.\n\nNo te preocupes por mí. Ya te alcanzaré. ¡Vete!', '', '', '', '', '', '', 47187),
(66258, 'esES', '¡Oh, no! ¡Ohn\'ahra!', 'Derrota a enemigos mientras Boku intenta liberar a Ohn\'ahra.', 'Esa primalista tiene apresada a Ohn\'ahra, aunque a duras penas. No parece que se haya percatado de nuestra presencia.\n\nPuedo oír las palabras de la khan Tigari: \"Hasta la brisa más suave puede derribar una piedra que se tambalea\". Si puedo interrumpir su hechizo, por poco que sea, Ohn\'ahra podría liberarse.\n\nTú mantén a los guardias distraídos. Tengo una idea.', '', '', '', '', '', '', 47187),
(66257, 'esES', 'Brujería a-víl-cola', 'Utiliza el tótem de viento de Boku para destruir los carros Nokhud.', 'Se dice que Ohn\'ahra imbuyó la lanza de nuestro ancestro, Maruuk, de su poder. Balakar Khan debe de haberle contado esa leyenda a los Primalistas.\n\nHan robado la magia de los niños de Ohn\'ahra, la han contaminado con su brujería de tormenta y han imbuido con ella los proyectiles de las balistas. ¿Para qué necesitarían los Nokhud armas así?\n\nNo debemos quedarnos de brazos cruzados a averiguarlo. Están cargando los proyectiles de tormenta en carros para transportarlos. Coge mis tótems y coloca uno en cada carro que encuentres. Mi magia de viento los romperá en pedazos.', '', '', '', '', '', '', 47187),
(66256, 'esES', 'Aguilitario', 'Libera a $1oa niños de Ohn\'ahra y elimina a $2oa primalistas en el Alto Son del Viento.', 'Hemos descubierto por qué los Nokhud quieren tótems místicos. Se pueden usar para capturar a los niños de Ohn\'ahra. Aunque los Nokhud han robado los tótems, son los Primalistas los que están detrás de esta blasfemia.\n\nLos niños de Ohn\'ahra son ohuna sagrados y están bendecidos por la mismísima madre del viento. Libera a cualquier ohuna que veas, $n. Y si te encuentras con algún primalista...\n\n<Boku se serena, pero su expresión muestra una firme determinación>.', '', '', '', '', '', '', 47187),
(66254, 'esES', 'Místico pesimista', 'Coloca los tótems de potenciación alrededor de Boku.', '¿Guerra? ¿Dragones? ¿Que necesitas que me ponga en contacto con Ohn\'ahra?\n\n¡No puedo! No oigo a Ohn\'ahra. No soy más que un iniciado, y parece que Ohn\'ahra me ha retirado sus bendiciones. Quizás no sea lo suficientemente bueno...\n\n<Boku empieza a rebuscar en su bolsa>.\n\nCuando mi mentora me asignó a este clan, me regaló estos pequeños tótems. Dijo que me daría fuerza si alguna vez dudaba de mí mismo.\n\n¿Me ayudarás a colocarlos? Intentaré invocar a Ohn\'ahra una vez más.', '', '', '', '', '', '', 47187),
(66252, 'esES', 'A la orden', 'Vuelve a Valdrakken e informa al capitán Drine.', 'La amenaza primalista ha sido eliminada, $n. Dentro de poco llegarán las fuerzas de Valdrakken y acabarán con lo que quede.\n\nDeberías volver a la ciudad e informar a la capitana Drine. Le interesará saber qué ha ocurrido aquí con el comandante Eranog.\n\nGracias de nuevo por todo, $n.', '', '', '', '', '', '', 47187),
(66251, 'esES', 'Luchador de fuego', 'Mata a Garfamagma.', 'El comandante Eranog nos traicionó y dejó a esta bestia al mando.\n\nYa has hecho mucho por mí, pero no puedo con ese monstruo en mi estado actual.\n\nPor favor, hazme un último favor y asegúrate de que la Puerta del Fuerte Sur no caiga en manos de los Primalistas.\n\n¡Tenemos que matar a su líder!\n\nAyúdame, $n.', '', 'El líder de los Primalistas que ha atacado la Puerta del Fuerte Sur.', 'Garfamagma', '', '', '', 47187),
(66250, 'esES', '¿Dónde está el jefe?', 'Acompaña al guardián Velomir e inspecciona la torre de vigilancia en la Puerta del Fuerte Sur.', 'Esta es la única parte de la fortaleza que aún no hemos registrado, $n. Si el comandante Eranog está en algún lugar, tiene que ser aquí.\n\n<Velomir mira hacia la puerta cercana>.\n\nA ver qué averiguamos.', '', '', '', '', '', '', 47187),
(66249, 'esES', 'Despejar el cielo', 'Controla un escorpión de asedio y úsalo para derribar a los veranatos juramagma.', 'Has hecho bien en reunir todo esto, ¡con ello podremos expulsar a los altaneros Primalistas del cielo!\n\nHay una plataforma al final de las escaleras con algunos escorpiones de asedio. ¡Si usas las lanzas con cuerda como munición, podrás derribar a los dragones juramagma!\n\nCuando despejes el camino a la torre, podremos podamos continuar la búsqueda del comandante Eranog.', '', '', '', '', '', 'Reúnete con el guardián Velomir sobre la torre de vigilancia de la Puerta del Fuerte Sur.', 47187),
(66248, 'esES', 'Atando cabos', 'Reúne $1oa rollos de cuerda pesada.', 'Este rollo de cuerda pesada parece en buen estado.\n\nEl guardián Velomir pidió que buscáramos materiales útiles. Si encuentras unos cuantos rollos más, podrían venirle bien.', '', '', '', '', '', '', 47187),
(66247, 'esES', 'Armas ligeramente usadas', 'Reúne $1oa lanzas de los juramagma.', 'La lanza parece en buen estado pese a la condición de su antiguo dueño.\n\nEl guardián Velomir mencionó que estuviéramos atentos por si veíamos materiales útiles. No estaría mal obtener un par de lanzas más de los juramagma.', '', '', '', '', '', '', 47187),
(66246, 'esES', 'La niebla de la batalla', 'Busca a los miembros de la unidad del guardián Velomir en la Puerta del Fuerte Sur.', 'Los Primalistas atacaron de repente y sin previo aviso. Mi unidad intentó encontrar a nuestro líder, el comandante Eranog, pero antes de que pudiéramos llegar al otro lado de la ciudadela, nos cortaron el paso.\n\nEn la batalla, el líder de mi unidad, el sargento Tagrik, contuvo a tres primalistas mientras Kaora, Mikor y yo luchábamos a su lado.\n\nLos gritos son lo último que recuerdo antes de caer.\n\nPor favor, $r, si ves algún rastro de mi unidad, cuéntame lo que ha sido de ellos.', '', '', '', '', '', '', 47187),
(66245, 'esES', 'Recuerda a los caídos', 'Reúne $1oa sellos de la guarnición del Fuerte Sur.', 'Muchos de mis camaradas han caído.\n\nPor favor... Recoge sus sellos de identificación para que sus nombres no caigan en el olvido.', '', '', '', '', '', '', 47187),
(66244, 'esES', 'A Valdrakken', 'Viaja a Valdrakken y reúnete con Alexstrasza la Protectora.', 'Gracias a ti, hemos evitado una catástrofe por los pelos.\n\nNo obstante, deberíamos ir a ver a los demás Aspectos y contarles lo que ha ocurrido aquí.\n\nReúnete conmigo en el Trono de los Aspectos de Valdrakken. Seguro que los demás saben algo sobre lo que traman Raszageth y los Primalistas.\n\nHay un cruce hacia Thaldraszus al norte, ligeramente al este de aquí. Las vistas desde el aire no están nada mal, pero no tardes mucho en llegar.', '', '', '', '', '', '', 47187),
(66242, 'esES', 'Control del clima', 'Mata a $1oa esencias vinculadas a la tormenta y a $2oa iniciados clamatormentas.', 'Esta tormenta antinatural está cargada de magia. Parece que los Nokhud están aprendiendo a manipular la esencia sagrada del Alto Son del Viento para crear elementales de tormenta. Algunos han tenido más éxito que otros...\n\n<Boku señala al desafortunado iniciado Nokhud que aún desprende humo por las quemaduras de un rayo>.\n\n$n, no podemos permitir que sigan.', '', '', '', '', '', '', 47187),
(66241, 'esES', 'Rally de Thaldraszus', '', 'Vuela a través de los anillos de control que marcan el recorrido.', '', '', '', '', '', '', 47187),
(66239, 'esES', 'Descomposición en expansión', 'Reúnete con Brena en la avanzada comercial.', '<Brena examina el tótem de Kargozarpa una y otra vez con sus gruesas manos>.\n\nKargozarpa es un peón. No es el origen de esta descomposición. Debemos encontrarlo antes de que se propague más.\n\nEl enclave de colmillarr más cercano es una avanzada comercial, justo al otro lado del puente que hay de camino a Iskaara.\n\nDeberíamos hablar con ellos... y rápido.', '', '', '', '', '', '', 47187),
(66237, 'esES', 'Aliados espirituales', 'Habla con las autoridades.', 'Nuestra llegada no habrá pasado desapercibida.\n\nDeja que hable con ellos antes de entrar. Me he relacionado con el consejo en el pasado.\n\nYa habrá tiempo para presentaciones más tarde.', '', '', '', '', '', '', 47187),
(66236, 'esES', 'Presencia detectada', 'Reúnete con Boku en el Alto Son del Viento.', 'Los Nokhud están recogiendo tótems. Los Primalistas están capturando ohunas. Y Ohn\'ahra guarda silencio.\n\nSean cuales sean los planes de los Nokhud, debemos frustrarlos. Boku y tú tenéis que viajar hasta el Alto Son del Viento. Seguramente nuestros enemigos ya estén allí.\n\nBusca a Ohn\'ahra. Si sus hijos están en peligro, sin duda irá a por ellos, y debemos ayudar. La madre del viento es poderosa, pero temo lo que pueden hacer los Primalistas.', '', '', '', '', '', 'Reúnete con Boku en el Alto Son del Viento.', 47187),
(66232, 'esES', 'La sal to\' frontal', 'Recolecta $1oa escamas de cristal en la Orilla Górloc.', 'No nos importa alojaros en nuestro pequeño hogar aunque nadie lo haya preguntado. Si subes a los manantiales, ¿podrías recoger unas escamas de cristal? Las usamos para conservar todo tipo de cosas. Y eso es algo crucial para conservar la comida en este lugar.\n\nLos górlocs más grandes están totalmente cubiertos de ellas. ¿Te importaría cogerles unas cuantas?', '', '', '', '', '', '', 47187),
(66230, 'esES', 'Un esbozo de petición', 'Recupera el \"libro de contabilidad\" de Alvi y llévaselo a la oteadora Alvi.', 'Los tarasek se llevaron todo lo que pudieron, incluso mi libro de contabilidad.\n\nEsos lagartos gigantescos acaparan abalorios y trofeos a docenas. Estoy segura de que ocultaron mi libro de contabilidad en algún sitio. ¿Podrías echar un ojo mientras atraviesas el paso?\n\nPor cierto, $n. Si consigues encontrarlo, no lo abras. El contenido es... más bien personal.', '', '', '', '', '', '', 47187),
(66228, 'esES', 'El Campamento de Antonidas', 'Reúnete con Noriko la que Todo lo Recuerda en el Campamento de Antonidas.', 'El Kirin Tor ha establecido su campamento principal al sur de aquí: el Campamento de Antonidas, lo llaman.\n\nCreo que Noriko y Khadgar están allí, reuniendo aventureros para ayudar a Kalecgos a reclamar la piedra de juramento azur.\n\nSi quieres ayudarnos con esta labor, ve allí.', '', '', '', '', '', 'Reúnete con Noriko la que Todo lo Recuerda en el Campamento de Antonidas.', 47187),
(66227, 'esES', 'Una buena pesca', 'Atrapa $3oa pezqueñines de cola azul en el Punto de Pesca de Khuri.', '¡Otro par de manos! Me vendría bien algo de ayuda para pescar suficientes peces y llevarlos a casa para comer.\n\nLa gente del Kirin Tor parece preocupada por algo que hay en la zona y a lo que llaman anomalías mágicas, signifique lo que signifique.\n\nPuedes quedarte, siempre y cuando arrimes el hombro.\n\nCoge una caña de pescar y ponte manos a la obra. ¡Cuantas más manos, menos trabajo!', '', '', '', '', '', '', 47187),
(66226, 'esES', 'Compañeros de apoyo emocional', 'Rescata a las criaturas inocentes de los Nokhud en el Retiro Crestagua.', 'Por favor, no me hagas daño...\n\n¿Qué? ¿Que has venido a ayudar? ¡Debes salvar a los animales!\n\nLos Nokhud nos atacaron por sorpresa. ¡Tuvimos que huir para salvar el pellejo! Yo me zambullí en el lago para evitar que me mataran.\n\n¡Pero tuvimos que abandonar a nuestros animales! Por favor, te lo ruego, rescátalos. Quién sabe qué atrocidades piensan cometer los Nokhud con ellos.', '', '', '', '', '', '', 47187),
(66225, 'esES', 'Todos los tótems', 'Recupera $1oa fardos de tótems de los Nokhud en el Retiro Crestagua.', 'Boku me preguntó por qué convoqué a todos los místicos al Retiro Crestagua.\n\nPero yo no envié mensaje alguno. Balakar atrajo a mis místicos a propósito a una trampa para debilitar al Clan Ohn\'ir.\n\nY puede que haya algo más. Los Nokhud están reuniendo tótems místicos, todos los que pueden. Están bendecidos por Ohn\'ahra.\n\nLos motivos de los Nokhud no están claros, pero no podemos permitir que se lleven los dones de Ohn\'ahra. Recupera tantos tótems como puedas.', '', '', '', '', '', '', 47187),
(66224, 'esES', 'El misterio místico', 'Reúnete con Boku y viaja al Retiro Crestagua.', 'Lo siento, pero no he logrado entrar en comunión con Ohn\'ahra. Necesitarás a alguien más para cumplir la petición de la khanam Matra.\n\nHace varios días, la khan Tigari convocó de urgencia a mis compañeros místicos al Retiro Crestagua. Aún deberían estar allí.\n\nReúnete conmigo fuera de la ciudad. Lo menos que puedo hacer es mostrarte el camino.', '', '', '', '', '', '', 47187),
(66223, 'esES', '¿Nos lo quedamos?', 'Llévale a Neelo $1oa peces gélidos de los vendedores de Iskaara o péscalos en las aguas oceánicas de las Islas Dragón.', '¡Solo intenta comernos porque está muy hambriento!\n\n¡Pescado! Nadie se resiste a un poco de frío y delicioso pescado crudo.\n\nLos peces gélidos son los mejores. ¡Los puedes atrapar por todo el océano! Si no te ves capaz de pescarlos por tu cuenta, Jinkutuk, que está en Iskaara, te los puede vender.\n\n¡Tráeme tantos como para saciar su hambre eternamente!', '', '', '', '', '', '', 47187),
(66222, 'esES', 'La calma antes de la tempestad', 'Entrega las órdenes de Jebotai a los habitantes de Teerakai.', 'Los Nokhud son poderosos y cuentan con muchos aliados. Necesitaremos todo lo que tenemos para resistir su ataque.\n\n$n, cuentas con la confianza de la khanam Matra. Sus órdenes eran reunir a nuestros amigos y preparar a nuestro pueblo.\n\nNecesito tu ayuda. Busca a Hojin para movilizar al resto de la guardia del khan. Alerta a la exploradora Khenyug de posibles incursiones Nokhud. Dile a Agura para que espere heridos y a Gensai que prepare nuestras provisiones.\n\nY en cuanto a los místicos, creo que se han ido hace poco. Veré si queda alguno en Teerakai.', '', '', '', '', '', '', 47187),
(66221, 'esES', 'Hacia adelante', 'Habla con Alexstrasza en el Trono de los Aspectos, que está en Valdrakken.', 'Ahora que la piedra de juramento bronce ha sido restaurada, Alexstrasza podrá continuar con su plan.\n\nViaja a Valdrakken, $n. Querrá oír las noticias de tu éxito.', '', '', '', '', '', '', 47187),
(66218, 'esES', 'Malandrines escurridizos', 'Encuentra a Neelo y a Nau.', 'Hola de nuevo.\n\n¿Podrías hacernos un favor a Norukk y a mí? Nuestros hijos Neelo y Nau se han ido a jugar. Saben que ya deberían haber vuelto.\n\nEstoy ocupada. ¿Podrías buscarlos? Dudo que estén en peligro. Saben cómo cuidarse.', '', '', '', '', '', '', 47187),
(66217, 'esES', 'SE BUSCA: Krojek el Acechacostas', 'Mata a Krojek el Acechacostas.', 'Hemos estado observando durante muchos años al gran tiburón que conocemos como Krojek a la espera del mejor momento para darle caza. \n\nSu terreno de caza está cada vez más cerca de la costa. Eso significa que ha llegado el momento. ¡Reúne tu grupo de caza y acaba con él!', '', 'En su día fue indispensable para el ecosistema local, pero ahora los terrenos de caza del Acechacostas se están acercando demasiado a Iskaara.', 'Krojek el Acechacostas', '', '', '', 47187),
(66213, 'esES', 'La trama de una historia', 'Cuéntale a la anciana Poa una historia sobre peces.', 'Mi amada esposa Poa es una gran narradora.\n\nPero han pasado treinta años y cuenta las mismas historias una y otra vez. Por favor, $c, habla con ella y ofrécele una historia nueva.\n\n¿Cómo dices? ¿Contarle una historia sobre tus aventuras? No digas bobadas... Eso no me interesa. Las historias más importantes siempre hablan de peces. Cuéntale una historia sobre peces, ¡aunque tengas que inventártela!', '', '', '', '', '', '', 47187),
(66212, 'esES', 'Pesca: polilla marina con alerón', 'Pesca $1oa polillas marinas con alerón en el océano que rodea las Islas Dragón.', '¿Es que ya nadie sabe pescar en condiciones?\n\n<Lukoturukk agita el bigote con furia>.\n\nTú, rostro, ve a pescar. Pero hazlo bien. ¡Y nada de grungles!', '', '', '', '', '', '', 47187),
(66211, 'esES', 'Hondonada Frondacuero: hasta el origen', 'Entra en la Hondonada Frondacuero y enfréntate a la descompotriarca Ojoiracundo.', 'Te estamos muy agradecidos por ayudarnos a rechazar a los gnolls Frondacuero.\n\nSin embargo, siguen reuniéndose y usando la hedionda magia de descomposición que extraen de algún sitio situado en lo profundo de la Hondonada Frondacuero. Y lo que es peor, ¡no tenemos noticias de los colmillarr de esa zona desde hace semanas!\n\nMe temo que allí está ocurriendo algo terrible. Debemos proteger nuestro hogar. ¡Por favor, reúne a tus tropas, encuentra a los nuestros y haz lo que puedas con la descomposición!', '', '', '', '', '', '', 47187),
(66210, 'esES', 'Reunir a la familia', 'Recoge $1oa ofrendas funerarias de los alrededores de Iskaara y luego colócalas en el barco funerario.', 'Tu amigo Kalecgos quiere hablar de las líneas Ley, pero debemos realizar los preparativos para el funeral.\n\nMientras me reúno con él, ¿podrías recoger las últimas ofrendas de Iskaara y colocarlas en el barco funerario junto al viejo Ponoliak?\n\n¡Espero que aproveches para disfrutar de la ciudad! Mi pueblo te dará una cálida bienvenida, sobre todo después de tu ayuda en Frondacuero.', '', '', '', '', '', '', 47187),
(66206, 'esES', 'Nozdormu, he venido a negociar', '', '', '', '', '', '', '', '', 47187),
(66201, 'esES', 'Pezuñas de guerra', 'Entrega el mensaje de la khanam Matra al guardián del khan Jebotai, que está en Teerakai.', 'Balakar reunirá a sus tropas para la guerra. Yo haré lo mismo, pero nos superan en número.\n\nLos dragones nos han pedido ayuda, y podemos usar la suya para equilibrar la balanza. Para responder a su llamada, debo soplar el Cuerno de Drusahl, pero necesito la bendición de Ohn\'ahra. ¿Me ayudarás?\n\nVe a Teerakai y entrega mi declaración de guerra a mi teniente Jebotai. Él reunirá a mis tropas y te dirigirá hacia los místicos que pueden encontrar a Ohn\'ahra.', '', '', '', '', '', 'Entrega el mensaje de la khanam Matra al guardián del khan Jebotai, que está en Teerakai.', 47187),
(66196, 'esES', 'Un graznido de ayuda', 'Lleva el patito en burbuja de vuelta al campamento de los ecologistas.', '<Este patito se agita frenéticamente dentro de la burbuja y grazna con miedo>.\n\n<Quizás los ecólogos sepan cómo ayudar>.', '', '', '', '', '', 'Lleva el patito en burbuja de vuelta al campamento de los ecologistas.', 47187),
(66187, 'esES', 'Mordigan el Loco y el rey de cristal', 'Descristaliza a Mordigan Quijahierro en la Orilla Górloc.', 'He explorado el perímetro. Si Mordigan está en algún sitio, es en esta cueva.\n\n<Unas maldiciones e insultos ahogados resuenan en la entrada de la cueva>.\n\nEstá en esta cueva, no hay duda.\n\nLOU-C dijo que estos cristales tienen propiedades de deshidratación muy peligrosas. A ver si puedes separarlo de sus... hallazgos geológicos. Intenta no hacerle demasiado daño.\n\nSe le respeta bastante en su campo.', '', '', '', '', '', 'Habla con Aelnara.', 47187),
(66177, 'esES', 'Hasta el último enano', 'Sigue la senda de Mordigan Quijahierro a lo largo de la Orilla Górloc.', 'Los niveles de sal superan los valores máximos de las gráficas. Tenemos que encontrar a Mordigan y sacarlo de ahí. Ya debe de estar peligrosamente deshidratado.\n\nSe fue hace solo un par de horas. ¡A ver si puedes averiguar qué camino tomó ese viejo enano gruñón!', '', '', '', '', '', 'Encuentra a Aelnara en la Orilla Górloc.', 47187),
(66176, 'esES', 'Experimentación elemental', 'Lleva a cabo $1oa experimentos con elementales en la Orilla Górloc.', 'Ve a realizar experimentos con los elementales de agua que acosan a los górlocs.', '', '', '', '', '', '¡Buen trabajo!', 47187),
(66175, 'esES', 'Experimento de campo', 'Ayuda a LOU-C con sus pruebas en el Rincón del Ballenero.', 'Gracias a ti, nuestra investigación geológica funciona ahora con casi un noventa y seis por ciento de eficiencia. \n\n<LOU-C frunce el ceño>.\n\nSon cifras de novatos.\n\nAyúdame a analizar las muestras que has obtenido con mi geoescáner 289-07. Nos darán una referencia clara para saber qué está pasando exactamente en la meseta.', '', '', '', '', '', 'Habla con LOU-C Fitzcog, que está en el Rincón del Ballenero.', 47187),
(66169, 'esES', 'La venganza se sirve caliente', 'Mata a $1oa primalistas juramagma en la Puerta del Fuerte Sur.', 'Los Primalistas nos pillaron completamente desprevenidos.\n\n<Velomir escupe con indignación>.\n\nEstos monstruos despedazaron a mis compañeros, y yo habría sido el siguiente si no hubieras aparecido.\n\nAún puedo oír a lo lejos los sonidos de la batalla. Es posible que todavía haya otros vivos, incluido el comandante Eranog.\n\nPréstame tu ayuda. Necesito que crees una distracción para que pueda acercarme más.\n\nSi matases a unos cuantos \"juramagma\", como se hacen llamar, sería perfecto.', '', '', '', '', '', '', 47187),
(66167, 'esES', 'Exposición al sur', 'Viaja a la guarnición del Fuerte Sur.', 'Según tus descubrimientos, sospecho que los Primalistas están atacando la guarnición del comandante Eranog en el Fuerte Sur. Mis Juraescama no pueden dejar la ciudad porque eso sería exactamente lo que esperan esos malvados.\n\nNecesito tu ayuda de nuevo, $n.\n\nViaja al Fuerte Sur, averigua a qué tipo de fuerzas nos enfrentamos y, si es posible, ponte en contacto con la guarnición.', '', '', '', '', '', '', 47187),
(66166, 'esES', 'Ojos y orejas', 'Busca pistas por Valdrakken.', 'Los Primalistas han estado difundiendo su asquerosa propaganda entre la ciudadanía de Valdrakken.\n\nPero nuestros enemigos son demasiado astutos como para decir algo en presencia de mis Juraescama; quizás tú puedas acercarte lo suficiente como para espiar sus conversaciones y ver si podemos descubrir algo de valor.\n\nHe señalado ubicaciones en tu mapa para que sigas investigando. \n\nToma esta piedra encantada. Mientras la tengas a mano, podremos comunicarnos.\n\n¿Todo listo para empezar?', '', '', '', '', '', '', 47187),
(66164, 'esES', 'Fingers de pescado', 'Recupera $1oa piezas robadas en la Orilla Górloc.', 'Ahora que Mordigan está lamiendo rocas, podemos llegar al meollo del asunto...\n\n¡Esos malditos peces con patas me han robado las piezas!\n\nNo llevábamos ni una hora en esta pequeña aldea y, ¡BUM!, los górlocs se nos echaron encima. ¡Rowe y Aelnara solo se dedicaron a gritar mientras yo esgrimía mi llave inglesa como una loca! \n\n¡A ver si puedes arreglar todo este embrollo y recuperar algunas de mis piezas!', '', '', '', '', '', '', 47187),
(66163, 'esES', 'No hay donde esconderse', 'Mata a $2oa primalistas infiltrados en Valdrakken.', 'Te doy la bienvenida a Valdrakken, $r. \nEl clima de la ciudad se ha caldeado un poco últimamente, y no me refiero al tiempo atmosférico.\n\nLos Primalistas merodean por aquí, lo que ha azuzado los desencuentros entre los ciudadanos.\n\nNuestros enemigos son astutos. Se disfrazan de ciudadanos para esconderse de los Juraescama. Saben cómo evitar a mis guardias, pero no sospecharán de alguien de fuera.\n\nToma esta gema de ojo de dragón. Con ella podrás verlos a pesar de sus disfraces.\n\nVe, ¡averigua quiénes son los infiltrados y mátalos!', '', '', '', '', '', '', 47187),
(66159, 'esES', 'Un mensaje peliagudo', 'Habla con Alexstrasza en el Trono de los Aspectos, que está en Valdrakken.', 'Kalecgos no quería contarnos lo que ocurrió en las Tierras Azures hasta que llegaras.\n\nNo sé de qué se trata, pero tengo un terrible presentimiento sobre ello, $n.', '', '', '', '', '', '', 47187),
(66156, 'esES', 'Renombrado con la Expedición Dragontina', 'Habla con la catalogadora Jakes en el Campamento Base Dragontina.', 'Tus hazañas no han pasado desapercibidas, ¡y sigues demostrando que eres $gun expedicionario:una expedicionaria; de renombre!\n\nVuelve al Campamento Base Dragontina. He preparado suministros que te ayudarán en tus aventuras.', '', '', '', '', '', '', 47187),
(66155, 'esES', 'La carrera en los rápidos del río de Ruriq', 'Navega río abajo con el Zancalejana.', 'No esperaba la aprobación de mi hermano..., pero la agradezco, claro. \n\n¡Ha llegado la hora de ver si nuestro arduo trabajo ha valido la pena!\n\n¡Monta conmigo en el Zancalejana, $n, y pesquemos para Iskaara mientras navegamos por el río!', '', '', '', '', '', '', 47187),
(66154, 'esES', 'Muestras de saliva', 'Recoge $1oa muestras de saliva en la Orilla Górloc.', '<El no-muerto se pelliza el puente de la nariz y suspira fuertemente>.\n\nEsto va a ser una mancha muy gorda en mi historial. De alguna manera, en un solo día hemos conseguido agitar a los górlocs locales y perder la mitad de nuestro equipo, y ahora, encima, nos falta un enano.\n\nEn esta situación, el protocolo dicta que seamos tan eficientes como sea posible. Acaba con algunos de nuestros enemigos y tráeme su saliva para realizar más pruebas.\n\nPero solo la saliva buena, claro.', '', '', '', '', '', '', 47187),
(66152, 'esES', 'Sin sitio al que ir', 'Reúnete con Garz en el Campamento Desubicado.', 'No podemos quedarnos aquí.\n\nNo sé qué hacer ni adónde ir...\n\nVolveremos al Campamento Desubicado. Los colmillarr deben saber lo ocurrido en Pinoherrumbre.\n\nSi continuamos contando nuestra historia, quizás no vuelva a suceder...', '', '', '', '', '', '', 47187),
(66151, 'esES', 'Su corazón de piedra', 'Mata a Corazón pétreo.', 'Gritamos de dolor por nuestro jefe, pero aún vive.\n\nLo que queda de Corazón Pétreo está en aquella cueva. Muchos han intentado razonar con él.\n\nLos ha matado. Y casi mata a Narn.\n\n¡Es un monstruo! Este es el objetivo de los Primalistas: convertirnos en piedra y llamas para ser sus sirvientes.\n\nNo queda nada de Pinoherrumbre en él. Debemos destruirlo antes de que otros corran la misma suerte.', '', 'El regalo de los Primalistas transformó el cuerpo del jefe Pinoherrumbre en piedra endurecida.', 'Corazón pétreo', '', '', '', 47187),
(66150, 'esES', 'Rescatar a Radza', 'Rescata a Radza Garratrueno.', 'Radza Garratrueno es nuestra guardiana espiritual. Conserva puras nuestra tradición y nuestra historia.\n\nLas creencias de los Primalistas van en contra de todo lo que nuestro clan defiende. ¡Sabía que desafiaría a Corazón Pétreo!\n\nCorazón Pétreo hará lo que sea para doblegarla. ¡Nadie puede llegar a ser jefe sin la bendición de Radza!\n\nNarn dice que Khargall Cinco Colmillos, guardia del jefe, está intentando someterla. Si Radza muere, nuestro clan morirá con ella.\n\nVe a ayudarla, $n, y prepárate. No la dejará marchar sin luchar.', '', '', '', '', '', 'Reúnete con Radza Garratrueno en la Guarida Pinoherrumbre.', 47187),
(66149, 'esES', 'Influencia elemental', 'Destruye $1oa tótems Nexo Terrestre de primalista y luego reúnete con Narn en la Guarida Pinoherrumbre.', 'Narn dice que no todos los miembros del clan Pinoherrumbre siguieron a Corazón Pétreo o a los Primalistas.\n\nLos que se han resistido son ahora sus prisioneros. Unos tótems que escupen roca y barro los retienen... para obligarlos a obedecer. \n\nDestruye los tótems. ¡Libéralos!', '', '', '', '', '', 'Reúnete con Narn en la Guarida Pinoherrumbre.', 47187),
(66148, 'esES', 'Antigua familia fúrbolg', 'Mata a $1oa elementales y fúrbolgs Pinoherrumbre, y luego reúnete con Narn en la Guarida Pinoherrumbre.', 'Vinieron los Primalistas. Nos ofrecieron un poder nuevo... El dominio de los elementos.\n\nNo pensé que Corazón Pétreo aceptaría sus dones. Nuestro clan no necesitaba poder. No consideró el precio a pagar.\n\nEsa terrible decisión no se puede deshacer. La magia ha corrompido a mi clan como la enfermedad pudre una raíz.\n\nMe parte el corazón, pero la única opción es acabar con los corruptos.', '', '', '', '', '', 'Reúnete con Narn en la Guarida Pinoherrumbre.', 47187),
(66147, 'esES', 'Cristales en el agua', 'Recoge $1oa muestras de cristal en la Orilla Górloc.', 'Puede que no lo parezca, pero somos profesionales. La expedición nos encomendó la búsqueda de unos extraños cristales por esta zona..., un estudio geológico, por así decirlo.\n\nTodavía me estoy recuperando del ataque de los górlocs. ¿Serías tan amable de ir a buscar esos cristales? Trae unas muestras, si puedes.', '', '', '', '', '', '', 47187),
(66141, 'esES', 'Tradiciones y cuerpos quebrados', 'Reúnete con Garz y Narn en el camino a la Guarida Pinoherrumbre.', 'Mis compañeros fúrbolgs ya no son ellos mismos. Han hecho cosas... malas. Y ahora se han convertido en cosas peores.\n\n¡Los fúrbolgs nunca se han enfrentado entre sí!\n\nMi hermano y yo escapamos. Vine aquí en busca de ayuda. Él sigue junto a la guarida de nuestro clan.\n\n¡Ayúdanos antes de que perdamos a nuestro clan!', '', '', '', '', '', '', 47187),
(66139, 'esES', 'Al fin una llama', 'Usa la esencia de agua concentrada para derrotar al inferno llameante en los Jardines.', 'Toma, joven, he colocado todas las esencias elementales de agua en este tarro.\n\nSi se lo lanzas al grande, debería funcionar. O sea, ¿cuándo no ha vencido el agua al fuego? Es un plan infalible.\n\nEl calor, eh... no es bueno para mis articulaciones, así que yo me quedaré aquí. Confío en que puedas hacerlo.\n \n¡Buena suerte, joven!', '', '', '', '', '', '', 47187),
(66138, 'esES', 'Como arena en un reloj', 'Recoge $1oa montones de arena del tiempo arrastrada por el viento en los Jardines.', 'Como el resto de los jardines, el reloj de arena de Nozdormu ha tenido que soportar la agitación elemental. Han aparecido unos elementales de viento turbulentos y han desperdigado la arena mágica del reloj.\n\nSin esta, la influencia de Nozdormu se reduce enormemente.\n\nComo administrador, tengo encargado supervisar el reloj de arena en todo momento. Si pudieras recoger la arena por mí, te estaría eternamente agradecido.', '', '', '', '', '', '', 47187),
(66137, 'esES', 'Un buen azote', 'Mata a $1oa muertenflor invasivas y esquejes azotadores en los Jardines.', 'Estoy seguro de que los vainetes no son los únicos seres que se comportan como gamberros.\n\nEl árbol de Alexstrasza siempre ha sido una gran molestia. Su magia vital atrae todo tipo de plantas y animales, buenos y malos. ¿Y adivina quién tiene que encargarse de los malos? El viejo Gryrmpech, ni más ni menos.\n\nPor los Aspectos, estoy demasiado mayor para esto.\n\nLos administradores no están entrenados en combate, así que te toca resolver el problema con las malas hierbas de la Protectora.', '', '', '', '', '', '', 47187),
(66136, 'esES', 'Extracto de elemental', 'Recoge $1a de esencia acuática de los Jardines.', 'Un gran elemental de fuego destruyó el estanque hace unos días. Creo que es el responsable de todo este alboroto, pero es demasiado grande como para luchar contra él. Tenemos que debilitarlo de alguna forma.\n\nNo descartéis aún al viejo Gryrmpech, porque tiene un plan.\n\nUnos elementales de agua decidieron instalarse en el pabellón del Vuelo Azul. Quizás podamos usar su magia contra ellos si consigues reunir esencia suficiente.\n\nSe dice que hay que combatir el fuego con el fuego, ¿no? Pues en este caso vamos a combatir el agua...\n\nEn fin, deberías ponerte en marcha.', '', '', '', '', '', '', 47187),
(66135, 'esES', 'El aprendiz de jardinero', 'Busca a Lord Albahácaton en el cobertizo del jardín limpiando los montones de basura.', '¡Albahácaton! ¿Dónde estás, lord Albahácaton?\n\nMi ayudante ejecutivo y aprendiz, lord Albahácaton, ha desaparecido. Le encanta explorar, aunque lo de defenderse se le da peor que a mí. Soy jardinero, no guerrero.\n\n¿Podrías buscar a ese holgazán? Necesito que esté aquí para poder pensar. Suele estar en el cobertizo, hurgando entre montones de basura.\n\nTen cuidado, puede ser una tarea... espinosa.', '', '', '', '', '', '', 47187),
(66134, 'esES', 'Control de plagas de Azeroth', 'Mata a $1oa esquejes perturbados en los Jardines.', '¡Tú! ¡Retoño!\n\nÉchame una mano, ¿quieres? Estos vainetes me están destrozando las plantas.\n\nLos jardines han sido invadidos por todo tipo de elementales, y parece que eso... está afectando a la fauna. Es como si su energía hubiese vuelto locos a esos pacíficos vainetes. ¡Más que de costumbre!\n\nNo doy abasto con estos tres. Ayúdame antes de que arranquen todos mis lechos de flores.', '', '', '', '', '', '', 47187),
(66133, 'esES', 'Llaves de lealtad', 'Recoge $1oa llave obsidiana superior.', '', '', '', '', '', '', 'Entrega la llave reconstruida en la Ciudadela Obsidiana.', 47187),
(66131, 'esES', 'Desbloquear nuestro pasado', 'Consigue $1oa llave reconstruida.', 'Tráeme una llave reconstruida.', '', '', '', '', '', 'Entrega la llave reconstruida a cualquier facción que haya en la Ciudadela del Dragón Negro.', 47187),
(66130, 'esES', 'Desbloquear nuestro pasado', 'Consigue $1oa llave reconstruida.', 'Tráeme una llave reconstruida.', '', '', '', '', '', 'Entrega la llave reconstruida a cualquier facción que haya en la Ciudadela del Dragón Negro.', 47187),
(66129, 'esES', 'Desbloquear nuestro pasado', 'Consigue $1oa llave reconstruida.', 'Tráeme una llave reconstruida.', '', '', '', '', '', 'Entrega la llave reconstruida a cualquier facción que haya en la Ciudadela Obsidiana.', 47187),
(66126, 'esES', 'Desbloquear nuestro pasado', 'Consigue $1oa llave reconstruida.', 'Tráeme una llave reconstruida.', '', '', '', '', '', 'Entrega la llave reconstruida a cualquier facción que haya en la Ciudadela Obsidiana.', 47187),
(66124, 'esES', 'Salida triunfal', 'Escapa del Enclave Raudoescarcha con la mayordoma Selistra.', 'Por lo que vi, la reina se retiró al Criadero Salvaje. Es una avanzada que sirve para vigilar a los protodracos de la zona... Espero que sus defensas sean suficientes.\n\n¡Debemos acudir allí de inmediato!', '', '', '', '', '', '', 47187),
(66123, 'esES', 'Que le corten la cabeza', 'Derrota a Jadzigeth en el Enclave Raudoescarcha.', 'Jadzigeth, uno de los infames tenientes de Raszageth, guía con orgullo a los Primalistas hasta aquí.\n\nEnseñémosles lo que les pasa a quienes se enfrentan a nosotros.', '', 'La teniente de Raszageth traerá consigo un aluvión de problemas si nadie la detiene.', 'Jadzigeth', '', '', '', 47187),
(66122, 'esES', 'Protolucha', 'Derrota a $2oa protodragones en el Enclave Raudoescarcha.', 'Los protodragones nos aborrecen. Creen que somos una versión retorcida de los dragónicos, meras marionetas y esclavos de los titanes. No lo entienden.\n\nPor eso se sienten a salvo mientras lanzan sus fuerzas contra nuestros muros.\n\nSe equivocan.\n\nToma esta lanza, $p. Acaba con nuestros enemigos.', '', '', '', '', '', 'Reúnete con la mayordoma Selistra en el Enclave Raudoescarcha.', 47187),
(66121, 'esES', 'Evacuación de los huevos', 'Rescata 4 huevos del Enclave Raudoescarcha.', '¡Los Primalistas nos han robado los huevos para sus perversos rituales! Hay que detenerlos.\n\nAyúdanos a recuperarlos antes de que sea demasiado tarde. Marca cada huevo conforme los vayas encontrando, $p. Me aseguraré de sacarlos de la zona sin peligro.', '', '', '', '', '', 'Reúnete con la mayordoma Selistra en el Enclave Raudoescarcha.', 47187),
(66119, 'esES', 'Estanques de Vida Rubí: invasión primalista', 'Accede a los Estanques de Vida Rubí y detén el ataque de los Primalistas.', 'Los Primalistas se han abierto paso hasta nuestro hogar. No estábamos preparados para un ataque tan feroz..., así que algunos de ellos lograron atravesar nuestras defensas.\n\nUno de nuestros dracónidos se adelantó para seguirlos, pero aún no hemos tenido noticias suyas. Me temo lo peor.\n\nEstaré alerta. No permitiremos que crucen nuestros muros más enemigos, pero debes detener a quienes ya lo han conseguido.\n\n¡Vamos!', '', '', '', '', '', '', 47187),
(66118, 'esES', 'Asalto de basalto', 'Destruye $1oa acantilados enfurecidos en el Asalto Raudoescarcha.', 'Raszageth y los Primalistas han invocado unos enormes elementales de tierra para derribar las murallas. ¡Debemos detenerlos!', '', '', '', '', '', '', 47187),
(66117, 'esES', 'Despejar el campo de batalla', '', '', '', '', '', '', '', '', 47187),
(66116, 'esES', 'La amenaza principal', 'Encuentra al comandante Lethanak en el Asalto Raudoescarcha.', 'Hay demasiados huevos vulnerables que proteger. ¡Lo perderemos todo si logran abrirse paso!\n\nSeguro que nuestros guardias se están reuniendo en el campo de batalla para hacerlos retroceder. Habla con el comandante Lethanak para que pueda dirigir tu fuerza allá donde sea más necesaria.', '', '', '', '', '', '', 47187),
(66115, 'esES', 'El mandato del Rojo', 'Habla con los cuidadores del Vitasagrario Rubí.', 'Nuestra vocación es el cuidado y la compasión. Ayudamos a los otros Vuelos no solo por su propio bien, sino por el de todos los dragónicos.\n\nTal vez lo entenderías mejor si hablaras con los dragauros del Vitasagrario Rubí.', '', '', '', '', '', '', 47187),
(66114, 'esES', 'Por el beneficio de la reina', 'Monta con la mayordoma Selistra hasta el Vitasagrario Rubí.', 'Protegemos nuestros valiosos huevos para salvaguardar el futuro de todos los Vuelos. Los Primalistas no solo quieren provocarnos dolor o angustia con sus actos.\n\nNos amenazan con la extinción misma.\n\nDebo informar a nuestra reina de inmediato.', '', '', '', '', '', '', 47187),
(66113, 'esES', 'Un transporte discreto', 'Repara el carro prestado.', '[DNT] Our foes watch the skies. I will risk no harm to the future of my flight, so we must travel by less traditional mean.\n\nI ordered a more... down to earth means of transport be acquired, but it seems to have suffered some damage during the exchange. You are undoubtedly more familiar with such things than I, $r, so your assistance in repairing the wagon would be most appreciated.', '', '', '', '', '', '', 47187),
(66112, 'esES', 'No hay que parar de fabricar', 'Consigue un núcleo terráneo primigenio y un núcleo de magma primigenio.', '¡¿Alguna vez habías visto unos elementales tan poderosos?!\n\n<Grun vitorea>.\n\nNo dejo de oír las quejas de los guardias por tener que enfrentarse a ellos constantemente, pero carecen de perspectiva... ¡De los elementales más grandes se sacan los mejores componentes de fabricación!\n\nMientras estás por ahí acabando con los elementales por nuestra seguridad y esas cosas, procura recoger los restos de los más grandes que encuentres para que pueda fabricar algo con ellos.', '', '', '', '', '', '', 47187),
(66111, 'esES', 'Elementales invasores', 'Mata a $1oa elementales primigenios en la Embajada Reposo Alado.', 'Los forjadores, artesanos y exploradores de la Expedición Dragontina no son aptos para el fragor de la batalla.\n\nTú y yo sí, $p.\n\nUsemos esa fuerza en las Islas Dragón para proteger a aquellos que no pueden protegerse por sí mismos.\n\nElimina a los elementales que se aproximan desde el norte para que la expedición pueda centrarse en sus nobles quehaceres.', '', '', '', '', '', '', 47187),
(66110, 'esES', 'Una oportunidad para la paz', 'Preséntate a los representantes de la Alianza.', 'Aka\'Magosh, $p.\n\nEsta expedición está bajo la protección de la Horda y la Alianza. Nuestras instrucciones son claras: dar apoyo a cualquier miembro de la Expedición Dragontina, independientemente de sus otras lealtades.\n\nLos representantes de la Alianza, la capitana Garrick y su hijo, hacen guardia al otro lado del campamento.\n\nLuché con la capitana Garrick contra la Plaga. Es honorable y servirá bien a esta expedición.\n\nOfrécele tu ayuda. Demuéstrale que la Horda honra sus acuerdos.', '', '', '', '', '', 'Habla con la capitana Garrick, que está en la Embajada Reposo Alado.', 47187),
(66108, 'esES', 'Una solución machacante', 'Mata a Charcolmoggl, rey de los Faucecharco, y a Torbelliglgurgl, rey de los Aletaviento.', 'Aunque me alegro de que Tharu vea mi punto de vista, también agradezco que te haya puesto a rescatar a la fauna mientras yo perdía el tiempo.\n\nLa situación es mucho más grave de lo esperado. Hizo bien en actuar. Con lo que hemos aprendido, temo que este bombardeo elemental no se detendrá hasta que nos hayamos ocupado de los górlocs.\n\nSi yo fuera Tharu y pensara en actuar, iría directamente a por sus líderes. Sin nadie que los lidere, la lucha se disipará y dejarán de ser una amenaza para los Humedales.', '', '', '', '', '', '', 47187),
(66107, 'esES', 'Rescate de la fauna', 'Rescata a la fauna de los Humedales Inquietos.', 'No hace falta ser ecologista para ver que los Humedales están en verdaderos problemas.\n\nPero Iskha nos tiene atrapados aquí, examinando criaturas muertas, ¡cuando lo que deberíamos hacer es evitar que mueran! ¡A eso se dedica el Vuelo Rojo, a preservar la vida, no a diseccionarla!\n\nMe encanta Iskha, y es bueno en lo que hace, pero si esperamos hasta que haya terminado de perder el tiempo, no quedarán Humedales que salvar.\n\nYo me encargaré de convencerlo, tú sal ahí fuera y rescata a la fauna.', '', '', '', '', '', '', 47187),
(66106, 'esES', 'No te enconches', 'Recoge $1oa caparazones imbuidos de agua y $1oa caparazones imbuidos de viento entre los górlocs Faucecharco y Aletaviento.', 'Fui un tonto al dudar de Iskha cuando insistió en que había algo más. No sería mi compañero si no estuviera siempre dos pasos por delante de mí.\n\nPodemos compensarlo... pasando a la acción, claro. Si los caparazones son los que están causando todo este caos elemental, ¿por qué no te adentras en su campamento y se los arrebatas de sus viscosas manos?\n\nTrae unos cuantos caparazones de viento y agua, los suficientes para que Iskha investigue a su gusto.', '', '', '', '', '', '', 47187),
(66105, 'esES', 'Una solución cortante', 'Mata a $1oa aguas desenfrenadas y a $1oa vientos desenfrenados.', 'Creo que desde aquí reunimos datos suficientes con seguridad, pero...\n\nTharu es un ecologista excepcional y es de los que prefieren actuar. Aun así, el ecosistema es frágil y podemos dañarlo si no tenemos cuidado. Estoy de acuerdo en que no tenemos mucho tiempo.\n\nNo obstante, quizá merezca la pena hacerle caso. Un poco.\n\nAcabar con los elementales desenfrenados nos debería dar algo de tiempo sin que ello entorpezca nuestra investigación. Procura reducir sus efectivos por igual; no queremos provocar más desequilibrios.', '', '', '', '', '', '', 47187),
(66104, 'esES', 'Ecología forense', 'Disecciona los cadáveres de los górlocs.', 'Estoy desesperado, $n. Tharu y yo hemos inspeccionado casi todos los cadáveres, pero, al final, no terminamos de ponernos de acuerdo con la metodología. ¡Ojalá le diera la gana de hacerme caso!\n\n<El ecologista Iskha suspira>.\n\nEl estrés de esta situación nos está afectando. Ni siquiera tengo una hipótesis clara.\n\nTienes pinta de tener buen estómago. ¿Te encargas de los dos últimos górlocs? Puedes usar mi escalpelo.', '', '', '', '', '', '', 47187),
(66103, 'esES', 'Deseos de agradar', 'Pon a prueba las habilidades de $1oa asesinos y vengadores Garranegra en el Baluarte Obsidiana.', 'Necesitamos más tropas para defender la Ciudadela Obsidiana. Ahora que tenemos una posición, es importante asegurarnos de tener ojos frescos y fuerzas renovadas.\n\nTenemos más tropas de reserva en el Baluarte Obsidiana que podrían ayudarnos.\n\nEstán bien entrenadas, pero se les vendría bien una práctica de combate con alguien con tanta habilidad y experiencia como tú. Así sabremos que están listas.', '', '', '', '', '', 'Reúnete con Fao el Implacable, que está en el Baluarte Obsidiana.', 47187),
(66101, 'esES', 'Desde tan altas alturas', 'Usa el disco de perito para saltar al cielo y explorar la zona.', 'Toddy y Naleidea han solicitado un informe de reconocimiento inmediato de los alrededores.\n\nPor suerte, he conseguido un telescopio encantado y un disco de perito que nos ayudarán a explorar las zonas cercanas con seguridad desde las nubes.\n\nLo malo es que tengo un miedo atroz a las alturas y no puedo ni tocar el artilugio.\n\nTú vértigo no tienes, ¿verdad?', '', '', '', '', '', '', 47187),
(66100, 'esES', 'Suministros en peso', 'Recoge $1oa bolsas de suministros de oteador.', 'Esta vez he metido la pata hasta el fondo. Me alejé del campamento un momento y, al volver, pillé a los tarasek robando todo lo que quedaba intacto.\n\n¡Esos suministros son caros y me es imposible pedir más! Mi hermana Nori cree ya me tiene por una inepta.\n\nSi de verdad quieres adentrarte en el valle, ¿te importaría estar al tanto por si ves las bolsas de suministros?', '', '', '', '', '', '', 47187),
(66087, 'esES', 'Hora de cerrar', 'Ayuda a los Caminantes del Tiempo matando enemigos perdidos en el tiempo, potenciando a vuestros aliados bronce, devolviendo artefactos perdidos y cerrando fallas temporales en el Mar de Dunas.', 'Estas incursiones ponen a prueba la resistencia de esta línea temporal hasta el punto casi de romperla. ¡Ojalá pudiera contar con todo un contingente de Caminantes del Tiempo!\n\nAunque acabas de aprender a usar el bastón, tengo entendido que ya te las has apañado para ayudarnos mucho. Si te doy un empujoncito, seguro que podrías hacer aún más por nosotros.\n\nEn condiciones normales, te sometería a un entrenamiento completo, pero los tiempos son... poco convencionales. ¡Llévate este pergamino de conocimiento avanzado y úsalo para repeler a los invasores! Los efectos son temporales, así que date prisa.', '', '', '', '', '', '', 47187),
(66085, 'esES', 'Si pudiéramos retroceder en el tiempo', 'Cierra las fallas temporales en el Mar de Dunas con Siaszerathel.', 'Un verdadero Caminante del Tiempo nunca deja una crisis sin resolver. ¿Por qué esperar y estudiar cuando ya tenemos las herramientas que necesitamos?\n\nComo tienes mi bastón original, yo he conseguido otro de repuesto. Seguro que nadie lo echará en falta. Te cuento el plan: unimos nuestras fuerzas y solucionamos lo de esas fallas. Todo el tema temporal aún me confunde un poco.\n\n¿Qué me dices? No puede ser muy difícil, ¿verdad?', '', '', '', '', '', '', 47187),
(66084, 'esES', 'Tiempos como estos', 'Recoge $1oa de residuo temporal de enemigos perdidos en el tiempo en el Mar de Dunas.', 'A pesar del pequeño contratiempo del entrenamiento, creo que estás $gpreparado:preparada; para ayudarnos.\n\nLas distorsiones del valle están permitiendo que se crucen varios períodos temporales con el nuestro. No sabemos cómo están conectados y eso nos preocupa. Necesitamos más información.\n\nTrata de averiguar más cosas sobre las criaturas que salen de las distintas líneas temporales. Seguro que su paso ha dejado algún tipo de residuo. Si los estudiamos, es posible que encontremos el modo de anticiparnos a esta crisis.', '', '', '', '', '', '', 47187),
(66083, 'esES', 'Como si fuera la primera vez', 'Habla con Andantenormu y participa en el entrenamiento de los Caminantes del Tiempo.', 'Guiar las líneas temporales es una tarea peligrosa.\n\nAunque no eres $gun:una; Caminante del Tiempo, la embajadora Chronormu cree que serás de gran ayuda. No obstante, para garantizar tu seguridad debemos entrenarte como es debido.\n\nPor desgracia, todos nuestros instructores siguen desaparecidos. Haré lo que pueda para ayudar. A ver cómo se nos da. Sé que la embajadora Chronormu cuenta con nosotros.', '', '', '', '', '', '', 47187),
(66082, 'esES', 'Tiempo embotellado', 'Recoge energía temporal de la fauna caída cargada de tiempo que hay en el Bosque Fluyente de Thaldraszus.', '¡Genial! ¡El bastón de Caminante del Tiempo está intacto! Pero no tiene energía.\n\n¡Ya sé! Podrías recargarlo usando la energía temporal que se acumula entre la fauna local. Por desgracia, eso implica que debes destruir a las criaturas afectadas en el bosque. Las energías las vuelven peligrosas e inestables y habríamos tenido que acabar con ellas de todos modos...\n\nA veces, hay que realizar sacrificios por un bien mayor. ¿Puedes ayudarnos? Sigo necesitando descansar.', '', '', '', '', '', '', 47187),
(66081, 'esES', 'Se acaba el tiempo', 'Recoge $1oa recolectores temporales en el Bosque Fluyente de Thaldraszus.', 'Ahora que el Templo Bronce está bajo ataque, la energía temporal se está filtrando por todas partes.\n\nLos Caminantes del Tiempo han colocado recolectores por todo el bosque para tratar de reunir toda la magia errante. ¡Todo lo que se recupere se puede usar como poder extra! Nos hace mucha falta porque esta crisis nos está dejando sin recursos.\n\nYo debía encargarme de recuperar los recolectores, pero necesito un respiro.\n\n¿Podrías ir tú a por ellos?', '', '', '', '', '', '', 47187),
(66080, 'esES', 'Problemas temporales', 'Encuentra a la recluta desaparecida en el Bosque Fluyente, que está en Thaldraszus.', 'Hola, $c. ¡Llegas justo a tiempo!\n\nHay algunos problemas en el templo que están desestabilizando las líneas temporales y provocando que se dispersen por el valle. Y eso no es todo, porque han desaparecido varios Caminantes del Tiempo.\n\nHemos pedido más ayuda, pero una de las nuevas reclutas sigue sin aparecer.\n\n¿Puedes ir a buscarla? Eso sí, ten cuidado. Dado el estado fluctuante del tiempo en el valle, ¡nunca se sabe qué peligros puede haber!', '', '', '', '', '', '', 47187),
(66079, 'esES', 'Wrathion espera', 'Reúnete con Wrathion, que está en el Baluarte Obsidiana.', 'Estos huevos representan una nueva generación de dragonantes. Hay que protegerlos protegerse y deben disponer de un hogar. No obstante..., mi preocupación por Wrathion hace que se me parta el corazón. Temo que su cabezonería lo lleve a la locura. \n\nMe has sido leal a lo largo de los años, $n. Quizá puedas ir a ayudarlo en mi nombre. \n\nBúscalo en el Baluarte Obsidiana. Por favor, cuida de él. Quedan muy pocos en su Vuelo.', '', '', '', '', '', 'Reúnete con Wrathion, que está en el Baluarte Obsidiana.', 47187),
(66078, 'esES', 'Práctica afilada', 'Pon a prueba las habilidades de $1oa asesinos y vengadores Garranegra.', 'Durante años, he cuidado de los Garranegra enseñándoles y animándoles a alcanzar las mismas cotas que has conseguido tú.\n\nPuede que no hayan logrado los mismos propósitos elevados, pero han cumplido sus propias expectativas. Estoy orgulloso de ellos.\n\nSería un honor que pusieras a prueba sus habilidades. Creo que verás algo de ti reflejado en ellos.', '', '', '', '', '', '', 47187),
(66076, 'esES', 'Cornisapo anciano', '', '', '', '', '', '', '', '', 47187),
(66074, 'esES', 'La reina guadáñido primigenia', '', '', '', '', '', '', '', '', 47187),
(66071, 'esES', 'Rocs voladores', 'Ayuda a $1oa rocs plumazul heridos.', 'Soy la profesora Harleen Chirridos, eminente ornitóloga. He venido a estudiar a los míticos rocs plumazul de las Islas Dragón, pero supongo que tenemos cosas más importantes entre manos.\n\nCreo que estas arpías volaron desde Kalimdor cuando las islas se despertaron. Son bastante invasivas, y están arrasando con todo como una manada de ogros en el bufé del Casino Pantoque.\n\nDemos a los rocs una oportunidad para defenderse. Toma este botiquín y ayuda a los que estén heridos a recuperarse.', '', '', '', '', '', '', 47187),
(66070, 'esES', 'Los huesos de Hoja Brillante', '', '', '', '', '', '', '', '', 47187),
(66057, 'esES', 'Restaurar la fe', 'Repara la piedra de juramento obsidiana.', 'Los fragmentos destrozados se han vuelto a formar. Estamos listos para reparar la piedra de juramento.\n\nVe y ayuda a Wrathion a acabar de repararla.', '', '', '', '', '', 'Reúnete con Wrathion en el Trono Obsidiana.', 47187),
(66056, 'esES', 'Forjar un nuevo futuro', 'Prepara la forja del Guardián de la Tierra.', 'La forja del Guardián de la Tierra es la más poderosa de todas las forjas de los dragones que existen. Nuestros antepasados la usaron para forjar las armas y armaduras más poderosas posibles para defender Azeroth.\n\nEn lo más profundo de ella se halla el poder necesario para volver a formar los fragmentos destrozados de la piedra de juramento.\n\nPongámonos en marcha y preparemos la forja para todo el trabajo que queda por hacer.', '', '', '', '', '', 'Entrega el carbón de fragmento cenizo al maestro de forja Bazentus.', 47187),
(66055, 'esES', 'Un pasado destrozado', 'Recupera $2oa fragmentos de piedra de juramento.', 'La piedra de juramento está dañada. Le faltan piezas.\n\nHaz lo que puedas para recuperar los fragmentos. ¡Puede que haya un modo de reparar la piedra!', '', '', '', '', '', '', 47187),
(66049, 'esES', 'Piedra de juramento obsidiana', 'Encuentra la piedra de juramento obsidiana.', 'Cuando Neltharion se convirtió en el Guardián de la Tierra, juró proteger este mundo, $n. Juró proteger las profundidades de la tierra y defender Azeroth junto a su Vuelo. La piedra de juramento obsidiana representa esa promesa. \n\nDebemos activar la piedra y dejar que las Islas Dragón sepan que el Vuelo Negro ha regresado.\n\nSígueme, $n.', '', '', '', '', '', '', 47187),
(66048, 'esES', 'Los mejores planes e intenciones', 'Revisa los planes con los distintos miembros de las fuerzas de Wrathion.', 'No será fácil atacar a los djaradin que controlan la Ciudadela Obsidiana. Incluso con Wrathion y sus fuerzas Garranegra, será una batalla encarnizada. Puede que Wrathion esté convencido, pero yo no lo tengo tan claro.\n\nTal vez podamos hablar con quienes elaboran la estrategia y ver si se puede mejorar algo.', '', '', '', '', '', 'Informa de tus descubrimientos a Wrathion, que está en el Baluarte Obsidiana.', 47187),
(66044, 'esES', 'Tomar las murallas', 'Elimina las tres arbalestas de asedio y al campeón Choruk.', 'Sabellian y los demás dragones están frenando a los Djaradin por ahora. Debemos actuar con rapidez para asegurar las torres altas y nuestra victoria.\n\nTú y yo eliminaremos las arbalestas de asedio que nos amenazan desde arriba.\n\nAvísame cuando lo tengas todo listo.', '', '', '', '', '', 'Reúnete con Wrathion', 47187),
(66040, 'esES', 'Regreso al futuro', 'Defiende a tus aliados contra el Imperio Negro hasta que se haya creado el portal temporal.', 'Ya no seguiremos cayendo a través del tiempo, pero nos hemos adentrado demasiado en el pasado. Un pasado muuuy lejano. Pero lejano en plan \"los titanes aún no han visitado Azeroth\". Volver a casa será... complicado.\n\nPero la especie de los dragones puede con esto y más. \n\nEso sí, vamos a necesitar que contengas a esos esbirros del Imperio Negro. No nos llevará mucho tiempo. \n\nCreo.\n\nEspero.\n\nNo te preocupes. Tú mantén alejados a esos monstruos y nos ocuparemos del resto. ¡Es pan comido!', '', '', '', '', '', '', 47187),
(66039, 'esES', 'Tiempo de Cromi', 'Encuentra a Cromi y completa el ritual de estabilización temporal.', 'Esto... es el Imperio Negro. Hemos viajado muy atrás en el tiempo, sin duda.\n\n¡Mira! Veo a la embajadora Chronormu y a Eternus. Tenemos que darnos prisa y completar el ritual. \n\nNo tengo tanta curiosidad por saber cuál puede ser su siguiente destino.', '', '', '', '', '', '', 47187),
(66038, 'esES', '¡Una carrera a través del tiempo!', 'Participa en una carrera a través del tiempo tras los pasos de Cromi y Eternus.', '$n, debemos actuar rápido para alcanzar a la embajadora Chronormu, y me refiero a ser rápidos literalmente.\n\nZera y yo haremos lo que podamos para acelerar nuestro progreso, pero es fundamental que evitemos enredarnos en este tiempo todo lo posible. Eso nos ralentizaría y quizá nos impediría atrapar a la embajadora antes de que se pierda y no pueda alcanzarla ni la magia de Nozdormu.\n\nNo hay tiempo que perder.\n\n|cFF0000FF(Si aceptas esta misión, se iniciará un temporizador)|r', '', '', '', '', '', '', 47187),
(66037, 'esES', 'De vuelta a la realidad', 'Vuelve con Nozdormu al presente.', 'Hemos podido aumentar la conexión de la embajadora Chronormu con nuestro tiempo. Estoy seguro de que, cuando la encontremos, podremos terminar el ritual.\n\nPor ahora, volvamos a nuestro presente y a un mundo con... muchos menos múrlocs.', '', '', '', '', '', '', 47187),
(66036, 'esES', '¡Mugurlglrlgl!', '¡Murglgulglrrglgul!', '¡Mrglgulglrrlglgul! ¡Grurguglullgurl!\n\nGruglrlgllrugl rrgulgrulgrgl grugll gurgull gur. Murgllgllrugl gurgllglrl Murgul gruggullgl. Murguglegurgllgur gurgll gurgulgul guruulgurllgr guuglrllgl.\n\nMgrgulllglll gurl gugll.\n\n<No tienes claro lo que está diciendo, pero apuñala el aire repetidas veces. Parece que el múrloc quiere que mates algo>.', '', '', '', '', '', '', 47187),
(66035, 'esES', 'Motas múrloc', 'Drena $1oa motas temporales.', '¡¿Una línea temporal alternativa nacida de los múrlocs?!\n\nPerdón por mi egoísmo, pero ¿podrías conseguirme unas motas de energía temporal mientras localizas a Chronormu?\n\nSolo tienes que acercarte a ellas y el bastón hará el resto. Examinaré los datos más tarde, cuando no estemos en pleno viaje entre las diferentes realidades de Azeroth.', '', '', '', '', '', '', 47187),
(66033, 'esES', '¿Al... pasado?', 'Usa el portal y reúnete con Andantenormu, que está en Azmerloth.', 'Es lamentable que no pudiéramos estabilizar a Chronormu, pero hay otro posible lugar en el que podríamos atraparla y terminar con su caída en el tiempo.\n\n<Nozdormu frunce el ceño>.\n\nLas visiones de esta línea temporal son... extrañas. Incluso comparadas con algunas con las que me he encontrado en mi vida.\n\nNo bajes la guardia, $n. No tengo claro a qué te vas a enfrentar, pero sí sé que es algo poderoso y extrañamente familiar.', '', '', '', '', '', 'Usa el portal y reúnete con Andantenormu, que está en Azmerloth.', 47187),
(66032, 'esES', 'Regreso al presente', 'Vuelve con Nozdormu al presente.', 'Esta línea temporal es oscura y caótica. La perturbación ha sido grave. Creo que me quedaré un rato más para ver qué ondas pueden quedar.\n\nVuelve con Nozdormu. Querrá estar al tanto de nuestro éxito aunque haya sido menor del que nos gustaría.', '', '', '', '', '', '', 47187),
(66031, 'esES', 'Recuperar el tiempo perdido', 'Reúne esencia elemental para el campamento de los supervivientes.', 'Supongo que no debería sorprenderme de estar aquí.\n\nEste no es el Azeroth que quería, pero es el que tengo. Luchamos para preservar lo que queda y recuperar el mundo, pero tu llegada ha causado algunos problemas.\n\nUsamos la esencia de esos elementales para alimentar nuestras protecciones y mantenernos a salvo. ¿Ves ese escudo? Es lo único que impide que nos descubran y nos aniquilen, y tú has agotado nuestros recursos. Tráeme parte de esa esencia y podremos sobrevivir un día más.', '', '', '', '', '', '', 47187),
(66030, 'esES', 'La resistencia no es fútil', 'Sana a los combatientes de la Resistencia que hay en el Futuro Primalista.', 'Las ondas temporales han causado problemas a la gente de aquí. Aparecen enemigos donde antes no había o son mucho más fuertes de lo que deberían. Son cambios pequeños pero desastrosos.\n\nTe pido que ayudes a los combatientes de la Resistencia. Sana sus heridas para que puedan volver a la batalla. Devuelve su línea temporal al lugar correcto, como si nunca hubieran interactuado con nosotros. No es mucho, pero es lo que podemos hacer por ellos.', '', '', '', '', '', '', 47187),
(66029, 'esES', 'Ajuste temporal', 'Utiliza el cronocristal con Eternus y Cromi en el Futuro Primalista para evitar que caigan a través del tiempo.', 'Chronormu y Eternus están cayendo a través del tiempo, pero siento que se detienen de vez en cuando. Estos instantes son nuestra oportunidad de encontrarlas.\n\n<Nozdormu conjura un cronocristal pequeño>.\n\nHe imbuido este cristal de poder y de mi propia resonancia temporal. Han viajado a un... posible futuro muy problemático. Encuéntralas y úsalo. Espero que puedas estabilizar su posición en el tiempo antes de que vuelvan a desaparecer.', '', '', '', '', '', 'Vuelve con Nozdormu al presente.', 47187),
(66028, 'esES', '¡Al futuro!', 'Viaja al Futuro Primalista.', 'He rastreado a Chronormu y a Eternus hasta un posible futuro. No sé qué encontrarás allí, solo sé que reina la oscuridad y el caos.\n\nSoridormi se ha adelantado con algunos de nuestros Caminantes del Tiempo para mantener estable nuestra conexión con este tiempo. Necesitaremos su considerable poder para mantener el portal abierto, así que debe confiar en tus talentos.\n\nSoridormi podrá darte más indicaciones cuando la veas allí.\n\nDeprisa, $n. Encuentra a Chronormu.', '', '', '', '', '', 'Habla con Soridormi en el Futuro Primalista.', 47187),
(66027, 'esES', 'Llamar a los dragones azules', 'Observa la llamada de Kalecgos al Vuelo Azul.', 'Ya no me da miedo reunir a los dragones azules, $n. Es mejor ser una familia... que un fragmento de lo que éramos.\n\nAunque no pueda reclamar la piedra de juramento, puedo usar su poder para enviar un mensaje a todos los dragones azules. \n\nEs hora de que reciban noticias... de su Aspecto.', '', '', '', '', '', '', 47187),
(66026, 'esES', 'Acción urgente necesaria', 'Reúnete con Brena en Frondacuero.', 'El origen de estos ataques debe de estar en Frondacuero.\n\nHemos luchado contra los gnolls de Frondacuero durante generaciones, pero hasta ahora no han resultado más que un incordio.\n\nAhora no tenemos más opción que tomar medidas urgentes. Esta repugnante descomposición destruirá las Tierras Azures, incluido lo que sea que estés buscando.\n\nNos vemos en las afueras de Frondacuero. Vamos a necesitar toda la ayuda posible.', '', '', '', '', '', '', 47187),
(66025, 'esES', 'La amenaza Nokhud', 'Habla de los siguientes pasos.', 'El ejército del Clan Nokhud está tomando el control de Maruukai.\n\nDebatiremos los pasos a seguir en las cámaras de los khanes. Debemos proteger a los Maruuk.', '', '', '', '', '', '', 47187),
(66024, 'esES', 'Cubrir la retaguardia', 'Mata a la guardia Bahir.', 'A los Nokhud les pirran las historias de guerra del pasado ancestral de nuestro pueblo. En realidad son unos críos débiles y teatrales. Ha bastado un relámpago para que corten su conexión con Ohn\'ahra.\n\n¡Está bien! Si recorren el camino de la corrupción en busca de guerra, los complaceremos.\n\nPor supuesto, dejaron a Bahir al mando para cubrir su retirada. Pronto, su sangre teñirá la tierra.', '', 'Bahir, dejada al mando por Balakar, lleva mucho tiempo esperando este momento.', 'La guardia Bahir', '', '', 'Vuelve con la khanam Matra Sarest.', 47187),
(66023, 'esES', 'Rompetreguas', 'Mata a $1oa Nokhud.', 'Balakar es una desgracia para su clan. Cegado por su ansia de poder, los lleva de cabeza a la tormenta.\n\nSu traición revela su fragilidad. Acaba con ellos.', '', '', '', '', '', '', 47187),
(66022, 'esES', 'La khanam Matra', 'Preséntate ante el guardia del khan Akato para asistir a la audiencia de Gemisath con la khanam Matra.', 'No puedo quedarme en las tierras de los centauros, debo volver a los jardines tan pronto como pueda.\n\nLa khanam Matra ha accedido a escuchar nuestra petición de ayuda. Espera mi llegada en lo alto del krutal, el edificio central de Maruukai.\n\nAunque debo ser yo quien hable con ella, eres más que $gbienvenido:bienvenida; a unirte a nosotros.', '', '', '', '', '', '', 47187),
(66021, 'esES', 'Una visita inoportuna', 'Derrota a $1oa centauros Nokhud.', '¡Ja! Mírate. Eres débil. Igual que esos insignificantes cazadores que te trajeron aquí.\n\n¿Quieres conocer a los Nokhud? Nuestro idioma es la batalla.\n\nNuestro ritual de batalla se llama \"tabarr\". Entrenamos y nos hacemos fuertes. No hay debilidad en nuestro clan.\n\nYa basta de charla. Ve a entrenar.', '', '', '', '', '', 'Vuelve con la exploradora Tomul.', 47187),
(66020, 'esES', 'Augurios e incienso', 'Recoge $1oa flores de madreselva, machácalas para convertirlas en incienso de madreselva y ayuda a Ohn Seshteng en el ritual.', 'He compartido con la khan Tigari el presagio que recibimos antes de entrar a Maruukai. Ha expresado su preocupación, y también ha sentido el frío del viento.\n\nAquí cultivamos ciertas flores, que molemos y quemamos para provocar un efecto de trance. Las utilizamos para conectar aún más con los presagios.\n\nTe pido que recojas algunas de ellas para que podamos elaborar el incienso. Con la ayuda de la khan, tal vez podamos averiguar más cosas sobre la situación de Ohn\'ahra.', '', '', '', '', '', '', 47187),
(66019, 'esES', 'Honrar a nuestros ancestros', 'Ayuda a Qariin Dotur a cocinar para los ancestros.', 'Nuestros ancestros caminan a nuestro lado a través de los vientos de Ohn\'ahra. Nos guían y nos protegen. Todos los Maruuk, muertos y vivos, se reúnen con una tregua en el Khural.\n\nEl aroma de esta comida llama a los ancestros para que se reúnan en torno a nuestro fuego. Cuando lleguen, comenzará el Khural.', '', '', '', '', '', '', 47187),
(66018, 'esES', 'El Clan Nokhud', 'Acompaña a Tomul a ver a la guardia Bahir.', '<Okir pone voz a las señales de la khan Sansok>.\n\nEl Clan Nokhud es el último que ha ascendido al poder. Su difunto khan, Jhakan, alzó un poderoso ejército para hacerse con el territorio de sus predecesores. Este es el camino de nuestro pueblo.\n\nJhakan se ganó el respeto de su gente, pero su hijo no. Balakar mató a su padre y se hizo con el control del clan. Desde entonces se han aislado cada vez más. Pero para conocer a los Maruuk, también debes conocerlos a ellos.', '', '', '', '', '', 'Reúnete con la exploradora Tomul en el campamento Nokhud.', 47187),
(66017, 'esES', 'El Clan Ohn\'ir', 'Reúnete con Ohn Seshteng en las pozas místicas.', '<Okir pone voz a las señales de la khan Sansok>.\n\nLos místicos de nuestras tierras, como Ohn Seshteng, pertenecen al Clan Ohn\'ir. Este clan no está formado por familias, sino por centauros de las llanuras que tienen una conexión innata con Ohn\'ahra. Se pasan la vida fortaleciendo esa conexión y perfeccionando sus habilidades. Con el tiempo reciben la tarea de aconsejar a otros clanes y proteger nuestras tierras.\n\nOhn Seshteng se ha ido a hablar con su khan sobre los presagios que presenció. Ve con ella para saber más sobre los Ohn\'ir.', '', '', '', '', '', 'Reúnete con Ohn Seshteng en las pozas místicas.', 47187),
(66016, 'esES', 'El Clan Teerai', 'Preséntate ante Qariin Dotur.', '<Okir pone voz a las señales de la khan Sansok>.\n\nLa khanam Matra pertenece al Clan Teerai, que es nuestra conexión directa con los ancestros de los Maruuk. Son los representantes de nuestras tradiciones y nuestros narradores.\n\nPara comprender a los Maruuk, debes comprender al Clan Teerai. Una de las hijas de la khanam Matra, Qariin Dotur, está preparando comida para nuestros ancestros. Ayúdala. Ella te enseñará cosas sobre nuestro pueblo.', '', '', '', '', '', 'Preséntate ante Qariin Dotur.', 47187),
(66015, 'esES', 'La piedra de juramento del dragón azul', 'Acompaña a Kalecgos a reclamar la piedra de juramento del dragón azul.', 'Por ahora, las Tierras Azures se han estabilizado y han aparecido más dragones azules... justo a tiempo.\n\nEs hora de volver al Archivo Azur y reclamar la piedra de juramento.\n\nNecesitaría que estuvieses allí, $n. Has sido una enorme bendición en este calvario.', '', '', '', '', '', '', 47187),
(66011, 'esES', 'En recuerdo de Ysera', 'Vuelve a buscar a Theramus.', '¡Oh, no! Creo que ahora lo entiendo. Theramus... echa de menos a Ysera, y ella no puede volver.\n\n¡Ven! Sospecho que sé adónde ha ido. No volveremos a molestarlo, pero no estará de más decirle que lo sentimos y que le daremos el espacio que necesita.\n\nEstamos aquí para cuidarnos, como la naturaleza que nos rodea.', '', '', '', '', '', '', 47187),
(66009, 'esES', 'En defensa de Vakthros', 'Derrota a Korthrox el Destructor.', 'Es el momento, $n. Al ocuparte del asunto en tierra, las fuerzas primalistas que hay en el aire están decayendo.\n\nGracias a ti, Razageth quiere reforzar sus tropas con una de sus lugartenientes.\n\nNecesito que te encargues de ese monstruo mientras yo avanzo para luchar contra Razageth y ayudar a Khadgar.\n\nBusca mi magia durante la lucha. Haré lo que pueda para ayudarte.\n\n¡Ha llegado la hora de que Razageth se enfrente a la furia del Aspecto de la Magia!', '', 'Uno de los tenientes de Raszageth, empeñado en destruir a los dragones azules.', 'Korthrox el Destructor', '', '', 'Habla con Khadgar más arriba, en Vakthros.', 47187),
(66007, 'esES', 'Aire libre', 'Destruye $1oa balizas de lava.', 'Los Primalistas están usando esos enormes orbes para contener a Kalecgos.\n\nA este ritmo, sus heridas serán demasiado graves como para que pueda seguir luchando. Si cae, no podré rechazar a Raszageth.\n\nLa gema potenciada que llevas te permitirá disfrazarte de elemental y pasar sin que noten tu presencia.\n\nÚsala para destruir los orbes. Eso dará margen a Kalecgos para desatar su poder.\n\nYo me centraré en proteger la torre de Raszageth.', '', '', '', '', '', 'Reúnete con Kalecgos en una cueva que en el interior de la Cumbre de Vakthros.', 47187),
(66006, 'esES', 'Volver con Roscha', 'Devuelve los suministros a la herradora Roscha.', 'Baba ha descansado, y hemos recuperado los suministros de Roscha. Podemos regresar sin irritarla más.\n\nLlévate algunas cajas. Enviaré guerreros a recoger el resto.', '', '', '', '', '', '', 47187),
(66005, 'esES', 'Medallón de una camarada caída', 'Devuelve el medallón de una camarada caída a Khasar.', '<Este trozo de metal mordisqueado era un bonito ornamento de gran importancia para un centauro Shikaar.\n\nPuede que Khasar sepa a quién pertenece>.', '', '', '', '', '', 'Devuelve el medallón de una camarada caída a Khasar.', 47187),
(66004, 'esES', 'Galgresh', '', '', '', '', '', '', '', '', 47187),
(66003, 'esES', 'Anillos para atarlos', 'Consigue $1oa anillos de vínculo de magma.', 'Los djaradin de aquí se han vuelto audaces, han vinculado los elementales de llamas y han dejado que arrasen la zona. La fauna ha huido y los elementales se acercan peligrosamente a nuestros campamentos.\n\nPor suerte, he podido construir un pequeño bastión de piedra para resistir la violencia que han desatado los djaradin... ¡y no fracasaremos!\n\nReúne los anillos mágicos que vinculan a estos elementales de llamas. Los usaremos para reforzar nuestras defensas contra ellos.', '', '', '', '', '', '', 47187),
(66001, 'esES', 'Una última esperanza', 'Rescata el último huevo de dragón imbuido.', 'Un linaje entero de vástagos, perdido...\n\n<Sendrax se endereza y levanta la cabeza>.\n\nQueda una ubicación que aún no hemos comprobado. El escenario del ritual donde ese protodragón dejó caer los huevos.\n\nLuchemos codo con codo contra sus crueles defensas, $p, y salvemos lo que podamos.', '', '', '', '', '', '', 47187),
(66000, 'esES', 'Biblioteca de Alexstrasza', 'Salva $1oa obras con valor cultural.', '<Las páginas del libro están carbonizadas.\n\nLos Primalistas parecen estar quemando los antiguos escritos que hay aquí para destruir la propia historia de los Vuelos. Es como si quisieran borrar cualquier referencia a los Vuelos de la historia.\n\nSalva lo que puedas>.', '', '', '', '', '', '', 47187),
(65999, 'esES', 'Garras y dientes rojos', 'Mata a $1oa invasores primalistas.', 'El comandante Lethanak nos advirtió de que, según sus informes, la Devoradora de Tormentas, Raszageth, había escapado de su prisión. Parece que sus sirvientes la han seguido y ahora amenazan todo lo que amamos.\n\nSe mueven rápido. El último informe indicaba que estas ruinas estaban abandonadas.\n\nDebemos detener a los Primalistas.\n\n¡Por la Protectora y por todos los Vuelos!', '', '', '', '', '', '', 47187),
(65998, 'esES', 'El futuro de los Vuelos', 'Rescata los huevos de dragón rubí.', 'No hay mayor honor que pueda recibir un dracónido al graduarse que defender cada huevo de dragón con su vida.\n\nPara eso entrenamos. Es la razón de nuestra existencia.\n\nNo puedo seguir aquí sin hacer nada, $p. Al robar e imbuir esos huevos, ¡los Primalistas amenazan el futuro de todos los Vuelos!\n\nNos superan en número, pero ¿lucharás a mi lado? ¿Lucharás por salvar los Vuelos?', '', '', '', '', '', '', 47187),
(65997, 'esES', 'En pos de Sendrax', 'Encuentra a Sendrax en las ruinas del Invernadero de la Protectora.', 'La cadete Sendrax pasó por aquí hace poco.\n\nNos informó de que el comandante Lethanak ordenaba que todos los dracónidos se reagrupasen en los Estanques de Vida. Todo nuestro regimiento partió hacia allá poco después.\n\nPero nuestros exploradores estaban patrullando en las viejas ruinas, así que Sendrax fue a informarles.', '', '', '', '', '', 'Reúnete con Sendrax en el Invernadero de la Protectora.', 47187),
(65996, 'esES', 'Refuerzos veteranos', 'Ayuda a los guardias heridos y encuentra a Sendrax.', 'El comandante Lethanak ha demostrado su perspicacia de costumbre. Necesitaremos la ayuda de nuestros guardias más veteranos si queremos frenarlos su amenaza. Reunirlos es la tarea perfecta para una joven cadete como Sendrax, pero puede que necesite ayuda.\n\nSu misión la llevará hacia el oeste, que puede haber sido abrumado por esta creciente amenaza. Allí también necesitarán ayuda. Toma este brebaje y ofréceles tu apoyo.', '', '', '', '', '', 'Reúnete con Sendrax en la Avanzada del Invernadero', 47187),
(65995, 'esES', 'La Ciudadela Obsidiana', 'Entrega los planes qalashi a Wrathion.', '<A primera vista, parecen mensajes internos entre campamentos djaradin.\n\nLas palabras \"Ciudadela Obsidiana\" te llaman la atención.\n\nQuizás a Wrathion le interese>.', '', '', '', '', '', '', 47187),
(65994, 'esES', 'Justicia djaradin', '', '', '', '', '', '', '', '', 47187),
(65993, 'esES', 'Aguafiestas', 'Mata a la muelecarnes Sotok en el Castillo Quiebrascama.', 'Ah, sí.\n\nVi a la líder de los gigantes volver de un ataque poco después de mi llegada. Está celebrando su victoria en algún lugar del campamento.\n\nSería una pena que alguien le arruinara la juerga, ¿no crees?', '', 'Gerifalte del ataque a la Avanzada Corazón de Dragón.', 'Muelecarnes Sotok', '', '', 'Reúnete con Wrathion en el Castillo Quiebrascama.', 47187),
(65992, 'esES', 'Información Garranegra', 'Habla con los espías de Wrathion escondidos en el Castillo Quiebrascama.', 'Mientras Selistra y yo atraíamos sus miradas hacia el cielo, mis sombras se colaban a través de sus defensas.\n\nMis agentes, los Garranegra, vigilan y escuchan por toda la fortaleza. Reúnete con ellos y hazles saber que estás de nuestro lado. Te darán información valiosa sobre nuestros enemigos.', '', '', '', '', '', 'Reúnete con Wrathion en el Castillo Quiebrascama.', 47187),
(65991, 'esES', 'Hora de ajustar cuentas', 'Reúnete con Wrathion y la mayordoma Selistra en el Castillo Quiebrascama.', 'La cadete Sendrax me ha informado de los planes de nuestra mayordoma. Gracias a la Protectora por su ayuda. Esto nos da el respiro que necesitamos para llevar a nuestros heridos de vuelta a los Estanques de Vida, donde podrán recibir tratamiento.\n\nOjalá pudiera enviar refuerzos a Selistra, pero debo mantener mis guardias cerca de los heridos. Dirígete a la fortaleza enemiga y reúnete con ellos.\n\nSi existiera otro modo de lidiar con los Djaradin, recurriría a ello. Pero tal y como está la cosa...\n\nDebes hacer lo que debe hacerse.', '', '', '', '', '', '', 47187),
(65990, 'esES', 'Líbralos del mal', 'Salva a $1oa vástagos sollozantes en la Avanzada Corazón de Dragón.', 'Se abalanzaron sobre nosotros antes de que pudiéramos responder. Mis guardias aguantaron todo lo que pudieron mientras evacuábamos a los jóvenes e indefensos, pero me temo que aún quedan algunos en la avanzada.\n\nCruza ese puente y busca supervivientes.', '', '', '', '', '', '', 47187),
(65989, 'esES', 'Invasión djaradin', 'Acaba con $1oa djaradin en la Avanzada Corazón de Dragón.', 'Puede que no tengamos el poder necesario para recuperar nuestra avanzada, pero no podemos rendirnos sin luchar.\n\nDemuéstrales que aún tenemos dientes.', '', '', '', '', '', '', 47187),
(65977, 'esES', 'Recuperación del Kirin Tor', 'Rescata a $1oa magos moribundos.', 'Cuando los Primalistas atacaron a nuestra expedición, temí haber perdido a muchos de nuestros magos.\n\n¡Pero parece que se los llevaron para torturarlos!\n\nPor favor, debes rescatar a esos magos. Tal vez no puedan ayudarnos en esta lucha, pero no podemos dejarlos atrás.', '', '', '', '', '', 'Reúnete con la proyección de Khadgar más adelante, en el Coto de Vakthros.', 47187),
(65962, 'esES', 'La interminable cuenta atrás', 'Habla con Cromi cuando estés a punto.', 'Nunca pensé que salvaría nuestro templo desmantelando las mismas medidas de seguridad que habíamos creado para protegerlo, ¡pero aquí estamos!\n\nAhora que los elementales de tiempo han sido purgados, los Caminantes del Tiempo son libres y los celadores están listos, ha llegado el momento de desactivar la burbuja de estasis y encargarnos de Eternus.\n\nAvísame cuando quieras empezar. Sé que nada puede salir mal contigo a mi lado.', '', '', '', '', '', '', 47187),
(65958, 'esES', 'Poder primigenio', 'Utiliza el enfoque elemental para absorber la energía elemental de los primalistas y elementales asesinados.', 'Me temo que cada vez es más difícil mantener mis reflejos exactos. Los Primalistas están centrando sus esfuerzos en derribarme.\n\nNo te preocupes... Tengo un plan.\n\nNecesito que tomes el orbe que has recuperado y reúnas la magia elemental de los primalistas muertos. \n\nNecesitaremos ese poder elemental más adelante para alejar a sus fuerzas de mí.', '', '', '', '', '', 'Reúnete con la proyección de Khadgar más adelante, en el Coto de Vakthros.', 47187),
(65957, 'esES', 'No hay tiempo para héroes', 'Mata a Modak la Escupellamas, a la Perforadora Gigra y a Olphis el Fundido.', 'Por lo que hemos visto, la sociedad djaradin se basa en la fuerza. Los más fuertes sirven de ejemplo para que los demás luchen con más ahínco. \n\nEntre los djaradin de ahí abajo hay tres más poderosos que el resto... Esos son tus objetivos.\n\nTú, $n, los eliminarás personalmente. Esto debería asestar un golpe devastador a su moral.', '', '', '', '', '', '', 47187),
(65956, 'esES', 'Golpe de garfa', 'Defensas djaradin desbaratadas.', 'Con tu ayuda, mis asesinos Garranegra acabarán con los djaradin que defienden el perímetro exterior. Marca a cualquier objetivo con una pequeña bomba aturdidora y acudirán en tu ayuda.\n\nProcede con rapidez y elimina todo lo que pueda entorpecer nuestro avance.', '', '', '', '', '', '', 47187),
(65955, 'esES', 'El mejor amigo del centauro', 'Libera a Khasar y reúnete con él en la cueva.', 'No es seguro quedarnos al descubierto, $p.\n\nLos górlocs llevaron a la fuerza a Baba, mi compañero de caza, a una cueva al este.\n\nLibérame y ayúdame a rescatar a Baba. Nos veremos en la cueva cuando el camino esté despejado.', '', '', '', '', '', '', 47187),
(65954, 'esES', 'Liberar a los canes', 'Libera a los bakars Shikaar.', 'He oído los familiares aullidos y ladridos de unos bakars que han desaparecido del campamento.\n\nNuestros queridos perros están atrapados en jaulas, esperando a que esas... cosas los hagan pedazos.\n\nEs nuestro deber proteger a nuestros compañeros. ¡Libéralos y presencia el verdadero poder de un bakar Shikaar!', '', '', '', '', '', '', 47187),
(65953, 'esES', 'Destruct-oráculo', 'Recoge $1oa tótems de chamanes górloc.', 'De todas las locuras de esta aldea de górlocs, la más inquietante es la de los chamanes.\n\nSon especialmente feroces y juegan imprudentemente con la magia de tormenta sin pensar en las consecuencias. \n\nHay que poner fin a esto. Mátalos y tráeme sus tótems. A nuestros místicos les interesarán mucho.', '', '', '', '', '', '', 47187),
(65952, 'esES', 'Un jefe legendario', 'Mata al jefe Grrlgllmesh.', 'Antes, los górlocs de este pantano eran criaturas sencillas. Alimañas, tal vez, pero nunca asaltantes, ladrones ni comeperros.\n\nEs su jefe, Grrlgllmesh, quien los ha alejado de su naturaleza.\n\nAcaba con él y los górlocs dejarán de atacarnos.', '', 'Grrlgllmesh, el más poderoso de los górlocs, no tiene nada más que conquistar que su propia desesperación.', 'Jefe Grrlgllmesh', '', '', '', 47187),
(65951, 'esES', 'Proveedor exclusivo', 'Busca a Khasar en el bosque.', '¡Pobre Roscha! Ha trabajado sin descanso para prepararse para la caravana, y ahora van los asquerosos górlocs y le roban los suministros.\n\nYa ha perdido muchísimo. Voy a hacer lo que pueda por ayudarla.\n\nEs probable que Khasar haya ido a recuperar los suministros solo, sin decírselo a nadie. Ha sido decisión suya, pero lleva fuera demasiado tiempo. Además, faltan muchos perros.\n\n¿Podrías buscar a Khasar y a los perros, $p?', '', '', '', '', '', 'Habla con Khasar en la Aldea Aletalodo.', 47187),
(65950, 'esES', 'Górlocs ladrones', 'Recupera los suministros robados de la Aldea Aletalodo y devuélvelos.', '¿Han invitado a la herrera Roscha a la caravana? ¡Nooo! ¿Quién debe proporcionar zapatos a la caravana? La herradora Roscha. ¿Y a quién roban los Aletalodo? A la herradora Roscha. ¿A quién si no?\n\nEnviaría a Khasar, pero cualquiera sabe por dónde andará ahora. \n\nBusca mis suministros. Enseña a esas criaturas a no robar a la herradora Roscha.\n\n¡Adelante!', '', '', '', '', '', 'Habla con Khasar en la Aldea Aletalodo.', 47187),
(65949, 'esES', 'Reparaciones', 'Devuelve el medallón a la herradora Roscha.', 'Cuando nos unimos a Ohn\'ahra en el viento, nos desprendemos de esos medallones.\n\nSi bien ayudé a fabricar este medallón, no me pertenece.\n\nHay que devolvérselo a Roscha. Es el último recuerdo de su prometido.\n\nLlévaselo para que pueda llorar su muerte y estar en paz.', '', '', '', '', '', '', 47187),
(65948, 'esES', 'Grietas en el tiempo', 'Usa los cristales del este y del oeste para potenciar aún más tu bastón de Caminante del Tiempo.', 'Cuando el templo se cerró, los celadores se quedaron atrapados con las puertas del templo. ¡Debemos eliminar esa burbuja de estasis para liberarlos! Por desgracia, necesitamos un bastón de Caminante del Tiempo a pleno poder...\n\n¡Ya sé! ¡Puedes drenar los cristales de estas plataformas! Eso debería bastar para potenciar el bastón.\n\nTienen sus propios campos de estasis, así que solo debes arrancarlos y absorber su energía con tu bastón.\n\nY no te preocupes si se rompen. ¡El poder sigue ahí, incluso en pedazos!', '', '', '', '', '', '', 47187),
(65947, 'esES', 'Caminantes del Tiempo anclados en el tiempo', 'Libera a $1oa Caminantes del Tiempo de sus burbujas temporales.', '¡Me alegra verte aquí! Necesito que estabilices la situación en las plataformas mientras Dante y Zera me ayudan a mantener en su sitio a nuestra amiga la dragona infinita.\n\nLas medidas de seguridad del templo encerraron a Eternus en una burbuja de estasis cuando intentó hacerse con la piedra de juramento. Por desgracia, también atraparon a los demás Caminantes del Tiempo.\n\nTu bastón de Caminante del Tiempo debería liberarlos sin problemas. ¡Asegúrate de lidiar con los vástagos temporales que puedan aparecer!', '', '', '', '', '', '', 47187),
(65944, 'esES', 'Ráfaga de lava', 'Destruye $1oa orbes de lava.', '¡Los Primalistas han destrozado la montaña para enviar sus fuerzas a Vakthros!\n\nHe visto algunos orbes de lava en el pasillo inicial que están usando para propagar su caos elemental.\n\nDestrúyelos para frenar su avance. Haré lo que pueda desde aquí para ayudar a Kalecgos.', '', '', '', '', '', 'Reúnete con la proyección de Khadgar dentro del Coto de Vakthros.', 47187),
(65943, 'esES', 'Ofensiva primigenia', 'Derrota a $1oa primalistas en Vakthros.', 'Khadgar y yo estamos haciendo todo lo posible para mantener a raya a los Primalistas en el cielo, pero no podemos avanzar más hacia la torre.\n\nNecesitamos que debilites sus fuerzas terrestres para que podamos acercarnos a Raszageth y detenerla antes de que sea demasiado tarde.\n\nÁbrete paso entre los Primalistas. Si puedo mantener mi concentración, habrá otro reflejo exacto esperándote.', '', '', '', '', '', 'Reúnete con el reflejo exacto de Kalecgos que se encuentra más adelante, en el Coto de Vakthros.', 47187),
(65940, 'esES', 'El camino roto', 'Viaja con la caravana Shikaar hasta el cruce del río.', 'Espero que no te importe mojarte los pies. La siguiente etapa de nuestro viaje nos llevará a través de dos ríos.\n\nOhn Seshteng quiere compartir una historia contigo sobre nuestra bendita vigía, Ohn\'ahra. Con mucho gusto te dejo bajo su vigilancia.', '', '', '', '', '', '', 47187),
(65939, 'esES', 'El coraje de las convicciones', 'Hazte con el control de la Ciudadela Obsidiana.', 'La próxima batalla será feroz, pero nuestro coraje y determinación podrán contra su superioridad numérica.\n\nCuento con tus excepcionales habilidades para liderar las tropas hacia la victoria.\n\nComenzaremos el asalto cuando lo ordenes.', '', '', '', '', '', '', 47187),
(65938, 'esES', 'Equipo de hoy y de mañana', 'Usa tu bastón de Caminante del Tiempo para hacer estallar la burbuja de estasis de la puerta del templo.', '¡Vale! ¡Vamos a reventar la burbuja de estasis que rodea las puertas del templo y a liberar a nuestros celadores! ¿$gListo:Lista; para una enorme batalla de tira y afloja contra el mismísimo tiempo?\n\nTira de la burbuja de la puerta como hiciste antes con los cristales. Pero ten cuidado, toda la energía temporal que liberes te atacará. No tengo claro qué habrá allí, pero los celadores liberados te ayudarán pase lo que pase.\n\n¡Buena suerte, $n!', '', '', '', '', '', '', 47187),
(65937, 'esES', 'Prueba de negligencia', 'Encuentra las pruebas de los daños al Paseo Lila y muéstraselas a Theramus.', 'No podemos rendirnos. Debe saber lo que está pasando aquí fuera. Si no quiere salir de la cueva, se lo enseñaremos directamente.\n\nCualquier cosa servirá, estoy segura. ¡Todo va mal! La flora corrupta, la fauna en lucha constante...', '', '', '', '', '', '', 47187),
(65935, 'esES', 'Ponerse al día con Cromi', 'Reúnete con Cromi en las plataformas de la Confluencia Temporal.', 'Nos has ayudado a recuperar el control de las arenas, pero puedo sentir que ocurre algo de mayor importancia en las plataformas del templo. Emprendamos el vuelo y reunámonos con la embajadora Chronormu allí arriba.\n\nComo siempre, el tiempo es oro.', '', '', '', '', '', '', 47187),
(65930, 'esES', 'Un pulso de viento y agua', 'Enfréntate al espíritu de aire Kraunot cerca del Destello Kauriq.', 'Ahora podremos enfrentarnos a los espíritus.\n\n¿Ruriq no lo mencionó? Según las tradiciones de nuestra tribu, debemos enfrentarnos a los espíritus en combate antes de pedir su bendición, y la fuerza de esta dependerá de lo mucho que los impresionemos. \n\nQuizás por eso la Escamabrillante insistió en que trabajáramos juntos.\n\nTú te encargarás de Kraunot, el espíritu de aire, y yo de Otu\'rorq, el espíritu de agua.\n\nEstán en la cueva detrás de la cascada cercana. Nos veremos allí.', '', 'El espíritu de los vientos caprichosos de la zona rodea al Destello Kauriq. Se sabe que disfruta de enfrentarse a los jóvenes colmillarr que quieren demostrar su valía.', 'Kraunot', '', '', '', 47187),
(65929, 'esES', 'Rompehielos', 'Libera las aguas heladas del hielo cerca del Destello Kauriq.', '¡Sabía que lo aprobaría!\n\nNo sé mucho de espíritus... El chamán es Kauj. Pero tendremos que apaciguar a los grandes espíritus de aire y de agua antes de que se nos aparezcan. \n\nCualquiera podría ver a los elementales de agua congelarse lentamente en la montaña. Y no parece para nada natural. Últimamente el frío ha estado bajando de las montañas más de lo habitual. Si esto sigue así, todo el río podría acabar congelado.\n\n¡Libéralos de sus prisiones heladas!', '', '', '', '', '', '', 47187),
(65928, 'esES', 'Vientos obstinados', 'Recoge $1oa motas de viento inquieto de los vientos inquietos cerca del Destello Kauriq.', '¡Bah! ¿Trabajar juntos, dice? \n\nPero... si la Escamabrillante cree que hay alguna posibilidad de que podamos ayudar a las demás tribus..., debemos intentarlo. \n\nPara que el espíritu de viento Kraunot nos reconozca, primero tendremos que atender a su elemento. Los elementales de viento cercanos han estado inquietos desde que la tierra comenzó a despertarse.\n\nVete y encárgate de esos elementales mientras yo inspecciono este barco que habéis construido, y tráeme sus motas inquietas. Eso debería devolver la calma a la zona.', '', '', '', '', '', '', 47187),
(65926, 'esES', 'Navegando por las cascadas', 'Ayuda a Ruriq a construir el Zancalejana.', '¿Has oído la historia de la Escamabrillante? ¡Construyó un barco tan resistente que podía bajar por las cascadas del río!\n\nA la anciana Nava le encanta contar esta historia.\n\nCreo que los nobles espíritus de los mamuts on\'tuq se sentirían honrados si utilizáramos sus restos para fabricar un barco como el de la leyenda.\n\nMi hermano se opone a ello, pero si lo conseguimos, podremos llevar pescado a nuestras tribus hermanas en apuros.\n\n¡Has demostrado gran habilidad y pasión! Seguro que podemos construir algo grande.', '', '', '', '', '', '', 47187),
(65925, 'esES', 'Diezmando a los diezmadores', 'Mata a los deslizadores de hielo y a los cavapozos de hielo cerca del Destello Kauriq.', 'Esas vermis no deberían estar aquí. No sé qué las ha sacado de sus guaridas subterráneas, pero ahora no hay forma de ayudarlas.\n\nNo podemos permitir que destruyan la fauna local.\n\nMata a las vermis, $n. Quédate sus pedazos, si es necesario, y reúnete conmigo en el Destello Kauriq cuando hayas terminado.', '', '', '', '', '', 'Reúnete con Ruriq en el Destello Kauriq.', 47187),
(65921, 'esES', 'Retribución refti', 'Mata primalistas y rescata a las refti en la Reserva de Tyrhold.', 'No puedo sacármelo de la cabeza, $p. Tantas de mis hermanas, masacradas... Tantas vidas perdidas... ¡Sus muertes no quedarán impunes!\n\nMis soldados han localizado a los primalistas responsables y dicen que algunas de nuestras hermanas siguen vivas.\n\n¡Debemos rescatarlas y asegurarnos de que esos primalistas conocen mi ira!', '', '', '', '', '', '', 47187),
(65920, 'esES', '¡Por los resguardos!', 'Usa las piedras angulares perdidas para reparar los resguardos de la reserva y luego activa la consola.', 'Por fin podemos restaurar los resguardos. Hemos sufrido grandes pérdidas, pero debemos completar nuestro trabajo.\n\n$p, necesitamos tu ayuda una vez más.Lleva cada piedra angular al lugar que le corresponde para que los resguardos vuelvan a estar completos.\n\nCuando lo hayas hecho, vuelve para que podamos activar la consola y restaurar el orden en la reserva.', '', '', '', '', '', '', 47187),
(65918, 'esES', 'Mantenimiento preventivo', 'Mata a $1oa elementales desatados en la Reserva de Tyrhold.', 'Los elementales primigenios se están reproduciendo de manera descontrolada. Normalmente, mis hermanas y yo nos ocuparíamos de ellos, pero no estamos en condiciones de hacerles frente. Han eliminado a muchos de nuestros soldados.\n\nAdemás, tenemos otros asuntos que atender.\n\n<Zuttiki hace una mueca de dolor>.\n\nAhí es donde entras tú, $p. ¿Podrías encargarte de los elementales?', '', '', '', '', '', '', 47187),
(65916, 'esES', 'No negociamos con los Primalistas', 'Mata al líder primalista Ko\'jo y recupera las piedras angulares perdidas en la Reserva de Tyrhold.', 'Los Primalistas creían que podrían superar el poder de Tyr. Se equivocaban. \n\nMis refti han podido rastrearlos hasta una cueva no muy lejos de aquí. Y como pensaba, tienen las piedras angulares que faltan.\n\nAdalid, si queremos restaurar la reserva, debemos recuperar esas piedras angulares.\n\nAdemás, tenemos que acabar con su líder para impedir que ataquen una segunda vez.', '', '', '', '', '', '', 47187),
(65914, 'esES', 'Los mamuts mandan', 'Consigue trocitos de pellejo de on\'tuq y colmillos de on\'tuq de los mamuts on\'tuq caídos cerca del Destello Kauriq.', 'Nuestra tribu ha cuidado con orgullo a las manadas de mamuts on\'tuq durante generaciones. Y ahora ya... no queda ni uno.\n\nSus almas permanecen cautivas de la ira tras la masacre. Debemos honrar sus vidas haciendo buen uso de sus restos.\n\nHay demasiados como para reunirlos sin ayuda. Por favor, consigue los materiales que puedas, tanto de los jóvenes como de las matriarcas, y luego reúnete conmigo en el Destello Kauriq.', '', '', '', '', '', 'Reúnete con Ruriq en el Destello Kauriq.', 47187),
(65913, 'esES', '¿Qué vigilas, vigía?', 'Rescata a la vigía Mara de los Primalistas en la Reserva de Tyrhold.', '¡Gracias a los titanes! $C, ¡necesitamos tu ayuda!\n\nLos Primalistas nos acaban de atacar. Mis hermanas y yo pudimos defendernos, pero con graves pérdidas...\n\n¡Habrá tiempo para llorar cuando mi vigía esté a salvo! Un grupo de primalistas se escapó mientras luchábamos. Te juro que, si hacen daño a nuestra vigía...\n\n¡Debes ayudarla antes de que sea demasiado tarde!', '', '', '', '', '', '', 47187),
(65911, 'esES', 'Alineación azur', 'Vuelve con Kalecgos, que está en el Archivo Azur.', 'Los lazos de esta comunidad... La amistad y la familia que comparten.\n\nNunca... he tenido algo así. El Vuelo Azul nunca había tenido eso. Y tal vez sea porque nunca tuvimos la oportunidad de intentarlo.\n\nAhora es el momento. Debo reunir a los míos.\n\nReúnete conmigo en el Archivo Azur. Queda mucho por hacer.', '', '', '', '', '', 'Vuelve con Kalecgos, que está en el Archivo Azur.', 47187),
(65907, 'esES', 'Fruta favorita', 'Recoge forraje salvaje en los Géiseres Ohn\'iri y alimenta a $1oa pisafango indolentes.', 'El entrenamiento de los místicos es muy aburrido. La mitad de los días, me dedico a ver cómo se moja el agua. Mientras tanto, mis hermanos ya están ahí fuera cazando dracos y primalistas para salvar el mundo.\n\nEn fin, ¡te prometí que te enseñaría algo chulo! ¿Sabías que a los pisafango les encanta el forraje? Crece cerca de aquí, entre los géiseres. Ve a recoger un poco y podremos alimentarlos.', '', '', '', '', '', '', 47187),
(65906, 'esES', 'Una iniciada contrariada', 'Habla con la iniciada Radiya en los Manantiales Ohn\'iri, que están en las Llanuras de Ohn\'ahra.', 'He recibido una carta interesante de los Manantiales Ohn\'iri.\n\nEn cuanto a la carta, detalla, y cito: \"una horrible prisión, con mentores controladores y aburrimiento extremo\". Lleva la firma de la iniciada Radiya. También hay un boceto de un águila... tirando por un acantilado a un centauro llamado Meluun de una patada.\n\nBueno, supongo que es una petición de ayuda, por si quieres ir a investigar por tu cuenta. Si te digo la verdad, creo que Radiya está bien. No es la primera carta con este tono que me envía.', '', '', '', '', '', 'Habla con la iniciada Radiya en los Manantiales Ohn\'iri, que están en las Llanuras de Ohn\'ahra.', 47187),
(65905, 'esES', 'Más que malas hierbas', 'Elimina la vegetación y mata a los monstruos del Paseo Lila.', 'Quizás sea mejor que le demos a Theramus algo de espacio.\n\nPero no podemos quedarnos de brazos cruzados. La arboleda se está destruyendo a sí misma rápidamente. ¡Ayúdanos!', '', '', '', '', '', '', 47187),
(65904, 'esES', 'Ya está bien', 'Lleva las pruebas de los daños al Paseo Lila a Theramus.', 'Gruñón o no, Theramus tiene un trabajo que hacer. Mientras se esconde ahí dentro, no puede ver las consecuencias de su ausencia.\n\nVamos $gjuntos:juntas;. Se las enseñaremos.', '', '', '', '', '', '', 47187),
(65903, 'esES', 'El poderoso Peludín', 'Atrapa $1oa saltarines del claro.', 'Pobre Theramus. ¡Tengo una idea para animarlo!\n\nToma esta red y atrapa algunos saltarines cercanos. Son dóciles pero rápidos. Los encontrarás por la costa.\n\nSe los llevaremos a Theramus. ¡No podrá con tanta esponjosidad!', '', '', '', '', '', '', 47187),
(65902, 'esES', 'Comida o pelusa', 'Llévale a Theramus la carne de tortuga a las hierbas y los saltarines del claro.', '¡Qué carne de tortuga a las hierbas más jugosa y deliciosa! Desde un punto de vista objetivo, claro. Yo soy vegetariana.\n\n¡Sigue! Seguro que no ha comido en todo el día.', '', '', '', '', '', '', 47187),
(65901, 'esES', 'Salir a hurtadillas', 'Coloca los tótems de aire en los Manantiales Ohn\'iri e informa a Radiya.', '¡Me han castigado indefinidamente! ¿Es que no sabe mi Ohn que cumplo dieciséis años la próxima primavera? Debería poder largarme cuando me diese la gana.\n\nTú tienes pinta de poder ayudarme. Tengo un plan para escapar. Puedo canalizar estos tótems para concentrar el aire y crear un gran revuelo. Pero no puedo colocarlos porque estoy bajo máxima vigilancia. Ni siquiera Togo quiere ayudarme.\n\nPero si tú me ayudas... ¡Por favor! Te prometo que te enseñaré una cosa chulísima.', '', '', '', '', '', 'Reúnete con Radiya junto al Espejo del Cielo.', 47187),
(65900, 'esES', 'Filete sospechosamente especiado', 'Recoge $1oa trozos de carne de tortuga perfectamente tierna, $2oa cáscaras de huevo reptiliano y $3oa vinagretas.', 'La idea de mi hermana es encantadora, pero Theramus necesita un verdadero estímulo.\n\nY me refiero a una buena dosis de vinagreta. Podemos hacer una pasta con ella y untarla en su comida favorita: ¡la carne de tortuga!\n\n¿Podrías ayudarme a conseguir los ingredientes?', '', '', '', '', '', '', 47187),
(65899, 'esES', 'Buscar a Theramus', 'Busca a Theramus en las cuevas cercanas.', '¡$R! ¿Has venido a visitar el maravilloso Paseo Lila? Me disculpo por su estado actual. Te prometo que no suele estar tan desatendido.\n\nTheramus, el cuidador del jardín, tenía que haber venido hoy para que resolviéramos esto juntos. Últimamente tiene problemas con el mantenimiento, así que Felina y yo estamos arrimando el hombro. Pero no podemos con todo.\n\n¿Nos ayudarás a buscarlo? Quizás se haya olvidado.', '', '', '', '', '', 'Vuelve con Celina Hojaseca.', 47187),
(65898, 'esES', 'Protoproblemas', 'Hazte con el Enclave y derrota al protodraco que lo protege.', 'La Llama Hendida no me cae lo que se dice muy bien, pero no puedo quedarme de brazos cruzados mientras se hacen pedazos unos a otros. Me trae demasiados recuerdos.\n\nSea lo que sea el enclave, estará mejor en nuestras manos que en las suyas. Sospecho que lo encontraremos si sigues el rastro de cuerpos.\n\nTen cuidado, $p. Me preocupa que el nido no esté tan abandonado como parece.', '', '', '', '', '', '', 47187),
(65896, 'esES', 'Que comience la sanación', 'Ayuda a la gente de Ventormenta a sanar.', '¿Te crees que podrías entrar en esta ciudad sin que me diera cuenta? ¡Pues no!\n\nYa tenía toda la razón antes sobre los tuyos, y que me parta un rayo si dejo que los dragones vuelvan a destruir mi hogar.\n\nEsto era un parque lleno de paz y alegría hasta que vino tu padre, Alamuerte. Ah, sí, lo sé todo sobre él. \n\nPuedes ver con tus propios ojos el legado de destrucción que dejó. El dolor que aún camina por estas calles.', '', '', '', '', '', '', 47187),
(65895, 'esES', 'Compañía competidora', 'Reúne información sobre la Llama Hendida.', '¡Bah! La muerte de unos obreros no nos ayudará a averiguar nada.\n\nBusca a sus líderes. Uno de ellos tendrá la información que necesitamos.\n\nAh, $n. Esta vez, escucha lo que tengan que decir antes de matarlos. Puede que averigües algo útil.', '', '', '', '', '', 'Reúnete con Adenedal cerca de la parte alta de las ruinas.', 47187),
(65893, 'esES', 'La investigación de la reliquia', 'Recolecta $1oa fragmentos de artefacto de Nelthazan.', 'La Llama Hendida está aquí. ¿Tú le confiarías artefactos valiosos a una gente que va por ahí hendiendo cosas?\n\nClaro que no. En cualquier caso, debemos averiguar qué hacen aquí si queremos entrar en acción. Reúne lo que puedas de ellos y cuéntame lo que descubras.\n\nEste rompecabezas tiene más piezas de las que vamos a encontrar en el suelo.', '', '', '', '', '', '', 47187),
(65892, 'esES', 'Los extremos hendidos', '', '', '', '', '', '', '', '', 47187),
(65891, 'esES', 'Herramientas de diatriba', 'Despliega las herramientas encantadas en $1oa pilas de escombros.', 'Bien. Justo estaba pensando que me vendría bien $gun aventurero:una aventurera; como tú. Fuerte, resistente y con $gdispuesto:dispuesta; a trabajar por una suma insignificante.\n\nEs como si mi voluntad te hubiese manifestado. Qué bien me las apaño, ¿eh? Estas ruinas parecen haber captado la atención de más gente. No podemos confiar en que excavarán como es debido. ¡Echarán a perder las muestras!\n\nToma esto. Despliégalo alrededor de los artefactos de interés que hay por las ruinas. Está encantado para realizar cualquier tarea necesaria.', '', '', '', '', '', '', 47187),
(65890, 'esES', 'Las Ruinas de Nelthazan', 'Reúnete con el escriba del cielo Adenedal en las Ruinas de Nelthazan.', 'La Expedición Dragontina requiere tu ayuda.\n\nEnviamos un escriba del cielo a las ruinas para que reuniera información. Deberían estar deshabitadas, pero puedo oír sus gritos desde aquí.\n\nDebe de estar en grave peligro para poder escucharlo a tanta distancia.\n\nEn esta expedición cuidamos de los nuestros. Aunque sean insufribles. Búscalo y protégelo del peligro que haya encontrado.', '', '', '', '', '', '', 47187),
(65887, 'esES', 'A las montañas', 'Reúnete con los reflejos exactos de Khadgar y Kalecgos en la base del Coto de Vakthros.', 'Lo de ahí arriba es un espectáculo digno de ver, ¡Khadgar y Kalecgos combatiendo contra los Primalistas en el cielo!\n\nHan invocado varios reflejos exactos de sí mismos para ayudarte a atravesar el monstruoso agujero que han creado los Primalistas.\n\nHay un par de ellos esperándote en la base de la montaña. \n\nSi las cosas empiezan a ir mal..., bueno, avisaré al resto en las Tierras Azures.', '', '', '', '', '', 'Reúnete con los reflejos exactos de Khadgar y Kalecgos en la base del Coto de Vakthros.', 47187),
(65886, 'esES', 'Al Escudo de Rhonin', 'Reúnete con Drok Puñalapergaminos en el Mirador de la Torre.', 'Raszageth y los Primalistas están lanzando un ataque a gran escala en la torre llamada Vakthros, al norte. ¡No podemos dejar que se salga con la suya!\n\nKhadgar y yo nos adelantaremos para ocuparnos de la situación desde los cielos.\n\nDirígete al Escudo de Rhonin, uno de los últimos campamentos del Kirin Tor en la zona.\n\nLlegarás ahí más rápido si montas sobre tu draco desde lo alto del archivo.\n\nUna vez allí, asegúrate de que los miembros del Kirin Tor están a salvo y luego dirígete a Vakthros.\n\nContamos contigo para que nos ayudes desde tierra.', '', '', '', '', '', 'Reúnete con Drok Puñalapergaminos en el Escudo de Rhonin.', 47187),
(65875, 'esES', 'El día libre de un dragón', 'Encuentra las diferentes bebidas para Vazallia.', 'Una vida en Terrallende... luchando a todas horas. ¡Así no hay quien tenga tiempo de relajarse!\n\nA veces, una dragona solo necesita un día de descanso con una bebida fresquita entre las garras.\n\nOye, ¡igual tú puedes ayudarme a relajarme! Hazme un favor e intenta encontrar algunas de esas bebidas para reabastecernos.', '', '', '', '', '', '', 47187),
(65874, 'esES', 'Una revelación podrida', 'Habla con Hanu, con la anciana Poa y con Norukk.', 'Mmm...\n\n<Brel observa atentamente al extraño tótem mientras le da la vuelta con sus gruesas manos>.\n\nTenemos que recomponernos el bigote y averiguar qué significa esto.', '', '', '', '', '', '', 47187),
(65873, 'esES', 'El líder de la manada zarpasombra', 'Mata a Kargozarpa y recupera su tótem.', 'Kargozarpa es el verdadero líder de los gnolls en esta parte del bosque. Hemos tenido... encuentros desagradables en el pasado.\n\nEsta vez fue distinto. Llevaba un extraño tótem que parecía retorcer su propia esencia.\n\nHay que detener a Kargozarpa y recuperar el tótem. Me temo que los gnolls están metidos en algo más oscuro de lo que imaginamos.', '', 'Kargozarpa siempre ha sido malo, pero se ha vuelto más agresivo desde que lleva un tótem fétido.', 'Kargozarpa el Fétido', '', '', '', 47187),
(65872, 'esES', 'Gnolls enfermos con intenciones enfermizas', 'Mata a $1oa gnolls zarpasombra en el Cubil de Kargozarpa.', 'Estoy captando un olor extraño en el viento. Algo no va bien...\n\nHanu describió a los gnolls que hay en esta cueva como extraños... y enfermos.Deberíamos averiguar lo que está provocando esta situación.\n\nNo bajes la guardia. A pesar de su aspecto enfermizo, no dejan de ser taimados y peligrosos.', '', '', '', '', '', '', 47187),
(65871, 'esES', 'Gnoll hay salida', 'Rescata a Norukk y a otros $1oa colmillarr cautivos.', 'He seguido el rastro de los colmillarr capturados, entre ellos mi marido Norukk, hasta esta cueva.\n\nNorukk no suele cuidarse mucho, así que esa responsabilidad es mía. Pero no soy tan orgullosa como para rechazar ayuda.\n\n¡Debemos rescatarlos!', '', '', '', '', '', '', 47187),
(65870, 'esES', '¡Suministros!', 'Recupera los alijos de suministros de caza.', 'No había rastro de nuestros suministros de caza en las Colinas del Gran Árbol. Deben de estar en esa cueva.\n\nBusca contenedores de suministros y prepárate para cualquier cosa.\n\nNo creo que los gnolls dejen la mercancía sin vigilar.', '', '', '', '', '', '', 47187),
(65869, 'esES', 'Otra emboscada', 'Habla con Akiun y examina $2oa cadáveres cercanos.', 'Qué tragedia. Y puede que sea la primera de muchas.\n\nAverigua qué sabe Akiun y examina a los caídos durante el ataque.\n\nTengo una corazonada sobre lo que ocurrió aquí. Veamos si las pistas refrendan mi teoría.\n\nMientras tanto, intentaré templar los ánimos por aquí.', '', '', '', '', '', '', 47187),
(65868, 'esES', 'No son para masticar', 'Recupera $1oa ofrendas funerarias.', 'He encontrado una de las ofrendas funerarias de Ponoliak. Esos gnolls zarpasombra le han dado un mal uso y luego la han desechado... Tiene marcas de mordiscos.\n\nNecesitamos esa ofrenda y unas cuantas más para la ceremonia funeraria en honor del jefe de Iskaara.\n\nEs una ofensa que algo tan sagrado sea usado como un mordedor de juguete. Busca más ofrendas.', '', '', '', '', '', 'Reúnete con Hanu en la entrada al Cubil de Kargozarpa en las Colinas del Gran Árbol.', 47187),
(65867, 'esES', 'Aullidos en las Colinas del Gran Árbol', 'Mata a Durgun, a Kerwal y a Bakra.', 'Los gnolls que atacaron nuestra caravana estaban a las órdenes de tres lugartenientes.\n\nA Durgun lo acompañaba una docena de hienas.\n\nKerwal se reía como un maníaco cada vez que lo perseguíamos y caíamos en sus trampas dentadas.\n\nBakra nos provocaba sin piedad.\n\nSi queremos recuperar lo que han robado, deben morir.', '', '', '', '', '', 'Reúnete con Hanu en la entrada al Cubil de Kargozarpa en las Colinas del Gran Árbol.', 47187),
(65866, 'esES', 'Romper las trampas', 'Activa $1oa trampas dentadas.', 'Las colinas están llenas de insidiosas trampas dentadas.\n\nPodrás localizarlas si te fijas bien. Actívalas con mucho cuidado y con el viejo truco colmillarr: un palo largo. Aunque también se pueda hacer pisándolas, no te lo recomiendo.\n\nCuando hayas eliminado las suficientes, busca a Hanu. La anciana Poa y yo os alcanzaremos cuando podamos.', '', '', '', '', '', 'Reúnete con Hanu en la entrada al Cubil de Kargozarpa en las Colinas del Gran Árbol.', 47187),
(65865, 'esES', '¡Nos tienen inmovilizados!', 'Mata tiradores certeros gnoll.', 'Los tiradores certeros gnoll son despiadados... y sorprendentemente precisos.\n\nNo podemos plantearnos partir hacia las Colinas del Gran Árbol mientras tengan sus armas preparadas para atacarnos.\n\n¡Reduce su número y hazles saber que no nos usarán para prácticas de tiro!', '', '', '', '', '', 'Reúnete con Hanu en la entrada al Cubil de Kargozarpa en las Colinas del Gran Árbol.', 47187),
(65864, 'esES', 'Alcanzar la caravana', 'Alcanza a Brena cerca de las Colinas del Gran Árbol.', 'Deberías alcanzar a Brena. Su caravana pasó por aquí hace un par de horas.\n\nViajaban recogiendo las posesiones más valiosas del difunto jefe para llevar a cabo un funeral en su honor.\n\nIban bastante cargados, así que no creo que anden lejos.', '', '', '', '', '', '', 47187),
(65855, 'esES', 'Al socorro de las Tierras Azures', 'Vuelve con Noriko la que Todo lo Recuerda en el Campamento de Antonidas.', 'No se puede reclamar la energía de la piedra de juramento hasta que se reparen las líneas Ley de las Tierras Azures.\n\nSolo se puede llegar a algunas líneas Ley si se dispone de las habilidades de Kalecgos..., pero quizá puedas ayudarnos en esto.\n\nSi han sobrevivido, busca a los colmillarr. En mis tiempos vivían aquí y conocen la tierra a fondo.\n\nHabla con uno de nuestros soportes Arcanos para volver con tus aliados.', '', '', '', '', '', 'Habla con Noriko la que Todo lo Recuerda en el Campamento de Antonidas.', 47187),
(65854, 'esES', 'Reclamar la piedra de juramento', 'Observa cómo Kalecgos reclama la piedra de juramento azur.', 'Buen trabajo. Parece que hemos logrado reparar las líneas Ley del Archivo Azur.\n\nCuando el Vuelo Azul estaba unido, les decía a mis hermanos y hermanas que nunca debían dudar de la fuerza de los mortales.\n\nReúnete conmigo en la piedra de juramento que hay al sur de aquí. La reclamaré y volveré a Thaldraszus.', '', '', '', '', '', 'Habla con Sindragosa.', 47187),
(65852, 'esES', 'Directo a la cima', 'Busca la roca pisoteadora Arcana en la bolsa de cosas útiles y úsala en un punto de enfoque Arcano para llegar a lo alto del Archivo Azur.', 'Parece que algo está debilitando las energías Arcanas en la cúspide de la torre.\n\nAhora que has estabilizado las energías aquí abajo, deberías poder \"montar\" la magia Arcana de la zona.\n\nBusca en tu bolsa algo llamado \"roca pisoteadora Arcana\" y úsala para reunirte conmigo allí arriba.', '', '', '', '', '', 'Reúnete con Kalecgos en lo alto del Archivo Azur.', 47187),
(65850, 'esES', 'El ciclo del mar', 'Habla con Brena para presenciar la ceremonia funeraria.', 'Gracias, $n. He averiguado lo que necesito de nuestros nuevos amigos.\n\nLa ceremonia funeraria en honor de su antiguo jefe está a punto de empezar. Como los habitantes de Iskaara han sido tan amables y hospitalarios, lo adecuado es que los acompañemos antes de volver a los archivos.\n\nHabla con Brena y dile que estamos preparados.', '', '', '', '', '', '', 47187),
(65849, 'esES', 'A Iskaara', 'Reúnete con Brena en Iskaara.', 'Gracias por tu ayuda, $n. Mi familia está a salvo gracias a ti.\n\nAl fin podemos volver a Iskaara y ver cómo devuelven al mar al viejo Ponoliak. Fue mi mentor y un buen jefe. \n\nAcompáñanos, por favor. La celebración del ciclo del mar es algo en lo que puede participar todo el mundo.', '', '', '', '', '', 'Reúnete con Brena en Iskaara.', 47187),
(65848, 'esES', 'Vínculo de tomo y lomo', 'Habla con Kalecgos para abrir el portal y luego usa lo que invoque para eliminar a los putrefactores Frondacuero y para destruir al anciano retorcido.', '¡Debemos pararle los pies a ese árbol! Ahora que tengo estos cristales Ley, por fin podré ayudar.\n\nAvísame cuando quieras empezar. Abriré un portal al Archivo Azur e intentaré invocar algo útil.\n\nAtrás, puede que sea un poco inestable.', '', '', '', '', '', 'Habla con Kalecgos en la cueva de cristal Ley.', 47187),
(65847, 'esES', 'Realineación', 'Concéntrate en el cristal Ley y destruye 3 infecciones de descomposición.', 'Ahora, a por la línea Ley. Parece que ha sucedido lo que me temía: la descomposición se ha propagado a ella.\n\nTendremos que purgarla y acelerar el proceso de sanación, pero no puedo canalizar suficiente energía solo con mi reflejo exacto.\n\nConcéntrate en este cristal Ley. Mi conexión contigo me ayudará a teletransportarme físicamente a este lugar. Cuando lo consiga, tendré las fuerzas suficientes.', '', '', '', '', '', 'Encuentra a Kalecgos en el exterior de Frondacuero.', 47187),
(65846, 'esES', 'Basura Ley', 'Recoge $1oa cristales Ley en las Afueras de Frondacuero.', 'La línea Ley está aquí... ¡La noto!\n\nPero antes debemos detener a los gnolls. Ese anciano será su arma más poderosa.\n\nLos gnolls han reunido algunos cristales Ley. Por suerte, no parecen entender el poder que albergan.\n\nTráeme tantos como puedas. Potenciarán mi reflejo exacto y me ayudarán a invocar algo útil del archivo para acabar con ese monstruo.', '', '', '', '', '', '', 47187);
INSERT INTO `quest_template_locale` (`ID`, `locale`, `LogTitle`, `LogDescription`, `QuestDescription`, `AreaDescription`, `PortraitGiverText`, `PortraitGiverName`, `PortraitTurnInText`, `PortraitTurnInName`, `QuestCompletionLog`, `VerifiedBuild`) VALUES
(65845, 'esES', 'Ecos de los caídos', 'Coloca el tótem de Brena cerca de $1oa cadáveres colmillarr para contactar con los espíritus.', '¡Aquí hay colmillarr! Mis amigos, mi gente..., mi familia. Se fueron a cazar hace apenas una semana.\n\nEstán demasiado descompuestos para recuperarse.\n\nSus espíritus siguen aquí. Están sumidos en la ira y el arrepentimiento. Kaqiata, Lutokk, Tuyuki...\n\nPor favor, $n, toma este tótem y colócalo cerca de sus restos. Se pondrá en contacto con sus espíritus y les ayudará a encontrar la paz.', '', '', '', '', '', '', 47187),
(65844, 'esES', 'Arrancar la podredumbre', 'Mata a $1oa antárboles putrefactos y a $2oa lanzapodredumbres Frondacuero.', '¡La descomposición les debe de haber podrido tanto los cerebros como los cuerpos a los gnolls!\n\nSon una especie destructiva, pero son nativos de esta tierra..., como nosotros.\n\nNo obstante, ya les hemos visto propagar la descomposición a la tribu del Gran Árbol. A este ritmo, consumirán toda la zona y se acabarán destruyendo a sí mismos.\n\nNo podemos permitir que ocurra. Es una pena, pero... acaba con ellos.', '', '', '', '', '', '', 47187),
(65842, 'esES', 'Comportamiento desarmador', 'Elimina a la maestra de armas Vordak y consigue $1oa armas rompemundos.', 'No siento mucho aprecio por los dragonantes rompemundos. Creen erróneamente que Alamuerte regresará algún día, y no nos ayudarán a proteger el Trono Obsidiana.\n\nLa maestra de armas Vordak, que antaño juró lealtad al Príncipe Negro, ha robado muchas armas fabricadas aquí, en la ciudadela, para entregárselas a los rompemundos. No permitiré tal robo ni tal traición.\n\nVe a la Cima Humeante y recupéralas... Usa la fuerza, si es preciso.', '', '', 'La maestra de armas Vordak', '', '', '', 47187),
(65841, 'esES', 'Detener la propagación', '', '', '', '', '', '', '', '', 47187),
(65838, 'esES', 'Destruir a los Frondacuero', 'Investiga las Afueras de Frondacuero.', 'Si los gnolls han descubierto la magia de descomposición, entonces tanto la línea Ley como la propia tierra están en grave peligro. \n\nMis reflejos exactos apenas dan abasto para hacer frente a una perturbación elemental a esta escala. Ve al bosque e investiga la descomposición.\n\nColaboraré con nuestros nuevos amigos colmillarr para encontrar un lugar en el que pueda mantener este reflejo y luego te veré en el interior del bosque.\n\n¡Debemos acabar con esto!', '', '', '', '', '', 'Habla con Kalecgos en las Zarzas Frondacuero.', 47187),
(65837, 'esES', 'Problemas en los pinos', 'Habla con el centinela Olekk en el Puesto del Pinar, que está en las Llanuras de Ohn\'ahra.', 'Se ha producido un ataque de los Primalistas en las Tierras Altas de Shikaar.\n\nSi tienes información o crees que puedes ayudar, dirígete al Puesto del Pinar y busca a Olekk. Dile que te envío yo. <Tirren se ríe>. Espero que ese pezuñas sucias se acuerde de mí.\n\nNo te alejes de los caminos, $p. Las llanuras no son tan pacíficas desde que han ocurrido todos estos cambios.', '', '', '', '', '', 'Habla con el centinela Olekk en el Puesto del Pinar, que está en las Llanuras de Ohn\'ahra.', 47187),
(65836, 'esES', 'Una exhibición de tormentas', 'Reúnete con Watu en el Pinar Sabiacresta.', '<Watu se levanta con facilidad, como si no estuviese herido>.\n\nM-me he clavado el fragmento. Ya no me duele nada. Me siento bien. Genial. Hasta eufórico.\n\nOlekk aún no ha vuelto. Le habrá pasado algo. ¡No tendría que haberse ido sin mí!', '', '', '', '', '', '', 47187),
(65834, 'esES', 'Regicidio de ocho patas', 'Mata a la reina de red trémula.', '¡Vamos allá! Un pelín de educación formal, una pequeña conjetura educada, un toque de runas recinceladas y... obtenemos un desinfusor de magia. ¿Desinyector? ¿Desimbuidor?\n\n¡No importa! A la reina no le gustará un pelo, de eso estoy seguro. Tiene que morir si queremos conjurar esta amenaza. Aplastar a las pequeñitas solo ralentizará a esos seres; hay que acabar con ellos desde el origen.', '', 'Nunca debe haber una reina araña.', 'Reina de red trémula', '', '', '', 47187),
(65833, 'esES', 'Manipulación primalista', 'Recupera las tres piedras rúnicas de los clamaventiscas.', 'Los Primalistas están imbuyendo las arañas de Hielo elemental y piensan usarlas como tropas de choque para superar las defensas de los dragones en las Tierras Azures. No podemos permitirlo.\n\nLos tres que parecen helados están al mando. Elimínalos y tráeme las piedras rúnicas que están usando para concentrar la magia primigenia. Así podremos cortar ese flujo.', '', '', '', '', '', '', 47187),
(65832, 'esES', 'Anticongelante enano', 'Encuentra $1oa frascos de anticongelante enano.', '¡Estoy en un buen aprieto, $Umuchacho:muchacha;! Esos Primalistas chupahielos me han encerrado en este enorme cubo de hielo y la única razón por la que no me he congelado del todo es por mi alijo secreto de material de primera.\n\nPor desgracia, cuando esa escoria ladrona me atacó, me quitó lo que no llevaba escondido y me estoy quedando sin nada.\n\n¿Tendrías la bondad de traerme unos frascos antes de que se me congele la sangre?\n\nAh, y $Umuchacho:muchacha;, si tienes que sacar alguno del innombrable de una de esas arañas, no me lo digas. Prefiero no saberlo.', '', '', '', '', '', '', 47187),
(65806, 'esES', 'Maruukai', 'Viaja a Maruukai.', '<Okir pone voz a las señales de la khan Sansok>.\n\nMaruukai se encuentra junto a la montaña que hay cerca de esta arboleda. Nuestro viaje casi ha terminado.\n\nDurante el Khural, los Maruuk mantienen una tregua, pero los presagios de Ohn Seshteng son preocupantes. Debemos mantenernos alerta.', '', '', '', '', '', '', 47187),
(65805, 'esES', 'Conexión con Ohn\'ahra', 'Recoge $1oa juncos fluviales, $2oa plumas de cola de ave y un corazón de salamantra en la orilla del río.', 'El viento está inquieto, $n. Ohn\'ahra trata de decirnos algo, y yo debo responder a la llamada.\n\nNecesito componentes para mi ritual: juncos de la orilla del río, plumas de cola de ánade real y el corazón de una salamantra. Reúne estos materiales del río para que pueda escuchar su voz.', '', '', '', '', '', '', 47187),
(65804, 'esES', 'En la comida y la guerra', 'Recoge $1oa trozos de carne de caza fresca de la fauna en la Estepa del Errante.', 'Los Maruuk viajan desde todas las llanuras para asistir al Khural, y la reunión dura bastantes días.\n\nAlimentar a tantos centauros no es tarea fácil. Los cazadores del Clan Shikaar se encargan de conseguir la carne para todas las comidas que compartimos. La caza de camino a Maruukai forma parte de nuestra tradición.\n\nTú también debes contribuir.', '', '', '', '', '', '', 47187),
(65803, 'esES', 'Hacia la ciudad', 'Viaja junto a la caravana Shikaar hasta la Estepa del Errante.', 'El Khural marca un tiempo para que los clanes debatan. Además, se comparten historias. Hay muchos clanes de centauros en las llanuras, pero todos somos Maruuk.\n\nLa caravana está lista para emprender la marcha. Como Maruukai está un poco lejos, haremos algunas paradas.\n\nCuando quieras partir, búscame en la caravana. No nos hagas esperar.', '', '', '', '', '', '', 47187),
(65802, 'esES', 'Suministros para el viaje', 'Recoge $1oa provisiones del campamento en los alrededores de la Avanzada Pasoleño y $2oa vainas de flor feral en los bosques cercanos.', '<Okir pone voz a las señales de la khan Sansok>.\n\nDeberás ayudar si vas a viajar con nosotros. Últimamente, unos górlocs han estado robándonos los suministros médicos, y debemos conseguir más. Recoge las flores naranjas alrededor de la avanzada para que podamos crear más cataplasmas.\n\nTambién hay suministros alrededor de la avanzada que hay que llevar a la caravana. Me gustaría que los recogieras mientras estas fuera.\n\nCuando lo tengas todo, llévaselo a Tomul.', '', '', '', '', '', 'Informa a la exploradora Tomul.', 47187),
(65801, 'esES', 'Hacer las presentaciones', 'Preséntate ante los miembros del Clan Shikaar.', '<Okir pone voz a las señales de la khan Sansok>.\n\nHan pasado innumerables generaciones desde que un forastero:una forastera; como tú llegara a nuestras tierras. Con los Primalistas merodeando por nuestras tierras y usando magias prohibidas, entenderás que mi gente esté un poco alarmada.\n\nDebes darte a conocer si quieres viajar con nosotros. Preséntate ante los miembros de mi clan.', '', '', '', '', '', 'Informa a la exploradora Tomul.', 47187),
(65798, 'esES', 'Un enfoque oportunista', 'Recupera armas y destruye las fuerzas de los Nokhud en la Vereda de Nokhud.', 'Los Shikaar han formado una línea ofensiva contra los Nokhud al norte. Aunque no me gusta la idea de detenernos para saquear, es un mal necesario para reponer nuestros suministros. Sal al campo de batalla, vuelve con armas y te recompensaré.\n\nQuizá los ancestros me juzguen con menos dureza si te centras en el bando Nokhud para esta tarea.', '', '', '', '', '', '', 47187),
(65796, 'esES', 'La mejor defensa...', 'Mata a Sirena la Quiebracolmillos.', 'Nuestro siguiente camino atraviesa el territorio de los Nokhud. Siempre hemos mantenido una frágil paz con su clan, pero los tiempos han cambiado. \n\nSi no actuamos primero, quedaremos sin protección y seremos vulnerables. Mis exploradores me han informado de que se ha avistado a una de sus líderes de guerra cerca del Concilio del Dragón. Lucha con ella directamente, no permitas que reúna fuerzas para atacarnos por el camino.', '', '', '', '', '', '', 47187),
(65795, 'esES', 'La siguiente estepa', 'Reúnete con la embajadora Taurasza en la Avanzada Escama Rubí.', 'El Vuelo Verde solicita tu ayuda, adalid. La hija de mi hermana y su Vuelo han entrado en el Sueño Esmeralda para potenciar la piedra de juramento, pero no tenemos noticias desde que comenzó su sueño.\n\nBusca a los centauros que gobiernan las Llanuras de Ohn\'ahra. Puede que necesites su conexión con la tierra y los espíritus si quieres despertar a los verdes.\n\nSon un pueblo orgulloso y territorial, y no se toman los insultos a la ligera. Habla con nuestra embajadora, ella te asesorará.', '', '', '', '', '', 'Reúnete con la embajadora Taurasza en la Avanzada Escama Rubí.', 47187),
(65794, 'esES', 'El deber del cuidado', 'Presencia la devolución de los huevos de dragón negro a los Estanques de Vida.', 'Te doy las gracias, $c, y mis condolencias por tener que lidiar con esa pareja durante tanto tiempo.\n\nEl Vuelo Rojo tiene el deber de conservar y cuidar a todos los dragones verdaderos, por muy fastidiosos que puedan ser.\n\nAhora que hemos recuperado los huevos del Vuelo Negro, los dragónicos están unidos como nunca desde hace diez mil años. Creo que esto es lo que encenderá la piedra de juramento rubí.\n\nHabla conmigo cuando estés listo:lista; para traer los huevos a los Estanques de Vida Obsidiana.', '', '', '', '', '', '', 47187),
(65793, 'esES', 'El vuelo del carro negro', 'Escolta los huevos a los Estanques de Vida.', 'Ahora que hemos potenciado de nuevo la piedra de juramento, debemos transportar el futuro de los nuestros a los Estanques de Vida. Nutrir los huevos con sus aguas es un derecho de todo Vuelo que se precie.\n\nPor desgracia, nuestros enemigos estarán vigilando los cielos ahora que hemos aparecido. Llevaremos a cabo la última parte del viaje a pie para evitar que nos detecten.\n\nReúnete conmigo cerca del Baluarte Obsidiana, $c. Como adalid de la Protectora, te invito a que me acompañes.', '', '', '', '', '', 'Habla con Sabellian en lo alto del Vitasagrario Rubí.', 47187),
(65792, 'esES', 'Diente por diente', 'Mata a $1oa colmillorrocas con Toluijin.', 'Toliqui ha estado contando por ahí que el otro día mató un colmillorroca sin ayuda. Puesto que nuestras almas están conectadas, no quiero llamarla mentirosa. Así que, en lugar de eso... \n\nQuiero demostrarle a ella y al resto que, de nuestra alma, soy la mejor mitad. La misión de colmillorrocas más cercana está al noreste. ¡Nos vemos allí!', '', '', '', '', '', '', 47187),
(65791, 'esES', 'Patrona de la Vida de servicio', 'Reúnete con Alexstrasza junto a la piedra de juramento rubí.', 'Pronto, los Estanques de Vida volverán a estar completos.\n\nGracias por tu ayuda, $n, es más importante de lo que puedo expresar con palabras.\n\nVe a ver a la Protectora junto la piedra de juramento y dile que está todo listo para los huevos.', '', '', '', '', '', 'Reúnete con Alexstrasza junto a la piedra de juramento rubí.', 47187),
(65789, 'esES', 'Donde duermen los ríos', 'Recoge componentes del Fangal Leñanudo.', 'El Leñanudo contiene componentes clave que suelen utilizarse para hablar con los ancestros. Por desgracia, la tribu Aletalodo ha infestado la zona, lo que nos dificulta su búsqueda.\n\nSi pudieras recoger algunas de las flores de la marisma, junto con algunos de los recursos de los Aletalodo, te lo agradecería.', '', '', '', '', '', '', 47187),
(65783, 'esES', 'Te damos la bienvenida a nuestro fuego', 'Reúnete con la exploradora Tomul en la Avanzada Pasoleño.', 'Has luchado junto a nuestros cazadores y te has ganado un lugar en nuestro fuego.\n\nNuestra khan se encuentra en nuestro puesto de caza en el pantano, preparando nuestra próxima caravana. Le informaré de tu llegada y de tu propósito.\n\nEstoy segura de que te las apañarás para volver.', '', '', '', '', '', 'Reúnete con la exploradora Tomul en la Avanzada Pasoleño.', 47187),
(65782, 'esES', 'Bajo triple llave', 'Hazte con la llave de la celda del rompemundos y libera a Ayasanth.', 'Cuando oímos rumores sobre un culto de Alamuerte, la mayordoma Selistra me ordenó que trajera a esos antiguos escamosos de vuelta al redil. Esperábamos que se tratase de un simple malentendido.\n\nEstá claro que nos equivocamos.\n\nHay que ocuparse de su líder, pero antes tengo que salir de esta jaula. Busca la llave y tráemela.', '', '', '', '', '', '', 47187),
(65780, 'esES', 'A prueba', 'Mata al protodragón llameante.', 'Puede que un regalo de los dragones impresione a algunos centauros, pero el Clan Shikaar necesita ver cómo se te da cazar.\n\nUno de nuestros grupos de caza acaba de eliminar a un protodragón imbuido del poder de la llama. Demuestra tus habilidades ayudando a acabar con él.', '', 'Cuando un centauro joven alcanza la madurez, se espera que participen en su primera cacería de protodracos.', 'El protodragón llameante', '', '', '', 47187),
(65779, 'esES', 'Hacia las llanuras', 'Reúnete con la exploradora Shikaar en las Llanuras de Ohn\'ahra.', 'El Vuelo Verde ha vuelto a sus jardines en las llanuras cercanas. La reina Alexstrasza desea que contactes con Merithra del Sueño.\n\nLos centauros de esas llanuras son cazadores feroces. Para llegar a los Jardines Esmeralda, antes tendrás que establecer relaciones diplomáticas con ellos.\n\nTrátalos con respeto, pero no muestres debilidad.', '', '', '', '', '', 'Reúnete con la exploradora Shikaar en las Llanuras de Ohn\'ahra.', 47187),
(65778, 'esES', 'Gastronomía alachirrido', 'Ponte el disfraz y usa el prototipo de \"huevo\" con la chef personal de la matriarca.', '¿Todo listo para hacer uso de tus dotes interpretativas, $n?\n\n¿Qué? ¿Cómo que no tienes ni idea? ¡Pues menos mal que he creado este disfraz de alachirrido im-PÍO-cable con los materiales que me has traído!\n\nSegallia y yo necesitamos más tiempo para terminar de fabricar el \"huevo\" final que eliminará a la matriarca, pero he creado una versión más pequeña como prototipo para que la pongas a prueba con la chef.\n\n¡Y no te preocupes! ¡Te garantizo un doce por ciento más de seguridad frente a explosiones bajo todas esas plumas!', '', '', '', '', '', '', 47187),
(65777, 'esES', 'Collar embarrado', 'Localiza a alguien experto en artefactos de cacería hechos a mano.', '<Las antiguas marcas del collar resultan bastante difíciles de leer, pero los materiales parecen hechos de pellejo de animal y fragmentos de hueso tallados.\n\nPuede que alguien experto en caza pueda obtener información sobre el valor de este objeto>.', '', '', '', '', '', '', 47187),
(65770, 'esES', 'Una promesa es una promesa', 'Promete a la iniciada Radiya que guardarás su secreto.', 'Parece que los animales se sienten cómodos contigo. Eso indica que tienes un buen espíritu.\n\nLa verdad es que... ¿Puedes guardar un secreto? Quiero presentarte a mi amiga. Nadie sabe que existe.\n\nTienes que prometerme que esto quedará entre $gnosotros:nosotras;. Mi Ohn me expulsaría de las llanuras si se enterara.', '', '', '', '', '', 'Habla con el ohuna Godoloto.', 47187),
(65769, 'esES', 'Telarañas heladas', 'Libera a $1oa supervivientes en capullo en el Valle Red Trémula.', 'Muchos de mis amigos y colegas fueron capturados cuando los arácnidos y sus señores primalistas atacaron.\n\nVi que los envolvían con telarañas heladas y se los llevaban a un destino que no me atrevo ni a imaginar.\n\nPor favor, ¡libera a todos los que puedas!', '', '', '', '', '', '', 47187),
(65761, 'esES', 'Más aventuras de lo esperado', 'Colabora con Godoloto para encontrar y rescatar a Radiya.', '<Godoloto te mira fijamente y con semblante acusador. Resopla>.\n\n<Quizás el ohuna pueda ayudarte a encontrar y rescatar a Radiya>.', '', '', '', '', '', '', 47187),
(65760, 'esES', 'A sus órdenes', 'Sigue a Sendrax hasta la Avanzada Corazón de Dragón.', 'Solo conozco a los Djaradin por los libros.\n\nAntiguos rivales de los dragones, poderosos gigantes que dominaban la tierra y la lava... dedicados en cuerpo y alma a cazar dragones hasta extinguirlos.\n\n<Sendrax frunce el ceño mirando el lejano volcán>.\n\nMe contaron que nadie los volvió a ver cuando se fueron los dragones, y que dormían en las profundidades de la tierra.\n\nSi han despertado, ¡todos los vástagos de las islas están en peligro!\n\nSígueme, iremos a ver al comandante Lethanak en la Avanzada Corazón de Dragón.', '', '', '', '', '', 'Habla con el comandante Lethanak en la Avanzada Corazón de Dragón.', 47187),
(65758, 'esES', 'Grungir el expedicionario', 'Encuentra a Grungir Picohierro.', '¡$N! Mi homólogo de la Liga de Expedicionarios, Grungir Picohierro, no se encontraba entre los que rescataste. Al principio consiguió escapar, pero, cuando vio que solo unos pocos conseguimos salir, se dio la vuelta y volvió a entrar. ¡Solo!\n\nEl patán es tan valiente como impulsivo y no merece el destino que le ha tocado.\n\nPor favor, encuéntralo.', '', '', '', '', '', '', 47187),
(65752, 'esES', 'Molestias arcanas', 'Mata a $1oa vermis devoradoras.', 'Muchas vermis de maná están absorbiendo la magia Arcana salvaje que sale del archivo.\n\nLa velocidad a la que lo hacen está alterando el equilibrio de las líneas Ley y eso impide reclamar la piedra de juramento azur.\n\nUsaré parte de la Arcana inestable que has recogido para formar una especie de gancho.\n\nUtilízalo para matar unas cuantas vermis. Un breve retraso bastará para ajustar las energías de abajo.', '', '', '', '', '', '', 47187),
(65751, 'esES', 'Ajustes de la plataforma', 'Disipa $1oa de energía Arcana inestable en la parte superior del Archivo Azur.', 'Parece que la última perturbación Arcana está aquí arriba.\n\nSeguiré ajustando las energías Ley. Usa algunas de las Arcanas que has recuperado para disipar las perturbaciones.', '', '', '', '', '', '', 47187),
(65750, 'esES', 'La amenaza de ocho patas', 'Mata $1oa trepadores de red trémula o reptadores de red trémula y $2oa primalistas cuidadores en el Valle Red Trémula.', '¡$C!\n\nNecesito tu ayuda, si tienes la bondad...\n\nEsta expedición conjunta tenía el objetivo de estudiar a los arácnidos únicos que habitan la zona, pero, como puedes ver, nuestros planes se han ido al traste. \n\nLo que al principio creíamos que era una adaptación evolutiva ha resultado ser una perversión del orden natural por parte de los Primalistas.\n\nComo conservacionista que soy, me tomo muy en serio mis responsabilidades, pero el momento de estudiar especímenes vivos ha pasado. No podemos dejar que su perversión se extienda. Y siempre podemos estudiar sus cadáveres. \n\n¿Podrías ayudarnos?', '', '', '', '', '', '', 47187),
(65711, 'esES', 'Robar el trueno', 'Mata a los extractores de tormentas y rescata a la espinatrueno Lizi en el Campamento Kaighan.', '¡Eres tú! Bendita sea Ohn\'ahra. Fingí que estaba herida para engañar al siguiente bruto que se acercara. Uf, esos chupapezuñas me han lanzado un hechizo de vinculación. Lo aguantaré.\n\nTienen a Lizi en la cueva. Sálvala, por favor. Ya veré cómo liberarme.\n\nHaz lo que tengas que hacer.', '', '', '', '', '', '', 47187),
(65709, 'esES', 'Poda Arcana', 'Busca el cetro Ley en la bolsa de cosas útiles y úsalo para reparar 2 plataformas.', 'No podemos activar la piedra de juramento del Archivo Azur hasta que solucionemos el problema de la energía Ley descontrolada.\n\nLa Arcana inestable está asfixiando dos de las tres runas dracónicas que deben controlarla.\n\nSiento que tengas que encargarte tú debido a las responsabilidades de Khadgar y a la ausencia de mis hermanos.\n\nHay un cetro Ley en la bolsa de cosas útiles que tienes.\n\nÚsalo para ayudarnos a reparar las runas cercanas.', '', '', '', '', '', '', 47187),
(65702, 'esES', 'Enloquecedor', 'Recupera $1oa de energía Arcana inestable.', 'El Archivo Azur fue en su día un lugar donde los dragones azules se reunían para hablar de magia.\n\nAhora soy el único de los míos que queda aquí.\n\nEste lugar controla las líneas Ley que hay bajo las Tierras Azures, pero sus sirvientes han perdido el control.\n\nCreo que, si restauramos el orden en este lugar, puedo recuperar la piedra de juramento azur.\n\nLos diversos ensamblajes y elementos rebosan energía Arcana inestable que se debe redirigir.\n\nDestrúyelos y recoge lo que puedas.', '', '', '', '', '', '', 47187),
(65701, 'esES', 'Preservación o Devastación', 'Elige una especialización.', 'Si lo que dicen estos dragones es cierto, se avecina una gran batalla. Necesitamos tu concentración y tu fortaleza, $gevocador:evocadora;.\n\nEs hora de elegir tu especialización de batalla. ¿Te dedicarás a cuidar a tus aliados o a devastar a tus enemigos? \n\nPara perfeccionar tus habilidades de combate, elige Devastación.\n\nPara maximizar tu potencial de sanación, toma el camino de la Preservación.\n\nCualquiera de las dos te dará buenos resultados. Y recuerda que puedes cambiarla o adaptarla más adelante.', '', '', '', '', '', '', 47187),
(65691, 'esES', 'La sombra de sus alas', 'Enfréntate a Cygenoth, la Voz de Neltharion.', 'La Voz de Neltharion reside en lo profundo y propaga mentiras entre sus seguidores.\n\nParece ser un dragauro como yo, pero su dracónico es muy tosco, digno de un sin escamas.\n\nSospecho que hay algo falso: una ilusión, quizás. Si podemos subyugarlo, sabremos la verdad.', '', 'Autoproclamada Voz de Neltharion y líder de los rompemundos.', 'Cygenoth', '', '', '', 47187),
(65690, 'esES', 'Recelo de cultor', 'Encuentra a Ayasanth en el Nido Humeante.', 'Ayer llegó otra forastera. Dijo ser una \"emisaria\" del Vuelo Rojo y pidió una audiencia con nuestro líder, la Voz de Neltharion.\n\nPero la Voz se enfadó mucho. ¡Dijo que el Guardián de la Tierra nos estaba poniendo a prueba y que debíamos ejecutarla!\n\nSé que no debemos confiar en los forasteros, pero tampoco hay por qué matarlos. Por favor, ayúdame a salvarla.', '', '', '', '', '', 'Habla con Ayasanth en el Nido Humeante.', 47187),
(65689, 'esES', 'Las muchas imágenes de Kalecgos', 'Usa el pilón de cristal para llegar al Archivo Azur.', 'Encantado de conocerte formalmente, $n. Me llamo Kalecgos, soy un archimago del Kirin Tor y el Aspecto de los dragones azules.\n\nEstoy teniendo dificultades para reparar el Archivo Azur y reclamar la piedra de juramento azur. Me vendría bien que me echaras una mano.\n\nAhora mismo estoy en el archivo, así que tendrás que subir hasta allí. He podido reactivar el pilón de fuera; eso debería permitirte cruzar hasta aquí arriba.', '', '', '', '', '', 'Habla con Kalecgos en el Archivo Azur.', 47187),
(65688, 'esES', 'Encuentro con Kalecgos', 'Consigue la bolsa de cosas útiles y llévasela a Kalecgos en la base del Archivo Azur.', 'Me temo que tendremos que dividir nuestra atención. Hay que ocuparse de la amenaza primalista del este.\n\nDebo pedirte que viajes por mí al Archivo Azur para ayudar a Kalecgos a reclamar la piedra de juramento azur.\n\nTendrás que recoger suministros que te sirvan de ayuda con lo que sea que esté pasando allí.\n\nHabla con nuestro intendente del portal, te dará algo que te ayude en el camino.\n\nBuena suerte, $n. Kalecgos agradecerá tu ayuda.', '', '', '', '', '', 'Reúnete con Kalecgos en la base del Archivo Azur.', 47187),
(65687, 'esES', 'La hora de las tortas', 'Mata a $1oa dragonantes rompemundos.', 'Algunos de los discípulos son... muy crueles.\n\n<Lingote se frota una herida reciente en el hocico>.\n\nAntes no era así. Cuando Cygenoth llegó, dijo: \"Deberíamos valorar la fuerza por encima de todas las cosas\". Ahora todos luchan continuamente.\n\nIntento defenderme, pero sus pellejos son demasiado fuertes... y mi altura es muy inferior a la suya.\n\n¡Pero no a la tuya! Debes luchar con abusones todo el rato. ¿Podrías ayudarme?', '', '', '', '', '', '', 47187),
(65686, 'esES', 'Hacia las Tierras Azures', 'Reúnete con Glania de los Benditos en las Tierras Azures.', '¡Saludos, $n! \n\nPakina y yo estamos buscando ayuda aquí en nombre del Kirin Tor.\n\nEl Kirin Tor está trabajando para proteger la magia Arcana salvaje de todas las Tierras Azures.\n\nKalecgos, el Aspecto del Vuelo Azul y uno de nuestros líderes, necesita ayuda para recuperar la piedra de juramento azur.\n\nSi quieres ayudar, sigue recorriendo el camino hasta encontrar a Glania de los Benditos.\n\nPodrá decirte dónde será más necesaria tu ayuda.', '', '', '', '', '', 'Reúnete con Glania de los Benditos en las Tierras Azures.', 47187),
(65615, 'esES', 'Intrusión Arcana', 'Investiga la baliza.', 'Esa baliza de ahí delante... Estoy seguro de que no estaba allí cuando nos encarcelaron.\n\nLa hechicería no es mi punto fuerte, pero reconozco la magia Arcana cuando la veo. La misma magia que usó el dragón azul en el nido.\n\nDijo un nombre... Malygos. Me resulta familiar, pero las enseñanzas del Guardián de la Tierra se me antojan lejanas y fragmentadas.\n\nSi ese Malygos fue quien nos puso en estasis, quizás también ordenó que colocaran la baliza Arcana.\n\nInvestiga la zona y luego infórmame. Asegúrate de que no se pueda usar la baliza para pedir refuerzos al enemigo.', '', '', '', '', '', '', 47187),
(65613, 'esES', 'Referente de la moda dracónica', 'Adopta una forma de rostro.', 'Seguro que tu llegada a Orgrimmar ha llamado la atención de sus ciudadanos. Algunos estarán más cómodos que otros ante tu presencia.\n\nCuando yo era un dragón joven, adopté el rostro mortal que ves. Eso me permitió vivir entre los tauren Monte Alto como aliado.\n\nAunque tu camino es distinto al mío, la esencia de los dragónicos también fluye por tus venas, $p. Tal vez sea eso lo que te permite asumir un rostro propio.\n\nVamos a dar un paseo.', '', '', '', '', '', '', 47187),
(65606, 'esES', 'Renombrado con los Maruuk', 'Habla con Agari en Maruukai.', 'Tus hazañas en beneficio de los intereses del clan no han pasado inadvertidas.\n\nVuelve a Maruukai. He preparado algunos suministros que te permitirán ayudarnos.', '', '', '', '', '', '', 47187),
(65595, 'esES', 'Una manzana podrida', 'Mata la raíz de decadencia.', 'Gnolls pasar hambre por podredumbre.\n\nPodredumbre dañar amigos.\n\nAhora nosotros matamos podredumbre. Eso hace monarca.', '', 'Este antárbol malo enseña magia de descomposición a gnolls. Y higiene mala.', 'Raíz de decadencia', '', '', '', 47187),
(65594, 'esES', 'Mucho ruido y pocos gnolls', 'Destruye $2oa tótems de descomposición.', 'Estúpida descomposición creer que manda, pero yo mando. La matamos ahora. Yo convertir moco en amigo.', '', '', '', '', '', '', 47187),
(65490, 'esES', 'Excrementos explosivos', 'Llena el autorrecolector de excrementos de la profesora Chirridos.', 'Las arpías son toda una sorpresa, pero he venido a estas montañas con un único objetivo: ¡¡excrementos!!\n\nEn concreto, los excrementos de rocs plumazul y que luego se comen y digieren los bichos. ¡La bilis de los escarabajos multiplica por diez la potencia del nitrógeno explosivo! ¡Como mínimo!\n\nCoge este autorrecolector de excrementos de Chirridos. Aplasta los escarabajos que hay en la cueva y usa el autorrecolector para recoger el botín.\n\nDevuélvemelo lleno, y podrá comenzar la auténtica diversión: ¡LAS EXPLOSIONES!', '', '', '', '', '', '', 47187),
(65486, 'esES', 'La foto perfecta', 'Monta en la balsa de catalogador con Fren y saca fotos de la fauna local.', 'Perdona si hah ehperado mucho. El telehcopio me dihtrae a veceh.\n\n¿No te parece que eh máh fácil entender el mundo dehde la dihtancia? Nada de interferenciah externah, solo la naturaleza haciendo suh cosah sin nosotroh...\n\n<Akunda la Catalogadora suspira>.\n\nVeo que Coralie te ha dado una cámara. Bien.\n\nVe río abajo con Fren y saca fotografíah de la fauna en suh hábitath naturaleh pa que pueda ehtudiarla.', '', '', '', '', '', 'Vuelve con Akunda la Catalogadora, que está en su campamento.', 47187),
(65475, 'esES', 'Aguantando los chirridos', 'Lleva el pergamino de alachirrido a Harleen Chirridos, que está en los Riscos Plumazul.', '<Sacas un trozo de pergamino de la bolsa pegajosa y ensangrentada de la Zamparrocs. Lo máximo que llegas a distinguir son imágenes de unas arpías devorando huevos enormes.\n\nTienes la certeza de que tu ornitóloga jefa preferida, Harleen Chirridos, entenderá estas marcas de arañazos ininteligibles y profundas>.', '', '', '', '', '', 'Lleva el pergamino de alachirrido a Harleen Chirridos, que está en los Riscos Plumazul.', 47187),
(65453, 'esES', 'Alimañas primigenias', 'Mata $1oa protodracos primigenios en la Costa Indómita.', '<Trillaceniza observa con sospecha a los protodragones que acechan en la cresta que hay detrás de ella>.\n\nJuraría que esos protodragones se acercan un poco más al campamento cada vez que me doy la vuelta.\n\nEsos no son los dragones que Ebyssian nos invitó a conocer.\n\nLos protodragones son depredadores despiadados con los que no se puede razonar. Nosotros debemos ser igual de despiadados.\n\nReduce su número para mantener a raya sus ambiciones, o esta expedición terminará antes de empezar.', '', '', '', '', '', 'Reúnete con la escamandante Trillaceniza en la Embajada Reposo Alado.', 47187),
(65452, 'esES', 'Exploradores en peligro', 'Rescata a 3 miembros de la Expedición Dragontina en la Costa Indómita.', 'No confundas los objetivos académicos de la expedición con timidez, $p.\n\nNo somos eruditos recluidos en altas torres para estudiar antiguos tomos.\n\n¡Somos aventureros, capaces de ir en busca de conocimiento hasta el rincón más inhóspito de Azeroth!\n\nNuestra pasión por la aventura nos lleva a caminos llenos de peligros, y algunos miembros de la expedición se han llevado algún mordisco más de los que quieren admitir...', '', '', '', '', '', 'Reúnete con Naleidea en la Embajada Reposo Alado.', 47187),
(65451, 'esES', 'Materiales de práctica', 'Consigue $1oa escamas de protocría primigenia.', 'Estos protodracos no se parecen a ninguno que haya visto antes en Azeroth.\n\nSus escamas son resistentes al fuego por naturaleza y más fuertes que el acero sin perder flexibilidad alguna. Es increíble.\n\nTodos mis artesanos me están pidiendo a gritos que les consiga algunas de esas escamas para trabajar con ellas.\n\nEmpieza por las crías. Sus pequeñas escamas deberían ser más flexibles hasta que hayamos dominado nuestra técnica trabajándolas.', '', '', '', '', '', 'Reúnete con el jefe Magor en la Embajada Reposo Alado.', 47187),
(65444, 'esES', '¡A las Islas Dragón!', 'Monta en la Dragontina Desafiante a las Islas Dragón desde la torre de zepelines a las afueras de Orgrimmar.', 'La expedición preliminar ha desembarcado en las Islas Dragón.\n\nGracias a los valerosos esfuerzos de la Expedición Dragontina, hemos logrado establecer una zona segura en estas islas y entrar en contacto con la embajada de los Vuelos.\n\n¿Estás $gpreparado:preparada; para acompañarnos en nuestro siguiente viaje a las Islas Dragón?', '', '', '', '', '', 'Reúnete con Naleidea Brillorrío en las costas de las Islas Dragón.', 47187),
(65443, 'esES', 'Coordinación expedicionaria', 'Recluta exploradores, artesanos y eruditos por todo Orgrimmar para la expedición a las Islas Dragón.', 'Encantada de conocerte, me llamo Naleidea Brillorrío.\n\n¡Que nos inviten a visitar las Islas Dragón es muy emocionante, ¿a que sí?!\n\nEl Relicario ha unido fuerzas con sus homólogos expedicionarios para coordinar nuestros esfuerzos. Como miembro de la Expedición Dragontina, es un honor darte la bienvenida.\n\nAunque primero debemos reunir unos cuantos miembros más para nuestro viaje. ¿Empezamos?', '', '', '', '', '', 'Reúnete con Naleidea en la torre de zepelines a las afueras de Orgrimmar.', 47187),
(65439, 'esES', 'Susurros en el viento', 'Habla con el archimago Khadgar a las afueras de Orgrimmar.', 'Hola, $p. Cuánto tiempo. Ay, me encantaría tener más tiempo para ponernos al día.\n\nPero verás, acabo de tener una esclarecedora... No, digamos premonitoria..., sí, premonitoria, conversación con un viejo amigo.\n\nA veces una revelación puede ser ambas cosas, claro.\n\nTengo que contarte todo lo que he descubierto.', '', '', '', '', '', '', 47187),
(65438, 'esES', 'Inicio de misión increíble', '', 'El comienzo de las Tierras Azures.', '', '', '', '', '', '', 47187),
(65437, 'esES', 'La invitación de los Aspectos', 'Habla con Ebyssian.', 'Llegas justo a tiempo, $p.\n\nAcabo de reunirme con el consejo de la Horda, y han aceptado la invitación de los Aspectos a las Islas Dragón.\n\nLa invitación también te incluye a ti, claro.\n\nPuede que también te hayas dado cuenta de que hay algunas nuevas caras por Orgrimmar. Los dracthyr son recién llegados que conocerás en el viaje que te espera.\n\nVen, hablemos.', '', '', '', '', '', '', 47187),
(65436, 'esES', 'Las Islas Dragón te esperan', 'Reúnete con Wrathion en Ventormenta.', '¡Maravillosas noticias! ¡Las Islas Dragón están despertando!\n\nMi pueblo abandonó estas tierras tras el Hendimiento, pero ahora, por fin, sentimos que nos llaman de vuelta a casa.\n\nAunque las islas albergan muchas maravillas, también es un lugar muy peligroso. Necesitaremos la ayuda de nuestros aliados mortales para recuperar nuestro legado.\n\nReúnete conmigo en Ventormenta. Debo presentar la invitación de los Aspectos a la Alianza.', '', '', '', '', '', '', 47187),
(65435, 'esES', 'Las Islas Dragón te esperan', 'Reúnete con Ebyssian en Orgrimmar.', 'Héroes de la Horda, traigo noticias. ¡Las Islas Dragón están despertando!\n\nPermanecieron dormidas tras el Hendimiento, pero ahora, por fin, nos llaman a mis hermanos y a mí de vuelta a casa.\n\nAunque el archipiélago alberga muchas maravillas, también es un lugar muy peligroso. Necesitaremos la ayuda de nuestros aliados mortales para recuperar nuestro legado.\n\nEstoy a punto de presentar la invitación de los Aspectos al consejo de la Horda en Orgrimmar. Reuníos conmigo allí y veremos lo que tienen que decir.', '', '', '', '', '', '', 47187),
(65422, 'esES', 'No es fácil cazar tesoros', 'Coge el equipamiento de escalarrocas, busca un asidero ¡y escala hasta la cima sin soltarte!', 'Puedo verlo en tus ojos: ¡te mueres de ganas de escalar hasta la cima de la montaña y descubrir qué hay en la cima!\n\nLos escaladores siempre nos reconocemos. No permitiremos que ninguna montaña nos haga sentir diminutos, ¿verdad?\n\nBueno, por suerte para ti he traído suficiente equipamiento de escalada. ¡Coge una mochila y busca un camino hasta la cima!', '', '', '', '', '', 'Habla con Pía Trabaluz en lo alto de la montaña.', 47187),
(65421, 'esES', 'Ni una montaña sin escalar', 'Coge el equipamiento de escalada, busca un asidero y escala el acantilado para rescatar a la abrecaminos Yips.', 'Espero que seas autodidacta, $c. ¡Porque no hay tiempo para lecciones!\n\nCoge una mochila y busca un camino hasta la cima.\n\nUna vez arriba, entrégale este paracaídas a nuestra colega Yips. ¡La pobre muchacha se quedó atrapada en unas vides cuando esos elementales de aire derribaron nuestro avión!\n\n¡Date prisa para que podamos salir de aquí!', '', '', '', '', '', '', 47187),
(65417, 'esES', 'Conectando todo', '', '', '', '', '', '', '', '', 47187),
(65374, 'esES', 'La hora del desplume', 'Arranca $1oa plumas de cría.', '¡Harleen me ha contado que está confeccionando un disfraz para ti! ¡Qué emocionante! Sin embargo, necesita plumas de las crías de roc para completar el atuendo.\n\nPor suerte, ¡acabo de arreglar el Desplumeitor 3300!\n\nLas alachirrido están capturando crías de roc en la parte inferior de los acantilados para criarlas por su cuenta. Usa el Desplumeitor para salvarlas. Además, ¡les arrancará un par de plumas!\n\n¿Dos pájaros de un plumazo? ¡Claro que sí!', '', '', '', '', '', '', 47187),
(65373, 'esES', 'Arrancando las piezas', 'Recupera 4 piezas del Desplumeitor 3300.', 'Oh, no... He cometido un grave error.\n\nHarleen me confió el famoso Desplumeitor 3300, un invento suyo realmente increíble.\n\nTenía pensado recoger plumas de roc en la cueva que hay al sur de aquí para que las investigase, pero las arpías me tendieron una emboscada y se rompió en pedazos mientras escapaba.\n\n¡Recupera las piezas! Probablemente estén repartidas por la cueva como escamas de muda.\n\nPuedo arreglarlo. Seguro. Bueno, con toda probabilidad.', '', '', '', '', '', '', 47187),
(65371, 'esES', 'Nuestro propio nido', 'Recoge $1oa garfas de alachirrido, $2oa bastones de alachirrido y $3oa núcleos de corriente.', 'El pergamino que encontraste es una orden que proclama que todos los huevos de plumazul deben llevarse ante la chef Ventofrita de las arpías. Al parecer, la matriarca alachirrido no comerá nada que no haya sido debidamente cocinado y aderezado.\n\nLe vamos a llevar un huevo especial. Uno que tenga un sabor EXPLOSIVO y que... explote cuando se lo coma. Faltaría más.\n\n¿Que cómo vas a entregarlo? ¡Con un disfraz!\n\nMata a las criaturas que hay en la parte baja de los acantilados, reúne esta lista de piezas y te confeccionaré un atuendo emplumado.', '', '', '', '', '', '', 47187),
(65313, 'esES', 'Hambre de roc', 'Mata a Hawthia Zamparrocs.', 'Tharzera parece de fiar y se le dan bien los artilugios, pero sucumbe al pánico con facilidad.\n\nPor ejemplo, cuando la envié a las cuevas del sur, se largó pitando de allí a causa de una arpía extrañamente grande. Parece que estaba dando órdenes a las demás.\n\n¿Y si es la matriarca de este linaje? ¿O una comandante? Ve y averígualo, $n.\n\nY no te preocupes si arrancas un par de plumas, ya me entiendes.', '', 'Una arpía alachirrido especialmente grande con un apetito voraz por los huesos de plumazul.', 'Hawthia Zamparrocs', '', '', '', 47187),
(65307, 'esES', 'La piedad es lo primero', 'Sana a los dracthyr y dracónidos heridos.', 'La toxicidad del nido casi se nos lleva a todos por delante. Aunque se está preparando el antídoto, necesito que encuentres heridos para sanarlos.\n\nSí, también los dracónidos azules. Las Alas Sanadoras no permanecen de brazos cruzados mientras hay quienes sufren.', '', '', '', '', '', '', 47187),
(65306, 'esES', 'Ranchero de podredumbre', 'Recoge $1oa de moco oloroso de la descomposición.', 'Descomposición ser mala, apesta y duele. Pero tener idea con moco. ¡COGER MOCO!', '', '', '', '', '', '', 47187),
(65302, 'esES', 'Las llaves del reino', 'Consigue la llave y úsala para abrir el alijo de armas.', 'Necesitar armas para el plan. Yo tener buenas armas, pero bajo llave. Gnolls dejar llave en campamento y proteger alijo.\n\nConseguir palos puntiagudos, con sangre.', '', '', '', '', '', '', 47187),
(65287, 'esES', 'Separar la yema', 'Recoge $1oa huevos de plumazul.', 'He descifrado el pergamino y, cómo no, ¡malas noticias!\n\nLas alachirrido no solo se están comiendo a los plumazules para alimentarse. Resulta que han encontrado un par de hechizos que transfieren la fuerza innata de los rocs al devorarlos. ¡Sobre todo sus huevos!\n\nBaja de los acantilados por aquí y salva tantos huevos de roc como puedas. Distraeré a las arpías el tiempo suficiente como para poner en marcha mi plan.\n\nTen cuidado con los elementales que vagan por ahí. ¡El efecto del hechizo de las maldisposas los ha agitado!', '', '', '', '', '', '', 47187),
(65286, 'esES', 'Contactos dracónicos', 'Consigue acceder a Ventormenta.', 'Normalmente un vuelo así llevaría mucho más tiempo, pero, cuando cuentas con la ayuda del mismísimo Aspecto Bronce, el trayecto se puede completar en... \n\nEjem. \"Tiempo\" récord.\n\nAh, y en cuanto a esos soldados con armas puntiagudas... No te preocupes. Una mera formalidad.\n\nMe encargaré de organizar una audiencia con el lord comandante mientras Azurathel y tú os ubicáis.\n\nPor suerte, disfruto de bastante influencia en esta ciudad.', '', '', '', '', '', 'Habla con Azurathel.', 47187),
(65279, 'esES', 'Por decreto real', 'Mata a $1oa guerreros Frondacuero y a $2oa chamanes Frondacuero en el Cubil Arroyodientes.', 'Gnolls idiotas no entender corona. Solo violencia. Pégales o te como.', '', '', '', '', '', '', 47187),
(65274, 'esES', 'Navigation Playtest: Level Up', '', 'This is a single quest. It will guide you though the high points of the level up story for Thaldraszus', '', '', '', '', '', '', 47187),
(65267, 'esES', 'Que no queden ni las plumas', 'Mata a $1oa alachirrido marchitadoras y $2oa alachirrido garramaleficios.', 'Tenía curiosidad por estas extrañas criaturas aladas e intenté presentarme. ¡Me habrían devorado de no ser por la profesora Chirridos y su enorme ave mecánica!\n\n¿Podrías ayudarnos a lidiar con esas \"alachirrido\"? Los rocs plumazul autóctonos están teniendo problemas para defender sus nidos de ellas.\n\nAdemás, no me gustaría que ocurriesen más presentaciones como la mía...', '', '', '', '', '', '', 47187),
(65220, 'esES', 'Navigation Playtest: Level Up (PART 2)', '', 'El final de las Tierras Azures.', '', '', '', '', '', '', 47187),
(65218, 'esES', 'Navigation Playtest: Level Up (PART 1)', '', 'El comienzo de las Tierras Azures.', '', '', '', '', '', '', 47187),
(65133, 'esES', 'Cómo usar el impulso con tu dragón', 'Planea a través de los anillos y aterriza en la zona indicada.', 'Ahora bien, ¿qué pasa si hay un obstáculo en tu camino?\n\nMientras vueles de forma correcta, podrás conservar el impulso y ganar algo de altura después de un picado.\n\nEsta vez, cuando hagas un picado, verás que tu ruta de vuelo te hace bajar con respecto a la zona de aterrizaje. Si usas el impulso, podrás recuperar la altura perdida al final del recorrido para aterrizar en la zona objetivo.\n\nSi te atascas, haz clic en el reloj de bronce y Celormu lo reiniciará para ti.', '', '', '', '', '', '', 47187),
(65120, 'esES', 'Cómo caer en picado con tu dragón', 'Cae en picado y luego planea a través de los anillos hasta aterrizar en la zona objetivo.', 'Planear te llevará a donde quieras ir. Pero ¿y si quieres llegar más rápido?\n\nHacer un picado tras saltar desde algún lugar alto te dará un acelerón de velocidad.\n\nVuela a través de los anillos hasta la zona objetivo.\n\nSi te atascas, usa el reloj de bronce y Celormu te hará empezar de nuevo.', '', '', '', '', '', '', 47187),
(65118, 'esES', 'Cómo planear con tu dragón', 'Planea a través de los anillos y aterriza en la zona indicada.', 'Empecemos por lo básico.\n\nSi vuelas en línea recta, te cansarás rápidamente. Usa la gravedad como ayuda y apunta ligeramente hacia abajo para volar a gran distancia. Los anillos te darán el ángulo general que deberías usar para planear de la forma más básica.\n\nPrimero, llama a tu draco.\n\nLuego vuela a través de los anillos y aterriza en la zona indicada.\n\nSi te atascas, usa el reloj de bronce y Celormu te hará empezar de nuevo.', '', '', '', '', '', '', 47187),
(65101, 'esES', 'Referente de la moda dracónica', 'Adopta tu rostro mortal.', 'Has revolucionado toda Ventormenta con tu llegada, $p. No cabe duda de que algunos ciudadanos han sido más... amables con tu presencia que otros.\n\nPara poder comunicarnos mejor con otras razas, los dragones adoptamos un rostro mortal, como el que ves ante ti. No solo hace que los aliados se sientan más cómodos, sino también sirve para que pasar por puertas no sea toda una odisea.\n\nEstá claro que la esencia de los dragones fluye por los dracthyr. Sospecho que compartís nuestra capacidad de asumir un rostro.\n\nVen conmigo.', '', '', '', '', '', 'Muestra tu rostro a Wrathion.', 47187),
(65100, 'esES', 'Órdenes finales', 'Organiza la evacuación del Confín Olvidado.', 'La tormenta liberada por Raszageth es demasiado poderosa. Debemos evacuar el único hogar que hemos conocido.\n\nYa no hay un Guardián de la Tierra que nos dirija. Por primera vez, somos libres de tomar nuestras propias decisiones. De encontrar nuestro destino.\n\nAllá donde vayas en esta nueva era, espero que encuentres aliados dignos. Cuéntales nuestra historia.\n\nYo me quedaré y buscaré supervivientes. Puede que encuentre respuestas sobre nuestro pasado por el camino.\n\nQue la fortuna nos favorezca a todos, $p.', '', '', '', '', '', 'Preséntate ante tu escamandante.', 47187),
(65098, 'esES', 'Consecuencias del valor', 'Busca a Ebyssian.', 'Gracias por sanarme, $n. Espero que así se alimente una confianza mutua.\n\n<Wrathion se estremece>.\n\nLa Devoradora de Tormentas. Nunca me he enfrentado a un dragón con tanto poder elemental. Si hay otros como ella...\n\nEspera... ¿Dónde está Ebyssian? ¿Ha sobrevivido? ¡Tienes que encontrarlo!', '', '', '', '', '', 'Habla con Pavethal.', 47187),
(65097, 'esES', '¡Corre!', '¡Retirada!', '¡Las tormentas están a punto de abrumarnos! ¡Debemos evacuar la zona!\n\nSalva a todos los que puedas. ¡Y encuentra a esos dragones negros!', '', '', '', '', '', 'Habla con Wrathion.', 47187),
(65087, 'esES', 'La recompensa interior', 'Defiende la cámara.', 'Entonces, ¿los Primalistas quieren lo que hay dentro de esta cámara?\n\n<Sarkareth entorna la mirada>.\n\nQue vengan.\n\n¡Les enseñaremos para qué nacieron los dracthyr!', '', '', '', '', '', '', 47187),
(65084, 'esES', 'La Cámara Petraescarcha', 'Acude a la Cámara Petraescarcha.', '¡Mira allí, más allá del confín! Las fuerzas primalistas están confluyendo en la Cámara Petraescarcha.\n\nLa tormenta que pretenden desatar debe de estar encerrada ahí dentro.\n\n<Pavethal hace una mueca cuando se le vienen a la cabeza unos recuerdos fragmentados>.\n\nYa nos enfrentamos antes a este enemigo y ganamos. Neltharion ordenó que se asegurara la cámara, pero no logro recordar la razón...\n\nNo es momento de contemplaciones. Reúnete con Sarkareth y las Escamas de Ébano en la cámara. ¡Que no entre el enemigo!', '', '', '', '', '', 'Preséntate ante el escamandante Sarkareth en la Cámara Petraescarcha.', 47187),
(65075, 'esES', 'Las Alas Sanadoras', 'Habla con Pavethal.', '$gEvocador:Evocadora;, estoy en deuda contigo por ayudar a mi alascuadrón en nuestro momento más crítico.\n\nCuando recuperemos las fuerzas, las Alas Sanadoras se reunirán con el resto de nuestras huestes.\n\nCeni dice que Pavethal ha perdido a todo su alascuadrón. Me temo que no tengo magia que pueda curar semejante herida.\n\nPuede que parezca estoica, pero se trata de una pérdida muy dolorosa para ella, $n. Dile que voy de camino.', '', '', '', '', '', 'Habla con Pavethal.', 47187),
(65074, 'esES', 'Presa fácil', 'Mata a $1oa guadáñidos.', 'En las tierras que rodean a este nido habitan los guadáñidos. Son unos insectoides voraces, a menudo territoriales y agresivos. \n\nTodos estos heridos serían presa fácil para esas bestias. No quiero que ataquen a nuestros ensalmadores mientras se recuperan.\n\nReduce su número mientras busco a Viridia.\n\nEs... muy valiente.', '', '', '', '', '', '', 47187),
(65073, 'esES', 'Un problema tóxico', 'Recoge $1oa glándulas de toxinas.', 'Te recuperas rápidamente, $n. Bien.\n\nQuienes escaparon de mi nido están mejorando, pero aún hay más atrapados dentro. Si entras para rescatarlos, tendré que volver a sacarte de ahí.\n\nHay unos nidos de alfazaques alrededor de la caldera. Sus glándulas de toxinas podrían ayudarnos a contrarrestar el efecto de su veneno.\n\nNo estoy en condiciones de recogerlas yo misma, así que debo confiar en tus habilidades, $gevocador:evocadora;.', '', '', '', '', '', '', 47187),
(65071, 'esES', '¡Ayuda!', 'Rescata a la pequeña Ko.', '¡Necesito ayuda!\n\nSoy To\'no y estaba explorando porque es lo que se me da bien, pero no me di cuenta de que mi hermana Ko me seguía y necesito que me ayudes a encontrarla porque seguro que se ha metido en un lío. Por favor...\n\nSe metió en esta cueva, pero no sabe esconderse tan bien como yo, y nuestros padres están demasiado lejos para ayudarnos.\n\n¿Puedes encontrarla antes de que lo hagan los monstruos?', '', '', '', '', '', 'Devuelve los niños a sus padres.', 47187),
(65063, 'esES', 'Hacia la colmena', 'Sigue a Trillaceniza para encontrar a Viridia.', 'Sea cual sea la toxina que ha infestado este nido, es lo suficientemente potente como para acabar con nuestros mejores sanadores.\n\nY eso no presagia nada bueno para ninguno de nosotros, $n.\n\nPero no importa. Si hay dracthyr atrapados ahí dentro, entraremos sin importar el riesgo.\n\n¡Respira hondo y sígueme!', '', '', '', '', '', 'Habla con Viridia.', 47187),
(65060, 'esES', 'La Caldera de los Ensalmadores', 'Reúnete con Trillaceniza en la Caldera de los Ensalmadores.', 'Tu visión de la baliza Arcana mostró que aún quedan otros dracthyr atrapados en sus nidos. No podemos permitirnos el lujo de perder más.\n\n<Pavethal hace una breve pausa con el ceño fruncido>.\n\nNo hay mejores médicos que las Alas Sanadoras en nuestras filas. Su nido está en la Caldera de los Ensalmadores. Trillaceniza conoce el camino.\n\nNo dejes a nadie atrás, $gevocador:evocadora;.', '', '', '', '', '', 'Habla con Trillaceniza en la Caldera de los Ensalmadores.', 47187),
(65057, 'esES', 'Unirse a Pavethal', 'Informa a Pavethal.', 'Ahora que la pelea ha terminado, me pides que informe a Pavethal. ¿Azurathel espera que siga sus órdenes?\n\nDe eso nada.\n\nLas Escamas de Ébano solo responden ante el Guardián de la Tierra. Y, hasta ahora, no he recibido órdenes de Neltharion.\n\n<Sarkareth frunce el ceño>.\n\nAun así, no soy ajeno a la amenaza que representan esos Primalistas. Estoy seguro de que ya me había enfrentado antes a su especie antes y sin embargo...\n\nNos reuniremos en el terreno cuando los míos se hayan recuperado. Puedes retirarte, $gevocador:evocadora;.', '', '', '', '', '', '', 47187),
(65052, 'esES', 'Las Escamas de Ébano', 'Ve con el escamandante Sarkareth.', 'Hemos superado la incursión primalista. Ahora debemos llegar hasta el nido.\n\nEl escamandante Sarkareth es duro como él solo, y su alascuadrón está resistiendo, pero un dragón ha acorralado a las Escamas de Ébano. \n\n¡Es hora de unirnos a la batalla!\n\nVe delante y da la señal cuando estemos al alcance del dragón. Entonces atacaremos con todas nuestras fuerzas.\n\nCuidado con las emboscadas. Tengo un mal presentimiento.', '', 'Una bestia antigua que mantiene a las Escamas de Ébano atrapadas.', 'Ekrazathal', '', '', 'Habla con el escamandante Sarkareth.', 47187),
(65050, 'esES', 'Ejército conjurado', 'Mata $1oa elementales conjurados.', 'Los Primalistas están invocando un ejército de elementales. Tenemos que asumir que quieren liberarlos contra nuestras fuerzas.\n\nPues no lo permitiremos.\n\n¡Cúbrelos de llamas, $gevocador:evocadora;! Quema a los elementales del confín y elimina a sus conjuradores antes de que invoquen más.', '', '', '', '', '', 'Reúnete con Azurathel en el Cráter Hiendetormenta.', 47187),
(65049, 'esES', 'Lío con los tarasek', 'Mata a $1oa tarasek.', 'Los tarasek son salvajes e impredecibles. Parecen dracónidos primordiales, por así decirlo.\n\nPara Neltharion nunca fueron más que carne de cañón, muñecos de entrenamiento. Pero son cazadores astutos y extremadamente peligrosos cuando van en manadas.\n\nSi obtienen el poder elemental de los Primalistas, se volverán aún más peligrosos.\n\nNo podemos permitirlo, $n. Reduce su número.', '', '', '', '', '', 'Reúnete con Azurathel en el Cráter Hiendetormenta.', 47187),
(65046, 'esES', 'Los Primalistas', 'Busca pistas sobre el origen y las intenciones de los Primalistas.', 'Mis recuerdos siguen nublados por la estasis, pero tengo la certeza de que ya nos habíamos encontrado antes con esos Primalistas.\n\n<Derviche aprieta los colmillos>.\n\nNo sirve de nada. Cualquier intento de recordar es como perseguir fragmentos de un sueño.\n\nTal vez a ti te vaya mejor. Busca pistas sobre lo que motiva a esos invasores.', '', '', '', '', '', 'Reúnete con Derviche en el Cráter Hiendetormenta.', 47187),
(65045, 'esES', 'El Cráter Hiendetormenta', 'Reúnete con Azurathel en el Cráter Hiendetormenta.', 'El informe de Derviche es preocupante. Unas fuerzas enemigas que se hacen llamar \"los Primalistas\" han invadido el Cráter Hiendetormenta y tienen acorraladas a las Escamas de Ébano en el Nido de Asedio.\n\nEstán invocando violentos elementales y reclutando a los despiadados tarasek para su causa.\n\nAzurathel necesitará tu ayuda en el cráter. Con alas o garfas, rescata a los nuestros.\n\nAsegúrate de que las Escamas de Ébano están a salvo y dile a su comandante que se reúna conmigo. Pero cuidado. Sarkareth puede ser bastante... quisquilloso.', '', '', '', '', '', 'Habla con Azurathel en el Cráter Hiendetormenta.', 47187),
(65036, 'esES', 'Entrenar como luchamos', 'Practica el remontamiento.', 'Atravesar los aros es útil para orientarte, pero entrenamos igual que luchamos: sin descanso.\n\nVe y remonta el vuelo por la zona hasta que creas que has dominado la técnica. Como no podía ser de otra forma, debes tener cuidado con la fauna local y estar alerta por si detectas posibles amenazas. Al fin y al cabo, practicamos para eso.\n\nInforma a Pavethal cuando quieras. ¡Buena suerte!', '', '', '', '', '', 'Habla con la escamandante Pavethal para continuar.', 47187),
(64877, 'esES', 'Navigation Playtest: Level Up (PART 2)', '', '¡Disfruta del final de las Tierras Bajas!', '', '', '', '', '', '', 47187),
(64873, 'esES', 'Estira las alas', 'Practica el lanzamiento de Remontar.', 'Me alegra ver que escaparon tantos del Nido Bélico. Mi propio alascuadrón... no tuvo tanta suerte.\n\n<Pavethal permanece en silencio un instante>.\n\nHay otros nidos por todo el confín llenos de dracthyr en peligro. Harán falta alas fuertes para llegar hasta ellos.\n\nConcéntrate. Recuerda tu entrenamiento. Vuelve a sentir el viento. Debes recuperar fuerzas y volar hasta los demás nidos.\n\nSe acabó el descanso.', '', '', '', '', '', '', 47187),
(64872, 'esES', 'El fuego interior', 'Aprende Aliento de Fuego y practica los ataques potenciados.', 'Perteneces a los evocadores, $n. Los mejores entre los mejores, unos soldados que han dominado las habilidades de cada uno de nuestros alascuadrones.\n\nEspero mucho de ti.\n\nPuede que tus recuerdos no estén del todo claros, pero el poder de los dragones corre por tus venas. Aprovéchalo.\n\nUna de las armas más poderosas que tienes es tu ataque de aliento. El fuego interior se vuelve más poderoso cuanto más tiempo inhalas.\n\nEsos insectos que pululan por nuestro campo de entrenamiento serán objetivos adecuados para que practiques.', '', '', '', '', '', '', 47187),
(64871, 'esES', 'Dragón a las puertas', 'Derrota a Lapisagos y escapa del Nido Bélico.', '¡Ese dragón azul derrumbará el nido y nos atrapará dentro!\n\nDice servir a Malygos. Ese nombre me resulta familiar, pero... ¿por qué querría encerrarnos un dragón?\n\nEscúchame bien, $p. Nos entrenaron para luchar junto a los dragones, no contra ellos. Pero no nos dejan elección.\n\nEs hora de hacer lo que debe hacerse, $gevocador:evocadora;.', '', 'Bloquea tu salida.', 'Lapisagos', '', '', '', 47187),
(64866, 'esES', 'A la caldera', 'Prepárate para abandonar el nido.', 'Necesitamos tus habilidades, $gevocador:evocadora;.\n\nEl nido se desmorona y tenemos pocos suministros. Debemos llegar hasta el pasadizo de salida, pero primero hemos de atravesar esta barrera Arcana.\n\nEn la cámara más allá hay dracthyr que necesitan nuestra ayuda. Sana sus heridas y destruye a cualquier enemigo que se interponga en tu camino.\n\nEsta puede ser la última vez que caminemos juntos por estas salas, $n. Haz que merezca la pena.', '', '', '', '', '', '', 47187),
(64865, 'esES', 'Equiparse', 'Consigue armas, armaduras y suministros.', 'Nos han invadido, los nuestros han sido confinados en un estasis mágico y nuestro nido está al borde del colapso.\n\nPara esto entrenamos, $n. En caso de duda, recurre a lo que sabes.\n\nLo primero es lo primero. Necesitamos armas, armaduras y suministros. Reúne todo lo que encuentres y equípate, yo reuniré a nuestras fuerzas.\n\nLuego encontraremos al Guardián de la Tierra. Seguro que Neltharion nos puede dar las respuestas que buscamos.', '', '', '', '', '', '', 47187),
(64864, 'esES', 'Despertad, dracthyr', 'Despierta a los demás dracthyr.', '<Cuando despiertas, solo te quedan vagos recuerdos de lo que parece un sueño interminable.\n\nLos dracthyr que ves no reaccionan; una magia desconocida los mantiene congelados. Notas un poder en tu interior capaz de liberar a tus aliados.\n\nPuede que haya más en estasis en el nido.\n\nEs tu deber despertarlos>.', '', '', '', '', '', 'Habla con el escamandante Azurathel.', 47187),
(64863, 'esES', 'Guardianes Arcanos', 'Derrota a $1oa guardianes o ensamblajes.', 'Esos ensamblajes que patrullan por el nido no han sido animados por la magia del Guardián de la Tierra.\n\n<Derviche frunce el ceño>.\n\nNo podemos permitir que haya enemigos entre nosotros.\n\nDestrúyelos para despejar nuestro camino.', '', '', '', '', '', '', 47187),
(64856, 'esES', '[DNT] A Little Pruning', 'Mata a %1oa azotadores carnívoros.', 'Saludos, mortal. Necesito tu ayuda.\n\nLos jardines se han deteriorado durante la larga ausencia de los Vuelos. Muchas de sus plantas se han vuelto... indisciplinadas.\n\nDebo ocuparme de los esquejes, lo cual me preocupa. Por favor, deshazte de la vegetación más hostil, te recompensaré.', '', '', '', '', '', '', 47187),
(64163, 'esES', 'Venganza contra los renegados', 'Encuentra y derrota a los guerreros centauro rebeldes en los campamentos improvisados al otro lado del río.', 'Los clanes rebeldes han reclamado algunos de nuestros campamentos al otro lado del río.\n\nDebemos encargarnos de esa gentuza.\n\nConfío en que serás capaz de darles una lección a esos rebeldes.\n\nLos campamentos también están hechos un desastre, así que ignora el caos por ahora. Podemos resolver ese asunto más adelante, una vez que hayamos restaurado el orden.', '', '', '', '', '', '', 47187),
(64162, 'esES', 'El ritual rival', 'Encuentra y derrota al kahn rebelde en los campamentos improvisados al otro lado del río.', 'Se ha alzado otro kahn entre las tribus rebeldes.\n\nMe encargaría yo mismo, pero estoy ocupado supervisando las cosas aquí. \n\nConfío en que puedas enseñarles el error de sus caminos.', '', '', '', '', '', '', 47187),
(64159, 'esES', 'Devolver suministros poco comunes', 'Recupera suministros de los campamentos improvisados al otro lado del río.', 'Los rebeldes han robado suministros de los campamentos cercanos.\n\nHas demostrado ser capaz de arreglar situaciones como esta. Confío en que puedas ayudarnos a resolver esta.', '', '', '', '', '', '', 47187),
(37484, 'esES', 'Silbato del capitán', 'Tráele a Anne Dunworthy 100 fragmentos de artefacto para conseguir un silbato del capitán.', '', '', '', '', '', '', '', 47187),
(5248, 'esES', 'Atormentados por el pasado', 'Lleva el Cristal de Zin-Malor a Lago Kel\'Theril en Cuna del Invierno y encuentra un espíritu Altonato que hable contigo.', '$n, lamento terriblemente lo que ocurrió en el pasado. Como este cristal, la raza de los elfos se rompió en mil pedazos. No sé si las piezas volverán a unirse en una sola, pero el poder ayudarte con esta pequeña tarea ha mitigado mi dolor.$B$BNo debemos olvidar el pasado, $n...$B$BPor favor, devuelve el Cristal de Zin-Malor al Lago Kel\'Theril. Debes encontrar un espíritu Altonato que comprenda el error de lo que se hizo hace tanto tiempo. Muestra al espíritu que hemos vuelto a corregir las cosas.', '', '', '', '', '', '', 47187),
(3632, 'esES', 'Ingeniería gnómica', 'Si quieres saber más sobre ingeniería gnómica, lleva el Manual de disciplinas de ingeniería al maestro manitas Sobrechispa en Forjaz.', 'En ingeniería avanzada te encuentras con dos escuelas: la de los gnomos y la de los goblins. ¡La ingeniería de los gnomos es mejor con diferencia! Se concentra en la creación de aparatos e instrumentos que hacen la vida más fácil.$B$BLéete este manual, $n. Si quieres saber más sobre el tema, llévaselo aI maestro manitas Sobrechispa, aquí en Forjaz. Recuerda que si te inscribes, no podrás pasarte luego a la otra escuela, ¡así que piénsatelo bien!', '', '', '', '', '', '', 47187);
